INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', 'Dostawa', 'Nasze warunki dostawy', 'conditions, delivery, delay, shipment, pack, dostawa, pakowanie, warunki', '<h2>Dostawy i zwroty</h2>\r\n<h3></h3>\r\n<h6></h6>\r\n<h6></h6>\r\n<h6>Twoja przesyłka paczki</h6>\r\n<h6></h6>\r\n<h6>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.</h6>\r\n<h6></h6>\r\n<h6>Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy szczególnej staranności, aby chronić delikatne przedmioty.</h6>\r\n<h6></h6>\r\n<h6>Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</h6>', 'dostawa'),
(2, 1, 1, 'Nota prawna', 'Nota prawna', 'Nota prawna', 'notice, legal, credits', '<h2>Nota prawna</h2>\r\n<h3></h3>\r\n<p>Zawartość tej strony jest umieszczona jedynie w celach poglądowych przed zakupem. Zabrania się jej kopiowania i wykorzystywania w celach zarobkowych.</p>', 'nota-prawna'),
(3, 1, 1, 'Regulamin', 'Regulamin', 'Regulamin', 'conditions, terms, use, sell', '<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:18pt;font-family:Helvetica, sans-serif;color:#333333;\">Regulamin sklepu <b>be_175716</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">obowiązujący od dnia 22 grudnia 2021r.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>§ 1</b><br /><b>Postanowienia ogólne</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Niniejszy Regulamin określa warunki zawierania i wykonywania wszystkich umów sprzedaży zawieranych ze Sprzedającym za pośrednictwem Sklepu Internetowego zgodnie z art. 384 Kodeksu Cywilnego są one częścią umowy zawartej ze Sprzedawcą.<br />2. Sprzedający zastrzega sobie prawo do zmiany regulaminu. Zmiana postanowień niniejszego Regulaminu nie dotyczy zamówień przyjętych do realizacji. Wszelkie zmiany regulaminu wchodzą w życie z dniem ich opublikowania na stronie <b>be_175716</b>.</span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">O treści zmian regulaminu każdy Użytkownik zostanie poinformowany przez umieszczenie przez Sklep na stronie głównej Serwisu Internetowego wiadomości o zmianie Regulaminu, zawierającej zestawienie zmian Regulaminu i utrzymanie tej informacji na stronie głównej Serwisu Internetowego przez okres co najmniej 14 kolejnych dni kalendarzowych, zaś Użytkownicy posiadający Konto Użytkownika zostaną dodatkowo powiadomieni przez Usługodawcę poprzez przesłanie na adres poczty elektronicznej, wskazany przez nich w formularzu rejestracyjnym, informacji zawierającej zestawienie zmian Regulaminu. Poinformowanie o zmianie Regulaminu, nastąpi nie później niż 14 dni kalendarzowych przed wprowadzeniem zmienionego Regulaminu. W razie, gdy Użytkownik posiadający Konto Użytkownika, nie akceptuje nowej treści Regulaminu obowiązany jest zawiadomić o tym fakcie Sklep ciągu 14 dni od daty poinformowania o zmianie Regulaminu.</span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">3. Niniejszy Regulamin obowiązuje również Klientów, którzy dokonali zamówień drogą telefoniczną.<br />4. Regulamin został stworzony na podstawie ustawy z dnia 18 lipca 2002 roku o świadczeniu usług drogą elektroniczną (Dz. U. Nr 144, poz. 1204 ze zmianami). W sprawach nieuregulowanych niniejszym Regulaminem zastosowanie mają przepisy ww. ustawy oraz ustawy z dnia 23 kwietnia 1964 r. Kodeks Cywilny oraz ustawy z dnia 30 maja 2014 r. o prawach konsumenta (Dz. U. 2014, poz. 827).</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 2</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Zamówienia</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Złożenie zamówienia wiąże się z obowiązkiem zapłaty za wybrany towar, zaś przedsiębiorca zobowiązuje się do dostarczenia towaru bez wad.<br />2. Zamówień można dokonać telefonicznie, bez konieczności rejestracji w systemie elektronicznym.<br />3. Wybór formy telefonicznej wiąże się z koniecznością podania adresu mailowego, na który zostanie przesłany regulamin sklepu internetowego wraz z załącznikami oraz umową sprzedaży.<br />4. Zakupu produktu można dokonać, rejestrując się na stronie sklepu internetowego be_175716 poprzez podanie danych niezbędnych do realizacji zamówienia (adres e-mail oraz hasło). Zakupu można dokonać także bez konieczności rejestracji.<br />5. Wybór zamawianych Towarów przez Klienta jest dokonywany poprzez ich dodanie do koszyka.<br />6. Po podaniu przez Klienta korzystającego ze Sklepu internetowego wszystkich danych adresowych, kontaktowych wyświetlone zostanie podsumowanie złożonego Zamówienia, które będzie zawierać informacje dotyczące:</span></p><p></p>\r\n<ul style=\"margin-top:0cm;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">przedmiotu zamówienia,</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">jednostkowej oraz łącznej ceny zamawianych produktów lub usług, w tym kosztów dostawy oraz dodatkowych kosztów (jeśli występują),</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">wybranej metody płatności,</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">wybranego sposobu dostawy,</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">przewidywanego czasu dostawy.</span><p></p></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">7. Kupujący zobowiązany jest do podania prawidłowych oraz pełnych danych osobowych w innym wypadku zamówienie może nie zostać zrealizowane ze względu na niemożność dostarczenia towaru.<br />8. W celu wysłania Zamówienia konieczne jest dokonanie akceptacji treści Regulaminu, podanie danych osobowych oznaczonych jako obowiązkowe oraz naciśnięcie przycisku <i>Zamawiam z obowiązkiem zapłaty</i>.<br />9. Wysłanie przez Klienta Zamówienia stanowi oświadczenie woli zawarcia Umowy sprzedaży, zgodnie z treścią Regulaminu.<br />10. Po złożeniu Zamówienia, Klient otrzymuje wiadomość e-mail, zawierającą ostateczne potwierdzenie wszystkich istotnych elementów Zamówienia.<br />11. Zawarcie umowy następuje poprzez potwierdzenie email.<br />12. Umowa sprzedaży zawierana jest w języku polskim, o treści zgodnej ze złożonym zamówieniem (w którym wskazany będzie przedmiot, cena i dane kupującego) oraz Regulaminem (w którym określone są uprawnienia stron oraz dane sprzedającego).<br />13. Formularze nieprawidłowo wypełnione nie stanowią zamówienia i nie będą realizowane. W szczególności za formularze nieprawidłowo wypełnione będą uznane formularze nie zawierające numeru telefonu kontaktowego lub adresu poczty elektronicznej Klienta, umożliwiającego potwierdzenie przez Sklep otrzymanego zamówienia. Sklep nie informuje Klienta o odrzuceniu formularza zamówienia, w razie gdy Klient nie podał danych kontaktowych umożliwiających kontakt telefoniczny lub za pomocą poczty elektronicznej.<br />14. W przypadku wystąpienia jakichkolwiek wątpliwości dotyczących treści złożonego przez Klienta i otrzymanego przez Sklep formularza zamówienia, Sklep zastrzega sobie prawo wstrzymania realizacji zamówienia do czasu wyjaśnienia tych wątpliwości. O wstrzymaniu realizacji zamówienia Sklep niezwłocznie powiadomi Klienta.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 3</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Artykuły dostępne w Sklepie</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Zamówienie może dotyczyć tylko artykułów wymienionych w aktualnym katalogu dostępnym na stronach internetowych Sklepu. Składając zamówienie Klient dokładnie określa rodzaj, nazwę i cenę katalogową artykułu oraz podaje jego numer katalogowy – czyni to poprzez dodanie towaru do koszyka (akceptując w ten sposób wskazane powyżej dane). Klient jest zobowiązany do wskazania ilości sztuk zakupywanego towaru, w innym wypadku domyślnie zostanie uznane, że zamawia 1 sztukę.<br />2. Informacje dotyczące artykułów dostępnych w Sklepie nie stanowią oferty, a jedynie zaproszenie do składania ofert w rozumieniu art. 71 ustawy z dnia 23 kwietnia 1964 r. Kodeks Cywilny. Ofertę stanowi natomiast prawidłowe zamówienie Klienta skierowane do Sklepu.<br />3. Ceny artykułów dostępnych w Sklepie wyrażone są w złotych polskich i zawierają podatek VAT. Sklep zastrzega sobie prawo zmiany cen określonych w katalogu oraz prawo wycofania niektórych produktów ze sprzedaży bez podania przyczyn. W przypadku zmiany ceny po złożeniu zamówienia, Sklep poinformuje Klienta o zaistniałej sytuacji najpóźniej w chwili potwierdzenia zamówienia. W przypadku braku akceptacji przez Klienta nowej ceny zamówienie uważane jest za anulowane.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 4</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Odbiór przesyłki</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Przy odbiorze przesyłki, klient proszony jest o sprawdzenie zawartości paczki w obecności kuriera i w razie uszkodzeń spisania protokołu szkody. Jeżeli klient zauważy uszkodzenie przesyłki po wyjściu kuriera należy zgłosić to firmie kurierskiej. Spisanie protokołu szkody ma szczególne znaczenie dla sprzedawcy przy dochodzeniu roszczeń od firmy kurierskiej za uszkodzenie przesyłki podczas przewozu z winy przewoźnika. <br />2. W przypadku, gdy paczka posiada widoczne, zewnętrzne ślady uszkodzenia, wówczas klient ma prawo otworzyć przesyłkę przed podpisaniem dokumentów odbioru i wówczas konieczne jest spisanie dokumentu, tzw. protokołu otwarcia przesyłki.<br />3. Postanowienia pkt 1 i 2 nie wpływają na uprawnienia klienta względem sprzedawcy, a służą jedynie ułatwieniu dochodzenia ewentualnych roszczeń sprzedawcy od firmy kurierskiej.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 5</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Odpowiedzialność za wady towaru</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Reklamacje dotyczące uszkodzenia opakowania przesyłki lub uszkodzeń mechanicznych asortymentu objętego zamówieniem powstałych podczas transportu w pierwszej kolejności powinny być zgłaszane pracownikowi firmy kurierskiej.<br />2. Wybrane artykuły dostępne w Sklepie posiadają gwarancję udzieloną przez podmiot udzielający gwarancji (Gwaranta) na warunkach przez niego określonych w dołączonym do artykułu dokumencie gwarancji.<br />3. W przypadku reklamacji (na podstawie gwarancji) należy skontaktować się bezpośrednio z serwisem wskazanym w dokumencie gwarancji. Zasady związane z postępowaniem reklamacyjnym w takim wypadku będzie określał dokument gwarancji.<br />4. Przepisy powyższe nie wyłączają możliwości dochodzenia na zasadach ogólnych roszczeń z tytułu rękojmi przeciwko sprzedawcy.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 6</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Rękojmia</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Klient realizuje swe uprawnienia wynikające z rękojmi poprzez:</span></p><p></p>\r\n<ul style=\"margin-top:0cm;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">naprawienie towaru</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">wymianę na towar wolny od wad</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">obniżenie ceny zakupionego towaru</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">odstąpienie od umowy w przypadku, gdy wada jest istotna</span><p></p></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br />2. Sprzedawca może nie wyrazić zgody na zaproponowany przez kupującego sposób realizacji uprawnień z tytułu rękojmi, jeżeli wybór takowy:</span></p><p></p>\r\n<ul style=\"margin-top:0cm;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">jest niemożliwy do spełnienia przez sprzedawcę</span><p></p></li>\r\n<li class=\"MsoNormal\" style=\"color:#333333;line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;\">wymagałby nadmiernych kosztów w porównaniu z wyborem zaproponowanym przez sprzedawcę.</span><p></p></li>\r\n</ul>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">3. Reklamacje, wynikające z naruszenia praw Klienta gwarantowanych prawnie, lub na podstawie niniejszego Regulaminu, należy kierować na adres mailowy: dawid.labudda@gmail.com. Sklep zobowiązuje się do rozpatrzenia każdej reklamacji w terminie do 14 dni, a gdyby to nie było możliwe, do poinformowania w tym okresie Klienta, kiedy reklamacja zostanie rozpatrzona.<br />4. W przypadku reklamacji zasadnej firma be_175716 zwraca koszt dostawy reklamowanego towaru, a także odsyła reklamowany towar na własny koszt. W przypadku nieuzasadnionej reklamacji lub uszkodzenia towaru z winy użytkownika, wszelkie koszty pokrywa Klient.<br />5. Nie stanowią podstawy reklamacji różnice w wyglądzie towarów dostarczonych z zamówionymi, oglądanymi na stronie Sklepu, które to różnice mogą wynikać z innych ustawień (parametrów) monitora Klienta, oraz innych urządzeń peryferyjnych komputera Klienta służących do zapoznania się z ofertą Sklepu, w szczególności różnicy w barwach i odcieniach, nie stanowią podstawy do zwrotu towaru.<br />6. Reklamacji nie podlegają:<br />uszkodzenia wynikłe z niewłaściwego użytkowania i konserwacji towaru,<br />uszkodzenia wynikłe z zużywania się towaru,<br />towary używane niezgodnie z ich przeznaczeniem,</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 7</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Wymiana</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Sklep umożliwia Klientom wymianę zakupionego towaru, jeżeli Klient po otrzymaniu towaru zgodnego ze złożonym przez niego zamówieniem i odpowiadającego treści zawartej umowy (towar pełnowartościowy) stwierdzi, iż towar nie odpowiada Klientowi. W takiej sytuacji Klient ma prawo wymienić zakupiony towar na inny.<br />2. Zgłoszenie chęci wymiany towaru następuje poprzez pisemne oświadczenie oraz odesłanie towaru które musi nastąpić do 10 dni od otrzymania przesyłki. Przekroczenie terminu będzie podstawą odmowy wymiany towaru.<br />3. Prawo wymiany dotyczy tylko towaru lub towarów będących w nienaruszonym stanie, wyłącznie w oryginalnym, nienaruszonym opakowaniu (tzn. towar nie może nosić śladów eksploatacji, musi zawierać wszystkie elementy, z którymi został dostarczony, opakowanie jest integralną częścią towaru).<br />4. W przypadku otrzymania przez Klienta zamówienia w uszkodzonym opakowaniu, w pierwszej kolejności należy ten fakt zgłosić pracownikowi Sklepu za pośrednictwem poczty e-mail a następnie odesłać towar do Sklepu.<br />5. Koszty związane z wymianą towaru ponosi Kupujący.<br />6. Niedostosowanie się do powyższych zaleceń będzie podstawą nieuwzględnienia wymiany.<br />7. Nie przyjmujemy przesyłek odsyłanych za pobraniem na koszt Sklepu.<br />8. Pytania oraz powiadomienia dotyczące wymiany prosimy kierować na adres e-mail: </span><u><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#3ab54a;\">dawid.labudda@gmail.com</span></u><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">.</span></p><p></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal;background:#FFFFFF;\"><b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">§ 8</span></b><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\"><br /><b>Zwrot zamówienia – prawo odstąpienia od umowy</b></span></p><p></p>\r\n<p class=\"MsoNormal\" style=\"line-height:normal;background:#FFFFFF;\"><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">1. Klient ma prawo do odstąpienia od umowy sprzedaży zawartej na odległość bez podania przyczyny, w terminie 14 dni od dnia otrzymania towaru.<br />2. W przypadku skorzystania z prawa odstąpienia od zawartej umowy, należy złożyć pisemne oświadczenie o odstąpieniu od umowy i wysłać podpisane oświadczenie na adres e-mail: </span><u><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#3ab54a;\">dawid.labudda@gmail.com</span></u><span style=\"font-size:10.5pt;font-family:Lato, sans-serif;color:#333333;\">, przed upływem w/w terminu.<br />3. Klient ponosi koszty wysyłki związane z odstąpieniem od umowy w przypadku gdy nie wybrał najtańszej formy dostawy. Całość kosztów wysyłki podczas zakupu zwracana jest jedynie pod warunkiem, że klient wybrał najtańszą możliwą formę dostawy dostępną na sklepie. W przypadku wyboru droższej metody dostawy, zwracana jest kwota najniższej dostępnej opcji dostawy. Koszt odesłania zwracacanego towaru do sklepu ponosi kupujący.<br />4. Pieniądze zwrócone zostaną klientowi na wskazany przez niego rachunek bankowy, którego numer powinien dołączyć do przesyłanego oświadczenia o odstąpieniu od umowy.<br />5. Zwracany towar należy odesłać niezwłocznie, nie później jednak niż w terminie 14 dni od daty przesłania sprzedawcy oświadczenia o odstąpieniu od umowy.<br />6. Klient proszony jest o odesłanie towaru w oryginalnym opakowaniu wraz z kompletną jego zawartością oraz kopię dowodu zakupu.<br />7. Zwracany towar musi być w stanie niezmienionym, tj. musi posiadać oryginalne etykiety oraz nie może nosić żadnych śladów użytkowania wykraczających poza zwykły zakres sprawdzenia.</span></p><p></p>\r\n<p class=\"MsoNormal\"></p><p> </p>', 'regulamin'),
(4, 1, 1, 'O nas', 'O nas', 'Dowiedz się więcej o nas', 'o nas', '<h2>O nas</h2>\r\n<h2><span style=\"font-size:11px;\">Nasza firma</span></h2>\r\n<p><span style=\"color:#7a7a7a;font-family:Manrope, sans-serif;font-size:14px;background-color:#ffffff;\">be_175716</span></p>\r\n<h3>Nasz zespół</h3>\r\n<p>-Dawid Labudda</p>\r\n<p>-Łukasz Żarski</p>\r\n<p>-Jakub Geleta</p>\r\n<p>-Adam Piskorz</p>\r\n<h3>Informacje</h3>\r\n<p>Naprawdę chcemy to zdać</p>', 'o-nas'),
