INSERT INTO `ps_homeslider_slides_lang` (`id_homeslider_slides`, `id_lang`, `title`, `description`, `legend`, `url`, `image`) VALUES
(1, 1, 'Światłość', '<h3></h3>\r\n<h3>PEŁNA FUNKCJONALNOŚĆ</h3>\r\n<p>Dołącz do świata, który nigdy nie śpi. Świata, który olśniewa o każdej porze.</p>\r\n<p>Pozwól najnowszym rozwiązaniom wkroczyć w Twoje domostwo.</p>', 'swiatlosc-1', 'http://94.40.79.249/prestashop/', '55c67b1cd90f67cbc6ed64f5450d7f8013bf907a_public-domain-images-free-stock-photos-chicago-skyline-night-1000x665.jpg'),
(4, 1, 'Otwartość', '<h3>ZMIANA W CENTRUM</h3>\r\n<p>Kształty się zmieniają. Kolory się zmieniają. Trendy się zmieniają.</p>\r\n<p>My zostajemy z Tobą.</p>\r\n<p></p>\r\n<p>Nasze produkty sprostają nawet najbardziej wygórowanym oczekiwaniom</p>', 'otwartosc-1', 'http://94.40.79.249/prestashop/', '761a896a81c51bd3be61f75791332e1e3c82c305_public-domain-images-free-stock-photos-chicago-skyline-night-1000x665.jpg'),
(5, 1, 'Technologia', '<h3>PRZYSZŁOŚĆ I TRADYCJA</h3>\r\n<p>Łączymy klasyczne wzorce z nowościami technicznymi.</p>\r\n<p>Wybór nowoczesności nie musi oznaczać zerwania z doczesnością.</p>\r\n<p></p>\r\n<p>Otocz się najlepszym z obu światów.</p>', 'technologia-1', 'http://94.40.79.249/prestashop/', '62600b04c44363d5dc6e212cd8086b8cb37c9904_public-domain-images-free-stock-photos-chicago-skyline-night-1000x665.jpg');
