INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Lampka podłogowa SWAN to minimalistyczna i nowoczesna lampka LED. Pozwala ona na dowolne regulowanie strumienia światła dzięki elastycznemu ramieniu, które można wyciągnąć w niemal dowolny kształt. Dostępna tutaj lampa stojąca LED pozwala także na regulowanie wysokości i kąta nachylenia strumienia światła, dzięki czemu dopasujesz światło do każdej sytuacji. Lampa LED emituje ciepłe, białe światło, które wprowadza w pomieszczeniach przyjemną atmosferę.Ta lampka podłogowa to praktyczny dodatek do każdego pomieszczenia, który oprócz emitowania przyjemnego światła jest znakomitym dopełnieniem nowoczesnego wnętrza.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-led-swan-65w-czarna-polux', '', '', '', 'LAMPA STOJĄCA podłogowa LED SWAN 6,5W czarna POLUX', '', '', '', ''),
(2, 1, 1, 'Lampka podłogowa SWAN to minimalistyczna i nowoczesna lampka LED. Pozwala ona na dowolne regulowanie strumienia światła dzięki elastycznemu ramieniu, które można wyciągnąć w niemal dowolny kształt. Dostępna tutaj lampa stojąca LED pozwala także na regulowanie wysokości i kąta nachylenia strumienia światła, dzięki czemu dopasujesz światło do każdej sytuacji. Lampa LED emituje ciepłe, białe światło, które wprowadza w pomieszczeniach przyjemną atmosferę.Ta lampka podłogowa to praktyczny dodatek do każdego pomieszczenia, który oprócz emitowania przyjemnego światła jest znakomitym dopełnieniem nowoczesnego wnętrza.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-led-swan-65w-biala-polux', '', '', '', 'LAMPA STOJĄCA podłogowa LED SWAN 6,5W biała POLUX', '', '', '', ''),
(3, 1, 1, 'Lampa podłogowa PIPE została zaprojektowana zgodnie ze współczesnymi trendami projektowania wnętrz. Styl Vintage to niezwykle prosty i piękny wygląd lampy stojącej sprawdzi się w większości nowoczesnych wnętrz.Do lampy pasować będą żarówki z trzonkiem E27. Niezwykła prostota wykonania lampy podłogowej sprawia, że pięknie prezentuje się ona w każdym wnętrzu. Lampa podłogowa ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy stojącej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Lampa stojąca to nowoczesne rozwiązanie idące wraz z duchem czasu. Piękny styl staroświecki Vintage widoczny w lampie podłogowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Źródła światła nie są dostarczane w zestawie!OBSZAR ZASTOSOWAŃ:CECHY, KTÓRE POSIADA LAMPA STOJĄCA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:', '', 'lampa-stojaca-podlogowa-stal-vintage-1906-pipe-floor-czarna-ledvance', '', '', '', 'LAMPA STOJĄCA Podłogowa Stal VINTAGE 1906 PIPE FLOOR Czarna LEDVANCE', '', '', '', ''),
(4, 1, 1, 'SZUKASZ STYLOWEGO I NASTROJOWEGO OŚWIETLENIA DO SWOJEJ SYPIALNI LUB SALONU? POSTAW NA STOJĄCĄ LAMPĘ PODŁOGOWĄ Z SERII VEJLE!Stojąca lampa podłogowa VEJLE ma niezwykle ozdobną, elegancką formę. Jej czarna, metalowa konstrukcja ozdobiona została kroplami szkła. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym. Będzie pasować również do aranżacji inspirowanych stylem retro oraz glamur.  Stworzona została z dużą dbałością o szczegóły z wysokiej jakości stali i pięknie oszlifowanego szkła, które w dzień pięknie się mieni. Wieczorem natomiast lampa pozwala uzyskać niezwykły efekt rozproszenia światła. Prezentowana lampa sprawdzi się przede wszystkim w sypialni lub salonie jako dodatkowe źródło światła, które pozwoli nam zbudować przyjemną atmosferę sprzyjającą intymnych chwilom we dwoje, a także relaksowi przy książce czy telewizji. ODMIEŃ SWOJĄ SYPIALNIĘ DZIĘKI LAMPIE Z SERII VEJLE!  *WYSOKA JAKOŚĆ*WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27*EFEKTOWNA OPRAWA*WYMIARY LAMPY  GDZIE NAJLEPIEJ SPRAWDZI SIĘ PODŁOGOWA LAMPA VEJLE?   Prezentowana lampa doskonale prezentuje się w połączeniu z innymi elementami oświetlenia z serii VEJLE. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu.  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-vejle-f351-polux', '', '', '', 'Lampa podłogowa Vejle F351 POLUX', '', '', '', ''),
(5, 1, 1, 'SZUKASZ NASTROJOWEGO OŚWIETLENIA DO SWOJEGO SALONU ALBO SYPIALNI? Postaw na stojącą lampę ROMEO!Lampa ROMEO ma ekskluzywny charakter. Stworzona została z wysokiej jakości chromowanego metalu oraz grubego szkła, dzięki czemu prezentuje się niezwykle elegancko. W dzień pięknie mieni się srebrną, lustrzaną powierzchnią, wieczorem natomiast pozwala uzyskać niezwykły efekt rozproszenia światła przez szklane zawieszki znajdujace sie w jej wnętrzu. Wspaniale wygląda zarówno we wnętrzach nowoczesnych, jak i tych bardziej klasycznych. Niezaleznie od tego, czy zedcydujemy się zastosować ją w salnonie, korytarzu, jadali, czy sypialni, stanie się interesującą ozdobą danego wnętzra, zaróno w dzień, jak i wieczorem.  Nie tylko doda klasy i reprezentacyjnego charakteru każdemu wnętrzu, ale także pomoże nam uzyskać przyjemną kameralną atmosferę, sprzyjającą relaksowi podczas wieczornego wypoczynku, czy spotkania z przyjaciółmi.  ODMIEŃ SWOJE WNĘTRZE DZIĘKI LAMPIE Z SERII ROMEO  *WYSOKA JAKOŚĆ *WPÓŁPRACA Z ŻARÓWKAMI NA GWINT G9 *EFEKTOWANA OPRAWA    *WYMIAR LAMPY  *ENERGOOSZCZĘDNOŚĆ  GDZIE LAMPA ROMEO SPRAWDZI SIĘ NAJLEPIEJ?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-stojaca-romeo-6xg9-160cm-polux', '', '', '', 'Lampa podłogowa stojąca ROMEO 6xG9 160cm - Polux', '', '', '', ''),
(6, 1, 1, 'Lampka podłogowa MONACO to minimalistyczna i nowoczesna lampka. Pozwala ona na dowolne regulowanie strumienia światła dzięki elastycznemu ramieniu, które można wyciągnąć w niemal dowolny kształt. Dostępna tutaj lampa stojąca LED pozwala także na regulowanie wysokości, dzięki czemu dopasujesz światło do każdej sytuacji. Lampa LED emituje ciepłe, białe światło, które wprowadza w pomieszczeniach przyjemną atmosferę.Ta lampka podłogowa to praktyczny dodatek do każdego pomieszczenia, który oprócz emitowania przyjemnego światła jest znakomitym dopełnieniem nowoczesnego wnętrza.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-led-monaco-42w-biala-polux', '', '', '', 'Lampa stojąca podłogowa LED MONACO 4,2W biała POLUX', '', '', '', ''),
(7, 1, 1, 'Lampka podłogowa MONACO to minimalistyczna i nowoczesna lampka. Pozwala ona na dowolne regulowanie strumienia światła dzięki elastycznemu ramieniu, które można wyciągnąć w niemal dowolny kształt. Dostępna tutaj lampa stojąca LED pozwala także na regulowanie wysokości, dzięki czemu dopasujesz światło do każdej sytuacji. Lampa LED emituje ciepłe, białe światło, które wprowadza w pomieszczeniach przyjemną atmosferę.Ta lampka podłogowa to praktyczny dodatek do każdego pomieszczenia, który oprócz emitowania przyjemnego światła jest znakomitym dopełnieniem nowoczesnego wnętrza.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-led-monaco-42w-czarna-polux', '', '', '', 'Lampa stojąca podłogowa LED MONACO 4,2W czarna POLUX', '', '', '', ''),
(8, 1, 1, 'Lampa podłogowa geometryczna o niebanalnym, nowoczesnym kształcie jest przystosowana do pracy z trzema żarówkami o trzonku E27. Nowoczesny wygląd lampy stojącej z niesymetrycznymi figurami geometrycznymi będzie ozdobą każdego nowoczesnego wnętrza. Dzięki temu, że lampa nie posiada kloszy pięknie prezentują się w niej żarówki. Wysoka jakość wykonania lamy podłogowej jest gwarancją tego, że będzie ona pięknie wyglądać i oświetlać mieszkanie przez długi czas. Lampa polecana jest w szczególności do salonu, choć równie dobrze sprawdzi się w jadalni czy pokoju gościnnym. Lampa zapewni przytulną i przyjemną atmosferę w każdym wnętrzu, a dzięki temu, że można w niej zamontować trzy żarówki, można być pewnym, że doskonale oświetli ona miejsce, w którym zostanie postawiona. Czarna lampa geometryczna, stojąca zaprojektowana z niezwykłą dbałością o szczegóły nada charakteru Twojemu salonowi i oświetli go pięknym blaskiem, a spędzanie w nim czasu będzie czystą przyjemnością.Lampa stojąca, geometryczna wykonana została z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-stojaca-podlogowa-czarna-do-salonu-figury-geometryczne-3-x-e27', '', '', '', 'Nowoczesna lampa stojąca podłogowa czarna do salonu figury geometryczne 3 x E27', '', '', '', ''),
(9, 1, 1, 'Lampa podłogowa posiadająca abażur o pięknym, kwiatowym wzorze to wysokiej jakości lampa wykonana w zgodzie z najnowszymi standardami posiadająca gniazdo na żarówkę LED o trzonku E27. Lampa stojąca będzie się pięknie prezentować w sypialni czy w salonie, gdzie postawiona obok kanapy świetnie sprawdzi się jako lampa do czytania. Klosz wykonany z tkaniny w różowe kwiaty nada każdemu wnętrzu romantycznej aury, a złote elementy nadadzą mu elegancji. Z tą lampą podłogową w kwiaty każde pomieszczenie nabierze szczególnego charakteru. Z pewnością sypialnia w której postawi się tą lampę będzie bardziej przytulna, a przyjemne światło wydobywające się z żarówki wprowadzi czarujący nastrój i ciekawy efekt świetlny.  Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-podlogowa-stojaca-w-kwiaty-do-sypialni-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa podłogowa stojąca w kwiaty do sypialni abażur z tkaniny 1 x E27', '', '', '', ''),
(10, 1, 1, 'SZUKASZ NOWOCZESNEGO  I NASTROJOWEGO OŚWIETLENIA? Postaw na lampę stojącą z serii MODERN!Stojąca lampa podłogowa LED marki Polux z kolekcji Modern w kolorze czarnym świetnie sprawdza się jako dodatkowe źródło światła w salonach i sypialniach. Pasuje do aranżacji utrzymanych w stylu modernistycznym i loftowym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem pozwala idealnie wybraną przez siebie przestrzeń. Złote wnętrze sprawia, że świeci przyjemnym, nastrojowym światłem, wprowadzając przyjemną intymną atmosferę w danym pomieszczeniu. Do tego klasycznego reflektora będzie pasować każda żarówka z trzonkiem E27 o maksymalnej mocy 20W LED, którą także można zamówić na naszej stronie Internetowej.ODMIEŃ SWOJE WNĘTRZE DZIĘKI KINKIETOM MODERN!  *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWNA OPRAWA    *WYMIAR LAMPY *REGULACJA KĄTA PADANIA ŚWIATŁA   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-modern-f-306c-e27-czarna-polux', '', '', '', 'Lampa stojąca podłogowa MODERN F-306C E27 czarna Polux', '', '', '', ''),
(11, 1, 1, 'Lampa podłogowa, stojąca marki Polux z kolekcji MODERN w kolorze białym będzie idealnie pasowała do wnętrz urządzonych w klimacie modernistycznym, gdzie królują ponadczasowe i stylowe aranżację.Lampa świetnie sprawdzi się w salonie, jadalni, sypialni lub holu. Dzięki temu, że wnętrze oprawy jest wykończone złota barwą, światło wydobywające się z lampy będzie ciepłe i przyjemne. Miękkie światło, wprowadzi do mieszkania przytulny, nastrojowy i kameralny charakter. Ustaw lampę w dowolnym miejscu i dzięki funkcji regulacji wysokości oraz kąta nachylenia rozświetl wybraną przez siebie przestrzeń.Lampa o nowoczesnym designie  idealnie sparwdzi się jako dodatkowe źródło światła, które można wykorzystać podczas czytania, oglądania telewizji lub w czasie romantycznych wieczorów. Do lampy pasować będzie każda żarówka o trzonku E27 o maksymalnej mocy 20W led, którą także można zamówić w naszym sklepie internetowym. Mieszkaj modnie i stylowe. Zobacz też inne lampy z kolekcji MODERN. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-modern-f-306c-e27-polux-biala', '', '', '', 'Lampa stojąca podłogowa MODERN F-306C E27 Polux biała', '', '', '', ''),
(12, 1, 1, 'SZUKASZ EKSKLUZYWNEGO OŚWIETLENIA DO SWOJEGO SALONU LUB SYPIALNI? Postaw na lampę ABBAZIA! Lampa ABBAZIA z jednym punktem świetlnymi ma ekskluzywny charakter, dzięki czemu idealnie wpisuje się w aranżacje w stylu glamur. Stworzona z wysokiej jakości chromowanej stali, szkła i tkaniny, prezentuje się niezwykle stylowo. Wspaniale wygląda zarówno we wnętrzach nowoczesnych, jak i klasycznych, podkreślając ich luksusowy wystrój. Jej forma nawiązująca do klasycznych żyrandoli doda reprezentacyjnego charakteru każdemu salonowi, jadalni czy sali restauracyjnej. Sprawdzi się również w sypialni urządzonej w stylu glamur. Należy przy tym podkreślić, że lampa ABBAZIA jest nie tylko efektowna, ale także stanowi wydajne i zarazem energooszczędne źródło światła. NADAJ LUKSUSOWEGO CHARAKTERU SWOJEMU SALONOWI DZIĘKI LAMPIE ABBAZIA!  *WYSOKA JAKOŚĆ*WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E14*EFEKTOWANA OPRAWA*WYMIAR LAMPY  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-stojaca-abbazia-e27-biala-160cm-polux', '', '', '', 'Lampa podłogowa stojąca ABBAZIA E27 biała 160cm - Polux', '', '', '', ''),
(13, 1, 1, 'LAMPA stojąca marki Polux z kolekcji IL MIO FINLAND w kolorze czarnym świetnie wkomponuje się we wnętrza urządzone w klimacie industrialnym lub modernistycznym. Delikatne, metalowe ramki zamknięte w prostej, geometrycznej formie tworzą niepowtarzalny i intrygujący efekt.   Industrialna i efektowna lampa, którą Państwu prezentujemy posiada, aż cztery wymienne źródła światła E27 (brak w zestawie), dzięki czemu pięknie rozświetli każde pomieszczenie. Lampa idealnie sprawdzi się w salonie,  pokoju dziennym lub gabinecie, gdzie będzie przyciągającą ozdobą oraz praktycznym źródłem dodatkowego światła, które można wykorzystać  podczas czytania, oglądania telewizji lub w czasie romantycznych wieczorów.  Na naszej stronie mogą Państwo także zamówić ozdobne żarówki typu FILAMENT, które doskonale dopełnią aranżację lampy, dzięki dekoracyjnym żarnikom zamkniętym w szklanej bańce.   Mieszkaj modnie i stylowo. Zobacz także inne dostępne na naszej stronie lampy,  żyrandole, żarówki  i oprawy.  SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-il-mio-finland-4xe27-czarna-polux', '', '', '', 'Lampa Stojąca Podłogowa IL MIO FINLAND 4xE27 Czarna - Polux', '', '', '', ''),
(14, 1, 1, 'SZUKASZ ZACHWYCAJĄCEGO OŚWIETLENIA DO SWOJEGO SALONU LUB SYPIALNI? Postaw na lampę FABRIZIA! Lampa Fabrizia łączy w sobie klasyczną formę i nowoczesny design. W całości została stworzona z wysokiej jakości metalu. Jej ażurowy klosz pozwala uzyskać interesujący efekt rozproszenia światła. Sprawdzi się przede wszystkim we wnętrzach o charakterze klasycznym i urządzonych w stylu glamur. Może być jednak także ciekawym przełamaniem aranżacji nowoczesnych, a nawet industrialnych. Niewątpliwie doda stylu i klasy każdemu wnętrzu.Sprawdzi się  przede wszystkim jako dodatkowe oświetlenie salonu lub sypialni. Z powodzeniem można ją wykorzystać również w aranżacji sali restauracyjnej, czy kawiarnianej, aby nadać jej bardziej eleganckiego, wręcz ekskluzywnego charakteru. Należy przy tym podkreślić, że jest nie tylko efektowna, ale także stanowi wydajne i zarazem energooszczędne źródło światła. ODMIEŃ SWOJE WNĘTRZE DZIĘKI LAMPIE PODŁOGOWEJ FABRIZIA!  *WYSOKA JAKOŚĆ*WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27*EFEKTOWNA OPRAWA*WYMIAR LAMPY  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ FABRIZIA?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-stojaca-fabrizia-1xe27-biala-150cm-polux', '', '', '', 'Lampa podłogowa stojąca Fabrizia 1xE27 biała 150cm - Polux', '', '', '', ''),
(15, 1, 1, 'Lampa podłogowa została zaprojektowana zgodnie ze współczesnymi trendami projektowania wnętrz. Niezwykle minimalistyczny i prosty wygląd lampy stojącej sprawdzi się w większości nowoczesnych wnętrz. Fantazyjnie powykręcane białe pręciki tworzą ciekawy kształt klosza, przez który pięknie widać żarówkę. Do lampy pasować będą żarówki z trzonkiem E27. Niezwykła prostota wykonania lampy podłogowej sprawia, że pięknie prezentuje się ona w każdym wnętrzu. Lampa podłogowa w szczególności polecana jest do salonu, gdzie jej piękny wygląd w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować.Lampa stojąca to nowoczesne rozwiązanie idące wraz z duchem czasu. Piękny minimalizm widoczny w lampie podłogowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-stojaca-podlogowa-biala-do-salonu-1-x-e27', '', '', '', 'Nowoczesna lampa stojąca podłogowa biała do salonu 1 x E27', '', '', '', ''),
(16, 1, 1, 'Lampa podłogowa została zaprojektowana zgodnie ze współczesnymi trendami projektowania wnętrz. Styl Vintage to niezwykle prosty i piękny wygląd lampy stojącej sprawdzi się w większości nowoczesnych wnętrz. Fantazyjnie przyciemniony klosz o stożkowatym kształcie, przez który pięknie widać żarówkę tworzy niesamowitą atmosferę.Do lampy pasować będą żarówki z trzonkiem E27. Niezwykła prostota wykonania lampy podłogowej sprawia, że pięknie prezentuje się ona w każdym wnętrzu. Lampa podłogowa ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy stojącej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Lampa stojąca to nowoczesne rozwiązanie idące wraz z duchem czasu. Piękny styl staroświecki Vintage widoczny w lampie podłogowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Źródła światła nie są dostarczane w zestawie!OBSZAR ZASTOSOWAŃ:CECHY, KTÓRE POSIADA LAMPA STOJĄCA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:', '', 'lampa-stojaca-podlogowa-szklana-vintage-1906-cone-floor-smoke-grey-przydymiona-ledvance', '', '', '', 'LAMPA STOJĄCA Podłogowa Szklana VINTAGE 1906 CONE FLOOR SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(17, 1, 1, 'LAMPA PODŁOGOWA LED marki Polux z kolekcji Soho cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Piękne i solidne wykonanie lampy w stylu loftowym oraz industrialnym idealnie wkomponuje się w wystrój naszych wnętrz. Wykonana z najlepszej jakości metalu, malowana proszkowo lampa prezentuje sie znakomicie. Lampa wyposażona została w potrójne gniazdo z gwintem E14 przystosowanym do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 12W. Decydując sie na zakup lampy podłogowej firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta. Mieszkaj modnie i stylowo. Zobacz też pozostałe lampy i kinkiety z kolecji VEJLE.  SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-stojaca-soho-3xe14-polux-czarna', '', '', '', 'Lampa podłogowa stojąca Soho 3xE14 POLUX czarna', '', '', '', ''),
(18, 1, 1, 'Lampa podłogowa, w kolorze czarnym, z klasycznej kolekcji Wenecja to starannie wykonany produkt, z dbałością o detale. Lampa stojąca została przystosowana do pracy z żarówką o trzonku E27 i mocy maksymalnej wynoszącej 60W, wraz z którą pięknie rozświetli pomieszczenie. Elegancka lampa za sprawą ozdobnych, akrylowych kryształków zwisających spod abażuru będzie wspaniałą ozdobą każdego wnętrza. Lampa w stylu glamour świetnie wkomponuje się w jasne przestrzenie jak również stworzy ciekawy kontrast przy ciemnych wnętrzach.', '', 'lampa-podlogowa-wenecja-czarna-1x-e27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Lampa podłogowa Wenecja czarna 1x E27 Metal abażur tkanina kryształki Lampex Styl glamour', '', '', '', ''),
(19, 1, 1, 'Lampa podłogowa o klasycznym wyglądzie to elegancki i luksusowy dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Lampa stojąca charakteryzuje się pięknym wyglądem. Zaletą tej klasycznej lampy podłogowej jest ekskluzywny materiałowy abażur o ciekawym wzorze. Dzięki niemu źródło światła przymocowane do lampy będzie emitować piękne, rozproszone światło. Lampa idealnie nadaje się do salonu, gdzie może służyć jako lampa do czytania lub do sypialni gdzie może służyć jako lampa nocna.	Lampa stojąca została wykonana z materiałów wysokiej jakości i z niezwykłą dbałością o szczegóły. Jest to dobry zakup, który będzie cieszył oczy swoim pięknym wyglądem przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-podlogowa-stojaca-nocna-srebrna-biala-do-salonu-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa podłogowa stojąca nocna srebrna biała do salonu abażur z tkaniny 1 x E27', '', '', '', ''),
(20, 1, 1, 'Lampa podłogowa z serii VICTORIA, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i tkaniny z dbałością o każdy detal lampa. Dominuje w niej klasyka zapakowana w nieco bardziej awangardową formę. W tej kolekcji na pierwszy plan wysuwają się tradycyjne, tkaninowe klosze o lekko trapezowym kształcie umieszczone na charakterystycznie wygiętych, metalowych ramionach. Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, z gwintem E27 o mocy nieprzekraczającej 60W.Stylistyka kolekcji VICTORIA świetnie wkomponuje się we wnętrza o nieco bardziej klasycznym sznycie. W zależności od wariantu kolorystycznego, na jaki się zdecydujemy, możemy połączyć ją z różnymi odcieniami drewna, z szarością, bielą czy czernią.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-milagro-victoria-1x-e27', '', '', '', 'Lampa podłogowa MiLAGRO VICTORIA 1x E27', '', '', '', ''),
(21, 1, 1, 'Lampa podłogowa w kolorze czarnym z serii VICTORIA, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i tkaniny z dbałością o każdy detal lampa. Dominuje w niej klasyka zapakowana w nieco bardziej awangardową formę. W tej kolekcji na pierwszy plan wysuwają się tradycyjne, tkaninowe klosze o lekko trapezowym kształcie umieszczone na charakterystycznie wygiętych, metalowych ramionach. Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, z gwintem E27 o mocy nieprzekraczającej 60W.Stylistyka kolekcji VICTORIA świetnie wkomponuje się we wnętrza o nieco bardziej klasycznym sznycie. W zależności od wariantu kolorystycznego, na jaki się zdecydujemy, możemy połączyć ją z różnymi odcieniami drewna, z szarością, bielą czy czernią.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-podlogowa-czarna-milagro-victoria-black-1x-e27', '', '', '', 'Lampa podłogowa czarna MiLAGRO VICTORIA BLACK 1x E27', '', '', '', ''),
(22, 1, 1, 'Lampa podłogowa Leone, to elegancka lampa, która idealnie wkomponuje się w niemal każde wnętrze. Lampa stojąca posiada przezroczysty klosz, który sprawia, że światło jeszcze piękniej i efektowniej będzie przenikać do pomieszczenia. Czarny pasek u dołu abażuru, doskonale dopełnia całości i sprawia, że lampa będzie zdobiła każdą aranżację. Nowoczesna lampa cechuje się mobilnością, która pozwala na jej dowolne przestawianie. Lampa stojąca wraz z żarówką o trzonku E27 i mocy maksymalnej wynoszącej 40 (brak w zestawie) pięknie oświetli pomieszczenie i wprowadzi w nie przyjemny nastój sprzyjający odpoczynkowi. Elegancka lampa została wykonana z wysokiej jakości materiałów, które sprawią, że będzie ona działać niezawodnie przez długi czas.', '', 'lampa-podlogowa-stojaca-leone-1x-e27-metal-i-pcv-lampex-styl-nowoczesny', '', '', '', 'Lampa podłogowa stojąca Leone 1x E27 Metal i PCV Lampex styl nowoczesny', '', '', '', ''),
(23, 1, 1, 'Lampa stojąca Elia, to wysokiej jakości produkt, który został stworzony z myślą o miłośnikach nowoczesnych rozwiązań. Lampa podłogowa posiada złote wykończenia, które nadają jej szyku i elegancji oraz fenomenalnie komponują się z przezroczystymi i czarnymi pasami. Nowoczesna lampa z pomocą żarówki o trzonku E27 o mocy maksymalnej wynoszącej 40W, wydobędzie z wnętrza abażura przyjemne światło i subtelnie rozświetli pomieszczenie tworząc przyjemną atmosferę. Zaletą lampy podłogowej jest jej mobilność, która pozwoli na dowolne jej przestawianie dostosowując ją do aranżacji. Tego rodzaju oświetlenie idealnie sprawdzi się zarówno w nowoczesnych jak i stylowych wnętrzach.', '', 'lampa-podlogowa-stojaca-elia-1x-e27-metal-i-pcv-lampex-styl-nowoczesny', '', '', '', 'Lampa podłogowa stojąca Elia 1x E27 Metal i PCV Lampex styl nowoczesny', '', '', '', ''),
(24, 1, 1, 'Lampa stojąca podłogowa o prostej formie i nowoczesnym kształcie. MiLAGRO Ray 171 wyróżnia się jednym punktem światła o mocy 36 W oraz mocnym strumieniem świetlnym 2520 lm. Do tego przyjemna naturalna barwa 4000 K jest najbardziej zbliżona swoim odcieniem do światła dziennego. Wszystko to sprawia, że dzięki zastosowaniu technologii LED uzyskujemy efekt niskiego zużycia energii przy wysokiej wydajności oświetlenia, a sama barwa nie męczy i wprowadza przyjemny nastrój do każdego wnętrza. Lampa podłogowa przypadnie do gustu z pewnością Klientom ceniącym współczesne trendy stylistyczne i chcącym stworzyć niebanalne wnętrza przy pomocy niepowtarzalnych dodatków.', '', 'lampa-stojaca-podlogowa-ray-36w-czarny-prostokat-led-ip20-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Lampa stojąca podłogowa RAY 36W czarny prostokąt LED IP20 Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(25, 1, 1, 'Lampa podłogowa z linii produktów WEST WHITE to niezwykle nowoczesna i oryginalna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Biała lampa, o niespotykanym wyglądzie, została zaprojektowana zgodnie z najnowszymi trendami dzięki czemu przyciąga wzrok i nie sposób przejść obok niej obojętnie. Lampa stojąca jest wyprodukowana przez polską markę MiLAGRO. Jej dwa białe i podłużne klosze doskonale współgrają z drewnianym elementem. Minimalistyczna lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w minimalistycznym, skandynawskim bądź nowoczesnym stylu. Lampa współpracuje z żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-stojaca-podlogowa-west-biala-2x-gu10-milagro-geometryczna-metal-drewno', '', '', '', 'Lampa stojąca podłogowa WEST biała 2x GU10 MILAGRO geometryczna metal + drewno', '', '', '', ''),
(26, 1, 1, 'Lampa Orion to lampa podłogowa o nowoczesnej i prostej formie. Niewielkie rozmiary podstawy sprawiają, że lampę można postawić na małej przestrzeni. Wyposażono ją w wymienny moduł LED o mocy 35 W. Strumień światła ma 2450 lm i przyjazną dla oka barwę 3000 K. Taka charakterystyka zapewnia odpowiednią jasność, wprowadza też przyjemny klimat do pomieszczenia. Biały, matowy kolor oraz prosta forma sprawia, że lampa jest propozycją do nowoczesnych wnętrz, jednak dobrze wkomponuje się także w bardziej klasycznie zaprojektowane pomieszczenia. Z powodzeniem można ją zastosować w salonach oraz przedpokojach.', '', 'lampa-stojaca-orion-okra-bialy-35w-led-ip20-styl-nowoczesny-minimalistyczny-metal-i-akryl-milagro', '', '', '', 'Lampa stojąca ORION okra biały 35W LED IP20 styl nowoczesny minimalistyczny Metal i akryl Milagro', '', '', '', ''),
(27, 1, 1, 'Lampa podłogowa LED o eleganckim i oryginalnym kształcie została zaprojektowana z myślą o nowoczesnych i minimalistycznych wnętrzach. Lampa stojąca za sprawą minimalizmu i srebrnego koloru doskonale wkomponuje się w niemal każde wnętrze. Lampa LED posiada zainstalowane na stałe moduły LED o mocy 9 W i strumieniu świetlnym wynoszącym 630 lm. Lampa LED emituje neutralną i przyjemną dla oka barwę 4000 K, która wiernie odzwierciedla kolory oświetlanych przedmiotów i wprowadza przyjemny nastrój. Nieskomplikowany design lampy sprawia, że można ją wkomponować w niemal każdą aranżację, a w połączeniu z innymi lampami z tej serii lampa podłogowa będzie się cudownie prezentować. Elegancka lampa objęta jest 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.\"', '', 'lampa-podlogowa-stojaca-led-chrom-ice-9w-4000k-ip20-metal-i-akryl-milagro', '', '', '', 'Lampa podłogowa stojąca LED Chrom ICE 9W 4000K IP20 Metal i akryl Milagro', '', '', '', ''),
(28, 1, 1, 'Lampa stojąca z serii Bella firmy MILAGRO to ceramiczna lampa w białym kolorze. Lampa podłogowa jest wyprodukowanym w Polsce produktem hand made o nietuzinkowym i eleganckim wyglądzie. Biała lampa to klasyczny dodatek w nowoczesnym wydaniu i prawdziwa gratka dla osób, które lubią niecodzienne, gustowne dodatki. Lampa Bella w ponadczasowej bieli doskonale wpasuje się w niemal każde pomieszczenie. Lampa świetnie sprawdzi się w aranżacjach minimalistycznych i industrialnych za sprawą tego, że Idealnie komponuje się z metalem, tekstyliami, naturalnym drewnem lub kamieniem. Lampa hand made wraz z żarówką E27 (brak w zestawie) będzie emitować klimatyczne światło, które ozdobi najbardziej wymagające wnętrze i będzie stanowić jego oryginalną dekorację. Lampy firmy MiLAGRO objęte są gwarancją producenta, posiadają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-stojaca-podlogowa-ceramiczna-bella-biala-ip20-1x-e27-ceramika-i-tkanina-milagro-hand-made', '', '', '', 'Lampa stojąca podłogowa ceramiczna BELLA Biała IP20 1x E27 Ceramika i tkanina Milagro Hand made', '', '', '', ''),
(29, 1, 1, 'Lea to nowoczesna oraz stylowa lampa stojąca. Ciekawa budowa, oraz stonowana kolorystyka nadają lampie elegancki wygląd. Potrójna metalowa podstawa przyciąga spojrzenia, a jednocześnie zapewnia lampie ogromną stabilność. Oprawa została wykonana z materiałów wysokiej jakości, dzięki czemu  zachowuje walory niezawodności. Minimalizm sprawia, że lampa podłogowa dopasuje się z łatwością do aranżacji wielu pokoi.  Trójnóg współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).  ', '', 'lampa-stojaca-podlogowa-trojnog-lea-braz-1xe27-metal-i-abazur-styl-nowoczesny-lampex', '', '', '', 'Lampa stojąca podłogowa trójnóg Lea brąz 1xE27 Metal i abażur styl nowoczesny Lampex', '', '', '', ''),
(30, 1, 1, 'Dina to nowoczesna lampa stojąca o ciekawym wyglądzie. Jej znakiem charakterystycznym jest abażur w kształcie ściętego stożka. Lampa została wykonana z materiałów najwyższej jakości dzięki czemu prezentuję się wspaniale,zachowując walory niezawodności. Szczególnie polecana do nowoczesnych, stylowych pomieszczeń.  Dzianinowa lampa współgra z żarówkami o trzonku E27 oraz mocy max 40W (brak w zestawie).', '', 'lampa-stojaca-podlogowa-dina-c-biala-popielata-1xe27-metal-i-abazur-tkanina-styl-nowoczesny-lampex', '', '', '', 'Lampa stojąca podłogowa Dina C Biała Popielata 1xE27 Metal i abażur tkanina styl nowoczesny Lampex', '', '', '', ''),
(31, 1, 1, 'Lampa stojąca EYE FLEX 8934 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o nietuzinkowym białym kolorze i niewielkiej średnicy. Unikatowa barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowę można regulować za sprawą elastycznego ramienia, Dzięki czemu możemy manipulować źródłem światła w dowolnym kierunku. Lampa podłogowa EYE FLEX 8934 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na wbudowany dodatkowy włącznik - szczególnie polecany  do salonu jako punktowe Oświetlenie. Lampa ma wysokość 120 cm, a abażur mierzy 5,5 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 10W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-nowodvorski-gu10-biala-elastyczne-ramie-eye-flex-8934-stal', '', '', '', 'Lampa stojąca podłogowa NOWODVORSKI GU10 Biała Elastyczne Ramię EYE FLEX 8934 Stal', '', '', '', ''),
(32, 1, 1, 'Lampa stojąca EYE FLEX 8935 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o nietuzinkowym czarnym kolorze i niewielkiej średnicy. Unikatowa barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowę można regulować za sprawą elastycznego ramienia, Dzięki czemu możemy manipulować źródłem światła w dowolnym kierunku. Lampa podłogowa EYE FLEX 8935 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na wbudowany dodatkowy włącznik - szczególnie polecany  do salonu jako punktowe Oświetlenie. Lampa ma wysokość 120 cm, a abażur mierzy 5,5 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 10W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-stojaca-podlogowa-nowodvorski-gu10-czarna-elastyczne-ramie-eye-flex-8935-stal', '', '', '', 'Lampa stojąca podłogowa NOWODVORSKI GU10 Czarna Elastyczne Ramię EYE FLEX 8935 Stal', '', '', '', ''),
(33, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 8 najważniejszych zalet LAMPY WISZĄCEJ!Lampa TRAGULA marki LUMILED w nowoczesnym stylu z trzema punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, modnych bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.  *KLOSZ*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tragula-czarna-spot-okragla-do-led-3x-e27-lumiled', '', '', '', 'Lampa sufitowa TRAGULA czarna SPOT okrągła do LED 3x E27 LUMILED', '', '', '', ''),
(34, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED. Wyposażony został w 250 diod SMD 2835 LED, które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie), który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami tej serii i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z tej serii za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 16W a w przypadku barwy neutralnej 33W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie. (Zasilanie pilota: 2x AAA 1,5V (brak w zestawie)).Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-okragla-plafon-led-zyrandol-33w-3000k-6500k-czarny-pilot', '', '', '', 'Lampa sufitowa okrągła PLAFON LED żyrandol 33W 3000K-6500K czarny + pilot', '', '', '', ''),
(35, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY ściennej!Kinkiet GAVI w nowoczesnym stylu o mocy 4,5W i strumieniu świetlnym 240lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ WISZĄCĄ I OCZARUJ SWOICH GOŚCI!     *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-ruchomy-reflektor-lampa-scienna-regulowana-45w-led-gavi-1-bialy-3000k-polux', '', '', '', 'Kinkiet ruchomy reflektor lampa ścienna regulowana 4,5W LED GAVI 1 biały 3000K Polux', '', '', '', ''),
(36, 1, 1, 'Przedstawiona lampa sufitowo-ścienna serii TRAGULA wyprodukowana jest z wysokiej jakości tworzywa sztucznego i stali. Czarny kinkiet został wykonany z dbałością o każdy detal. Lampy zostały zaprojektowane w taki sposób, aby wyeksponować dekoracyjną żarówkę. Oprawa, przystosowana została do pracy z energooszczędnym źródłem światła LED o trzonku E27, dzięki temu gwintowi mamy możliwość zamontowania dowolnego źródła światła. Czarny klosz, gdzie źródło światła, jest częściowo odsłonięte, doskonale oświetla pomieszczenie, przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa w loftowym stylu świetnie sprawdzi się w salonie czy jadalni, gdzie zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, doskonale nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze. Dodatkowym atutem jest to, że lampa jest łamana, dzięki temu możemy ją zamontować na suficie lub na ścianie jako kinkiet.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza. ZASTOSOWANIE:Brak źródła światła w komplecie.WYMIARYProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-tragula-czarna-lamana-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowo-ścienna TRAGULA czarna łamana loft do LED 1xE27 LUMILED', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(37, 1, 1, 'POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED. Wyposażony został w 380 diod SMD 2835 LED, które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie), który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami tej serii i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z tej serii za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 27W a w przypadku barwy neutralnej 54W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-led-zyrandol-54w-3000k-6500k-czarny-pilot', '', '', '', 'Lampa sufitowa PLAFON LED żyrandol 54W 3000K-6500K czarny + pilot', '', '', '', ''),
(38, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 8 najważniejszych zalet LAMPY SUFITOWO-ŚCIENNEJ!Lampa sufitowo-ścienna w loftowym stylu z jednym punktem świetlnym zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmPOSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA *GWINT E27UWAGA! Brak źródła światła w komplecie. *KLOSZ*REGULOWANA LAMPA  *ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-tragula-czarna-ruchoma-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowo-ścienna TRAGULA czarna ruchoma loft do LED 1xE27 LUMILED', '', '', '', ''),
(39, 1, 1, 'GLASO to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chromu, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa  została wyposażona w jeden punkt świetlny, do której możemy zamontować żarówkę z trzonkiem G9 o maksymalnej mocy 40W. GLASO przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux GLASO, to rodzina opraw punktowych (sufitowo-ściennych). Dzięki regulacji możemy swobodnie ustawić kąt padania światła. Kształt opraw i ciekawe wzornictwo szklanych kloszy podkreślają charakter wnętrz retro, a chromowane dodatki dodają subtelnego szlifu wnętrzom nowoczesnym.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 19640 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-glaso-g9-chrom-kanlux', '', '', '', 'Oprawa lampa sufitowa GLASO G9 chrom Kanlux', '', '', '', ''),
(40, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!Kinkiet FILIS marki LUMILED w loftowym stylu z jednym punktem świetlnym, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.    *KLOSZ   *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-filis-geometryczna-druciana-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowa FILIS geometryczna druciana loft do LED 1xE27 LUMILED', '', '', '', ''),
(41, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa TRAGULA marki LUMILED w loftowym stylu z jednym punktem świetlnym zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmPOSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.     *KLOSZ   *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tragula-czarna-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowa TRAGULA czarna loft do LED 1xE27 LUMILED', '', '', '', ''),
(42, 1, 1, 'Potrójny KINKIET FIONA z wysokiej jakości materiałów w kolorze miętowym doskonale sprawdzi się do oświetlania ścian fasad budynku. Przystosowany do energooszczędnych źródeł światła z trzonkiem E14 (mały gwint) o maksymalnej mocy 8W. Żarówki LED można dokupić na pozostałych naszych aukcjach. Lampa wykonana została z stali proszkowanej i stanowi piękny dodatek do Twojego wnętrza. Oprawka zasilana jest typowym napięciem 230V.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-fiona-oprawa-scienna-3xe14-do-sufitu-mieta-polux', '', '', '', 'KINKIET FIONA oprawa ścienna 3xE14 do sufitu MIĘTA POLUX', '', '', '', ''),
(43, 1, 1, 'Lampa sufitowa ze stali PIPE ANGLED wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt estetycznie wykonany w kolorze czarnym. Lampa współpracuje z żarówkami o trzonku 6 x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową PIPE ANGLED firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-stal-vintage-1906-pipe-angled-6-x-e27-czarna-ledvance', '', '', '', 'Lampa Sufitowa Stal VINTAGE 1906 PIPE ANGLED 6 x E27 Czarna LEDVANCE', '', '', '', ''),
(44, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z czterema punktami świetlnymi w nowoczesnym stylu o mocy 18W i strumieniu świetlnym 960lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Oprawa będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI! *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻUGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-18w-led-gavi-4-czarny-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 18W LED GAVI 4 czarny 3000K Polux', '', '', '', ''),
(45, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze CZARNYM. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w trzy tradycyjne gniazda E14 do których możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-3xe14-polux-czarny', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 3xE14 Polux CZARNY', '', '', '', ''),
(46, 1, 1, 'Kolekcja Kronos to seria lamp w różnych konfiguracjach. Wśród nich znaleźć możemy właśnie lampę sufitową z jednym punktem światła, który ukryte jest w ozdobnym kloszu. Sufitowe oświetlenie posiada klasyczny mały gwint E14, dzięki czemu bardzo łatwo możemy dobrać do nich energooszczędne żarówki LED dostępne w naszej ofercie. Nowoczesny kształt żyrandolu marki Milagro sprawdzi się jako piękny dodatek do współczesnego wystroju wnętrz. Okrągły i spłaszczony kształt  w połączeniu z zawsze modnym kolorem czarnym prezentuje się znakomicie, wpisując się w obecnie panujące trendy. Tylko zakup markowych lamp zapewni ci najlepsza jakość oraz bardzo długi okres użytkowania.Lampa Sufitowa Świetnie Sprawdzi się:SPECYFIKACJA TECHNICZNA: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą. ', '', 'lampa-sufitowa-zyrandol-kronos-1xe14-ip20-czarny-metal-milagro', '', '', '', 'Lampa sufitowa żyrandol KRONOS 1xE14 IP20 Czarny Metal Milagro', '', '', '', ''),
(47, 1, 1, 'Lampa sufitowa Iglo, w kolorze szarym, to świetna propozycja dla miłośnika nowoczesnych i minimalistycznych wnętrz. Plafon został wykonany z wysokiej jakości tkaniny i metalu, dzięki czemu będzie działać niezawodnie przez długi czas jednocześnie pięknie się prezentując. Oprawa za sprawą swojego minimalistycznego wyglądu idealnie wkomponuje się niemalże w każde pomieszczenie, będąc przy tym świetną dekoracją. Szara lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 40W, wraz z którymi rozjaśni pomieszczenie i wprowadzi w nie przyjemną atmosferę.', '', 'plafon-lampa-sufitowa-iglo-szara-40-cm-3x-e27-abazur-tkanina-i-pcv-lampex', '', '', '', 'Plafon Lampa sufitowa Iglo Szara 40 cm 3x E27 Abażur tkanina i PCV Lampex', '', '', '', ''),
(48, 1, 1, 'Lampa sufitowa CRATE 9045 w minimalistycznym wydaniu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa została wykonana z niezwykłą dbałością o detale, dzięki czemu jest niezawodnym i efektownym produktem. Czarne elementy kinkietu doskonale komponują się ze sobą, tworząc zgrabną i elegancką całość. Dodatkowo wyróżnia się nowoczesnym designem oraz geometryczną formą. Jej wygląd przypomina klatkę, w której \"zamknięta\" została żarówka. Wysokość maksymalna lampy to 30,5 cm, a szerokość klosza wynosi 15 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-e27-klatka-loft-9045-crate-czarna-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI E27 Klatka Loft 9045 CRATE Czarna Stal', '', '', '', ''),
