(53, 1, 1, 'LISTWA LED Polux  z 4-ema źródłami światła w kolorze czarnym, o mocy 3x5W o ciepłej, przyjemniej, białej barwie 3000K idealnie rozświetli Twoje wnętrze. Listwa świetni sprawdzi się w pomieszczeniach typu  łazienka, kuchnia oraz gabinety/biura urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia pod dowlnym kątem 4-ech źródeł światła sprawisz, że padające promienie idealnie rozświetlą wybraną przez Ciebie przestrzeń.   Nowoczesny design oraz chrakterystyczny, okrągły kształt opraw ledowych w czarnej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.. Praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako główne lub dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-capri-4x5w-czarna-3000k', '', '', '', 'Listwa LAMPA SUFITOWA LED Polux CAPRI  4x5W CZARNA 3000K', '', '', '', ''),
(54, 1, 1, 'Lampa dziecięca z uroczej kolekcji STAR to różowy żyrandol, który ozdobiony jest mieniącymi się kryształkami i gwiazdkami. Różowa lampa zamontowana na suficie będzie przywodzić na myśl gwieździste niebo i jednocześnie wywoływać uśmiech na twarzy każdego dziecka. Lampa dla dzieci współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa z gwiazdkami, w różowym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy STAR od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-rozowa-zyrandol-dla-dzieci-gwiazdki-star-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa różowa Żyrandol dla dzieci Gwiazdki STAR 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(55, 1, 1, 'Lampa sufitowa CRATE 9047 w minimalistycznym wydaniu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa została wykonana z niezwykłą dbałością o detale, dzięki czemu jest niezawodnym i efektownym produktem. Czarne elementy kinkietu doskonale komponują się ze sobą, tworząc zgrabną i elegancką całość. Dodatkowo wyróżnia się nowoczesnym designem oraz geometryczną formą. Jej wygląd przypomina klatkę, w której \"zamknięta\" została żarówka. Oświetlenie zostało wyposażone w pięć źródeł światła. Wysokość maksymalna lampy to 30,5 cm, a szerokość klosza wynosi 15 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-5xe27-klatka-loft-9047-crate-czarna-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 5xE27 Klatka Loft 9047 CRATE Czarna Stal', '', '', '', ''),
(56, 1, 1, 'Duna to klasyczny plafon o jasnej, stonowanej barwie. Owalny kształt klosza doskonale podkreśli charakter każdego wnętrza. Lampa została wykonana z wysokiej jakości materiałów dzięki czemu świetnie prezentuje się,zachowując jednocześnie walory niezawodności. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'plafon-p1-duna-biala-patyna-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Plafon P1 Duna biała patyna 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(57, 1, 1, 'Lampa sufitowa Iglo, o szerokości wynoszącej 50cm i w kolorze czarnym, to świetna propozycja dla miłośnika nowoczesnych i minimalistycznych wnętrz. Plafon został wykonany z wysokiej jakości tkaniny i metalu, dzięki czemu będzie działać niezawodnie przez długi czas jednocześnie pięknie się prezentując. Oprawa za sprawą swojego minimalistycznego wyglądu idealnie wkomponuje się niemalże w każde pomieszczenie, będąc przy tym świetną dekoracją. Czarna lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 40W, wraz z którymi rozjaśni pomieszczenie i wprowadzi w nie przyjemną atmosferę.', '', 'plafon-lampa-sufitowa-czarna-iglo-50-cm-3x-e27-abazur-tkanina-i-pcv-lampex', '', '', '', 'Plafon Lampa sufitowa czarna Iglo 50 cm 3x E27 Abażur tkanina i PCV Lampex', '', '', '', ''),
(58, 1, 1, 'Lampa sufitowa z kolekcji JOKER Black to niezwykły produkt, który doskonale pasuje do minimalistycznych, nowoczesnych bądź industrialnych wnętrz. Czarna lampa, w kształcie pająka z pięcioma ramionami, pięknie oświetli każde pomieszczenie, w którym się ją zamontuje. Lampa loft została wyprodukowana przez markę MiLAGRO, co świadczy o wysokiej jakości produktu. Srebrne elementy doskonale komponują się z czarnymi oprawami tworząc elegancką całość, która zachwyca i nadaje wnętrzom niepowtarzalnego charakteru. Lampa pająk współpracuje z żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Ponadto kolekcja JOKER objęta jest gwarancją producenta. Czas jej trwania wynosi 24 miesiące. W tym okresie wszelkie naprawy są świadczone nieodpłatnie.', '', 'lampa-sufitowa-joker-czarna-5x-gu10-milagro-metal-pajak-loft', '', '', '', 'Lampa sufitowa JOKER czarna 5x GU10 MILAGRO Metal pająk loft', '', '', '', ''),
(59, 1, 1, 'Żyrandol z kolekcji Natan to niezwykle elegancka lampa, która świetnie sprawdzi się we wnętrzach w stylu klasycznym bądź glamour. Lampa sufitowa składa się ze srebrnej oprawy i pięciu białych kloszy, które doskonale się ze sobą komponują tworząc piękną całość. Drobne, delikatne kryształki i subtelne pierścienie na kloszach lampy sprawiają, że lampa wprowadza we wnętrza odrobinę luksusu i przyjemną atmosferę. Klasyczna lampa współpracuje z pięcioma żarówkami, o mocy maksymalnej wynoszącej 40W, wraz z którymi pięknie oświetli pomieszczenie, w którym zostanie zamontowana. Lampa z kloszami została wykonana z materiałów najwyższej jakości, co sprawia, że będzie ona działać niezawodnie przez długi czas.', '', 'zyrandol-lampa-sufitowa-natan-5-5x-e27-metal-i-szklo-lampex-styl-klasyczny-glamour', '', '', '', 'Żyrandol Lampa sufitowa Natan 5 5x E27 Metal i szkło Lampex styl klasyczny glamour', '', '', '', ''),
(60, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze białym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w potrójne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-3xe14-polux-5901508310996', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 3xE14 Polux 5901508310996', '', '', '', ''),
(61, 1, 1, 'Dodaj stylu swoim wnętrzom dzięki lampie ERIS GOLDPoznaj jej największe zalety! Lampa sufitowa ERIS GOLD wykonana została z dużą dbałością o szczegóły, dzięki czemu wygląda niezwykle elegancko. Jej aluminiowa obudowa wykończona czarną matową powłoką, niezwykle stylowo prezentuje się w połączeniu ze złotym środkiem. Oprawa idealnie komponuje się we wnętrzach minimalistycznych, nowoczesnych i urządzonych w stylu industrialnym. Sprawdzi się w takich pomieszczeniach jak sypialnia, salon, jadalnia czy korytarz. Jedną z jej największych zalet jest możliwość regulacji kąta padania światła w zakresie 90° w pionie i 350° wokół własnej osi. Pozwala to dokładnie doświetlić wybraną przestrzeń przy wykorzystaniu dwóch żarówek o trzonku GU10 i maksymalnej mocy 35 W.    GŁÓWNE ZALETY PRODUKTU:GWINT GU10Lampa współpracuje z dwoma żarówkami o trzonku GU10, umożliwia nam to  błyskawiczny montaż lub wymianę żródła światła. Do oprawy z łatwością można dobrać energooszczędną żarówkę LED do max. 35W mocy. Dzięki temu możemy cieszyć się dobrze oświetloną przestrzenią, oszczędzając do 90% energii w porównaniu do tradycyjnych źródeł światła.  MATERIAŁ WYKONANIAPrezentowana lampa wykonana została z wysokiej jakości aluminium wykończonego czarną matową powłoką. Powstała z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  WYMIARY PRODUKTU Dzięki kompaktowym wymiarom lampa nadaje się do wykorzystania nawet w niewielkich pomieszczeniach, bez efektu przytłoczenia. długość całkowita: 295 mmszerokość: 51 mmwysokość podstawy: 25 mmwysokość całkowita: 164 mmWymiary klosza:długość: 100 mmszerokość: 60 mm   EFEKTOWNA OPRAWACzarna matowa obudowa lampy w połączeniu ze złotymi wnętrzami kloszy, wygląda niezwykle stylowo. Wspaniale wygląda dzięki temu we wnętrzach urządzonych w stylu nowoczesnym,  minimalistycznym czy industrialnym. Może być dopełnieniem aranżacji, w której zastosowano inne dodatki w kolorze czarnym lub być przyciągającym uwagę akcentem.   STOPIEŃ SZCZELNOŚCI IP20Oprawa przeznaczona jest do stosowania wewnątrz pomieszczeń. Oznacza to, że obudowa chroni nas przed porażeniem prądem przy próbie dotknięcia, jednak w żaden sposób nie jest zabezpieczona przed działaniem wody.  REGULACJA KĄTA PADANIA ŚWIATŁAWybierając lampę sufitową Eris Gold mamy możliwość płynnej regulacji ustawienia jej kloszy w dwóch płaszczyznach, 90° w pionie i 350° wokoło wokół własnej  osi. Pozwala to doświetlić wybraną przestrzeń według własnych potrzeb.      GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Kupując u nas otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą. ', '', 'lampa-sufitowa-led-eris-gold-2x-gu10-regulowana', '', '', '', 'Lampa sufitowa LED ERIS GOLD 2x GU10 regulowana', '', '', '', ''),
(62, 1, 1, 'Lampa sufitowa z jednym punktem świetlnym i w nieco surowym wydaniu została stworzona dzięki zainspirowaniu się starodawnymi lampami. Biała lampa świetnie sprawdzi się we wnętrzach w stylu industrialnym bądź retro. Lampa loft współpracuje z żarówką o trzonku E27 o mocy maksymalnej 60 W (brak w zestawie), wraz z którą stworzy spektakularny efekt. Lampa wraz z solidnym i metalowym kloszem nada pomieszczeniu nieco surowości i jednocześnie podkreśli jego walory. Lampa retro przyciąga wzrok i sprawia, że nie sposób przejść obok niej obojętnie.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-wiszaca-z-kloszem-1x-e27-biala-styl-loft-retro-metal', '', '', '', 'Lampa sufitowa wisząca z kloszem 1x E27 Biała Styl loft Retro Metal', '', '', '', ''),
(63, 1, 1, 'Lampa sufitowa Iglo, w kolorze czarnym, to świetna propozycja dla miłośnika nowoczesnych i minimalistycznych wnętrz. Plafon został wykonany z wysokiej jakości tkaniny i metalu, dzięki czemu będzie działać niezawodnie przez długi czas jednocześnie pięknie się prezentując. Oprawa za sprawą swojego minimalistycznego wyglądu idealnie wkomponuje się niemalże w każde pomieszczenie, będąc przy tym świetną dekoracją. Czarna lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 40W, wraz z którymi rozjaśni pomieszczenie i wprowadzi w nie przyjemną atmosferę.', '', 'plafon-lampa-sufitowa-iglo-40-cm-czarna-3x-e27-abazur-tkanina-i-pcv-lampex', '', '', '', 'Plafon Lampa sufitowa Iglo 40 cm Czarna 3x E27 Abażur tkanina i PCV Lampex', '', '', '', ''),
(64, 1, 1, 'Lampa sufitowa ze stali PIPE FLEX wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt estetycznie wykonany w kolorze czarnym. Lampa współpracuje z żarówkami o trzonku 5 x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową PIPE FLEX firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-stal-vintage-1906-pipe-flex-5-x-e27-czarna-ledvance', '', '', '', 'Lampa Sufitowa Stal VINTAGE 1906 PIPE FLEX 5 x E27 Czarna LEDVANCE', '', '', '', ''),
(65, 1, 1, 'Lampa sufitowa z interesującej kolekcji Bluszcz została stworzona z myślą o miłośnikach stylu retro i vintage. Lampa bluszcz posiada biały klosz, który stylizowany jest na kielich kwiatu. Całość została osadzona na solidnej, metalowej oprawie przyozdobionej listkami. Produkt został wykonany z materiałów wysokiej jakości, dzięki czemu prezentuje się wspaniale i będzie działać niezawodnie przez długi czas.Klasyczna lampa została przystosowana do pracy z żarówką o trzonku E27 o mocy maksymalnej wynoszącej 60W, wraz z którą pięknie oświetli pomieszczenie.', '', 'lampa-sufitowa-bluszcz-1x-e27-metal-i-szklo-lampex-styl-retro-vintage', '', '', '', 'Lampa sufitowa Bluszcz 1x E27 Metal i szkło Lampex styl retro vintage', '', '', '', ''),
(66, 1, 1, 'MANUFACTURE 9742 to unikatowa lampa o loftowym charakterze. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa sufitowa, przypominająca bombkę, w której kryję się źrodło światła. Zaletą lamp drucianych jest to, że samoistnie tworzą, część aranżacji wnętrza przez swoje oryginalne formy jednocześnie dając dużo światła w pomieszczeniu. Dodatkową dekoracją metalowych części jest wykorzystanie dekoratywnych żarówek najlepiej w stylu vintage. Lampy druciane coraz częściej wieszane są w kuchni, pokojach dziennych czy młodzieżowych. Lampy druciaki są o tyle uniwersalne, że nie określają aranżacji pomieszczenia, choć najczęściej są użytkowane w pomieszczeniach industrialnych i skandynawskich. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość pojedynczego klosza lampy to 31 cm, a szerokość wynosi 18 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-e27-retro-loft-9741-manufacture-czarna-miedz-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI E27 Retro Loft 9741 MANUFACTURE Czarna Miedź Stal', '', '', '', ''),
(67, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa NODUM marki LUMILED SKRĘT z pięcioma punktami świetlnymi w loftowym stylu charakteryzuje elegancki minimalizm idący w parze ze swobodą i artyzmem, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.     *KLOSZ   *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nodum-skret-czarny-do-led-5x-e27-lumiled', '', '', '', 'Lampa sufitowa NODUM SKRĘT czarny do LED 5x E27 LUMILED', '', '', '', ''),
(68, 1, 1, 'Lampa sufitowa szklana PINEAPPLE wykonana w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym, kloszem przypominającym ananasa w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CARVED PINEAPPLE firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-carved-pineapple-ananas-przydymiony-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CARVED PINEAPPLE Ananas Przydymiony LEDVANCE', '', '', '', ''),
(69, 1, 1, 'Lampa sufitowa z linii produktów WEST BLACK to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa wisząca została wyprodukowana przez polską markę MiLAGRO. Jej czarne, podłużne klosze przyciągają uwagę, a drewniany element doskonale z nimi współgra. Lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Czarna lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w minimalistycznym, skandynawskim bądź nowoczesnym stylu. Lampa współpracuje z pięcioma żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-wiszaca-sufitowa-west-czarna-5x-gu10-milagro-geometryczna-metal-drewno', '', '', '', 'Lampa wisząca sufitowa WEST czarna 5x GU10 MILAGRO geometryczna metal + drewno', '', '', '', ''),
(70, 1, 1, 'Lampa sufitowa 444 to doskonała propozycja dla miłośników stylu klasycznego. Szklany klosz osadzony na metalowej ramie doskonale podkreśli charakter każdego wnętrza. Produkt został wykonany z materiałów najwyższej jakości, dzięki czemu wspaniale się prezentuje, zachowując przy tym walory niezawodności. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'lampa-sufitowa-miedz-braz-classic-retro-1xe27-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa miedź + brąz Classic Retro 1xE27 Metal i szkło Lampex', '', '', '', ''),
(71, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa sufitowa TRAGULA marki LUMILED w loftowym stylu z czterema punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i designerski wystrój wnętrza.kmPOSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie. *KLOSZ *ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tragula-czarna-spot-kwadratowa-do-led-4x-e27-lumiled', '', '', '', 'Lampa sufitowa TRAGULA czarna SPOT kwadratowa do LED 4x E27 LUMILED', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(72, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Sofia w kolorach czarno-mieździowym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Sofia która została wyposażona w cztery tradycyjne gniazda E14 do których możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Przy połączeniu ozdobnych żarówek Led oraz czarnego klosza wykonanego z drutu uzyskamy niesamowity efekt który doda naszym wnętrzom charakteru i ciekawszego wyglądu. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-sofia-4xe14-polux-5901508310965', '', '', '', 'Oprawa ścienna KINKIET Spot Sofia 4xE14 Polux 5901508310965', '', '', '', ''),
(73, 1, 1, 'Lampa sufitowa ze stali PIPE STRAIGHT wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt estetycznie wykonany w kolorze czarnym. Lampa współpracuje z żarówkami o trzonku 5 x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową PIPE STRAIGHT firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-stal-vintage-1906-pipe-straight-5-x-e27-czarna-ledvance', '', '', '', 'Lampa Sufitowa Stal VINTAGE 1906 PIPE STRAIGHT 5 x E27 Czarna LEDVANCE', '', '', '', ''),
(74, 1, 1, 'Lampa sufitowa EYE SUPER 6504 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Trzy gwinty GU10 zostały zamknięte w stalowym kloszu i wbudowane w oprawę w kształcie metalowej tuby, o uniwersalnym czarnym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowę została zawieszona na regulowanym zawiesiu, dodatkowo możemy manipulować źródłem światła, dzięki regulowanej konstrukcji klosza. Lampa EYE SUPER 6504 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design — szczególnie polecany do sypialni, salonu bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 52 cm, zaś abażur ma wymiar 20 x 5,5 cm. Oświetlenie może osiągać szerokość maksymalną 135 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-3xgu10-czarna-ruchomy-klosz-eye-super-6504-stal', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI 3xGU10 Czarna Ruchomy Klosz EYE SUPER 6504 Stal', '', '', '', ''),
(75, 1, 1, 'TWIG 9138 to piękna lampa, która jest kwintesencją loftowego szyku. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrilanym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa sufitowa, z sześcioma źródłami światła, odsłaniającymi żarówki, doskonale oświetlając całe pomieszczenie. Zwis będzie w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość lampy to 55 cm, a szerokość klosza wynosi 110 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-6xe27-retro-loft-9138-twig-czarna-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 6xE27 Retro Loft 9138 TWIG Czarna Stal', '', '', '', ''),
