sufitowa-szklana-vintage-1906-cone-spot-1xe27-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CONE SPOT 1xE27 SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(77, 1, 1, 'Lampa sufitowa Kraft została w całości wykonana z metalu. Jej wygląd oraz styl idealnie pasują do nowoczesnego wnętrza. Metalowy korpus został umieszczony na przegubie, dzięki czemu możliwa jest regulacja kierunku padania światła. Lampa została wyprodukowana wyłącznie z materiałów najwyższej jakości, dzięki czemu prezentuje się wspaniale, zachowując przy tym walory niezawodności. Kwadratowa lampa współgra z żarówkami o trzonku GU10 oraz mocy max 40W (brak w zestawie).', '', 'lampa-sufitowa-kraft-1-biala-1xgu10-metal-styl-nowoczesny-lampex', '', '', '', 'Lampa sufitowa Kraft 1 biała 1xGU10 Metal styl nowoczesny Lampex', '', '', '', ''),
(78, 1, 1, 'Lampa dziecięca z serii ANGELICA to uroczy żyrandol, w białym kolorze, który współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci posiada wiszące kryształki i motylki, które razem znakomicie się prezentują i wywołają uśmiech na twarzy każdego dziecka. Lampa z motylkami w białym kolorze wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Wszystkie modele z kolekcji ANGELICA wykonano z połączenia bezpiecznego metalu oraz akrylu. Żyrandole od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-biala-zyrandol-angelica-motyle-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa biała Żyrandol ANGELICA Motyle 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(79, 1, 1, 'Srebrna oprawa posiadająca trzy gniazda na żarówki LED o trzonku E14 wykonana jest z metalu wysokiej jakości. Żyrandol pięknie podkreśli wygląd wkręconych do niego żarówek, które same w sobie staną się ozdobą wnętrza. Lampa sufitowa zrobiona w minimalistycznym stylu będzie się pięknie prezentować w każdym nowoczesnym wnętrzu. Została ona stworzona po to, aby oświetlić garderobę, choć równie dobrze sprawdzi się np. na korytarzu. 	Jeśli poszukujesz dobrej jakościowo lampy sufitowej, w minimalistycznym stylu to lampa dostępna tutaj jest bardzo dobrym wyborem. Jej zaletą jest również to, że to od Ciebie zależy wygląd wkręconej żarówki jak również to jakie światło będzie ona emitować.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-sufitowa-srebrna-zyrandol-oprawa-do-garderoby-na-korytarz-3x-e14', '', '', '', 'Nowoczesna lampa sufitowa srebrna żyrandol oprawa do garderoby na korytarz 3x E14', '', '', '', ''),
(80, 1, 1, 'Lampa dziecięca z uroczej kolekcji STAR to różowy żyrandol, który ozdobiony jest mieniącymi się kryształkami i gwiazdkami. Różowa lampa zamontowana na suficie będzie przywodzić na myśl gwieździste niebo i jednocześnie wywoływać uśmiech na twarzy każdego dziecka. Lampa dla dzieci współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa z gwiazdkami, w różowym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy STAR od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-rozowa-zyrandol-dla-dzieci-gwiazdki-star-3xe27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa różowa Żyrandol dla dzieci Gwiazdki STAR 3xE27 Metal i kryształki Milagro', '', '', '', ''),
(81, 1, 1, 'Lampa dziecięca z kolekcji CORAZON to uroczy żyrandol, w szarym kolorze, który zdobią fantazyjnie wiszące kryształki i serduszka. Szara lampa współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci za sprawą mieniących się kryształków wywoła uśmiech na twarzy każdego dziecka. Lampa z serduszkami, w szarym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy CORAZON od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-szara-zyrandol-glamour-serduszka-corazon-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa szara Żyrandol glamour Serduszka CORAZON 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(82, 1, 1, 'MILL 9135 to piękna lampa, która jest kwintesencją loftowego szyku. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa sufitowa, z ośmioma źródłami światła, odsłaniającymi żarówki, doskonale oświetlając całe pomieszczenie. Zwis będzie w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Z uwagi na swój intrygujący design i złote wykończenie, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość maksymalna lampy to 18 cm, a szerokość klosza wynosi 98 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-8xe27-pajak-retro-9135-mill-zlota-stal-sr-98-cm', '', '', '', 'Lampa sufitowa NOWODVORSKI 8xE27 Pająk Retro 9135 MILL Złota Stal Śr. 98 cm', '', '', '', ''),
(83, 1, 1, 'Lampa sufitowa FORM 9672 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w kształcie przypominającym muszlę wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny biały kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Plafon ma wymiary 80 x 26 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-4xe27-muszla-rozlozysta-biala-form-9672-lycra-stal-80cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 4xE27 Muszla Rozłożysta Biała FORM 9672 Lycra + Stal 80cm', '', '', '', ''),
(84, 1, 1, 'Duna to klasyczny plafon o jasnej, stonowanej barwie. Owalny kształt klosza doskonale podkreśli charakter każdego wnętrza. Lampa została wykonana z wysokiej jakości materiałów dzięki czemu świetnie prezentuje się,zachowując jednocześnie walory niezawodności.  Szklana lampa współgra z żarówką o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'plafon-p1-duna-biala-chrom-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Plafon P1 Duna biała chrom 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(85, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze białym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w cztery tradycyjne gniazda E14 do których możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-4xe14-polux-5901508311009', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 4xE14 Polux 5901508311009', '', '', '', ''),
(86, 1, 1, 'Żyrandol Greg został stworzony z myślą o miłośnikach stylu klasycznego. Lampa sufitowa z trzema punktami świetlnymi to doskonałe połączenie bieli i srebra, które nadaje całości eleganckiego i zarazem interesującego wyglądu. Klasyczna lampa cechuje się okrągłymi, szklanymi kloszami, które zostały wykonane z dbałością o detale. Metalowa oprawa lampy udekorowana jest krętymi, fantazyjnymi elementami, które doskonale dopełniają całości nadając lampie szyku i elegancji. Do produkcji lampy wykorzystano tylko materiały najwyższej jakości, dzięki czemu prezentuje się doskonale na każdym suficie. Lampa przystosowana jest do pracy z żarówkami o trzonku E14, o mocy maksymalnej 60W, wraz z którymi pięknie oświetli pomieszczenie.', '', 'zyrandol-lampa-sufitowa-greg-3x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa  Greg 3x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(87, 1, 1, 'Lampa sufitowa szklana GLOBE DOUBLE SMOKE-GREY wykonana w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym, kloszem okrągłym o średnicy 20cm, w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową GLOBE DOUBLE SMOKE-GREY firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-globe-double-20cm-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 GLOBE DOUBLE 20cm SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(88, 1, 1, 'Dodaj stylu swoim wnętrzom dzięki lampie ERIS GOLDPoznaj jej największe zalety! Lampa sufitowa ERIS GOLD wykonana została z dużą dbałością o szczegóły, dzięki czemu wygląda niezwykle elegancko. Jej aluminiowa obudowa wykończona czarną matową powłoką, niezwykle stylowo prezentuje się w połączeniu ze złotym środkiem. Oprawa idealnie komponuje się we wnętrzach minimalistycznych, nowoczesnych i urządzonych w stylu industrialnym. Sprawdzi się w takich pomieszczeniach jak sypialnia, salon, jadalnia czy korytarz. Jedną z jej największych zalet jest możliwość regulacji kąta padania światła w zakresie 90° w pionie i 350° wokół własnej osi. Pozwala to dokładnie doświetlić wybraną przestrzeń przy wykorzystaniu sześciu żarówek o trzonku GU10 i maksymalnej mocy 35 W.    GWINT GU10Lampa współpracuje z sześcioma żarówkami o trzonku GU10, umożliwia nam to  błyskawiczny montaż lub wymianę żarówki. Do oprawy z łatwością można dobrać energooszczędną żarówkę LED do max. 35W mocy. Dzięki temu możemy cieszyć się dobrze oświetloną przestrzenią, oszczędzając do 90% energii w porównaniu do tradycyjnych żarówek.  MATERIAŁ WYKONANIAPrezentowana lampa wykonana została z wysokiej jakości aluminium wykończonego czarną matową powłoką. Powstała z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  WYMIARY PRODUKTU Dzięki kompaktowym wymiarom lampa nadaje się do wykorzystania nawet w niewielkich pomieszczeniach, bez efektu przytłoczenia. długość całkowita: 1200 mmszerokość: 50 mmwysokość podstawy: 25 mmwysokość całkowita: 164 mmWymiary klosza:długość: 100 mmszerokość: 60 mm EFEKTOWNA OPRAWACzarna matowa obudowa lampy w połączeniu ze złotymi wnętrzami kloszy, wygląda niezwykle stylowo. Wspaniale wygląda dzięki temu we wnętrzach urządzonych w stylu nowoczesnym,  minimalistycznym czy industrialnym. Może być dopełnieniem aranżacji, w której zastosowano inne dodatki w kolorze czarnym lub być przyciągającym uwagę akcentem.   STOPIEŃ SZCZELNOŚCI IP20Oprawa przeznaczona jest do stosowania wewnątrz pomieszczeń. Oznacza to, że obudowa chroni nas przed porażeniem prądem przy próbie dotknięcia, jednak w żaden sposób nie jest zabezpieczona przed działaniem wody.  REGULACJA KĄTA PADANIA ŚWIATŁAWybierając lampę sufitową Eris Gold mamy możliwość płynnej regulacji ustawienia jej kloszy w dwóch płaszczyznach, 90° w pionie i 350° wokoło wokół własnej  osi. Pozwala to doświetlić wybraną przestrzeń według własnych potrzeb.   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Kupując u nas otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą. ', '', 'lampa-sufitowa-eris-spot-reflektor-oprawa-halogenowa-6xgu10-czarno-zlota', '', '', '', 'Lampa sufitowa ERIS SPOT Reflektor Oprawa Halogenowa 6xGU10 Czarno-Złota', '', '', '', ''),
