przeznaczona jest do stosowania wewnątrz pomieszczeń. Oznacza to, że obudowa chroni nas przed porażeniem prądem przy próbie dotknięcia, jednak w żaden sposób nie jest zabezpieczona przed działaniem wody.  REGULACJA KĄTA PADANIA ŚWIATŁAWybierając lampę sufitową Eris Gold mamy możliwość płynnej regulacji ustawienia jej kloszy w dwóch płaszczyznach, 90° w pionie i 350° wokoło wokół własnej  osi. Pozwala to doświetlić wybraną przestrzeń według własnych potrzeb.      GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Kupując u nas otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą. ', '', 'lampa-sufitowa-led-eris-gold-3x-gu10-regulowana', '', '', '', 'Lampa sufitowa LED ERIS GOLD 3x GU10 regulowana', '', '', '', ''),
(90, 1, 1, 'SZUKASZ NOWOCZESNEGO OŚWIETLENIA DO KUCHNI, SALONU LUB JADALNI?Postaw na lampę CAMILLA WHITE! Nowoczesna lampa wisząca CAMILLA WHITE marki Novodworski w kolorze białym idealnie sprawdzi się, jako oświetlenie główne w kuchni, salonie, a nawet sypialni. Wspaniale prezentuje się w jasnych, nowoczesnych wnętrzach. Jej lekki, druciany klosz z wnętrzem z wysokiej jakości tkaniny nie tylko staje się subtelnym akcentem w danym wnętrzu, ale także pięknie rozprasza światło. Dzięki użyciu materiałów i podzespołów najwyższej jakości zachowuje pełną funkcjonalność i doskonały wygląd przed długie lata. Z prezentowaną lampą współpracuje każda żarówka LED z trzonkiem E27 o maksymalnej mocy 40W LED. W zależności od temperatury barwowej wybranego źródła światła zyska nieco inny charakter.  POZNAJ NAJWIĘKSZE ZALETY LAMPY CAMILLA WHITE:  WYSOKA JAKOŚĆLampa CAMILLA WHITE wykonana została z dużą dbałością o szczegóły  z połączenia najwyższej jakości stali i tkaniny. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Lampa, przystosowana jest do pracy z energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 40W.  Z łatwością zatem możemy dobrać do niej energooszczędną żarówkę LED. Decydując się na jej zakup, możemy więc cieszyć się wydajnym źródłem światła przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWATkaninowy abażur umieszczony wewnątrz drucianego klosza lampy, łagodzi jej surowy charakter i przyjemnie rozprasza światło znajdującej się wewnątrz żarówki. Lampa będzie dzięki temu interesującym, ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o charakterze nowoczesnym.      WYMIARY LAMPYWymiary drucianego klosza lampy to średnica 28 cm x 24,5 cm wysokości. Maksymalna wysokość lampy to natomiast 120 cm.  REGULACJA WYSOKOŚCI Wysokość zawieszenia klosza prezentowanej lampy można dowolnie regulować. Pozwala to idealnie dopasować ją do warunków danego pomieszczenia i swoich preferencji. ŁATWY MONTAŻLampa jest dosyć lekka.  Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ TĘ LAMPĘ?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-wiszaca-nowodvorski-e27-druciana-loft-4611-camilla-biala-stal-sr-26-cm', '', '', '', 'Lampa wisząca NOWODVORSKI E27 Druciana Loft 4611 CAMILLA Biała Stal Śr. 26 cm', '', '', '', ''),
(91, 1, 1, 'SZUKASZ ZACHWYCAJĄCEGO OŚWIETLENIA DO SWOJEGO SALONU? Postaw na plafon JULIA!Plafon JULIA z 5 punktami świetlnymi ma ekskluzywny charakter. Stworzony został z wysokiej jakości chromowanego metalu oraz szkła, dzięki czemu prezentuje się niezwykle elegancko. Ze srebrnej błyszczącej oprawy wystają szklane sople. Podświetlone przez  żarówki umiejscowione wewnątrz plafonu, wyglądają one jak kapiące szkło. Lampa wspaniale prezentuje się we wnętrzach nowoczesnych, oraz takich urządzonych w stylu glamur, stając się ich mocnym akcentem. Doda klasy i reprezentacyjnego charakteru każdemu salonowi czy jadalni. Można ją wykorzystać także w sypialni. Będzie nie tylko efektownym dodatkiem, ale pomoże nam również uzyskać kameralną przytulną atmosferę. Warto podkreślić także, że plafon JULIA nie jest jedynie dekoracją, a stanowi wydajne i zarazem energooszczędne źródło światła.ODMIEŃ SWOJE WNĘTRZE DZIĘKI LAMPIE Z SERII DELIA!  *WYSOKA JAKOŚĆ *GWINT E14 *EFEKTOWNA OPRAWA    *WYMIARY LAMPY *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'plafon-led-panel-oprawa-sufitowa-lampa-5xe14-chrom-ip20', '', '', '', 'Plafon LED Panel Oprawa Sufitowa Lampa 5xE14 Chrom IP20', '', '', '', ''),
(92, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 9W i strumieniu świetlnym 480lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Oprawa będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻUGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-9w-led-gavi-2-bialy-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 9W LED GAVI 2 biały 3000K Polux', '', '', '', ''),
(93, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z trzema punktami świetlnymi w nowoczesnym stylu o mocy 13,5W i strumieniu świetlnym 720lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Oprawa będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-135w-led-gavi-3-bialy-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 13,5W LED GAVI 3 biały 3000K Polux', '', '', '', ''),
(94, 1, 1, 'Odmień swoje wnętrze dzięki lampie sufitowej GALAXI IPoznaj jej największe zalety!Potrójna lampa GALAXI I wykonana została z wysokiej jakości szkła i metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem wnętrza w stylu glamur jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako głowne źródło światła nie tylko w salonie, ale także w sypialni, kuchni czy jadalni. Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.POSTAW NA LAMPĘ GALAXI I OCZARUJ SWOICH GOŚCI! MATERIAŁ WYKONANIAPrezentowana lampa wyprodukowana jest z wysokiej jakości szkła i metalu pokrytego chromem. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje z trzema źródłami światła o trzonku  E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu GALAXI o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.      ŁATWOŚĆ MONTAŻULampa jest dosyć lekka. Jej montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędne od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 20 cm. Całkowita szerokość lampy to 45 cm.     GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'potrojna-lampa-sufitowa-k-8003-3g-z-serii-galaxy-i-3xe14-kaja', '', '', '', 'Potrójna lampa sufitowa K-8003-3G z serii GALAXY I 3xE14 Kaja', '', '', '', ''),
(95, 1, 1, 'Czy chcesz odmienić swoje wnętrze? Poznaj największe zalety LAMPY wiszącej lampy sufitowej z serii RAZONI!Ta nowoczesna lampa doskonale sprawdzi się jako oświetlenie ogólne w kuchni, sypialni, jadalni czy salonu. Współpracuje z jednym źródłem światła (brak żarówki w zestawie). Szeroki klosz lampy ma interesującą fakturę i jest cieniowany,  dzięki czemu piękne mieni się odcieniami srebra. Dużą zaletą prezentowanej lampy jest regulacja wysokości zawieszenia klosza. Pozwala to idealnie dopasować ją do własnego pomieszczenia i preferencji. Lampa wykonana jest z materiałów i podzespołów elektrycznych najwyższej jakości, dzięki czemu działa niezawodnie i zachowuje doskonały wygląd nawet po wielu latach użytkowania. POSTAW NA TĘ LAMPĘ RAZONI I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie. *REGULACJA WYSOKOŚCI  *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-wiszaca-sufitowa-razoni-chrom-akryl-1-x-e27', '', '', '', 'Lampa wisząca sufitowa RAZONI chrom + akryl 1 x E27', '', '', '', ''),
(96, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa sufitowo-ścienna SKRĘT z jednym punktem świetlnym w loftowym stylu charakteryzuje elegancki minimalizm idący w parze ze swobodą i artyzmem, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.kmTa lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!    *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.    *KLOSZ  *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-nodum-skret-czarny-do-led-1x-e27-lumiled', '', '', '', 'Lampa sufitowo-ścienna NODUM SKRĘT czarny do LED 1x E27 LUMILED', '', '', '', ''),
(97, 1, 1, 'Nowoczesny Żyrandol LED. Wyposażony został w 310 diod SMD 2835 LED które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie) który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami serii GALAX i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z serii GALAX za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 20 W a w przypadku barwy neutralnej 40W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria Galax charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.Specyfikacja:W zestawie:', '', 'lampa-sufitowa-zyrandol-led-galax-40w-czarny-pilot', '', '', '', 'Lampa Sufitowa Żyrandol LED Galax 40W czarny + Pilot', '', '', '', ''),
(98, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom SAMANTAPoznaj ich największe zalety! Kinkiet SAMANTA wykonany został z wysokiej jakości szkła i metalu. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Decydując się na te kinkiety, warto postawić na dekoracyjne żarówki typu filament. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Można z powodzeniem wykorzystać go również w pomieszczeniach urządzonych w stylu loft, czy boho, będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni. Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.DODAJ SWOIM WNĘTRZOM CHARAKTERU DZIĘKI KINKIETOM SAMANTA  MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E27Lampa współpracuje ze źródłem światła o trzonku E27 o maksymalnej mocy 40W. Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu SAMANTA wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.     ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki.  Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 23 cm. Całkowita szerokość lampy to 19 cm.  Wymiary klosza 15 cm x 23 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!   Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-k-8037-1-z-serii-samanta-1xe27-kaja', '', '', '', 'Lampa ścienna kinkiet K-8037-1 z serii SAMANTA 1xE27 Kaja', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(99, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom TROY GOLDPoznaj ich największe zalety!Lampa TROY GOLD o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metalu. Złoty, druciany klosz wygląda bardzo elegancko. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, ale także takich o bardziej klasycznym charakterze. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.WPROWADŹ NIEPOWTARZALNY KLIMAT DO SWOICH WNĘTRZ DZIĘKI LAMPIE TROY GOLD!   MATERIAŁ WYKONANIAPrezentowana lampa wyprodukowana jest z wysokiej jakości metalu. Powstała z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko.  GWINT E27Lampa współpracuje z dwoma źródłami światła o trzonku  E27 o maksymalnej mocy 60W.  Z łatwością dobierzemy do niej zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii.UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu TROY GOLD o okrągłym kształcie wykonana jest z wysokiej jakości metalu w kolorze czarnym. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.      ŁATWOŚĆ MONTAŻUSposób montażu polega na zamontowaniu lampy za pomocą akcesoriów montażowych dołączonych do lampy. Montaż powinien być dostosowany do efektu, który chcemy uzyskać  WYMIAR LAMPYSzerokość całkowita lampy wynosi 26 cm. Wymiary klosza 10 cm x 9 cm. Postawa kinkietu to 26 cm x 2 cm.  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań! sypialnia - lampa z serii TROY GOLD doskonale sprawdzają się w sypialni. Wyglądają niezwykle stylowo, są wydajnym źródłem nastrojowego światła. salon - lampa TROY GOLD sprawdzą się również w salonie jako  źródło światła w salonie. restauracja - lampa TROY GOLD to również doskonałe rozwiązanie do restauracji i kawiarni. Pomagają stworzyć kameralny nastrój.Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-na-listwie-2xe27-k-4781-z-serii-troy-gold-kaja', '', '', '', 'Lampa sufitowa na listwie 2xE27 K-4781 z serii TROY GOLD KAJA', '', '', '', ''),
(100, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na plafon CAMERON WHITE II Plafon CAMERON to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich subtelnym dodatkiem i efektywnym źródłem światła. Dzięki możliwości współpracy z 2 źródłami światła w postaci żarówek o trzonku E27 i max mocy 25W będzie wydajnym oświetleniem nawet dużego pomieszczenia. Lampa idealnie sprawdzi się w sypialni, salonie, czy pokoju dziennym.  POZNAJ NAJWIĘKSZE ZALETY LAMPY PLAFONU CAMERON WHITE II: WYSOKA JAKOŚĆPlafon CAMERON wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości tworzywa sztucznego i bardzo wytrzymałego papieru. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z dwoma energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 25W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa plafonu CAMERON WHITE II wygląda niezwykle nowocześnie. Dzięki temu jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.      WYMIARY LAMPYWymiary oprawy plafonu to średnica 35 cm x 15 cm wysokości. Plafon będzie wydajnym źródłem światła nawet w dużych pomieszczeniach.  WYDAJNE OŚWIETLENIEDzięki możliwości współpracy  z 2 żarówkami o maksymalnej mocy 25W lampa jest w stanie skutecznie wypełnić światłem nawet duże pomieszczenie.  ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ TĘ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-2xe27-okragla-biala-cameron-9605-pcv-35cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 2xE27 Okrągła Biała CAMERON 9605 PCV 35cm', '', '', '', ''),
(101, 1, 1, 'Kolekcja Kronos to seria lamp w różnych konfiguracjach. Wśród nich znaleźć możemy właśnie lampę sufitową z potrójnym punktem światła, gdzie w każdym z trzech ozdobnych kloszy znajdziemy jedno gniazdo. Sufitowe oświetlenie posiada klasyczny mały gwint E14, dzięki czemu bardzo łatwo możemy dobrać do nich energooszczędne żarówki LED dostępne w naszej ofercie. Nowoczesny kształt żyrandolu marki Milagro sprawdzi się jako piękny dodatek do współczesnego wystroju wnętrz. Okrągły i spłaszczony kształt  w połączeniu z zawsze modnym kolorem białym prezentują się znakomicie, wpisując się w obecnie panujące trendy. Tylko zakup markowych lamp zapewni ci najlepsza jakość oraz bardzo długi okres użytkowania.Lampa Sufitowa Świetnie Sprawdzi się:SPECYFIKACJA TECHNICZNA: Kupując u nas otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-kronos-3xe14-ip20-biala-metal-milagro', '', '', '', 'Lampa sufitowa żyrandol KRONOS 3xE14 IP20 Biała Metal Milagro', '', '', '', ''),
(102, 1, 1, 'Lampa sufitowa LAGUNA 8954 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w  okrągłym kształcie wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny ecru kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Plafon ma wymiary 50 x 13 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-3xe27-okragla-ecru-laguna-8954-pcv-stal-50cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 3xE27 Okrągła Ecru LAGUNA 8954 PCV + Stal 50cm', '', '', '', ''),
(103, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na plafon CAMERON!Plafon CAMERON to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich subtelnym dodatkiem i efektywnym źródłem światła. Dzięki średnicy 65 cm i możliwości współpracy aż z 4 źródłami światła w postaci żarówek o trzonku E27 i max mocy 25W będzie wydajnym oświetleniem nawet dużego pomieszczenia. Lampa idealnie sprawdzi się w sypialni, salonie, czy pokoju dziennym.  POZNAJ NAJWIĘKSZE ZALETY LAMPY PLAFONU CAMERON: WYSOKA JAKOŚĆPlafon CAMERON wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości tworzywa sztucznego i bardzo wytrzymałego papieru. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z czterema energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 25W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa plafonu CAMERON wygląda niezwykle nowocześnie. Dzięki temu jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.      WYMIARY LAMPYWymiary oprawy plafonu to średnica 65 cm x 20 cm wysokości. Plafon będzie wydajnym źródłem światła nawet w dużych pomieszczeniach.  WYDAJNE OŚWIETLENIEDzięki dużej średnicy plafonu i możliwości jego współpracy aż z 4 żarówkami o maksymalnej mocy 25W lampa jest w stanie skutecznie wypełnić światłem nawet duże pomieszczenie.  ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-4xe27-okragla-biala-cameron-9606-pcv-65cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 4xE27 Okrągła Biała CAMERON 9606 PCV 65cm', '', '', '', ''),
(104, 1, 1, 'Lampa sufitowa w uniwersalnym białym kolorze i nowoczesnej stylistyce skrywa w sobie wymienne moduły LED o łącznej mocy 36 W. Wykorzystanie modułu LED pozwala zmniejszyć koszty zużycia energii, nie wpływając na jakość źródła światła. Przyjemna dla oka barwa 4000 K wprowadza miły klimat do pomieszczeń i dba o odpowiedni nastrój. Lampa została wykonana z wysokiej jakości materiałów: metalu i akrylu. W zestawie znajdują się niezbędne elementy do jej montażu. Plafon zachwyca swoją estetyczną, a zarazem prostą formą. Zamieszczone na nim trzy źródła światła w kształcie pierścieni, przypominają elegancką biżuterię.  Biała lampa z powodzeniem znajdzie zastosowanie w każdym pomieszczeniu, bez różnicy czy będzie to jadalnia, kuchnia lub designerski salon.', '', 'lampa-sufitowa-ring-trzy-okregi-biale-36w-led-ip20-metal-i-akryl-styl-nowoczesny-milagro', '', '', '', 'Lampa sufitowa RING trzy okręgi białe 36W LED IP20 Metal i akryl styl nowoczesny Milagro', '', '', '', ''),
(105, 1, 1, 'Lampa sufitowa Megan to nowoczesna oprawa oświetleniowa o futurystycznym wyglądzie. Świetnie wykonana chromowana oprawa wraz z z półprzeźroczystymi kloszami nadaje lampie elegancki wygląd. Lampa została wykonana z materiałów wysokiej jakości, dzięki czemu wspaniale prezentuje się,zachowując przy tym walory niezawodności. Kompatybilna z żarówką E14 o mocy 40W (brak w zestawie).', '', 'lampa-sufitowa-megan-55-5xe14-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Megan 5+5 5xE14 Metal i szkło Lampex', '', '', '', ''),
(106, 1, 1, 'Lampa sufitowa w nieco surowym wydaniu została stworzona dzięki zainspirowaniu się starodawnymi lampami. Żyrandol świetnie sprawdzi się we wnętrzach w stylu industrialnym bądź retro. Lampa loft współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej 60 W (brak w zestawie), wraz z którymi stworzy spektakularny efekt. Czarna lampa z solidnymi i metalowymi kloszami nada pomieszczeniu nieco surowości i jednocześnie podkreśli jego walory. Lampa retro przyciąga wzrok i sprawia, że nie sposób przejść obok niej obojętnie. Lampa świetnie sprawdzi się w salonie czy jadalni, gdzie zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą.Lampa świetnie sprawdzi się w:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-czarna-zyrandol-3-klosze-3x-e27-czarna-styl-loft-retro-metal', '', '', '', 'Lampa sufitowa czarna Żyrandol 3 klosze 3x E27 Czarna Styl loft Retro Metal', '', '', '', ''),
(107, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z czterema punktami świetlnymi w nowoczesnym stylu o mocy 18W i strumieniu świetlnym 960lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI! *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻUGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-18w-led-gavi-4-bialy-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 18W LED GAVI 4 biały 3000K Polux', '', '', '', ''),
(108, 1, 1, 'Plafon Liger to nowoczesna oprawa oświetleniowa o nietuzinkowym kształcie. Perfekcyjne połączenie metalu i szkła nadaje mu niepowtarzalnego charakteru a jego znakiem szczególnym są futurystyczne, okrągłe klosze. Dołączony do zestawu pilot umożliwia zdalne włączanie lub wyłączanie Produkt został wykonany z najwyższej jakości materiałów, dzięki czemu będą mogli Państwo cieszyć się nim przez długie lata. Szczególnie polecany do nowoczesnych, stylowych wnętrz. Kompatybilny z żarówką LED o mocy 51W (brak w zestawie).  ', '', 'lampa-sufitowa-liger-6-led-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Liger 6 LED Metal i szkło Lampex', '', '', '', ''),
(109, 1, 1, 'LISTWA LED Polux  z kolekcji CAPRI w kolorze czarnym, z 2-oma źródłami światła idealnie sprawdzi się w różnych pomieszczeniach typu łazienka, kuchnia, biuro/gabinet urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K, dzięki wbudowanym do oprawy diodom led.Nowoczesny model i charakterystyczny, okrągły kształt opraw ledowych w czarnej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru. Praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako główne lub dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-capri-2x5w-czarna-3000k', '', '', '', 'Listwa LAMPA SUFITOWA LED Polux CAPRI  2x5W CZARNA 3000K', '', '', '', ''),
