(111, 1, 1, 'LISTWA LED Polux  z 3-ema źródłami światła w kolorze białym, o mocy 3x5W o ciepłej, przyjemniej, białej barwie 3000K idealnie rozświetli Twoje wnętrze. Listwa świetni sprawdzi się w pomieszczeniach typu  łazienka, kuchnia oraz gabinety/biura urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia pod dowlnym kątem 3-ech źródeł światła sprawisz, że padające promienie idealnie rozświetlą wybraną przez Ciebie przestrzeń.   Nowoczesny design oraz chrakterystyczny, okrągły kształt opraw ledowych w białej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.. Praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako główne lub dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-capri-3x5w-biala-3000k', '', '', '', 'Listwa LAMPA SUFITOWA LED Polux CAPRI  3x5W BIAŁA 3000K', '', '', '', ''),
(112, 1, 1, 'Quado to nowoczesna lampa sufitowa o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na suficie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Lampa sufitowa współgra z żarówkami o trzonku GU10 oraz mocy max 40W (brak w zestawie).', '', 'lampa-sufitowa-plafon-quado-deluxe-2-bialy-2xgu10-metal-styl-nowoczesny-lampex', '', '', '', 'Lampa sufitowa plafon Quado DELUXE 2 biały 2xGU10 Metal styl nowoczesny Lampex', '', '', '', ''),
(113, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom WATSOPoznaj ich największe zalety!Potrójny kinkiet WATSO wykonany został z wysokiej jakości metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych. Może być ciekawym przełamaniem aranżacji w stylu loftowym. Sprawdzi się jako dodatkowe źródło światła w salonie, w sypialni czy jadalni.  Można go wykorzystać również w korytarzu, garderobie czy jako oświetlenie schodów.LAMPA SUFITOWA WATSO TO EFEKTOWNE I WYDAJNE ŹRÓDŁO ŚWIATŁA  MATERIAŁ WYKONANIAPrezentowana lampa wykonana jest z wysokiej jakości metalu malowanego na biało. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje z trzema źródłami światła o trzonku  E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWARegulowana lampa WATSO nadaje się do wykorzystania jako lampa sufitowa w pomieszczeniach o różnym przeznaczeniu. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem jest efektywnym źródłem światła.      ŁATWOŚĆ MONTAŻULampa jest dosyć lekka. Jej montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędne od przymocowania lampy.   WYMIAR LAMPYWysokość całkowita lampy wynosi 23 cm. Całkowita szerokość lampy to natomiast 54 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'potrojna-lampa-sufitowa-k-8005-3-watso-white-3xe14-kaja', '', '', '', 'Potrójna lampa sufitowa K-8005-3 WATSO WHITE 3xE14 Kaja', '', '', '', ''),
(114, 1, 1, 'Lampa dziecięca z serii ANGELICA to uroczy żyrandol, który współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci posiada wiszące kryształki i motylki, które razem znakomicie się prezentują i wywołają uśmiech na twarzy każdego dziecka. Lampa z motylkami w szarym kolorze wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Wszystkie modele z kolekcji ANGELICA wykonano z połączenia bezpiecznego metalu oraz akrylu. Żyrandole od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-szara-zyrandol-angelica-motyle-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa szara Żyrandol ANGELICA Motyle 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(115, 1, 1, 'Lampa sufitowa EYE SUPER 6497 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Trzy gwinty GU10 zostały zamknięte w stalowym kloszu i wbudowane w oprawę w kształcie metalowej tuby, o uniwersalnym grafitowym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na regulowanym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza. Lampa EYE SUPER 6497 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design szczególnie polecany do sypialni, salonu bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 52 cm, zaś abażur ma wymiar 20 x 5,5 cm. Oświetlenie może osiągać szerokość maksymalną 135 cm.  Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.  Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-3xgu10-grafitowa-ruchomy-klosz-eye-super-6497-stal', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI 3xGU10 Grafitowa Ruchomy Klosz EYE SUPER 6497 Stal', '', '', '', ''),
(116, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom FONSPoznaj ich największe zalety!Kinkiet FONS wykonany został z wysokiej jakości szkła i metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem wnętrza w stylu glamur jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.POSTAW NA KINKIETY FONS I OCZARUJ SWOICH GOŚCI!    MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu pokrytego chromem. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje ze źródłem światła o trzonku E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.     ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki. Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędne od przymocowania lampy.   WYMIAR LAMPYWysokość całkowita lampy wynosi 28 cm. Całkowita szerokość lampy to 17 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!    Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-k-jsl-1302-1w-z-serii-fons-1xe14-kaja', '', '', '', 'Lampa ścienna kinkiet K-JSL-1302/1W z serii FONS 1xE14 Kaja', '', '', '', ''),
(117, 1, 1, 'BOLD 9392 to designerka, bardzo efektowna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Betonowa forma w kształcie kostki/sześcianu. Wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego modernistycznych stylach. Oprawa ma futurystyczny betonowy kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Klosz ma wymiary 14 x 14,5 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 75W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-spot-nowodvorski-gu10-betonowa-szara-kostka-14cm-shy-9392', '', '', '', 'Lampa sufitowa spot NOWODVORSKI GU10 Betonowa Szara Kostka 14cm SHY 9392', '', '', '', ''),
(118, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na plafon CAMERON GRAY!Plafon CAMERON GRAY to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich subtelnym dodatkiem i efektywnym źródłem światła. Dzięki możliwości współpracy z 2 źródłami światła w postaci żarówek o trzonku E27 i max mocy 25W będzie wydajnym oświetleniem nawet dużego pomieszczenia. Lampa idealnie sprawdzi się w sypialni, salonie, czy pokoju dziennym. Można ją wykorzystać także w kuchni, czy jadalni.  POZNAJ NAJWIĘKSZE ZALETY LAMPY PLAFONU CAMERON GRAY:   WYSOKA JAKOŚĆPlafon CAMERON GRAY wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości tworzywa sztucznego i bardzo wytrzymałego papieru. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z dwoma energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 25W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa plafonu CAMERON GRAY wygląda niezwykle nowocześnie. Dzięki temu jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.      WYMIARY LAMPYWymiary oprawy plafonu to średnica 35 cm x 15 cm wysokości. Plafon będzie wydajnym źródłem światła nawet w dużych pomieszczeniach.  WYDAJNE OŚWIETLENIEDzięki dużej średnicy plafonu i możliwości jego współpracy z 2 żarówkami o maksymalnej mocy 25W lampa jest w stanie skutecznie wypełnić światłem nawet duże pomieszczenie.  ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-2xe27-okragla-szara-cameron-9687-pcv-sr35-cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 2xE27 Okrągła Szara CAMERON 9687 PCV Śr.35 cm', '', '', '', ''),
(119, 1, 1, 'Noa to jedyna w swoim rodzaju lampa sufitowa, która charakteryzuje się kloszami o kształcie kielichów kwiatowych. Oprawa oświetleniowa będzie się genialnie prezentować na każdym suficie. Pięć punktów świetlnych spokojnie wystarczy, aby wypełnić jasnością każdą wymaganą przestrzeń. Klasyczny wygląd zadowoli miłośników tego jakże wyrafinowanego stylu. Urokliwe oświetlenie sprawi, że wnętrze zyska subtelny element dekoracyjny. Najwyższa jakość metalu i szkła, z których produkt został wykonany pozwoli cieszyć się trwałością oraz niezawodnością przez długi czas.  Szklana lampa współgra z żarówkami o trzonku E14 oraz mocy max 40W (brak w zestawie).', '', 'lampa-sufitowa-noa-kwiaty-5-5xe14-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Noa Kwiaty 5 5xE14 Metal i szkło Lampex', '', '', '', ''),
(120, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!Lampa sufitowa ROMEO marki POLUX w kolorze chromu w eleganckim stylu z dwoma punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, modnych bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.Produkt ten, z pewnością przypadnie do gustu wszystkim wielbicielom klasycznych rozwiązań. POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!*MATERIAŁ WYKONANIA*2x GWINT G9UWAGA! Brak źródła światła w komplecie.*KLOSZ*ŁATWOŚĆ MONTAŻU   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'plafon-lampa-sufitowa-oprawa-romeo-szklana-chrom-krysztalki-2x-g9-polux', '', '', '', 'Plafon lampa sufitowa oprawa ROMEO szklana chrom kryształki 2x G9 Polux', '', '', '', ''),
(121, 1, 1, 'Lampa sufitowa o eleganckim wyglądzie została zaprojektowana z myślą o nowoczesnych i minimalistycznych wnętrzach. Lampa posiada trzy źródła światła LED, które pięknie rozświetlą każde pomieszczenie. Oprawa LED posiada zainstalowane na stałe moduły LED o mocy 15 W i strumieniu świetlnym wynoszącym 1050 lm. Lampa LED emituje neutralną i przyjemną dla oka barwę 4000 K, która wiernie odzwierciedla kolory oświetlanych przedmiotów i wprowadza przyjemny nastrój. W zestawie oprócz lampy znajdują się wszystkie niezbędne elementy przeznaczone do montażu. Nieskomplikowany design lampy sprawia, że można ją wkomponować w niemal każdą aranżację. Produkt objęty jest 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.\"', '', 'lampa-sufitowa-led-chrom-ice-15w-ip20-metal-i-akryl-milagro', '', '', '', 'Lampa sufitowa LED Chrom ICE 15W IP20 Metal i akryl Milagro', '', '', '', ''),
(122, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWO-WISZĄCEJ!Lampa MORA CHROME marki POLUX w kolorze chromu, w nowoczesnym stylu z czterema punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, modnych bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.Produkt ten, z pewnością przypadnie do gustu wszystkim wielbicielom klasycznych i nowoczesnych rozwiązań. POSTAW NA TĘ LAMPĘ SUFITOWO-WISZĄCĄ I OCZARUJ SWOICH GOŚCI! *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie. *ŁATWOŚĆ MONTAŻU*CZTERY OPRAWY*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-wiszaca-mora-chrome-chrom-vintage-retro-4x-e27-polux', '', '', '', 'Lampa sufitowa wisząca MORA CHROME chrom vintage retro 4x E27 Polux', '', '', '', ''),
(123, 1, 1, 'Odmień swoje wnętrze lampie z serii DEFISPoznaj jej największe zalety!Lampa DEFIS wykonana została z wysokiej jakości szkła i metalu. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Decydując się na te kinkiety, warto postawić na dekoracyjne żarówki typu filament. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Można z powodzeniem wykorzystać go również w pomieszczeniach urządzonych w stylu loft, czy boho, będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni. Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.DODAJ SWOIM WNĘTRZOM CHARAKTERU DZIĘKI LAMPIE DEFIS  MATERIAŁ WYKONANIAPrezentowana lampa wykonana jest z wysokiej jakości szkła i metalu. Powstał z dużą dbałością o szczegóły, dzięki czemu jest bardzo elegancki i wygląda doskonale, nawet po wielu latach użytkowania.  GWINT E14Lampa współpracuje ze źródłem światła o trzonku E14 o maksymalnej mocy 25W. Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa potrójnej regulowanej lampy DEFIS o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.       ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki. Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.   WYMIAR LAMPYWysokość całkowita lampy wynosi 17 cm. Całkowita szerokość lampy to 59 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-regulowana-k-8113-z-serii-defis-3xe14-kaja', '', '', '', 'Lampa sufitowa regulowana K-8113 z serii DEFIS 3xE14 Kaja', '', '', '', ''),
(124, 1, 1, 'Lampa sufitowa z czterema punktami świetlnymi serii DYLAN, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27). Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni ze złotem oraz miedzianego odcienia żarówki sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.DYLAN idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-w-stylu-industrialnym-czarna-milagro-dylan-4x-e27', '', '', '', 'Lampa sufitowa w stylu industrialnym czarna MiLAGRO DYLAN 4x E27', '', '', '', ''),
(125, 1, 1, 'MILL 9136 to piękna lampa, która jest kwintesencją loftowego szyku. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa wisząca, z trzema źródłami światła, odsłaniającymi żarówki, doskonale oświetlając całe pomieszczenie. Zwis będzie w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Z uwagi na swój intrygujący design i złote wykończenie, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Głębokość lampy to 15,5 cm, a szerokość klosza wynosi 60 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-3xe27-pajak-retro-9136-mill-zlota-stal-sr-98-cm', '', '', '', 'Lampa sufitowa NOWODVORSKI 3xE27 Pająk Retro 9136 MILL Złota Stal Śr. 98 cm', '', '', '', ''),
(126, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na plafon CAMERON WHITE III!Plafon CAMERON WHITE III to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich subtelnym dodatkiem i efektywnym źródłem światła. Dzięki średnicy 65 cm i możliwości współpracy aż z 3 źródłami światła w postaci żarówek o trzonku E27 i max mocy 25W będzie wydajnym oświetleniem nawet dużego pomieszczenia. Lampa idealnie sprawdzi się w sypialni, salonie, czy pokoju dziennym.  POZNAJ NAJWIĘKSZE ZALETY LAMPY PLAFONU CAMERON WHITE III:   WYSOKA JAKOŚĆPlafon CAMERON wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości tworzywa sztucznego i bardzo wytrzymałego papieru. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z trzema energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 25W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa plafonu CAMERON wygląda niezwykle nowocześnie. Dzięki temu jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.     WYMIARY LAMPYWymiary oprawy plafonu to średnica 45 cm x 30 cm wysokości. Dzięki swoim rozmiarom prezentowany plafon będzie wydajnym źródłem światła nawet w dużych pomieszczeniach.  WYDAJNE OŚWIETLENIEDzięki dużej średnicy plafonu i możliwości jego współpracy aż z 3 żarówkami o maksymalnej mocy 25W lampa jest w stanie skutecznie wypełnić światłem nawet duże pomieszczenie.  ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-3xe27-okragla-biala-cameron-9684-pcv-45cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 3xE27 Okrągła Biała CAMERON 9684 PCV 45cm', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(127, 1, 1, 'Odmień swoje wnętrze dzięki oryginalnej lampie z serii NOKAPoznaj jej największe zalety!Lampa sufitowa z serii NOKA wykonana została z wysokiej jakości metalu pomalowanego na czarno. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym dodatkiem do wnętrz urządzonych w stylu loft i industrialnym.   Sprawdzi się jako główne źródło światła nie tylko w salonie, ale także w sypialni, kuchni czy jadalni. Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.DODAJ SWOIM WNĘTRZOM CHARAKTERU DZIĘKI LAMPIE NOKA  MATERIAŁ WYKONANIAPrezentowana lampa wyprodukowana jest z wysokiej jakości  metalu pomalowanego na czarno. Powstała z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko i na bardzo długo zachowuje doskonały wygląd.  GWINT E127Lampa współpracuje z czterema źródłami światła o trzonku E27 o maksymalnej mocy 25W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWACzarne, metalowe klosze z wnętrzami w barwie miedzi sprawiają, że lampa świeci przyjemnym miękkim świtłem.  Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt ciepłego światła. ŁATWOŚĆ MONTAŻULampa jest dosyć lekka. Jej montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.   WYMIAR LAMPYWysokość całkowita lampy wynosi 17 cm. Całkowita szerokość lampy to 73 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!    Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-regulowana-k-8117-z-serii-noka-4xe27-kaja', '', '', '', 'Lampa sufitowa regulowana K-8117 z serii NOKA 4xE27 Kaja', '', '', '', ''),
(128, 1, 1, 'Lampa sufitowa ze stali PIPE BENT wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt estetycznie wykonany w kolorze czarnym. Lampa współpracuje z żarówkami o trzonku 6 x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową PIPE BENT firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-stal-vintage-1906-pipe-bent-6-x-e27-czarna-ledvance', '', '', '', 'Lampa Sufitowa Stal VINTAGE 1906 PIPE BENT 6 x E27 Czarna LEDVANCE', '', '', '', ''),
(129, 1, 1, 'Lampa sufitowa z trzema punktami świetlnymi (3 klosze) serii DAMA BLACK, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Czarny klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-w-stylu-skandynawskim-czarna-milagro-dama-3x-e27-drewno-metal', '', '', '', 'Lampa sufitowa w stylu skandynawskim czarna MiLAGRO DAMA 3x E27 Drewno + metal', '', '', '', ''),
(130, 1, 1, 'Lampa dziecięca z uroczej kolekcji STAR to szary żyrandol, który ozdobiony jest mieniącymi się kryształkami i gwiazdkami. Szara lampa zamontowana na suficie będzie przywodzić na myśl gwieździste niebo i jednocześnie wywoływać uśmiech na twarzy każdego dziecka. Lampa dla dzieci współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa z gwiazdkami, w szarym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy STAR od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-szara-zyrandol-dla-dzieci-gwiazdki-star-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa szara Żyrandol dla dzieci Gwiazdki STAR 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(131, 1, 1, 'Lampa dziecięca z uroczej kolekcji STAR to biały żyrandol, który ozdobiony jest mieniącymi się kryształkami i gwiazdkami. Biała lampa zamontowana na suficie będzie przywodzić na myśl gwieździste niebo i jednocześnie wywoływać uśmiech na twarzy każdego dziecka. Lampa dla dzieci współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa z gwiazdkami, w białym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy STAR od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-biala-zyrandol-dla-dzieci-gwiazdki-star-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa biała Żyrandol dla dzieci Gwiazdki STAR 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(132, 1, 1, 'Lampa dziecięca z kolekcji CORAZON to uroczy żyrandol, w białym kolorze, który zdobią fantazyjnie wiszące kryształki i serduszka. Biała lampa współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci za sprawą mieniących się kryształków wywoła uśmiech na twarzy każdego dziecka. Lampa z serduszkami, w białym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy CORAZON od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-biala-zyrandol-dla-dzieci-serduszka-corazon-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa biała Żyrandol dla dzieci Serduszka CORAZON 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(133, 1, 1, 'Lampa dziecięca z serii ANGELICA to uroczy żyrandol, w fioletowym kolorze, który współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci posiada wiszące kryształki i motylki, które razem znakomicie się prezentują i wywołają uśmiech na twarzy każdego dziecka. Lampa z motylkami w fioletowym kolorze wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Wszystkie modele z kolekcji ANGELICA wykonano z połączenia bezpiecznego metalu oraz akrylu. Żyrandole od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-fioletowa-zyrandol-angelica-motyle-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa fioletowa Żyrandol ANGELICA Motyle 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(134, 1, 1, 'Lampa sufitowa EYE SUPER 6491 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Trzy gwinty GU10 zostały zamknięte w stalowym kloszu i wbudowane w oprawę w kształcie metalowej tuby, o uniwersalnym białym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowę została zawieszona na regulowanym zawiesiu, dodatkowo możemy manipulować źródłem światła, dzięki regulowanej konstrukcji klosza. Lampa EYE SUPER 6491 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design — szczególnie polecany do sypialni, salonu bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 52 cm, zaś abażur ma wymiar 20 x 5,5 cm. Oświetlenie może osiągać szerokość maksymalną 135 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-3xgu10-biala-ruchomy-klosz-eye-super-6491-stal', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI 3xGU10 Biała Ruchomy Klosz EYE SUPER 6491 Stal', '', '', '', ''),
(135, 1, 1, 'Żyrandol kryształowy Hissar to produkt niezwykle nowoczesny, elegancki i luksusowy. Pilot dołączony do lampy pozwala na zdalne włączanie lub wyłączanie lampy oraz zmianę barwy światła. Lampa sufitowa pracuje z czterema żarówkami o trzonku E14, o mocy maksymalnej wynoszącej 40W (brak w zestawie), dzięki czemu można dobrać barwę światła i moc do własnych potrzeb i preferencji. Żyrandol charakteryzuje się doskonałym połączeniem metalu i szkła. Znakiem szczególnym tej lampy sufitowej jest duża ilość zdobień: kryształki i fantazyjne kółka, które doskonale się ze sobą komponują i wprowadzają we wnętrza odrobinę elegancji i luksusu.', '', 'zyrandol-krysztalowy-lampa-sufitowa-hissar-4x-e14-metal-i-szklo-lampex-styl-glamour-pilot', '', '', '', 'Żyrandol kryształowy Lampa sufitowa Hissar 4x E14 Metal i szkło Lampex Styl Glamour + pilot', '', '', '', ''),
(136, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na plafon CAMERON GRAY!Plafon CAMERON to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich subtelnym dodatkiem i efektywnym źródłem światła. Dzięki średnicy 65 cm i możliwości współpracy aż z 4 źródłami światła w postaci żarówek o trzonku E27 i max mocy 25W będzie wydajnym oświetleniem nawet dużego pomieszczenia. Lampa idealnie sprawdzi się w sypialni, salonie, czy pokoju dziennym.  POZNAJ NAJWIĘKSZE ZALETY LAMPY PLAFONU CAMERON:   WYSOKA JAKOŚĆPlafon CAMERON wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości tworzywa sztucznego i bardzo wytrzymałego papieru. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z czterema energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 25W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa plafonu CAMERON wygląda niezwykle bardzo nowocześnie. Dzięki temu jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.      WYMIARY LAMPYWymiary oprawy plafonu to średnica 65 cm x 20 cm wysokości. Plafon będzie wydajnym źródłem światła nawet w dużych pomieszczeniach.  WYDAJNE OŚWIETLENIEDzięki dużej średnicy plafonu i możliwości jego współpracy aż z 4 żarówkami o maksymalnej mocy 25W lampa jest w stanie skutecznie wypełnić światłem nawet duże pomieszczenie.  ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-4xe27-okragla-szara-cameron-9682-pcv-65cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 4xE27 Okrągła Szara CAMERON 9682 PCV 65cm', '', '', '', ''),
(137, 1, 1, 'Lampa Kolorado to doskonałe połączenie bieli i półprzejrzystego szkła. Klosz został wykonany z dbałością o każdy detal, dzięki czemu wygląda wspaniale. Lampa zapewnia dużą ilość światła, a jej dodatkowym atutem jest łatwy w czyszczeniu klosz.Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'plafon-kolorado-p1-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Plafon Kolorado P1 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(138, 1, 1, 'LISTWA LED Polux  z kolekcji CAPRI w kolorze białym, z 2-oma źródłami światła idealnie sprawdzi się w różnych pomieszczeniach typu łazienka, kuchnia, biuro/gabinet urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K, dzięki wbudowanym do oprawy diodom led.Nowoczesny model i chrakterystyczny, okrągły kształt opraw ledowych w białej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.. Praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako główne lub dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-capri-2x5w-biala-3000k', '', '', '', 'Listwa LAMPA SUFITOWA LED Polux CAPRI  2x5W BIAŁA 3000K', '', '', '', ''),
(139, 1, 1, 'LISTWA SUFITOWA LED marki Polux z kolekcji Fucidi w kolorze białym z 2-oma źródłami światła. Lampa sufitowa świetnie sprawdzi się w różnych pomieszczeniach typu: kuchnia, łazienka, biuro/sklep urządzonych w stylu klasycznym i nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K dzięki wbudowanym do oprawy diodom led. Nowoczesne i praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako głowne lub dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw sufitowych led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-ficudi-2x6w-kolor-bialy-3000k', '', '', '', 'Listwa LAMPA Sufitowa LED Polux Ficudi 2x6W Kolor BIAŁY 3000K', '', '', '', ''),
(140, 1, 1, 'Lampa sufitowa z jednym punktem świetlnym serii DYLAN, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27). Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni ze złotem oraz miedzianego odcienia żarówki sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.DYLAN idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-w-stylu-industrialnym-czarna-milagro-dylan-1x-e27', '', '', '', 'Lampa sufitowa w stylu industrialnym czarna MiLAGRO DYLAN 1x E27', '', '', '', ''),
(141, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Sofia w kolorach czarno-mieździowym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Sofia która została wyposażona w podwójne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Przy połączeniu ozdobnych żarówek Led oraz czarnego klosza wykonanego z drutu uzyskamy niesamowity efekt który doda naszym wnętrzom charakteru i ciekawszego wyglądu. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-sofia-2xe14-polux-5901508310941', '', '', '', 'Oprawa ścienna KINKIET Spot Sofia 2xE14 Polux 5901508310941', '', '', '', ''),
(142, 1, 1, 'SILMA LED to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX, która cechuje się nowoczesnym designem w okrągłym płaskim kształcie z możliwością regulacji. Oprawa ścienno-sufitowa została wyposażona w zintegrowane źródło światła o mocy 6W w barwie 3000K - biały ciepły emitujących strumień świetlny na poziomie 320lm. SILMA przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kinkiet LED, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Decydując się na zakup prezentowanej oprawy ścienno-sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. Kanlux SILMA to seria opraw o nietypowym, futurystycznym kształcie. Ciekawy design opraw to przede wszystkim płaskie klosze tych opraw ze zintegrowanymi źródłami światła LED. Polecamy do nowoczesnych, modernistycznych wnętrz.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 24440Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-silma-6w-3000k-ciepla-chrom-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SILMA 6W 3000K Ciepła Chrom Kanlux', '', '', '', ''),
(143, 1, 1, 'MOLI EL-4I to wykonany z najlepszej jakości stali kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chrom/mat, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w cztery punkty świetlne, do których możemy zamontować żarówki z trzonkiem GU10 o maksymalnej mocy 4x 50W. MOLI przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux MOLI to rodzina opraw przywodząca na myśl styl retro. Satynowy chrom o opływowych kształtach stanie się ozdoba wnętrz domowych. Decydując się na zakup prezentowanej oprawy ścienno sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 7088 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-moli-4x-gu10-chrom-mat-80cm-kanlux', '', '', '', 'Oprawa Lampa Sufitowa MOLI 4x GU10 CHROM MAT 80cm Kanlux', '', '', '', ''),
(144, 1, 1, 'LAMPA SONDA to wykonany z najlepszej jakości stali kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chrom/mat, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w dwa punkty świetlne, do których możemy zamontować żarówki z trzonkiem GU10 o maksymalnej mocy 2x 50W. SONDA przystosowana jest do nadbudowania na ściane i suficie. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Futurystyczna lampa o nietypowym kształcie, idealna przede wszystkim do wnętrz urządzonych w nowoczesnym stylu. Wykonana z całości ze stali, stanie się dyskretną ozdobą każdego pomieszczenia. Reflektor możemy ustawić w dowolnej pozycji.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 4796 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-sonda-2x-gu10-chrom-mat-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SONDA 2x GU10 CHROM MAT Kanlux', '', '', '', ''),
(145, 1, 1, 'Lampa sufitowa Wenecja to elegancka lampa w stylu glamour. Klasyczna lampa posiada finezyjny abażur spod którego zwisają akrylowe kryształki, które sprawiają, że lampa ta będzie się pięknie prezentować w  każdym wnętrzu. Lampa z abażurem została wykonana z materiałów wysokiej jakości, dzięki czemu będzie służyć niezawodnie przez długi czas. Lampa współpracuje z żarówką o trzonku E27 o mocy maksymalnej 60W, wraz z którą pięknie oświetli wnętrze i wprowadzi w nie niepowtarzalną atmosferę.', '', 'lampa-sufitowa-wenecja-biala-1xe27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Lampa sufitowa Wenecja Biała 1xE27 Metal abażur tkanina kryształki Lampex styl glamour', '', '', '', ''),
(146, 1, 1, 'Lampa sufitowa EYE SUPER 6496 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o uniwersalnym grafitowym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na  sztywnym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza.  Lampa EYE SUPER 6496 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design - szczególnie polecany  do sypialni nad łóżko, bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 77 cm, zaś abażur ma wymiar 20 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnętrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-gu10-grafitowa-ruchomy-klosz-eye-super-6496-stal-77-cm', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI GU10 Grafitowa Ruchomy Klosz EYE SUPER 6496 Stal 77 cm', '', '', '', ''),
(147, 1, 1, 'Żyrandol Amor to nowoczesna oprawa oświetleniowa z dwoma punktami świetlnymi. Chromowana oprawa oraz akrylowe klosze nadają lampie niespotykany wygląd i styl. Lampa została wykonana z materiałów najwyższej jakości, dzięki czemu wspaniale się prezentuje.  Lampa sufitowa współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'zyrandol-lampa-sufitowa-amor-2-2xe27-srebrny-chrom-metal-i-szklo-styl-nowoczesny-lampex', '', '', '', 'Żyrandol Lampa sufitowa Amor 2 2xE27 Srebrny Chrom Metal i szkło styl nowoczesny Lampex', '', '', '', ''),
(148, 1, 1, 'Maja to klasyczna lampa sufitowa, która wyróżnia się doskonale wykonanym metalowym korpusem. Jej znakiem szczególnym są piękne, kolorowe abażury wykonane z dbałością o najmniejszy detal. Oprawa została wykonana z materiałów najwyższej jakości, dzięki czemu prezentuje się wspaniale, zachowując jednocześnie walory niezawodności.  Okrągła lampa współgra z żarówkami o trzonku E14 oraz mocy max 60W (brak w zestawie).', '', 'lampa-sufitowa-maja-3xe14-metal-i-abazur-tkanina-styl-klasyczny-lampex', '', '', '', 'Lampa sufitowa Maja 3xE14 Metal i abażur tkanina styl klasyczny Lampex', '', '', '', ''),
(149, 1, 1, 'Żyrandol Greg został stworzony z myślą o miłośnikach stylu klasycznego. Lampa sufitowa z pięcioma punktami świetlnymi to doskonałe połączenie bieli i srebra, które nadaje całości eleganckiego i zarazem interesującego wyglądu. Klasyczna lampa cechuje się okrągłymi, szklanymi kloszami, które zostały wykonane z dbałością o detale. Metalowa oprawa lampy udekorowana jest krętymi, fantazyjnymi elementami, które doskonale dopełniają całości nadając lampie szyku i elegancji. Do produkcji lampy wykorzystano tylko materiały najwyższej jakości, dzięki czemu prezentuje się doskonale na każdym suficie. Lampa przystosowana jest do pracy z żarówkami o trzonku E14, o mocy maksymalnej 60W, wraz z którymi pięknie oświetli pomieszczenie.', '', 'zyrandol-lampa-sufitowa-greg-5x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa  Greg 5x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(150, 1, 1, 'Lampa sufitowa szklana CONE SPOT SMOKE-GREY wykonana w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym kloszem w kształcie stożka w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku 3x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CONE SPOT SMOKE-GREY firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-cone-spot-3xe27-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CONE SPOT 3xE27 SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(151, 1, 1, 'Lampa ścienna z trzema czarnymi oprawkami, w których można zamontować żarówki LED o trzonku GU10 to produkt wysokiej jakości ze źródłem światła LED w komplecie. Kinkiet został stworzony po to, aby pięknie oświetlić garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu. Dołączone do kompletu żarówki LED o mocy 3W i białej ciepłej barwie światła wprowadzą przyjemną atmosferę i oświetlą pięknym, optymistycznym światłem ciemny korytarz czy garderobę. Nowoczesny design lampy, zaprojektowany w zgodzie z najnowszymi trandami, to praktyczny i niebanalny dodatek, który będzie w stanie ożywić i odmienić wnętrze.	Jeśli poszukujesz dobrej jakościowo lampy ściennej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem. Dodatkowo kinkiet posiada dołączone źródła światła, co jest jego ogromną zaletą.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-garderoby-3x-gu10-3x-zarowka-led-gu10-3w', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do garderoby 3x GU10 + 3x żarówka LED GU10 3W', '', '', '', ''),
(152, 1, 1, 'Irati, to lampa sufitowa najwyższej jakości. Światło wydobywające się z wnętrza trzech białych kloszy wspaniale wypełni pomieszczenie. Perfekcyjne połączenie szkła i metalu nadaje oświetleniu stylowego charakteru. Tego typu produkt idealnie wkomponuje się w każdy styl aranżacji, jednakże polecany jest przede wszystkim do nowoczesnych aranżacji, w takich miejscach jak: salon, jadalnia, sypialnia, kuchnia oraz korytarz. Lampa współgra z żarówką o gwincie E27 oraz mocy 60W.', '', 'lampa-sufitowa-irati-3-3xe27-wenge-metal-i-szklo-classic-lampex', '', '', '', 'Lampa sufitowa Irati 3 3xE27 Wenge Metal i szkło Classic Lampex', '', '', '', ''),
(153, 1, 1, 'Lampa sufitowa z listwą model MLP4184 z serii WILL marki MILAGRO została wykonana z połączenia metalu oraz drewna. Oprawa sufitowa została wyposażona w potrójne gniazdo z tradycyjnym gwintem typu E27, dzięki czemu jest ona dostosowana do różnego rodzaju energooszczędnych żarówek LED (brak źródeł światła w zestawie). Listwa sufitowa WILL 4184, na której zamontowano trzy punkty świetlne ma długość 90cm. Klosze wykonane z białego drutu w połączeniu z elementem drewnianym idealnie wkomponują się w wystrój wnętrz w stylu minimalistycznym, nowoczesnym lub loftowym. Prezentowana lampa z serii WILL ożywi wasze wnętrza, a zarazem doda im charakteru oraz ciekawszego wyglądu.Lampa Stołowa Świetnie Sprawdzi się: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-will-3x-e27-loft-biala-metal-drewno-milagro', '', '', '', 'Lampa sufitowa żyrandol WILL 3x E27 LOFT Biała Metal + drewno Milagro', '', '', '', ''),
(154, 1, 1, 'Lampa sufitowa GARRET 9247 firmy Nowodvorski stanowi połączenie twardego i nowoczesnego oświetlenia z oryginalnym designem. Modna lampa ma czarny klosz z miedzianym wnętrzem. Plafon w stylu retro będzie się pięknie komponować z ciężkimi kolonialnymi meblami oraz innymi dodatkami w stylu loft. Lampa, którą przedstawiamy zawieszona w centralnym miejscu mieszkania, będzie piękną ozdobą domu oraz praktycznym źródłem światła, które wprowadzi do wnętrza mocny charakter. Zwis idealnie sprawdzi się w jadalni, salonie lub pokoju dziennym, a jego budowa sprawia, że jest łatwy do utrzymania w czystości. Abażur ma wymiary 34,5 x 34,5 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-e27-czarna-miedziana-retro-garret-9247-stal', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI E27 Czarna Miedziana Retro GARRET 9247 Stal', '', '', '', ''),
(155, 1, 1, 'Lampa sufitowa z trzema oprawkami, w kolorze chrom, w których można zamontować żarówki LED o trzonku GU10 to produkt wysokiej jakości. Żyrandol został stworzony po to, aby pięknie oświetlić garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu. Nowoczesny design lampy, zaprojektowany w zgodzie z najnowszymi trendami, to praktyczny i niebanalny dodatek, który będzie w stanie ożywić i odmienić wnętrze.Jeśli poszukujesz dobrej jakościowo lampy sufitowej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-sufitowa-chrom-zyrandol-do-garderoby-3x-gu10', '', '', '', 'Nowoczesna lampa sufitowa chrom żyrandol do garderoby 3x GU10', '', '', '', ''),
(156, 1, 1, 'Lampa dziecięca z kolekcji CORAZON to uroczy żyrandol, w różowym kolorze, który zdobią fantazyjnie wiszące kryształki i serduszka. Różowa lampa współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci za sprawą mieniących się kryształków wywoła uśmiech na twarzy każdego dziecka. Lampa z serduszkami, w różowym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy CORAZON od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-rozowa-zyrandol-serduszka-corazon-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa różowa Żyrandol Serduszka CORAZON 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(157, 1, 1, 'Lampa sufitowa Muskat to nowoczesna oprawa oświetleniowa o futurystycznym wyglądzie. Świetnie wykonana chromowana oprawa przyciąga spojrzenia postronnych obserwatorów, a jej niecodzienny wygląd idealnie uzupełni wystrój każdego wnętrza. Lampa została wykonana z materiałów wysokiej jakości, dzięki czemu wspaniale prezentuje się,zachowując przy tym walory niezawodności.  Futurystyczna lampa współgra z żarówkami o trzonku G9 oraz mocy max 8W (brak w zestawie).', '', 'lampa-sufitowa-muskat-p6-srebrny-chrom-6xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Lampa sufitowa Muskat P6 srebrny chrom 6xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(158, 1, 1, 'Lampa sufitowa w uniwersalnym czarnym kolorze i nowoczesnej stylistyce skrywa w sobie wymienne moduły LED o łącznej mocy 36 W. Wykorzystanie modułu LED pozwala zmniejszyć koszty zużycia energii, nie wpływając na jakość źródła światła. Przyjemna dla oka barwa 4000 K wprowadza miły klimat do pomieszczeń i dba o odpowiedni nastrój. Lampa została wykonana z wysokiej jakości materiałów: metalu i akrylu. W zestawie znajdują się niezbędne elementy do jej montażu. Plafon zachwyca swoją estetyczną, a zarazem prostą formą. Zamieszczone na nim trzy źródła światła w kształcie pierścieni, przypominają elegancką biżuterię.  Czarna lampa z powodzeniem znajdzie zastosowanie w każdym pomieszczeniu, bez różnicy czy będzie to jadalnia, kuchnia lub designerski salon.', '', 'lampa-sufitowa-ring-trzy-okregi-czarny-36w-led-ip20-metal-i-akryl-styl-nowoczesny-milagro', '', '', '', 'Lampa sufitowa RING trzy okręgi czarny 36W LED IP20 Metal i akryl styl nowoczesny Milagro', '', '', '', ''),
(159, 1, 1, 'Lampa sufitowa z linii produktów WEST WHITE to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa wisząca, w kolorze białym, została wyprodukowana przez polską markę MiLAGRO. Jej białe, podłużne klosze przyciągają uwagę, a drewniany element doskonale z nimi współgra. Lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Biała lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w minimalistycznym, skandynawskim bądź nowoczesnym stylu. Lampa współpracuje z pięcioma żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-sufitowa-wiszaca-west-biala-5x-gu10-milagro-geometryczna-metal-drewno', '', '', '', 'Lampa sufitowa wisząca WEST biała 5x GU10 MILAGRO geometryczna metal + drewno', '', '', '', ''),
(160, 1, 1, 'Lampa sufitowa EYE SUPER 6492 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Pięć gwintów GU10 zostało zamkniętych w stalowym kloszu i wbudowanych w oprawę w kształcie metalowej tuby, o uniwersalnym białym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na regulowanym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza. Lampa EYE SUPER 6492 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design szczególnie polecany do sypialni, salonu bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 56 cm, zaś abażur ma wymiar 20 x 5,5 cm. Oświetlenie może osiągać szerokość maksymalną 205 cm.  Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.  Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-5xgu10-biala-ruchomy-klosz-eye-super-6492-stal', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI 5xGU10 Biała Ruchomy Klosz EYE SUPER 6492 Stal', '', '', '', ''),
(161, 1, 1, 'Lampa sufitowa Tivoli to stylowa lampa w stylu glamour. Lampa cechuje się nowoczesnym i eleganckim połączeniem metalu i szkła. Lampa w stylu glamour o niepowtarzalnym kształcie, ozdobionym wiszącymi owalnym kształtami, kojarzącymi się z kosmosem, doskonale podkreśli charakter pomieszczeń w stylu glamour bądź nowoczesnym. Nowoczesna lampa została wykonana z wysokiej jakości materiałów dzięki czemu będzie działać niezawodnie przez długi czas. Elegancka lampa współpracuje z sześcioma żarówkami o trzonku E27 i mocy maksymalnej 40W, wraz z którymi wprowadzi do pomieszczenia niepowtarzalną atmosferę..', '', 'lampa-sufitowa-tivoli-6x-e27-metal-i-szklo-lampex-chrom-styl-glamour', '', '', '', 'Lampa sufitowa Tivoli 6x E27 Metal i szkło Lampex Chrom Styl glamour', '', '', '', ''),
(162, 1, 1, 'STALACTITE BRASS 9054 to unikatowa lampa o nowoczesnym charakterze. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze loftowym oraz nowoczesnym. Model ten składa się z trzynastu żarówek G9 zamkniętych w metalicznym kloszu, o rzadko spotykanym mosiężnym kolorze i niewielkiej średnicy. Niecodzienna barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Model ten zawieszono na okrągłej podsufitce. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Lampa sufitowa w nowoczesnym stylu jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Swoje miejsce znajdzie w salonie czy jadalni i będzie cieszącą oczy ozdobą, doskonale nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja. Wysokość lampy to 25,5 cm, a szerokość wynosi 34 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 10W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to G9, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-13xg9-retro-loft-9054-stalactite-brass-mosiadz-stal-sr-34-cm', '', '', '', 'Lampa sufitowa NOWODVORSKI 13xG9 Retro Loft 9054 STALACTITE BRASS Mosiądź Stal Śr. 34 cm', '', '', '', ''),
(163, 1, 1, 'Lampa sufitowa to doskonała propozycja dla miłośników stylu klasycznego. Szklany klosz osadzony na metalowej ramie doskonale podkreśli charakter każdego wnętrza. Produkt został wykonany z materiałów najwyższej jakości, dzięki czemu wspaniale się prezentuje, zachowując przy tym walory niezawodności. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w komplecie).', '', 'lampa-sufitowa-czarny-zloty-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa czarny + złoty 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(164, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Fiona w kolorze białym. Ta oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Fiona która została wyposażona w podwójne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-fiona-2xe14-polux-5901508311023', '', '', '', 'Oprawa ścienna KINKIET Spot Fiona 2xE14 Polux 5901508311023', '', '', '', ''),
(165, 1, 1, 'Poczwórny KINKIET FIONA z wysokiej jakości materiałów w kolorze miętowym doskonale sprawdzi się do oświetlania ścian fasad budynku. Przystosowany do energooszczędnych źródeł światła z trzonkiem E14 (mały gwint) o maksymalnej mocy 8W. Żarówki LED można dokupić na pozostałych naszych aukcjach. Lampa wykonana została z stali proszkowanej i stanowi piękny dodatek do Twojego wnętrza. Oprawka zasilana jest typowym napięciem 230V.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-fiona-oprawa-scienna-4xe14-do-sufitu-mieta-polux', '', '', '', 'KINKIET FIONA oprawa ścienna 4xE14 do sufitu MIĘTA POLUX', '', '', '', ''),
(166, 1, 1, 'LISTWA LED Polux  z 4-ema źródłami światła w kolorzebiałym, o mocy 4x5W o ciepłej, przyjemniej, białej barwie 3000K idealnie rozświetli Twoje wnętrze. Listwa świetni sprawdzi się w pomieszczeniach typu  łazienka, kuchnia oraz gabinety/biura urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia pod dowlnym kątem 4-ech źródeł światła sprawisz, że padające promienie idealnie rozświetlą wybraną przez Ciebie przestrzeń.   Nowoczesny design oraz chrakterystyczny, okrągły kształt opraw ledowych w białej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.. Praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako główne lub dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-capri-4x5w-biala-3000k', '', '', '', 'Listwa LAMPA  SUFITOWA LED Polux CAPRI  4x5W BIAŁA  3000K', '', '', '', ''),
(167, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Fiona w kolorze białym. Ta oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Fiona która została wyposażona w poczwórne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-fiona-4xe14-polux-5901508311047', '', '', '', 'Oprawa ścienna KINKIET Spot Fiona 4xE14 Polux 5901508311047', '', '', '', ''),
(168, 1, 1, 'Lampa sufitowa model MLP4189 z serii WILL marki MILAGRO została wykonana z połączenia metalu oraz drewna. Żyrandol został wyposażony w jedno gniazdo z tradycyjnym gwintem typu E27, dzięki czemu jest on dostosowany do różnego rodzaju energooszczędnych żarówek LED (brak źródła światła w zestawie). Klosz oprawy o szerokości 24cm został wykonany z czarnego drutu w połączeniu z elementem drewnianym, taka kompozycja idealnie wkomponuje się w wystrój wnętrz w stylu minimalistycznym, nowoczesnym lub loftowym. Prezentowana lampa z serii WILL ożywi wasze wnętrza, a zarazem doda im charakteru oraz ciekawszego wyglądu.Lampa Stołowa Świetnie Sprawdzi się: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-will-1x-e27-loft-czarna-metal-drewno-milagro', '', '', '', 'Lampa sufitowa żyrandol WILL 1x E27 LOFT Czarna Metal + drewno Milagro', '', '', '', ''),
(169, 1, 1, 'Lampa sufitowa model MLP4189 z serii WILL marki MILAGRO została wykonana z połączenia metalu oraz drewna. Żyrandol został wyposażony w jedno gniazdo z tradycyjnym gwintem typu E27, dzięki czemu jest on dostosowany do różnego rodzaju energooszczędnych żarówek LED (brak źródła światła w zestawie). Klosz oprawy o szerokości 24cm został wykonany z białego drutu w połączeniu z elementem drewnianym, taka kompozycja idealnie wkomponuje się w wystrój wnętrz w stylu minimalistycznym, nowoczesnym lub loftowym. Prezentowana lampa z serii WILL ożywi wasze wnętrza, a zarazem doda im charakteru oraz ciekawszego wyglądu.Lampa Stołowa Świetnie Sprawdzi się: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-will-1x-e27-loft-biala-metal-drewno-milagro', '', '', '', 'Lampa sufitowa żyrandol WILL 1x E27 LOFT Biała Metal + drewno Milagro', '', '', '', ''),
(170, 1, 1, 'Lampa sufitowa Wenecja, w kolorze czarnym to elegancka lampa w stylu glamour. Klasyczna lampa posiada finezyjny abażur spod którego zwisają akrylowe kryształki, które sprawiają, że lampa ta będzie się pięknie prezentować w każdym wnętrzu. Lampa z abażurem została wykonana z materiałów wysokiej jakości, dzięki czemu będzie służyć niezawodnie przez długi czas. Lampa współpracuje z żarówką o trzonku E27 o mocy maksymalnej 60W, wraz z którą pięknie oświetli wnętrze i wprowadzi w nie niepowtarzalną atmosferę.', '', 'lampa-sufitowa-wenecja-czarna-1x-e27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Lampa sufitowa Wenecja Czarna 1x E27 Metal abażur tkanina kryształki Lampex styl glamour', '', '', '', ''),
(171, 1, 1, 'Lampa sufitowa z serii Estero to niebanalny produkt, który świetnie sprawdzi się w nowoczesnych i stylowych wnętrzach. Żyrandol posiada dekoracyjne kryształki, które dodają lampie uroki i elegancji. Lampa współpracuje z dwoma żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 60W. Światło wydobywające się z wnętrza dwóch kloszy przyjemnie wypełni pomieszczenie. Nowoczesna lampa została wykonana najwyższej jakości metalu i szkła, co pozwoli cieszyć się trwałością oraz niezawodnością lampy przez długi czas. Żyrandol Estero fenomenalnie sprawdzi się w salonie, jadalni, sypialni, kuchni oraz korytarzu.', '', 'lampa-sufitowa-estero-2-2x-e27-metal-i-szklo-lampex-styl-nowoczesny-krysztalki', '', '', '', 'Lampa sufitowa Estero 2 2x E27 Metal i szkło Lampex styl nowoczesny kryształki', '', '', '', ''),
(172, 1, 1, 'Lampa sufitowa kinkiet ścienny z dwoma punktami świetlnymi serii DYLAN, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni ze złotem oraz miedzianego odcienia żarówki sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.DYLAN idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-scienny-lampa-sufitowa-w-stylu-industrialnym-czarna-milagro-dylan-2x-e27', '', '', '', 'Kinkiet ścienny lampa sufitowa w stylu industrialnym czarna MiLAGRO DYLAN 2x E27', '', '', '', ''),
(173, 1, 1, 'Lampa sufitowa EYE SUPER 6488 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o uniwersalnym białym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na  sztywnym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza.  Lampa EYE SUPER 6488 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design - szczególnie polecany  do sypialni nad łóżko, bądź nad nowoczesną wyspę kuchenną.  Wysokość całkowita wynosi 56 cm, zaś abażur ma wymiar 5,5 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-gu10-biala-ruchomy-klosz-eye-super-6488-stal-56-cm', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI GU10 Biała Ruchomy Klosz EYE SUPER 6488 Stal 56 cm', '', '', '', ''),
(174, 1, 1, 'Lampa sufitowa EYE SUPER 6495 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o uniwersalnym grafitowym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na  sztywnym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza.  Lampa EYE SUPER 6495 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design - szczególnie polecany  do sypialni nad łóżko, bądź nad nowoczesną wyspę kuchenną.  Wysokość całkowita wynosi 56 cm, zaś abażur ma wymiar 5,5 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-gu10-grafitowa-ruchomy-klosz-eye-super-6495-stal-56-cm', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI GU10 Grafitowa Ruchomy Klosz EYE SUPER 6495 Stal 56 cm', '', '', '', ''),
