(176, 1, 1, 'SHY 9390 to designerka, bardzo efektowna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Betonowa forma w kształcie walca. Wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego modernistycznych stylach. Oprawa ma futurystyczny betonowy kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Klosz ma wymiary 9 x 12 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-spot-nowodvorski-gu10-betonowa-szara-walec-9cm-shy-9390', '', '', '', 'Lampa sufitowa spot NOWODVORSKI GU10 Betonowa Szara Walec 9cm SHY 9390', '', '', '', ''),
