(178, 1, 1, 'GLASO to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chromu, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w trzy punkty świetlne, do których możemy zamontować żarówki z trzonkiem G9 o maksymalnej mocy 3x 40W. GLASO przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux GLASO, to rodzina opraw punktowych (sufitowo-ściennych). Dzięki regulacji możemy swobodnie ustawić kąt padania światła. Kształt opraw i ciekawe wzornictwo szklanych kloszy podkreślają charakter wnętrz retro, a chromowane dodatki dodają subtelnego szlifu wnętrzom nowoczesnym.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 19644 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-glaso-3xg9-chrom-kanlux', '', '', '', 'Oprawa lampa sufitowa GLASO 3xG9 chrom Kanlux', '', '', '', ''),
