(181, 1, 1, 'Lampa sufitowa Kraft została w całości wykonana z metalu. Jej wygląd oraz styl idealnie pasują do nowoczesnego wnętrza. Metalowy korpus został umieszczony na przegubie, dzięki czemu możliwa jest regulacja kierunku padania światła. Lampa została wyprodukowana wyłącznie z materiałów najwyższej jakości, dzięki czemu prezentuje się wspaniale, zachowując przy tym walory niezawodności. Kwadratowa lampa współgra z żarówkami o trzonku GU10 oraz mocy max 40W (brak w zestawie).', '', 'lampa-sufitowa-kraft-1-popiel-1xgu10-metal-styl-nowoczesny-lampex', '', '', '', 'Lampa sufitowa Kraft 1 popiel 1xGU10 Metal styl nowoczesny Lampex', '', '', '', ''),
(182, 1, 1, 'Quado to nowoczesna lampa sufitowa o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na suficie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Lampa sufitowa współgra z żarówkami o trzonku GU10 oraz mocy max 40W (brak w zestawie).', '', 'plafon-quado-deluxe-2-czarny-2xgu10-metal-styl-nowoczesny-lampex', '', '', '', 'Plafon Quado DELUXE 2 czarny 2xGU10 Metal styl nowoczesny Lampex', '', '', '', ''),
(183, 1, 1, 'Żyrandol świecznikowy Nikozja to niezwykle elegancka i klasyczna lampa wisząca. Żyrandol stylizowany na świecznik przyciąga spojrzenia, dzięki swojej nietypowej konstrukcji. Lampa sufitowa przeznaczona została do pracy z żarówkami o trzonku E14 o mocy maksymalnej 40W, wraz z którymi wprowadzi w pomieszczenia niesamowitą atmosferę. Do produkcji świecznika zostały użyte wyłącznie materiały najwyższej jakości, dzięki czemu wspaniale się prezentuje i będzie działać niezawodnie przez długi czas.', '', 'zyrandol-swiecznikowy-lampa-sufitowa-samanta-5-biala-swiecznik-5xe14-metal-styl-klasyczny-retro-lampex', '', '', '', 'Żyrandol świecznikowy Lampa sufitowa Samanta 5 biała świecznik 5xE14 Metal styl klasyczny retro Lampex', '', '', '', ''),
(184, 1, 1, 'SILMA LED to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX, która cechuje się nowoczesnym designem w okrągłym płaskim kształcie z możliwością regulacji. Oprawa ścienno-sufitowa została wyposażona w zintegrowane źródło światła o mocy 2x 6W w barwie 3000K - biały ciepły emitujących strumień świetlny na poziomie 2x 320lm. SILMA przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kinkiet LED, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Decydując się na zakup prezentowanej oprawy ścienno-sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. Kanlux SILMA to seria opraw o nietypowym, futurystycznym kształcie. Ciekawy design opraw to przede wszystkim płaskie klosze tych opraw ze zintegrowanymi źródłami światła LED. Polecamy do nowoczesnych, modernistycznych wnętrz.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 24441 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-silma-2x-6w-3000k-ciepla-chrom-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SILMA 2x 6W 3000K Ciepła Chrom Kanlux', '', '', '', ''),
(185, 1, 1, 'SHY 9393 to designerka, bardzo efektowna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Betonowa forma w kształcie walca. Wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego modernistycznych stylach. Oprawa ma futurystyczny betonowy kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Klosz ma wymiary 14 x 14,5 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 75W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10 lub ES111, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-spot-nowodvorski-gu10-betonowa-szara-walec-14', '', '', '', 'Lampa sufitowa spot NOWODVORSKI GU10 Betonowa Szara Walec 14', '', '', '', ''),
(186, 1, 1, 'LAMPA SONDA to wykonany z najlepszej jakości stali kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chrom/mat, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w trzy punkty świetlne, do których możemy zamontować żarówki z trzonkiem GU10 o maksymalnej mocy 3x 50W. SONDA przystosowana jest do nadbudowania na ściane i suficie. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Futurystyczna lampa o nietypowym kształcie, idealna przede wszystkim do wnętrz urządzonych w nowoczesnym stylu. Wykonana z całości ze stali, stanie się dyskretną ozdobą każdego pomieszczenia. Reflektor możemy ustawić w dowolnej pozycji.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 4797 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-sonda-3x-gu10-chrom-mat-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SONDA 3x GU10 CHROM MAT Kanlux', '', '', '', ''),
(187, 1, 1, 'Napoli to nowoczesna lampa sufitowa z czterema punktami świetlnymi. Długa, chromowana oprawa podkreśli charakter nowoczesnych pomieszczeń. Nowoczesna lampa wraz z czterema żarówkami E14 pięknie oświetli pomieszczenie. Lampa natynkowa została wykonana z materiałów najwyższej jakości, dzięki czemu wspaniale się prezentuje, działając jednocześnie niezawodnie przez długi czas. Elegancka lampa jest szczególnie polecana do stylowych pomieszczeń.', '', 'lampa-sufitowa-listwa-oprawa-natynkowa-napoli-4x-e14-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Listwa Oprawa natynkowa Napoli 4x E14 Metal i szkło Lampex', '', '', '', ''),
(188, 1, 1, 'Lampa sufitowa szklana CONE SPOT SMOKE-GREY wykonana w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym kloszem w kształcie stożka w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku 2x E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CONE SPOT SMOKE-GREY firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-cone-spot-2xe27-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CONE SPOT 2xE27 SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(189, 1, 1, 'Elegancka lampa sufitowa została przystosowana do pracy z dwoma żarówkami o trzonku E14. Biała lampa jest idealna do oświetlenia korytarza, choć świetnie sprawdzi się również w przedpokoju czy w garderobie. Lampa sufitowa została wykonana z niezwykłą dbałością o detale. Razem z zamontowanymi żarówkami LED E14 lampa ta będzie pięknie oświetlać korytarz i odmieni jego wygląd. 	Jeśli potrzebujesz lampy sufitowej do korytarza czy garderoby ten żyrandol będzie dobrym wyborem. Lampa sufitowa to produkt wykonany z wysokiej jakości materiałów, który będzie cieszył oczy pięknym wyglądem przez długi czas.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-sufitowa-biala-zyrandol-na-korytarz-do-przedpokoju-2x-e14', '', '', '', 'Nowoczesna lampa sufitowa biała żyrandol na korytarz do przedpokoju 2x E14', '', '', '', ''),
(190, 1, 1, 'GLASO to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chromu, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w cztery punkty świetlne, do których możemy zamontować żarówki z trzonkiem G9 o maksymalnej mocy 4x 40W. GLASO przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux GLASO, to rodzina opraw punktowych (sufitowo-ściennych). Dzięki regulacji możemy swobodnie ustawić kąt padania światła. Kształt opraw i ciekawe wzornictwo szklanych kloszy podkreślają charakter wnętrz retro, a chromowane dodatki dodają subtelnego szlifu wnętrzom nowoczesnym.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 19643 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-glaso-4xg9-chrom-70cm-kanlux', '', '', '', 'Oprawa lampa sufitowa GLASO 4xG9 chrom 70cm Kanlux', '', '', '', ''),
(191, 1, 1, 'Lampa sufitowa z trzema czarnymi oprawkami, w których można zamontować żarówki LED o trzonku GU10 to produkt wysokiej jakości. Żyrandol został stworzony po to, aby pięknie oświetlić garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu.	 Jeśli poszukujesz dobrej jakościowo lampy sufitowej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem. 	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-sufitowa-czarna-zyrandol-do-garderoby-3x-gu10', '', '', '', 'Nowoczesna lampa sufitowa czarna żyrandol do garderoby 3x GU10', '', '', '', ''),
(192, 1, 1, 'Lampa sufitowa z linii produktów WEST BLACK to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa w stylu skandynawskim została wyprodukowana przez polską markę MiLAGRO. Jej czarny, podłużny klosz przyciąga uwagę, a drewniany element doskonale z nim współgra. Minimalistyczna lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Czarna lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w minimalistycznym, skandynawskim bądź nowoczesnym stylu. Lampa współpracuje z żarówką o trzonku GU10 i  mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-sufitowa-west-czarna-1x-gu10-milagro-geometryczna-metal-drewno-styl-skandynawski', '', '', '', 'Lampa sufitowa WEST czarna 1x GU10 MILAGRO geometryczna metal + drewno styl skandynawski', '', '', '', ''),
(193, 1, 1, 'Lampa sufitowa z linii produktów WEST WHITE to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa w stylu skandynawskim, w kolorze białym, została wyprodukowana przez polską markę MiLAGRO. Jej biały, podłużny klosz przyciąga uwagę, a drewniany element doskonale z nim współgra. Minimalistyczna lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Biała lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w stylu minimalistycznym, skandynawskim bądź nowoczesnym. Lampa współpracuje z żarówką o trzonku GU10 i mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-sufitowa-west-biala-1x-gu10-milagro-geometryczna-metal-drewno-styl-skandynawski', '', '', '', 'Lampa sufitowa WEST biała 1x GU10 MILAGRO geometryczna metal + drewno styl skandynawski', '', '', '', ''),
(194, 1, 1, 'Żyrandol z kolekcji Natan to niezwykle elegancka lampa, która świetnie sprawdzi się we wnętrzach w stylu klasycznym bądź glamour. Lampa sufitowa składa się ze srebrnej oprawy i białych kloszy, które doskonale się ze sobą komponują tworząc piękną całość. Drobne, delikatne kryształki i subtelne pierścienie na kloszach lampy sprawiają, że lampa wprowadza we wnętrza odrobinę luksusu i przyjemną atmosferę. Klasyczna lampa współpracuje z trzema żarówkami, o mocy maksymalnej wynoszącej 40W, wraz z którymi pięknie oświetli pomieszczenie, w którym zostanie zamontowana. Lampa z kloszami została wykonana z materiałów najwyższej jakości, co sprawia, że będzie ona działać niezawodnie przez długi czas.', '', 'zyrandol-lampa-sufitowa-natan-3-3x-e27-metal-i-szklo-lampex-styl-klasyczny-glamour', '', '', '', 'Żyrandol Lampa sufitowa Natan 3 3x E27 Metal i szkło Lampex styl klasyczny glamour', '', '', '', ''),
(195, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWO-WISZĄCEJ!Lampa MORA GOLD marki POLUX w kolorze złotym, w nowoczesnym stylu z czterema punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, modnych bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.Produkt ten, z pewnością przypadnie do gustu wszystkim wielbicielom klasycznych i nowoczesnych rozwiązań. POSTAW NA TĘ LAMPĘ SUFITOWO-WISZĄCĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.     *CZTERY OPRAWY*ŁATWOŚĆ MONTAŻU    *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-wiszaca-mora-gold-zlota-vintage-retro-4x-e27-polux', '', '', '', 'Lampa sufitowa wisząca MORA GOLD złota vintage retro 4x E27 Polux', '', '', '', ''),
(196, 1, 1, 'Lampa sufitowa szklana CONE ORANGE  wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym kloszem w kształcie stożka w kolorze pomarańczowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CONE ORANGE firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-e27-cone-orange-pomaranczowa-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 E27 CONE ORANGE Pomarańczowa LEDVANCE', '', '', '', ''),
(197, 1, 1, 'Lampa sufitowa Muskat to nowoczesna oprawa oświetleniowa o futurystycznym wyglądzie. Świetnie wykonana chromowana oprawa przyciąga spojrzenia postronnych obserwatorów,a jej niecodzienny wygląd idealnie uzupełni wystrój każdego wnętrza. Lampa została wykonana z materiałów wysokiej jakości, dzięki czemu wspaniale prezentuje się,zachowując przy tym walory niezawodności. Kompatybilna z żarówką G4 o mocy 8W (brak w zestawie).', '', 'lampa-sufitowa-muskat-p4-4xg9-metal-lampex', '', '', '', 'Lampa sufitowa Muskat P4 4xG9 Metal Lampex', '', '', '', ''),
(198, 1, 1, 'SILMA LED EL-40 to wykonany z najlepsze jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX, która cechuje się nowoczesnym designem w okrągłym płaskim kształcie z możliwością regulacji. Oprawa ścienno-sufitowa została wyposażona w zintegrowane źródło światła o mocy 4x 6W w barwie 3000K - biały ciepły emitujących strumień świetlny na poziomie 4x 320lm. SILMA przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kinkiet LED, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Decydując się na zakup prezentowanej oprawy ścienno-sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. Kanlux SILMA to seria opraw o nietypowym, futurystycznym kształcie. Ciekawy design opraw to przede wszystkim płaskie klosze tych opraw ze zintegrowanymi źródłami światła LED. Polecamy do nowoczesnych, modernistycznych wnętrz.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 24443 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-silma-4x-6w-3000k-ciepla-chrom-76cm-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SILMA 4x 6W 3000K Ciepła Chrom 76cm Kanlux', '', '', '', ''),
(199, 1, 1, 'Lampa sufitowa szklana PUMPKIN wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym, kloszem przypominającym dynie w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CARVED PUMPKIN firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-carved-pumpkin-dynia-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CARVED PUMPKIN Dynia Przydymiona LEDVANCE', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(200, 1, 1, 'Lampa sufitowa z trzema punktami świetlnymi (3 klosze) serii DAMA WHITE, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Biały klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-w-stylu-skandynawskim-biala-milagro-dama-3x-e27-drewno-metal', '', '', '', 'Lampa sufitowa w stylu skandynawskim biała MiLAGRO DAMA 3x E27 Drewno + metal', '', '', '', ''),
(201, 1, 1, 'Lampa dziecięca z serii ANGELICA to uroczy żyrandol, w różowym kolorze, który współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci posiada wiszące kryształki i motylki, które razem znakomicie się prezentują i wywołają uśmiech na twarzy każdego dziecka. Lampa z motylkami w różowym kolorze wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Wszystkie modele z kolekcji ANGELICA wykonano z połączenia bezpiecznego metalu oraz akrylu. Żyrandole od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-rozowa-zyrandol-angelica-motyle-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa różowa Żyrandol ANGELICA Motyle 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(202, 1, 1, 'TWIG 9140 to piękna lampa, która jest kwintesencją loftowego szyku. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa wisząca, z czterema źródłami światła, odsłaniającymi żarówki, doskonale oświetlając całe pomieszczenie. Zwis będzie w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość lampy to 55 cm, a szerokość klosza wynosi 110 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-4xe27-retro-loft-9140-twig-czarna-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 4xE27 Retro Loft 9140 TWIG Czarna Stal', '', '', '', ''),
(203, 1, 1, 'Kolekcja Kronos to seria lamp w różnych konfiguracjach. Wśród nich znaleźć możemy właśnie szynową lampę sufitową z potrójnym punktem światła, gdzie w każdym z trzech ozdobnych kloszy znajdziemy jedno gniazdo. Sufitowe oświetlenie posiada klasyczny mały gwint E14, dzięki czemu bardzo łatwo możemy dobrać do nich energooszczędne żarówki LED dostępne w naszej ofercie. Nowoczesny kształt żyrandolu marki Milagro sprawdzi się jako piękny dodatek do współczesnego wystroju wnętrz. Okrągły i spłaszczony kształt  w połączeniu z zawsze modnym kolorem białym prezentują się znakomicie, wpisując się w obecnie panujące trendy. Tylko zakup markowych lamp zapewni ci najlepsza jakość oraz bardzo długi okres użytkowania.Lampa Sufitowa Świetnie Sprawdzi się:SPECYFIKACJA TECHNICZNA: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-kronos-3xe14-ip20-bialy-metal-milagro', '', '', '', 'Lampa sufitowa żyrandol KRONOS 3xE14 IP20 Biały Metal Milagro', '', '', '', ''),
(204, 1, 1, 'FLEX 9772 to designerka, bardzo praktyczna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Minimalistyczna forma z pięcioma wyginanymi ramionami wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego rodzaju stylach. Oprawa ma uniwersalny i ponadczasowy biały kolor przewodu. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym, a jej budowa sprawia, że jest łatwa do utrzymania w czystości. Odległość oświetlenia od sufitu to 50 cm, a szerokość waha się między 18, a 80 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-5xe27-biala-pajak-gietka-flex-9772-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 5xE27 Biała Pająk Giętka FLEX 9772 Stal', '', '', '', ''),
(205, 1, 1, 'FLEX 9766 to designerka, bardzo praktyczna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Minimalistyczna forma z pięcioma wyginanymi ramionami wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego rodzaju stylach. Oprawa ma uniwersalny i ponadczasowy czarny kolor przewodu. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym, a jej budowa sprawia, że jest łatwa do utrzymania w czystości. Odległość oświetlenia od sufitu to 50 cm, a szerokość waha się między 18, a 80 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-5xe27-czarna-pajak-gietka-flex-9766-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 5xE27 Czarna Pająk Giętka FLEX 9766 Stal', '', '', '', ''),
(206, 1, 1, 'Lampa sufitowa FORM 9673 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w kształcie przypominającym muszlę wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny biały kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Plafon ma wymiary 50 x 21 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-2xe27-muszla-rozlozysta-biala-form-9673-lycra-stal-50cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 2xE27 Muszla Rozłożysta Biała FORM 9673 Lycra + Stal 50cm', '', '', '', ''),
(207, 1, 1, 'Lampa sufitowa TURDA 8952 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w  okrągłym kształcie wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny biały kolor abażuru. Plafon będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Abażur ma wymiary 50 x 13 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-3xe27-okragla-biala-turda-8952-pcv-stal-50cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 3xE27 Okrągła Biała TURDA 8952 PCV + Stal 50cm', '', '', '', ''),
(208, 1, 1, 'MANUFACTURE 9740 to unikatowa lampa o loftowym charakterze. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa sufitowa, przypominająca trzy bombki, w których kryją się źrodła światła. Zaletą lamp drucianych jest to, że samoistnie tworzą, część aranżacji wnętrza przez swoje oryginalne formy jednocześnie dając dużo światła w pomieszczeniu. Dodatkową dekoracją metalowych części jest wykorzystanie dekoratywnych żarówek najlepiej w stylu vintage. Lampy druciane coraz częściej wieszane są w kuchni, pokojach dziennych czy młodzieżowych. Lampy druciaki są o tyle uniwersalne, że nie określają aranżacji pomieszczenia, choć najczęściej są użytkowane w pomieszczeniach industrialnych i skandynawskich. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość pojedynczego klosza lampy to 62 cm, a szerokość wynosi 35 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-3xe27-retro-loft-9740-manufacture-czarna-miedz-stal-sr-35-cm', '', '', '', 'Lampa sufitowa NOWODVORSKI 3xE27 Retro Loft 9740 MANUFACTURE Czarna Miedź Stal Śr. 35 cm', '', '', '', ''),
