(210, 1, 1, 'Kolekcja Kronos to seria lamp w różnych konfiguracjach. Wśród nich znaleźć możemy właśnie lampę sufitową z potrójnym punktem światła, gdzie w każdym z trzech ozdobnych kloszy znajdziemy jedno gniazdo. Sufitowe oświetlenie posiada klasyczny mały gwint E14, dzięki czemu bardzo łatwo możemy dobrać do nich energooszczędne żarówki LED dostępne w naszej ofercie. Nowoczesny kształt żyrandolu marki Milagro sprawdzi się jako piękny dodatek do współczesnego wystroju wnętrz. Okrągły i spłaszczony kształt  w połączeniu z zawsze modnym kolorem czarnym prezentują się znakomicie, wpisując się w obecnie panujące trendy. Tylko zakup markowych lamp zapewni ci najlepsza jakość oraz bardzo długi okres użytkowania.Lampa Sufitowa Świetnie Sprawdzi się:SPECYFIKACJA TECHNICZNA: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-kronos-3xe14-ip20-czarny-metal-milagro', '', '', '', 'Lampa sufitowa żyrandol KRONOS 3xE14 IP20 Czarny Metal Milagro', '', '', '', ''),
