(213, 1, 1, 'Unikatowa lampa sufitowa CRAFT 9150 to doskonała propozycja dla każdego miłośnika nietuzinkowych detali we wnętrzach. Lampa solidnego producenta NOWODVORSKI to nowoczesny wygląd w połączeniu z wysokiej jakości wykonaniem i uniwersalnym czarnym kolorem, który zachwyci najbardziej wymagających koneserów wnętrz. Bardzo elegancki produkt w składający się z trzech, czarnych kloszy z białym wnętrzem sprawia, że wygląda doskonale stonowanych wnętrzach. Lampa w tym stylu świetnie sprawdzi się w salonie czy jadalni, gdzie zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, doskonale nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmieni one swoje oblicze.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.  Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-3xe27-czarna-loft-craft-9150-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 3xE27 Czarna Loft CRAFT 9150 Stal', '', '', '', ''),
(214, 1, 1, 'FLEX 9265 to designerka, bardzo praktyczna lampa sufitowa Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Minimalistyczna forma z sześcioma wyginanymi ramionami umieszczonymi na 150 cm listwie, wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnego rodzaju stylach. Oprawa ma uniwersalny i ponadczasowy czarny kolor przewodu. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym, a jej budowa sprawia, że jest łatwa do utrzymania w czystości. Odległość oświetlenia od sufitu to 51 cm, a szerokość wynosi 150.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-6xe27-czarna-pajak-gietka-listwa-flex-9765-stal', '', '', '', 'Lampa sufitowa NOWODVORSKI 6xE27 Czarna Pająk Giętka Listwa FLEX 9765 Stal', '', '', '', ''),
(215, 1, 1, 'Lampa sufitowa z linii produktów WEST WHITE to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa wisząca, w kolorze białym, została wyprodukowana przez polską markę MiLAGRO. Jej trzy białe i podłużne klosze przyciągają uwagę, a drewniany element doskonale z nimi współgra. Lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Biała lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w stylu minimalistycznym, skandynawskim bądź nowoczesnym. Lampa współpracuje z pięcioma żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-sufitowa-wiszaca-west-biala-3x-gu10-milagro-geometryczna-metal-drewno', '', '', '', 'Lampa sufitowa wisząca WEST biała 3x GU10 MILAGRO geometryczna metal + drewno', '', '', '', ''),
(216, 1, 1, 'Lampa sufitowa LAGUNA 8957 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w  okrągłym kształcie wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny ecru kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Plafon ma wymiary 50 x 13 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-4xe27-okragla-ecru-laguna-8957-pcv-stal-65cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 4xE27 Okrągła Ecru LAGUNA 8957 PCV + Stal 65cm', '', '', '', ''),
(217, 1, 1, 'MANUFACTURE 9738 to unikatowa lampa o loftowym charakterze. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa sufitowa, przypominająca pięć bombek, w których kryją się źrodła światła. Zaletą lamp drucianych jest to, że samoistnie tworzą, część aranżacji wnętrza przez swoje oryginalne formy jednocześnie dając dużo światła w pomieszczeniu. Dodatkową dekoracją metalowych części jest wykorzystanie dekoratywnych żarówek najlepiej w stylu vintage. Lampy druciane coraz częściej wieszane są w kuchni, pokojach dziennych czy młodzieżowych. Lampy druciaki są o tyle uniwersalne, że nie określają aranżacji pomieszczenia, choć najczęściej są użytkowane w pomieszczeniach industrialnych i skandynawskich. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość lampy to 72 cm, a szerokość wynosi 80 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nowodvorski-5xe27-retro-loft-9738-manufacture-czarna-miedz-stal-sr-80-cm', '', '', '', 'Lampa sufitowa NOWODVORSKI 5xE27 Retro Loft 9738 MANUFACTURE Czarna Miedź Stal Śr. 80 cm', '', '', '', ''),
(218, 1, 1, 'Plafon Tivoli to stylowe połączenie metalu i szkła. Jego niepowtarzalny kształt zdobiony wiszącymi bombkami doskonale podkreśli charakter nowoczesnych pomieszczeń. Wykonany został z wysokiej jakości materiałów dzięki czemu świetnie się prezentuje zachowując jednocześnie walory niezawodności. Szczególnie polecany do designerskich, stylowych wnętrz.  Szklana lampa współgra z żarówkami o trzonku E27 oraz  mocy max 40W (brak w zestawie).', '', 'plafon-tivoli-4-4xe27-metal-i-szklo-lampex', '', '', '', 'Plafon Tivoli 4 4xE27 Metal i szkło Lampex', '', '', '', ''),
(219, 1, 1, 'Lampa sufitowa z pięcioma punktami światła serii DALLAS GOLD, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu z dbałością o każdy detal lampa. Lampa w stylu nowoczesnym przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem GU10. W zestawie jest 5x źródło światła o mocy 3W, które emituje światło o przyjemnej i ciepłej barwie (3000K) o strumieniu świetlnym 300lm.Lampy z kolekcji DALLAS to propozycja dla osób, które szukają do swojego domu rozwiązań nie tylko praktycznych, ale również stylowych. Prosta, geometryczna forma kloszy i elegancka kolorystyka, łącząca czerń i szlachetne złoto, sprawiają, że lampy – poza swoją podstawową funkcją oświetleniową – będą pełniły również rolę designerskiego dodatku. Szczególnie gdy zestawi się je z nowoczesnymi meblami z drewna i malowanego proszkowo metalu.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Źródło światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-czarno-zlota-milagro-dallas-5xgu10', '', '', '', 'Lampa sufitowa czarno-złota MiLAGRO DALLAS + 5xGU10', '', '', '', ''),
