(221, 1, 1, 'Lampa sufitowa EYE SUPER 6498 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Pięć gwintów GU10 zostało zamkniętych w stalowym kloszu i wbudowanych w oprawę w kształcie metalowej tuby, o uniwersalnym grafitowym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na regulowanym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza. Lampa EYE SUPER 6498 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design szczególnie polecany do sypialni, salonu bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 56 cm, zaś abażur ma wymiar 20 x 5,5 cm. Oświetlenie może osiągać szerokość maksymalną 205 cm.  Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.  Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-5xgu10-grafitowa-ruchomy-klosz-eye-super-6498-stal', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI 5xGU10 Grafitowa Ruchomy Klosz EYE SUPER 6498 Stal', '', '', '', ''),
