(224, 1, 1, 'Lampa sufitowa LAGUNA 8962 to designerska, bardzo efektowna propozycja Nowodvorski wpisująca się w najnowsze trendy wnętrzarskie. Prosta forma w  okrągłym kształcie wpisze się idealnie w nowoczesne pomieszczenia urządzone w różnych modernistycznych stylach. Produkt ma uniwersalny ecru kolor abażuru. Oświetlenie będzie pięknie komponować się z dodatkami zarówno w intensywnych, jak i stonowanych kolorach. Prezentowany produkt będzie delikatną ozdobą dla pomieszczenia, w którym zostanie zamontowana. Jej zaletą jest nie tylko unikatowy design, lecz również bycie praktycznym źródłem światła. Lampa idealnie sprawdzi się w sypialni, salonie lub pokoju dziennym. Plafon ma wymiary 100 x 16 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 25W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-nowodvorski-9xe27-okragla-ecru-laguna-8962-pcv-stal-100cm', '', '', '', 'Lampa sufitowa plafon NOWODVORSKI 9xE27 Okrągła Ecru LAGUNA 8962 PCV + Stal 100cm', '', '', '', ''),
(225, 1, 1, 'LYNX 5006 marki MiLAGRO to efektowana lampa zaprojektowana przez znanego polskiego projektanta- Macieja Zienia. Swoim kształtem przypomina tubę, a złoty panel dookoła oprawy nawiązuje do bransoletek i eleganckich zapięć kobiecych akcesoriów. W stylowym detalu można doszukać się także odniesień do bogatych zdobień stosowanych w architekturze. Jej niebanalny, nieco ekstrawagancki kształt dodaje szyku i charakteru lampie, a podłużne tuby z półokrągłym zakończeniem przyciągają wzrok i nie pozostawiają nikogo obojętnym. Lampa LYNX ma dwa równoległe punkty świetlne o gwincie E14, a prawidłowo i bezpiecznie działaj przy napięciu równym 230 V i częstotliwości wynoszącej 50 Hz.Tym, co charakteryzuje serię Lynx jest z pewnością niebanalny, nieco ekstrawagancki kształt. Stworzone z myślą o indywidualistach, ceniących odważne i unikalne rozwiązania. Czarno-złota kolorystyka doskonale ze sobą współgra, podkreślając reprezentacyjne oblicze lamp. Fani wyjątkowych i oryginalnych form z pewnością docenią osobliwy charakter lamp z serii Lynx. Łącząc ze sobą oprawy wchodzące w skład kolekcji, można stworzyć spójne i jedyne w swoim rodzaju wnętrza przepełnione elegancją i wykwintnością. Wyjątkowa i oryginalna forma żyrandola z jednym punktem światła z linii Lynx, wyróżnia się czarno-złotą kolorystyką oraz niebanalnym kształtem przypominającym tubę, ozdobioną złotym panelem. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-lynx-2xe14-minimalistyczna-forma-czarna-zlota-mz5006-milagro-by-maciej-zien-mosiadz', '', '', '', 'Lampa sufitowa LYNX 2xE14 Minimalistyczna Forma Czarna Złota MZ5006 Milagro by Maciej Zień Mosiądz', '', '', '', ''),
(226, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWO-WISZĄCEJ!Lampa ARANE marki LUMILED, PAJĄK w loftowym stylu z sześcioma punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmMinimalistyczny design lampy wiszącej sprawia, że idealnie dopełni ona aranżację wnętrza. POSTAW NA TĘ LAMPĘ SUFITOWO-WISZĄCĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*GWINT E27Lampa pająk najlepiej będzie się prezentować z żarówkami typu Edison / VINTAGE.UWAGA! Brak źródła światła w komplecie.  *SZEŚĆ OPRAW *REGULACJA WYSOKOŚCI  *ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-wiszaca-sufitowa-arane-pajak-6-ramion-do-led-6x-e27-lumiled', '', '', '', 'Lampa wisząca sufitowa ARANE PAJĄK 6 ramion do LED 6x E27 LUMILED', '', '', '', ''),
(227, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED o mocy 27W. Wyposażony został w 180 diod SMD 2835 LED, o barwie neutralnej 4000K i strumieniu świetlnym równym 1620lm.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-geometryczna-plafon-led-zyrandol-27w-4000k-czarny', '', '', '', 'Lampa sufitowa geometryczna PLAFON LED żyrandol 27W 4000K czarny', '', '', '', ''),
(228, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED. Wyposażony został w 480 diod SMD 2835 LED, które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie), który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami tej serii i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z tej serii za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 33W a w przypadku barwy neutralnej 66W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-plafon-led-zyrandol-66w-3000k-6500k-czarny-pilot', '', '', '', 'Lampa sufitowa PLAFON LED żyrandol 66W 3000K-6500K czarny + pilot', '', '', '', ''),
(229, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 9W i strumieniu świetlnym 480lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Belka będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI! *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻUGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-9w-led-gavi-2-czarny-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 9W LED GAVI 2 czarny 3000K Polux', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(230, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWO-WISZĄCEJ!Lampa ARANE marki LUMILED, PAJĄK w loftowym stylu z ośmioma punktami świetlnymi, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmMinimalistyczny design lampy wiszącej sprawia, że idealnie dopełni ona aranżację wnętrza. POSTAW NA TĘ LAMPĘ SUFITOWO-WISZĄCĄ I OCZARUJ SWOICH GOŚCI! *MATERIAŁ WYKONANIA*GWINT E27Lampa pająk najlepiej będzie się prezentować z żarówkami typu Edison / VINTAGE.UWAGA! Brak źródła światła w komplecie.    *OSIEM OPRAW*REGULACJA WYSOKOŚCI   *ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-wiszaca-sufitowa-arane-pajak-8-ramion-do-led-8x-e27-lumiled', '', '', '', 'Lampa wisząca sufitowa ARANE PAJĄK 8 ramion do LED 8x E27 LUMILED', '', '', '', ''),
(231, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED. Wyposażony został w 990 diod SMD 2835 LED, które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie), który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami tej serii i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z tej serii za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 65W a w przypadku barwy neutralnej 130W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie. (Zasilanie pilota: 2x AAA 1,5V (brak w zestawie)).Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-geometryczna-plafon-led-zyrandol-130w-3000k-6500k-czarny-pilot', '', '', '', 'Lampa sufitowa geometryczna PLAFON LED żyrandol 130W 3000K-6500K czarny + pilot', '', '', '', ''),
(232, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED o mocy 35W. Wyposażony został w 240 diod SMD 2835 LED, o barwie neutralnej 4000K i strumieniu świetlnym równym 2100lm.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-geometryczna-plafon-led-zyrandol-35w-4000k-czarny', '', '', '', 'Lampa sufitowa geometryczna PLAFON LED żyrandol 35W 4000K czarny', '', '', '', ''),
(233, 1, 1, 'Nowoczesny Żyrandol LED. Wyposażony został w 580 diod SMD 2835 LED które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie) który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami serii Galaxis i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z serii Galaxis za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 20 W a w przypadku barwy neutralnej 77W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie.Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria Galaxis charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.Specyfikacja:W zestawie:', '', 'lampa-sufitowa-zyrandol-led-galaxis-virgo-72w-czarny-pilot', '', '', '', 'Lampa Sufitowa Żyrandol LED GALAXIS VIRGO 72W czarny + Pilot', '', '', '', ''),
(234, 1, 1, 'Lampa sufitowa Iglo to świetna propozycja dla miłośnika nowoczesnych i minimalistycznych wnętrz. Plafon został wykonany z wysokiej jakości tkaniny i metalu, dzięki czemu będzie działać niezawodnie przez długi czas jednocześnie pięknie się prezentując. Oprawa za sprawą swojego minimalistycznego wyglądu idealnie wkomponuje się niemalże w każde pomieszczenie, będąc przy tym świetną dekoracją. Biała lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 40W, wraz z którymi rozjaśni pomieszczenie i wprowadzi w nie przyjemną atmosferę.', '', 'plafon-lampa-sufitowa-iglo-40-cm-bialy-3x-e27-abazur-tkanina-i-pcv-lampex', '', '', '', 'Plafon Lampa sufitowa Iglo 40 cm Biały 3x E27 Abażur tkanina i PCV Lampex', '', '', '', ''),
(235, 1, 1, 'Podwójny KINKIET FIONA z wysokiej jakości materiałów w kolorze miętowym doskonale sprawdzi się do oświetlania ścian fasad budynku. Przystosowany do energooszczędnych źródeł światła z trzonkiem E14 (mały gwint) o maksymalnej mocy 8W. Żarówki LED można dokupić na pozostałych naszych aukcjach. Lampa wykonana została z stali proszkowanej i stanowi piękny dodatek do Twojego wnętrza. Oprawka zasilana jest typowym napięciem 230V.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-fiona-oprawa-scienna-2xe14-do-sufitu-mieta-polux', '', '', '', 'KINKIET FIONA oprawa ścienna 2xE14 do sufitu MIĘTA POLUX', '', '', '', ''),
(236, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem?Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ!POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!Nowoczesny Żyrandol LED. Wyposażony został w 250 diod SMD 2835 LED, które posiadają opcję ściemniania oraz zmiany barwy światła. Do regulacji pracy urządzenia służy dedykowany pilot (w zestawie), który pozwala nam na zmniejszanie bądź zwiększanie intensywności światła lub zmianę jego barwy z ciepłej na neutralna, lub zimną. Pilot działa radiowo co oznacza, że nie musimy celować w konkretny punkt w celu zmiany ustawień.Pilot 4-strefowy współpracuje ze wszystkimi produktami tej serii i pozwala na dowolną ich konfigurację. Dodatkowo pozwala on na jednoczesne sterowanie wielu produktów z tej serii za pomocą tylko jednego pilota.Produkt można ściemniać w zakresie od 1% - 100% mocy a barwę światła zmienimy w zakresie 3000K - 6500K. Przy ustawieniu białego ciepłego/zimnego maksymalna moc produktu wynosi 16W a w przypadku barwy neutralnej 33W. Zmian dokonujemy za pośrednictwem pilota RF znajdującego się w zestawie. (Zasilanie pilota: 2x AAA 1,5V (brak w zestawie)).Produkt składa się głównie z aluminium (obudowa), tworzywa sztucznego (klosz) i stali (podstawa). Seria ta charakteryzuje się ciekawym designem skierowanym zarówno do miłośników nowoczesnego stylu jak i bardziej uniwersalnego.WYMIARY:GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-okragla-plafon-led-zyrandol-33w-3000k-6500k-bialy-pilot', '', '', '', 'Lampa sufitowa okrągła PLAFON LED żyrandol 33W 3000K-6500K biały + pilot', '', '', '', ''),
(237, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna GAVI z trzema punktami świetlnymi w nowoczesnym stylu o mocy 13,5W i strumieniu świetlnym 720lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Oprawa będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻUGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowo-scienna-ruchoma-regulowana-135w-led-gavi-3-czarny-3000k-polux', '', '', '', 'Lampa oprawa sufitowo-ścienna ruchoma regulowana 13,5W LED GAVI 3 czarny 3000K Polux', '', '', '', ''),
