ufitowa geometryczna PLAFON LED żyrandol 130W 3000K-6500K biały + pilot', '', '', '', ''),
(239, 1, 1, 'Lampa sufitowa z kolekcji JOKER WHITE to niezwykły produkt, który doskonale pasuje do minimalistycznych, nowoczesnych bądź industrialnych wnętrz. Biała lampa, w kształcie pająka z pięcioma ramionami, pięknie oświetli każde pomieszczenie, w którym się ją zamontuje. Lampa loft została wyprodukowana przez markę MiLAGRO, co świadczy o wysokiej jakości produktu. Srebrne elementy doskonale komponują się z białymi oprawami tworząc elegancką całość, która zachwyca i nadaje wnętrzom niepowtarzalnego charakteru. Lampa pająk współpracuje z żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Ponadto kolekcja JOKER objęta jest gwarancją producenta. Czas jej trwania wynosi 24 miesiące. W tym okresie wszelkie naprawy są świadczone nieodpłatnie.', '', 'lampa-sufitowa-joker-biala-5x-gu10-milagro-metal-pajak-loft', '', '', '', 'Lampa sufitowa JOKER biała 5x GU10 MILAGRO Metal pająk loft', '', '', '', ''),
(240, 1, 1, 'Żyrandol Gina został stworzony z myślą o miłośnikach stylu klasycznego. Lampa sufitowa z dwoma punktami świetlnymi to doskonałe połączenie bieli i srebra, które nadaje całości eleganckiego i zarazem interesującego wyglądu. Klasyczna lampa cechuje się okrągłymi, szklanymi kloszami, które posiadają ciekawą i nieregularną teksturę, przywodzącą na myśl kwiaty. Metalowa oprawa lampy zwieńczona jest dekoracyjnymi listkami, które doskonale dopełniają całości nadając lampie szyku i elegancji. Do produkcji wykorzystano tylko materiały najwyższej jakości, dzięki czemu prezentuje się doskonale na każdym suficie. Lampa przystosowana jest do pracy z żarówkami o trzonku E14, o mocy maksymalnej 60W, wraz z którymi pięknie oświetli pomieszczenie.', '', 'zyrandol-lampa-sufitowa-gina-2x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Gina 2x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(241, 1, 1, 'Lampa sufitowa Iglo, o szerokości wynoszącej 50cm i w kolorze białym, to świetna propozycja dla miłośnika nowoczesnych i minimalistycznych wnętrz. Plafon został wykonany z wysokiej jakości tkaniny i metalu, dzięki czemu będzie działać niezawodnie przez długi czas jednocześnie pięknie się prezentując. Oprawa za sprawą swojego minimalistycznego wyglądu idealnie wkomponuje się niemalże w każde pomieszczenie, będąc przy tym świetną dekoracją. Biała lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 40W, wraz z którymi rozjaśni pomieszczenie i wprowadzi w nie przyjemną atmosferę.', '', 'plafon-lampa-sufitowa-biala-iglo-50-cm-3x-e27-abazur-tkanina-i-pcv-lampex', '', '', '', 'Plafon Lampa sufitowa biała Iglo 50 cm 3x E27 Abażur tkanina i PCV Lampex', '', '', '', ''),
(242, 1, 1, 'Lampa sufitowa z trzema punktami świetlnymi (3 klosze) serii DAMA GREY, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Szary klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-w-stylu-skandynawskim-szara-milagro-dama-3x-e27-drewno-metal', '', '', '', 'Lampa sufitowa w stylu skandynawskim szara MiLAGRO DAMA 3x E27 Drewno + metal', '', '', '', ''),
(243, 1, 1, 'Lampa Sufitowa - Żyrandol serii Galaxis w kolorze czarnym (RAL 9017) łączy w sobie nowoczesność, ciekawy wygląd i prostotę użytkowania. Lampa została wyposażona w zintegrowane źródło światła LED o mocy 90W. Atutem lampy LED jest możliwość zmiany barwy światła oraz ściemniania. Lampą możemy sterować za pomocą dedykowanego pilota. Pilot pozwala nam na zmniejszanie bądź zwiększanie intensywności światła, zmianę jego barwy z ciepłej na neutralna lub zimną oraz włączanie i wyłączanie lampy.Pilot współpracuje ze wszystkimi produktami serii GALAXIS. Za pomocą tylko jednego pilota możemy sterować wieloma lampami serii GALAXIS jednocześnie. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-led-90w-cct-galaxis-vela-czarny-pilot-sterujacy', '', '', '', 'Lampa Sufitowa Żyrandol LED 90W CCT GALAXIS VELA Czarny + Pilot Sterujący', '', '', '', ''),
