(245, 1, 1, 'Lampa Sufitowa - Żyrandol serii Galaxis w kolorze czarnym (RAL 9017) łączy w sobie nowoczesność, ciekawy wygląd i prostotę użytkowania. Lampa została wyposażona w zintegrowane źródło światła LED o mocy 60W. Atutem lampy LED jest możliwość zmiany barwy światła oraz ściemniania. Lampą możemy sterować za pomocą dedykowanego pilota. Pilot pozwala nam na zmniejszanie bądź zwiększanie intensywności światła, zmianę jego barwy z ciepłej na neutralna lub zimną oraz włączanie i wyłączanie lampy.Pilot współpracuje ze wszystkimi produktami serii GALAXIS. Za pomocą tylko jednego pilota możemy sterować wieloma lampami serii GALAXIS jednocześnie. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-zyrandol-led-60w-cct-galaxis-phoenix-czarny-pilot-sterujacy', '', '', '', 'Lampa Sufitowa Żyrandol LED 60W CCT GALAXIS PHOENIX Czarny + Pilot Sterujący', '', '', '', ''),
(246, 1, 1, 'Atlanta to nowoczesny plafon ledowy utrzymany w bogatej stylistyce. Pilot dołączony do zestawu umożliwia zmianę barwy światła oraz zdalne włączanie i wyłączanie lampy. Duża ilość szklanych ozdób nadaje jej elegancki wygląd. Produkt został wykonany z materiałów najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie zachowując walory niezawodności. Szczególnie polecany do stylowych, nowoczesnych wnętrz.   Szklana lampa współgra z żarówkami o trzonku G4 oraz mocy max 20W (brak w zestawie).', '', 'lampa-sufitowa-plafon-atlanta-4xg4-krysztalki-metal-i-szklo-styl-nowoczesny-glamour-lampex-pilot', '', '', '', 'Lampa sufitowa plafon Atlanta 4xG4 kryształki Metal i szkło styl nowoczesny glamour Lampex + pilot', '', '', '', ''),
(247, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWO-ŚCIENNEJ!Kinkiet w loftowym stylu z jednym punktem świetlnym, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.      *KLOSZ   *ŁATWOŚĆ MONTAŻU *REGULOWANA LAMPA     *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-filis-geometryczna-ruchoma-druciana-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowo-ścienna FILIS geometryczna ruchoma druciana loft do LED 1xE27 LUMILED', '', '', '', ''),
(248, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 8,4W i strumieniu świetlnym 850lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Belka będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPYGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-ruchoma-regulowana-84w-led-berg-2-bialy-3000k-polux', '', '', '', 'Lampa sufitowo-ścienna ruchoma regulowana 8,4W LED BERG 2 biały 3000K Polux', '', '', '', ''),
(249, 1, 1, 'Żyrandol Yoko to idealny produkt dla osób, które cenią sobie klasyczny i elegancki styl. Dzięki ponadczasowemu połączeniu kolorów: złota i bieli, żyrandol pięknie się prezentuje i można go wkomponować w dowolne pomieszczenie. Lampa sufitowa cechuje się podłużnymi kloszami, które umieszczone są na finezyjnej i metalowej oprawie. Klasyczna lampa została wykonana z materiałów wysokiej jakości, które sprawiają, że lampa będzie działać niezawodnie przez długi czas. Elegancka lampa współpracuje z trzema żarówkami E14 o mocy maksymalnej 60W, wraz z którymi wprowadzi w pomieszczenie przyjemną atmosferę.', '', 'zyrandol-lampa-sufitowa-yoko-3x-e14-metal-i-szklo-lampex-bialy-zloty-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Yoko 3x E14 Metal i szkło Lampex Biały + złoty Styl klasyczny', '', '', '', ''),
(250, 1, 1, 'Żyrandol Yoko, z pięcioma kloszami, to idealny produkt dla osób, które cenią sobie klasyczny i elegancki styl. Dzięki ponadczasowemu połączeniu kolorów: złota i bieli, żyrandol pięknie się prezentuje i można go wkomponować w dowolne pomieszczenie. Lampa sufitowa cechuje się podłużnymi kloszami, które umieszczone są na finezyjnej i metalowej oprawie. Klasyczna lampa została wykonana z materiałów wysokiej jakości, które sprawiają, że lampa będzie działać niezawodnie przez długi czas. Elegancka lampa współpracuje z pięcioma żarówkami E14 o mocy maksymalnej 60W, wraz z którymi wprowadzi w pomieszczenie przyjemną atmosferę.', '', 'zyrandol-lampa-sufitowa-yoko-5x-e14-metal-i-szklo-lampex-bialy-zloty-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Yoko 5x E14 Metal i szkło Lampex Biały + złoty Styl klasyczny', '', '', '', ''),
(251, 1, 1, 'Plafon Tokyo to stylowe połączenie prostej budowy i wyszukanego wzornictwa. Owalny kształt klosza ozdobiony japońskim wzorem, doskonale podkreśli charakter każdego wnętrza. Został wykonany z wysokiej jakości materiałów dzięki czemu świetnie się prezentuje,zachowując jednocześnie walory niezawodności.Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'plafon-p1-tokyo-bialy-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Plafon P1 Tokyo Biały 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(252, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna RAWI z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 8,4W i strumieniu świetlnym 850lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Belka będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!*MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPYGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-ruchoma-regulowana-84w-led-rawi-2-bialy-3000k-polux', '', '', '', 'Lampa sufitowo-ścienna ruchoma regulowana 8,4W LED RAWI 2 biały 3000K Polux', '', '', '', ''),
(253, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Sofia w kolorach czarno-mieździowym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Sofia która została wyposażona w potrójne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Przy połączeniu ozdobnych żarówek Led oraz czarnego klosza wykonanego z drutu uzyskamy niesamowity efekt który doda naszym wnętrzom charakteru i ciekawszego wyglądu. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-sofia-3xe14-polux-5901508310958', '', '', '', 'Oprawa ścienna KINKIET Spot Sofia 3xE14 Polux 5901508310958', '', '', '', ''),
(254, 1, 1, 'Lampa sufitowa Wenecja, w kolorze szarym to elegancka lampa w stylu glamour. Klasyczna lampa posiada finezyjny abażur spod którego zwisają akrylowe kryształki, które sprawiają, że lampa ta będzie się pięknie prezentować w każdym wnętrzu. Lampa z abażurem została wykonana z materiałów wysokiej jakości, dzięki czemu będzie służyć niezawodnie przez długi czas. Lampa współpracuje z żarówką o trzonku E27 o mocy maksymalnej 60W, wraz z którą pięknie oświetli wnętrze i wprowadzi w nie niepowtarzalną atmosferę.', '', 'lampa-sufitowa-wenecja-popiel-1x-e27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Lampa sufitowa Wenecja Popiel 1x E27 Metal abażur tkanina kryształki Lampex styl glamour', '', '', '', ''),
(255, 1, 1, 'Major to stylizowana na styl retro lampa sufitowa. Przepięknej budowy klosze przypominające kielichy kwiatów wspaniale będą prezentować się w każdym pomieszczeniu. Urok i wdzięk, które reprezentuje oprawa oświetleniowa nadadzą wnętrzu świeżości. Wysokiej jakości materiały sprawią, że produkt jest niezwykle odporny na zniszczenia.  Szklana lampa współgra z żarówkami o trzonku E14 oraz mocy max 60W (brak w zestawie).', '', 'lampa-sufitowa-major-3-kwiaty-3xe14-retro-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Major 3 Kwiaty 3xE14 Retro Metal i szkło Lampex', '', '', '', ''),
(256, 1, 1, 'Gracia to lampa sufitowa, która jest świetną propozycją dla miłośników nowoczesnych wnętrz. Nowoczesna lampa za sprawą dekoracyjnych mlecznych kloszy oraz czarnego korpusu będzie pięknym elementem dekoracyjnym w niemalże każdym pomieszczeniu. Korpus lampy sufitowej przywodzi na myśl pętlę, która przykuwa uwagę i nie sposób przejść obok niej obojętnie. Lampa wykonana z najwyższej jakości metalu i szkła  pozwoli cieszyć się trwałością oraz niezawodnością przez wiele lat. Lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 60W, wraz z którymi pięknie oświetli każde pomieszczenie.', '', 'lampa-sufitowa-gracia-3x-e27-metal-i-szklo-lampex-styl-nowoczesny', '', '', '', 'Lampa sufitowa Gracia 3x E27 Metal i szkło Lampex styl nowoczesny', '', '', '', ''),
(257, 1, 1, 'Żyrandol z kolekcji Beja to niezwykle elegancki produkt, stworzony z myślą o klasycznych wnętrzach. Lampę sufitową wyróżnia doskonałe połączenie metalu i szkła. Klasyczny żyrandol posiada krętą i metalową oprawę oraz łączące się z nią białe i szklane klosze. Delikatne i drobne kryształki, oplatające trzy białe klosze, układają się na kształt pierścieni, dzięki czemu nadają lampie szyku i elegancji. Lampa sufitowa idealnie uzupełni wystrój każdego wnętrza, nadając mu szczególny charter. Lampa pracuje z żarówkami E27, o mocy maksymalnej 60W (brak w zestawie), wraz z którymi pięknie oświetli pomieszczenie.', '', 'zyrandol-lampa-sufitowa-beja-3x-e27-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Beja 3x E27 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(258, 1, 1, 'Lampa sufitowa z trzema czarnymi oprawkami, w których można zamontować żarówki LED o trzonku GU10 to produkt wysokiej jakości ze źródłem światła LED w komplecie. Żyrandol został stworzony po to, aby pięknie oświetlić garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu. Dołączone do kompletu żarówki LED o mocy 3W i białej ciepłej barwie światła wprowadzą przyjemną atmosferę i oświetlą pięknym, optymistycznym światłem ciemny korytarz czy garderobę. Nowoczesny design lampy, zaprojektowany w zgodzie z najnowszymi trendami, to praktyczny i niebanalny dodatek, który będzie w stanie ożywić i odmienić wnętrze.	Jeśli poszukujesz dobrej jakościowo lampy sufitowej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem. Dodatkowo żyrandol posiada dołączone źródła światła, co jest jego ogromną zaletą.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-sufitowa-czarna-zyrandol-do-garderoby-3x-gu10-3x-zarowka-led-gu10-3w', '', '', '', 'Nowoczesna lampa sufitowa czarna żyrandol do garderoby 3x GU10 + 3x żarówka LED GU10 3W', '', '', '', ''),
(259, 1, 1, 'Lampa dziecięca z kolekcji CORAZON to uroczy żyrandol, w fioletowym kolorze, który zdobią fantazyjnie wiszące kryształki i serduszka. Fioletowa lampa współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa dla dzieci za sprawą mieniących się kryształków wywoła uśmiech na twarzy każdego dziecka. Lampa z serduszkami, w fioletowym kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy CORAZON od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-fioletowa-zyrandol-serduszka-corazon-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa fioletowa Żyrandol Serduszka CORAZON 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(260, 1, 1, 'Lampa sufitowa z linii produktów WEST BLACK to niezwykle nowoczesna lampa charakteryzująca się geometrycznym i wyrazistym kształtem. Lampa wisząca została wyprodukowana przez polską markę MiLAGRO. Jej trzy czarne i podłużne klosze przyciągają uwagę, a drewniany element doskonale z nimi współgra. Lampa łączy w sobie nowoczesny design ze skandynawskim stylem i przywiązaniem do natury. Czarna lampa będzie stanowić idealne uzupełnienie wnętrz utrzymanych w minimalistycznym, skandynawskim bądź nowoczesnym stylu. Lampa współpracuje z pięcioma żarówkami o trzonku GU10, o mocy maksymalnej 8W.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkty wyprodukowane przez firmę MiLAGRO objęto 2-letnim okresem gwarancji. Po tym czasie można skorzystać ze specjalistycznego serwisu firmowego.', '', 'lampa-wiszaca-sufitowa-west-czarna-3x-gu10-milagro-geometryczna-metal-drewno', '', '', '', 'Lampa wisząca sufitowa WEST czarna 3x GU10 MILAGRO geometryczna metal + drewno', '', '', '', ''),
(261, 1, 1, 'Lampa sufitowa Macao charakteryzuje się pięknym i eleganckim wyglądem, który idzie w parze z nowoczesną technologią. Lampa w stylu glamour  o niepowtarzalnym kształcie zdobiona jest kryształem oraz szklanymi bryłami, które doskonale podkreślą charakter nowoczesnych pomieszczeń. Elegancka lampa została wykonana z wysokiej jakości materiałów (szkła i metalu), dzięki czemu świetnie prezentuje się w nowoczesnych wnętrzach, działając niezawodnie przez długi czas. Lampa współpracuje z żarówkami G4, wraz z którymi stworzy w pomieszczeniu niepowtarzalną atmosferę. Lampa z kryształkami idealnie sprawdzi się na salach weselnych czy w restauracjach. Lampa w zestawie posiada pilot, który umożliwia włączenie różnych efektów świetlnych. Lampa z pilotem szczególnie polecana jest do designerskich i stylowych wnętrz.', '', 'lampa-sufitowa-macao-4x-g4-metal-i-szklo-lampex-styl-glamour-krysztalki-pilot', '', '', '', 'Lampa sufitowa Macao 4x G4 Metal i szkło Lampex Styl glamour Kryształki + Pilot', '', '', '', ''),
(262, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa sufitowa NODUM marki LUMILED SKRĘT z trzema punktami świetlnymi w loftowym stylu charakteryzuje elegancki minimalizm idący w parze ze swobodą i artyzmem, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.kmTa lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!    *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie. *KLOSZ   *ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  INFORMACJA: Źródła światła można podpiąć na kilka włączników.Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-nodum-skret-czarny-do-led-3x-e27-lumiled', '', '', '', 'Lampa sufitowa NODUM SKRĘT czarny do LED 3x E27 LUMILED', '', '', '', ''),
(263, 1, 1, 'LISTWA SUFITOWA LED marki Polux z kolekcji Fucidi w kolorze białym z 3-ema źródłami światła. Lampa sufitowa świetnie sprawdzi się w różnych pomieszczeniach typu: kuchnia, łazienka, biuro/sklep. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K dzięki wbudowanym do oprawy diodom led. Nowoczesne i praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako głowne lub dodatkowe źródło światła Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw led.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-ficudi-3x6w-kolor-bialy-3000k', '', '', '', 'Listwa LAMPA sufitowa LED Polux Ficudi 3x6W Kolor BIAŁY 3000K', '', '', '', ''),
(264, 1, 1, 'LISTWA SUFITOWA LED marki Polux z kolekcji Fucidi w kolorze białym z 4-ema źródłami światła. Lampa sufitowa świetnie sprawdzi się w różnych pomieszczeniach typu: kuchnia, łazienka, biuro/sklep urządzonych w stylu klasycznym i nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K dzięki wbudowanym do oprawy diodom led. Nowoczesne i praktyczne oświetlenie w formie listwy led, może służyć w zależności od potrzeb, jako głowne lub dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele oświetleniowych listw sufitowych led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'listwa-lampa-sufitowa-led-polux-ficudi-4x6w-kolor-bialy-3000k', '', '', '', 'Listwa LAMPA sufitowa LED Polux Ficudi 4x6W Kolor BIAŁY 3000K', '', '', '', ''),
(265, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna RAWI z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 8,4W i strumieniu świetlnym 850lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Belka będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!*MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPYGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-ruchoma-regulowana-84w-led-rawi-2-czarny-3000k-polux', '', '', '', 'Lampa sufitowo-ścienna ruchoma regulowana 8,4W LED RAWI 2 czarny 3000K Polux', '', '', '', ''),
(266, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY sufitowo-ściennej!Lampa sufitowo-ścienna z dwoma punktami świetlnymi w nowoczesnym stylu o mocy 8,4W i strumieniu świetlnym 850lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ WISZĄCĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-ruchoma-regulowana-84w-led-berg-2-czarny-3000k-polux', '', '', '', 'Lampa sufitowo-ścienna ruchoma regulowana 8,4W LED BERG 2 czarny 3000K Polux', '', '', '', ''),
(267, 1, 1, 'Lampa sufitowa z serii Carlos, to wspaniała lampa, która z pewnością zachwyci miłośników stylu loft oraz retro. Żyrandol posiada finezyjnie pozawijany metalowy korpus, który będzie się wspaniale prezentować na suficie i stanie się designerską ozdobą dopełniająca wystrój wnętrza. Lampa loft wykonana z najwyższej jakości metalu pozwoli cieszyć się trwałością oraz niezawodnością przez wiele lat. Lampa Edison polecana jest przede wszystkim do salonu, jadalni, sypialni, kuchni oraz korytarza. Lampa współpracuje z żarówkami o trzonku E27 o mocy maksymalnej 60W (brak w zestawie).', '', 'lampa-sufitowa-zyrandol-carlos-3-3x-e27-metal-lampex-loft-retro-edison', '', '', '', 'Lampa sufitowa żyrandol Carlos 3 3x E27 Metal Lampex loft retro edison', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(268, 1, 1, 'Lampa sufitowa Viola to doskonała propozycja dla miłośników stylu klasycznego. Solidnie wykonana metalowa podstawa została dodatkowo ozdobiona dekoracyjnymi listkami, dzięki czemu przyciąga spojrzenia. Lampa została wykonana z materiałów najwyższej jakości,dzięki czemu wygląda wspaniale, jednocześnie zachowując walory niezawodności.  Lampa sufitowa współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'lampa-sufitowa-viola-2b-czarna-liscie-2xe27-metal-i-szklo-styl-klasyczny-retro-lampex', '', '', '', 'Lampa sufitowa Viola 2B czarna liście 2xE27 Metal i szkło styl klasyczny retro  Lampex', '', '', '', ''),
(269, 1, 1, 'Lampa sufitowa EYE SUPER 6503 to szykowna i minimalistyczna propozycja od firmy Nowodvorski. Gwint GU10 został zamknięty w stalowym kloszu i wbudowany w oprawę w kształcie metalowej tuby, o uniwersalnym czarnym kolorze i niewielkiej średnicy. Stonowana barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Jej obudowa została zawieszona na  sztywnym zawiesiu, dodatkowo możemy manipulować źródłem światła, Dzięki regulowanej konstrukcji klosza.  Lampa EYE SUPER 6503 doskonale sprawdzi się we wnętrzach urządzonych w stylu industrialnym. Z uwagi na swój design - szczególnie polecany  do sypialni nad łóżko, bądź nad nowoczesną wyspę kuchenną. Wysokość całkowita wynosi 77 cm, zaś abażur ma wymiar 20 cm. Maksymalna moc przewidziana na jeden punkt świetlny to 35W. Stopień  ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to GU10, które dostępne są w naszym sklepie.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-tuba-nowodvorski-gu10-czarna-ruchomy-klosz-eye-super-6503-stal-77-cm', '', '', '', 'Lampa sufitowa tuba NOWODVORSKI GU10 Czarna Ruchomy Klosz EYE SUPER 6503 Stal 77 cm', '', '', '', ''),
(270, 1, 1, 'Lampa sufitowa serii DALLAS GOLD, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu z dbałością o każdy detal lampa. Lampa w stylu nowoczesnym przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem GU10. W zestawie jest źródło światła o mocy 3W, które emituje światło o przyjemnej i ciepłej barwie (3000K) o strumieniu świetlnym 300lm.Lampy z kolekcji DALLAS to propozycja dla osób, które szukają do swojego domu rozwiązań nie tylko praktycznych, ale również stylowych. Prosta, geometryczna forma kloszy i elegancka kolorystyka, łącząca czerń i szlachetne złoto, sprawiają, że lampy – poza swoją podstawową funkcją oświetleniową – będą pełniły również rolę designerskiego dodatku. Szczególnie gdy zestawi się je z nowoczesnymi meblami z drewna i malowanego proszkowo metalu.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Źródło światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-czarno-zlota-milagro-dallas-1xgu10-3w-led', '', '', '', 'Lampa sufitowa czarno-złota MiLAGRO DALLAS + 1xGU10 3W LED', '', '', '', ''),
(271, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY SUFITOWO-ŚCIENNEJ!Lampa sufitowo-ścienna z trzema punktami świetlnymi w nowoczesnym stylu o mocy 12,6W i strumieniu świetlnym 1275lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-ruchoma-regulowana-126w-led-berg-3-bialy-3000k-polux', '', '', '', 'Lampa sufitowo-ścienna ruchoma regulowana 12,6W LED BERG 3 biały 3000K Polux', '', '', '', ''),
