(274, 1, 1, 'Isabell to lampa sufitowa, która jest świetną propozycją dla miłośników stylu glamour i nowoczesnego. Nowoczesna lampa za sprawą dekoracyjnych mlecznych kloszy oraz łańcuszka z kryształkami będzie pięknym elementem dekoracyjnym w niemalże każdym pomieszczeniu. Korpus lampy sufitowej przywodzi na myśl pętlę, która przykuwa uwagę i nie sposób przejść obok niej obojętnie. Lampa glamour wykonana z najwyższej jakości metalu i szkła  pozwoli cieszyć się trwałością oraz niezawodnością przez wiele lat. Lampa współpracuje z trzema żarówkami o trzonku E27 o mocy maksymalnej wynoszącej 60W, wraz z którymi pięknie oświetli każde pomieszczenie.', '', 'lampa-sufitowa-isabell-3x-e27-metal-i-szklo-lampex-styl-nowoczesny-glamour', '', '', '', 'Lampa sufitowa Isabell 3x E27 Metal i szkło Lampex styl nowoczesny glamour', '', '', '', ''),
