(276, 1, 1, 'Lampa sufitowa szklana GLOBE PENDANT SMOKE-GREY wykonana w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym, kloszem okrągłym o średnicy 30cm, w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową GLOBE PENDANT SMOKE-GREY firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-wiszaca-sufitowa-szklana-vintage-1906-globe-pendant-30cm-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Wisząca Sufitowa Szklana VINTAGE 1906 GLOBE PENDANT 30cm SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
(277, 1, 1, 'Major to lampa wisząca charakteryzująca się najwyższą jakością. Oprawa oświetleniowa o niecodziennym wyglądzie będzie pełnić nie tylko rolę praktyczną, ale również stanie się genialną ozdobą w pomieszczeniu. Pięć punktów świetlnych sprawią, że każde wnętrze zostanie przepięknie wypełnione jasnością. Klosze stylizowane na kielichy kwiatów zostały perfekcyjnie połączone z czarnym korpusem.  Szklana lampa współgra z żarówkami o trzonku E14 oraz mocy max 40W (brak w zestawie).', '', 'lampa-sufitowa-major-5-5xe14-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Major 5 5xE14 Metal i szkło Lampex', '', '', '', ''),
(278, 1, 1, 'Żyrandol z kolekcji Lima to doskonała lampa do wnętrz w stylu klasycznym. Lampa wisząca wyróżnia się niesymetryczną, metalową oprawą, która nadaje jej ciekawy i niespotykany wygląd. Klasyczna lampa idealnie uzupełni wystrój każdego wnętrza, nadając mu przy tym odrobinę szyku i elegancji. Lampa sufitowa została wykonana z materiałów wysokiej jakości, dzięki czemu będzie działać niezawodnie przez długi czas, jednocześnie pięknie się prezentując. Żyrandol pracuje z żarówkami E14, o mocy maksymalnej 40W, wraz z którymi pięknie oświetli każde wnętrze.', '', 'zyrandol-lampa-sufitowa-lima-3x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Lima 3x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
