(282, 1, 1, 'SILMA LED to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX, która cechuje się nowoczesnym designem w okrągłym płaskim kształcie z możliwością regulacji. Oprawa ścienno-sufitowa została wyposażona w zintegrowane źródło światła o mocy 3x 6W w barwie 3000K - biały ciepły emitujących strumień świetlny na poziomie 3x 320lm. SILMA przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kinkiet LED, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Decydując się na zakup prezentowanej oprawy ścienno-sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. Kanlux SILMA to seria opraw o nietypowym, futurystycznym kształcie. Ciekawy design opraw to przede wszystkim płaskie klosze tych opraw ze zintegrowanymi źródłami światła LED. Polecamy do nowoczesnych, modernistycznych wnętrz.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 24442 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-silma-3x-6w-3000k-ciepla-chrom-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SILMA 3x 6W 3000K Ciepła Chrom Kanlux', '', '', '', ''),
(283, 1, 1, 'Lampa sufitowa szklana CONE SMOKE-GREY  wykonany w stylu VINTAGE renomowanej i cenionej w branży oświetleniowej firmy Ledvance to niezwykle elegancki i minimalistyczny produkt, który wyróżnia się szklanym, estetycznie wykonanym kloszem w kształcie stożka w kolorze dymowym. Kształt klosza zapewnia idealne rozproszenie światła. Lampa współpracuje z żarówkami o trzonku E27 i mocy nie przekraczającej 40W, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom.Oświetlenie sufitowe zostało wykonane w staroświeckim stylu z dbałością o nawet najdrobniejszy szczegół, dzięki czemu będzie się pięknie prezentować w pomieszczeniach użytku codziennego, ma bardzo szeroki obszar zastosowań, swoje idealne miejsce znajdzie w salonie, sypialni, jadalni, pokojach dziennych jak również w restauracjach czy barach, poprzez piękny wygląd lampy sufitowej w połączeniu z żarówką pozwolą się dobrze poczuć i zrelaksować. Przedstawiona lampa to nowoczesne rozwiązanie idące wraz z duchem czasu. Stylowy staroświecki wygląd lampy w połączeniu z żarówkami LED serii VINTAGE 1906 idealnie pasować będą do wnętrz urządzonych w stylu vintage. Piękny styl staroświecki Vintage widoczny w lampie sufitowej zachwyca i pięknie wpasowuje się we współczesne wnętrza.Kupując Lampę Sufitową CONE SMOKE-GREY firmy Ledvance otrzymujesz komplet akcesorii do montażu i podłączenia produktu (Źródło światła nie jest częścią zestawu).Obszar Zastosowań:CECHY, KTÓRE POSIADA LAMPA SUFITOWA:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-szklana-vintage-1906-cone-smoke-grey-przydymiona-ledvance', '', '', '', 'Lampa Sufitowa Szklana VINTAGE 1906 CONE SMOKE-GREY Przydymiona LEDVANCE', '', '', '', ''),
