(285, 1, 1, 'Żyrandol z kolekcji Lima to doskonała lampa do wnętrz w stylu klasycznym. Lampa wisząca wyróżnia się niesymetryczną, metalową oprawą, która nadaje jej ciekawy i niespotykany wygląd. Klasyczna lampa idealnie uzupełni wystrój każdego wnętrza, nadając mu przy tym odrobinę szyku i elegancji. Lampa sufitowa została wykonana z materiałów wysokiej jakości, dzięki czemu będzie działać niezawodnie przez długi czas, jednocześnie pięknie się prezentując. Żyrandol pracuje z żarówkami E14, o mocy maksymalnej 40W, wraz z którymi pięknie oświetli każde wnętrze.', '', 'zyrandol-lampa-sufitowa-lima-5x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Lima 5x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(286, 1, 1, 'Lampa dziecięca z uroczej kolekcji STAR to niebieski żyrandol, który ozdobiony jest mieniącymi się kryształkami i gwiazdkami. Niebieska lampa zamontowana na suficie będzie przywodzić na myśl gwieździste niebo i jednocześnie wywoływać uśmiech na twarzy każdego dziecka. Lampa dla dzieci współpracuje z trzema żarówkami E27, o mocy maksymalnej wynoszącej 60 W (brak w zestawie). Lampa sufitowa za sprawą swojego bajecznego wyglądu świetnie sprawdzi się w dziecięcym pokoju i pięknie go oświetli. Lampa z gwiazdkami, w niebieskim kolorze, wprowadzi w każdym wnętrzu radosną i przyjemną atmosferę. Lampy STAR od firmy MiLAGRO objęte są gwarancją producenta, mają certyfikaty zgodności, a także instrukcję obsługi wraz z elementami niezbędnymi do ich złożenia.', '', 'lampa-dziecieca-sufitowa-niebieska-zyrandol-dla-dzieci-gwiazdki-star-3x-e27-metal-i-krysztalki-milagro', '', '', '', 'Lampa dziecięca sufitowa niebieska Żyrandol dla dzieci Gwiazdki STAR 3x E27 Metal i kryształki Milagro', '', '', '', ''),
(287, 1, 1, 'Lampa sufitowa Natalie to wspaniała propozycja dla miłośników stylu nowoczesnego. Wbudowany moduł LED rozświetli pomieszczenie we wspaniałym stylu. Chromowana oprawa wraz z listwami nadaje lampie elegancki, lekko futurystyczny wygląd.  Lampa współgra z żarówkami o trzonku LED oraz  mocy max 30W (brak w zestawie).', '', 'lampa-sufitowa-natalie-3-led-metal-i-szklo-lampex', '', '', '', 'Lampa sufitowa Natalie 3 LED Metal i szkło Lampex', '', '', '', ''),
(288, 1, 1, 'Żyrandol Nola to produkt stworzony z zamiłowania do klasycznego stylu. Ponadczasowe połączenie bieli i srebra sprawia, że lampa ta wprowadza do pomieszczeń szyk i elegancję. Lampa sufitowa wyróżnia się  falistymi i mleczno-białymi kloszami, które zostały osadzone na symetrycznie pozaginanej metalowej oprawie. Klasyczna lampa będzie wspaniałą ozdobą w każdym klasycznym wnętrzu. Lampa posiada pięć punktów świetlnych, na żarówki o trzonku E27, o mocy maksymalnej 40W, wraz z którymi pięknie oświetli pomieszczenie.', '', 'zyrandol-lampa-sufitowa-nola-5x-e14-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Żyrandol Lampa sufitowa Nola 5x E14 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(289, 1, 1, 'Lampa sufitowa z trzema punktami światła serii DALLAS GOLD, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu z dbałością o każdy detal lampa. Lampa w stylu nowoczesnym przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem GU10. W zestawie jest 3x źródło światła o mocy 3W, które emituje światło o przyjemnej i ciepłej barwie (3000K) o strumieniu świetlnym 300lm.Lampy z kolekcji DALLAS to propozycja dla osób, które szukają do swojego domu rozwiązań nie tylko praktycznych, ale również stylowych. Prosta, geometryczna forma kloszy i elegancka kolorystyka, łącząca czerń i szlachetne złoto, sprawiają, że lampy – poza swoją podstawową funkcją oświetleniową – będą pełniły również rolę designerskiego dodatku. Szczególnie gdy zestawi się je z nowoczesnymi meblami z drewna i malowanego proszkowo metalu.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Źródło światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-czarno-zlota-milagro-dallas-3xgu10-3w-led', '', '', '', 'Lampa sufitowa czarno-złota MiLAGRO DALLAS + 3xGU10 3W LED', '', '', '', ''),
(290, 1, 1, 'Lampa sufitowa z trzema punktami światła serii DALLAS GOLD, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu z dbałością o każdy detal lampa. Lampa w stylu nowoczesnym przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem GU10. W zestawie jest 3x źródło światła o mocy 3W, które emituje światło o przyjemnej i ciepłej barwie (3000K) o strumieniu świetlnym 300lm.Lampy z kolekcji DALLAS to propozycja dla osób, które szukają do swojego domu rozwiązań nie tylko praktycznych, ale również stylowych. Prosta, geometryczna forma kloszy i elegancka kolorystyka, łącząca czerń i szlachetne złoto, sprawiają, że lampy – poza swoją podstawową funkcją oświetleniową – będą pełniły również rolę designerskiego dodatku. Szczególnie gdy zestawi się je z nowoczesnymi meblami z drewna i malowanego proszkowo metalu.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Źródło światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-czarno-zlota-milagro-dallas-3xgu10', '', '', '', 'Lampa sufitowa czarno-złota MiLAGRO DALLAS + 3xGU10', '', '', '', ''),
(291, 1, 1, 'Lampa sufitowa Megan to wspaniała propozycja dla miłośników stylu nowoczesnego. Wbudowany moduł LED w połączeniu z żarówkami rozświetli pomieszczenie we wspaniałym stylu. Chromowana oprawa wraz z półprzeźroczystymi kloszami nadaje lampie elegancki wygląd. Oprawa została wykonana z materiałów najwyższej jakości, dzięki czemu świetnie prezentuje się, jednocześnie zachowując walory niezawodności.  Srebrna lampa współgra z żarówkami o trzonku E14 o mocy max 30W(brak w zestawie).', '', 'lampa-sufitowa-megan-srebrna-33-3xe14-metal-i-szklo-styl-nowoczesny-lampex', '', '', '', 'Lampa sufitowa Megan srebrna 3+3 3xE14 Metal i szkło styl nowoczesny Lampex', '', '', '', ''),
(292, 1, 1, 'Oryginalny plafon COSMO 167  marki Milagro zachowany jest w nowoczesnej stylistyce. Charakteryzują go sporej wielkości rozmiary oraz dwa moduły LED będące źródłem światła. Średnica mniejszego okręgu ma 30 cm, większego 50 cm. Zainstalowane w nich moduły mają moc 36 W, a wykorzystanie technologii LED pozwala zmniejszyć koszty zużycia energii, nie wpływając na jakość źródła światła. Do tego przyjemna dla oka barwa 4000 K, która wprowadza miły klimat do pomieszczeń i dba o odpowiedni nastrój. W zestawie znajdują się niezbędne elementy do jej montażu.Plafon COSMO 167 zachwyca swoją prostą, a zarazem oryginalną formą. Zamontowane na nim dwa źródła światła w kształcie pierścieni, nadają pomieszczeniom charakteru i wyjątkowego stylu. Lampa z powodzeniem znajdzie zastosowanie w każdym pomieszczeniu. Może być też doskonałym uzupełnieniem aranżacji, w której wykorzystano pozostałe lampy z kolekcji Cosmo.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-cosmo-36w-led-okragla-dwa-elementy-pierscienie-ml167-milagro-metal-akryl', '', '', '', 'Lampa sufitowa COSMO 36W LED Okrągła Dwa Elementy Pierścienie ML167 Milagro Metal + Akryl', '', '', '', ''),
(293, 1, 1, 'Kinkiet ścienny LED marki Polux z kolekcji IZAR cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Oprawa wykonana z najlepszej jakości szczotkowanego aluminium, prezentuje sie znakomicie. Kinkiet został wyposażony w gniazdo G9, przystosowane do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 10W. Decydując sie na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta.Mieszkaj modnie i stylowo. Zobacz też pozostałe kinkiety z serii IZAR.Specyfikacja techniczna:', '', 'kinkiet-oprawa-scienna-led-1xg9-izar-polux-aluminium-nikiel', '', '', '', 'Kinkiet Oprawa Ścienna LED 1xG9 IZAR POLUX Aluminium NIKIEL', '', '', '', ''),
(294, 1, 1, 'Lampka ścienna, kinkiet do czytania z serii LEO w kolorze białym przeznaczony do montażu natynkowego. Lampka została wyposażona w nowoczesne źródło światła LED o mocy 3W. Kinkiet emituje neutralne przyjazne dla oczu światło o temperaturze barwowej 4000K. Lampka o elastycznej szyjce o długości 33cm, dzięki czemu możemy ustawiać lampkę według naszych potrzeb. Dodatkowym atutem lampki jest również wbudowany w oprawę wyłącznik - kinkiet możemy w prosty sposób włączać / wyłączać bez konieczności wypinania go z zasilania, szukania wyłącznika na przewodzie jak w przypadku innych lampek tego typu. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-led-elastyczny-kinkiet-do-czytania-leo-3w-4000k-bialy', '', '', '', 'Lampa Ścienna LED Elastyczny Kinkiet do Czytania LEO 3W 4000K Biały', '', '', '', ''),
(295, 1, 1, 'Lampka ścienna, kinkiet do czytania z serii LEO w kolorze czarnym przeznaczony do montażu natynkowego. Lampka została wyposażona w nowoczesne źródło światła LED o mocy 3W. Kinkiet emituje neutralne przyjazne dla oczu światło o temperaturze barwowej 4000K. Lampka o elastycznej szyjce o długości 33cm, dzięki czemu możemy ustawiać lampkę według naszych potrzeb. Dodatkowym atutem lampki jest również wbudowany w oprawę wyłącznik - kinkiet możemy w prosty sposób włączać / wyłączać bez konieczności wypinania go z zasilania, szukania wyłącznika na przewodzie jak w przypadku innych lampek tego typu. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-led-elastyczny-kinkiet-do-czytania-leo-3w-4000k-czarny', '', '', '', 'Lampa Ścienna LED Elastyczny Kinkiet do Czytania LEO 3W 4000K Czarny', '', '', '', ''),
(296, 1, 1, 'Kinkiet ścienny LED marki Polux z kolekcji IZAR cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Oprawa wykonana z najlepszej jakości szczotkowanego aluminium, prezentuje sie znakomicie. Kinkiet został wyposażony w gniazdo G9, przystosowane do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 10W. Decydując sie na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta.Mieszkaj modnie i stylowo. Zobacz też pozostałe kinkiety z serii IZAR.Specyfikacja techniczna:', '', 'kinkiet-oprawa-scienna-led-1xg9-izar-polux-aluminium-czarny', '', '', '', 'Kinkiet Oprawa Ścienna LED 1xG9 IZAR POLUX Aluminium CZARNY', '', '', '', ''),
(297, 1, 1, 'SZUKASZ INTERESUJĄCEGO OŚWIETLENIA DO SALONU, JADALNI LUB SYPIALNI? Postaw na kinkiety ROPE ARTHUR! Kinkiety ROPE ARTHUR marki POLUX stanowią wyjątkową dekorację do wnętrz utrzymanych w charakterze rustykalnym, loftowym i industrialnym.  Z uwagi na swój intrygujący design i metalowe wykończenie, znakomicie będzie  współgrać również ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Lampa świetnie sprawdzi się jako dodatkowe, dekoracyjne źródło światła w pomieszczeniu. Wspaniale prezentuje się w połączeniu z żarówkami typu FILAMENT.Zaletą lampy ROPE ARTHUR jest również staranne wykonanie i zastosowanie przy produkcji materiałów najwyższej jakości. ODMIEŃ SWOJE WNĘTRZE DZIĘKI KINKIETOM Z SERII ROPE ARTHUR!   *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWNA OPRAWA    *WYMIAR LAMPY  *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-rope-line-loft-arthur-e27-polux', '', '', '', 'Kinkiet Lampa Ścienna ROPE LINE Loft Arthur E27 - Polux', '', '', '', ''),
(298, 1, 1, 'Przedstawiona lampa sufitowo-ścienna serii TRAGULA wyprodukowana jest z wysokiej jakości tworzywa sztucznego i stali. Czarny kinkiet został wykonany z dbałością o każdy detal. Lampy zostały zaprojektowane w taki sposób, aby wyeksponować dekoracyjną żarówkę. Oprawa, przystosowana została do pracy z energooszczędnym źródłem światła LED o trzonku E27, dzięki temu gwintowi mamy możliwość zamontowania dowolnego źródła światła. Czarny klosz, gdzie źródło światła, jest częściowo odsłonięte, doskonale oświetla pomieszczenie, przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa w loftowym stylu świetnie sprawdzi się w salonie czy jadalni, gdzie zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, doskonale nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze. Dodatkowym atutem jest to, że lampa jest łamana, dzięki temu możemy ją zamontować na suficie lub na ścianie jako kinkiet.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza. ZASTOSOWANIE:Brak źródła światła w komplecie.WYMIARYProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-tragula-czarna-lamana-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowo-ścienna TRAGULA czarna łamana loft do LED 1xE27 LUMILED', '', '', '', ''),
(299, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze CZARNYM. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w tradycyjne gniazdo E14 do których możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-1xe14-polux-czarny', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 1xE14 Polux CZARNY', '', '', '', ''),
(300, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze białym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-1xe14-polux-5901508310972', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 1xE14 Polux 5901508310972', '', '', '', ''),
(301, 1, 1, 'Lampa ścienna wykonana z wysokiej jakości aluminium marki Ledvance, w kolorze czarnym, która odznacza się ładnym wzornictwem i dużą funkcjonalnością. Dzięki elementom montażowym, które są zawarte w zestawie mamy pewność, iż instalacja jest łatwa i szybka. Przedstawiony przez nas kinkiet zewnętrzny zapewnia nam w ciemności bezpieczeństwo. Produkt spełnia obowiązujące normy europejskie. Lampa współpracuje z żarówkami o trzonku 1x E27, dzięki czemu z łatwością można dobrać do niej źródło światła o parametrach odpowiadającym naszym potrzebom. Lampa jest odpowiednia do inteligentnych zastosowań, dzięki kompatybilności z systemem Smart z lampami firmy LEDVANCE. Kinkiet ENDURA CLASSIC LANTERN CYLINDER to innowacyjne urządzenie które ma swoje zastosowanie na zewnątrz, najlepiej sprawdzi się jako oświetlenie balkonów, patio oraz jako oświetlenie awaryjne. Zastosowane materiały pozwalają uzyskać bardzo dobrą ochronę na oddziaływanie warunków atmosferycznych (IP43), dzięki temu odporna jest przed natryskiwaniem wodą z dowolnego kierunku.Źródła światła nie są dostarczane w zestawie!GŁÓWNE ZASTOSOWANIE:CECHY, KTÓRE POSIADA KINKIET ZEWNĘTRZNY ELEWACYJNY:KORZYŚCI ZE STOSOWANIA PRODUKTU:DODATKOWE INFORMACJE:', '', 'kinkiet-scienny-zewnetrzny-elewacyjny-lampa-scienna-czarna-ip43-endura-classic-lantern-cylinder-e27-ledvance', '', '', '', 'Kinkiet ścienny zewnętrzny elewacyjny lampa ścienna Czarna IP43 ENDURA CLASSIC Lantern Cylinder E27 LEDVANCE', '', '', '', ''),
(302, 1, 1, 'Lampa ścienna z czarnym kloszem na żarówkę o trzonku E27 to lampa wykonana z wysokiej jakości materiałów. Kinkiet ten zaprojektowano z nowatorskim podejściem. Jego nowoczesny wygląd zaskakuje i nadaje pomieszczeniom charakteru. Lampa ścienna została stworzona z myślą o kuchni, choć równie dobrze nada się ona do salonu czy pokoju dziennego, jako światło dodatkowe. Ciekawie zaprojektowany klosz wykonano z niezwykłą dbałością o szczegóły. Ponadto żarówka wkręcona do wiszącej lampy daje ciekawy efekt świetlny, a dzięki czarnemu kloszowi pięknie rozprowadza światło.	Ta lampa ścienna sprawi, że wnętrze z nią stanie się bardziej nowoczesne i przyjemnie będzie spędzać w nim czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-z-kloszem-do-kuchni-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet z kloszem do kuchni 1 x E27', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(303, 1, 1, 'Oprawa LED KANAŁOWA Garażowa ścienno-sufitowa, serii SOMA METAL 100 w kolorze białym, o owalnym kształcie, renomowanej i cenionej w branży oświetleniowej firmy KOBI. Oprawa wykonana z wysokiej jakości materiałów, cechuje się wysoką trwałością i wykonaniem z dbałością o najmniejszy szczegół. Podstawa wykonana jest z tworzywa sztucznego, osłona wykonana z metalu, natomiast klosz jest ze szkła.Lampa kanałowa przystosowana jest do pracy z źródłami światła LED na dużym gwincie E27, w klasach energetycznych A++ - E, żarówki energooszczędne zapewniają mniejsze o nawet 90% zużycie energii względem innych tradycyjnych źródeł światła. Lampa o mocy max. 100W i stopniu ochronności IP44, zastosowane materiały pozwalają uzyskać ochronę na wnikanie pyłu i wilgoci, odporny na deszcz, dzięki temu klosz znajdzie swoje zastosowanie (wewnątrz i na zewnątrz budynku) w pomieszczeniach gospodarczych i domowych, np. w piwnicy, garażu, warsztacie, magazynie, klatce schodowej, a także w ogrodzie, czy też na tarasie. Tanie rozwiązanie na wydajne oświetlenie. Oprawa w kolorze białym z przezroczystym kloszem do montażu sufitowego lub ściennego.OPRAWA KANAŁOWA IDEALNIE SPRAWDZI SIĘ JAKO OŚWIETLENIE:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-led-e27-kanalowa-lampa-garazowa-owal-100w-siatka-metal-ip44-biala-kobi', '', '', '', 'Oprawa LED E27 KANAŁOWA Lampa Garażowa Owal 100W Siatka Metal IP44 Biała KOBI', '', '', '', ''),
(304, 1, 1, 'GLASO to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chromu, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa  została wyposażona w jeden punkt świetlny, do której możemy zamontować żarówkę z trzonkiem G9 o maksymalnej mocy 40W. GLASO przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux GLASO, to rodzina opraw punktowych (sufitowo-ściennych). Dzięki regulacji możemy swobodnie ustawić kąt padania światła. Kształt opraw i ciekawe wzornictwo szklanych kloszy podkreślają charakter wnętrz retro, a chromowane dodatki dodają subtelnego szlifu wnętrzom nowoczesnym.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 19640 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-glaso-g9-chrom-kanlux', '', '', '', 'Oprawa lampa sufitowa GLASO G9 chrom Kanlux', '', '', '', ''),
(305, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Sofia w kolorach czarno-mieździowym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Sofia która została wyposażona w tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Przy połączeniu ozdobnych żarówek Led oraz czarnego klosza wykonanego z drutu uzyskamy niesamowity efekt który doda naszym wnętrzom charakteru i ciekawszego wyglądu. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-sofia-1xe14-polux-5901508310934', '', '', '', 'Oprawa ścienna KINKIET Spot Sofia 1xE14 Polux 5901508310934', '', '', '', ''),
(306, 1, 1, 'Lampa ścienna z okrągłą, czarną oprawką, w której można zamontować żarówkę LED o trzonku GU10 to produkt wysokiej jakości ze źródłem światła LED w komplecie. Kinkiet został stworzony po to, aby pięknie oświetlać garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu. Dołączona do kompletu żarówka LED o mocy 3W i białej ciepłej barwie światła wprowadzi przyjemną atmosferę i oświetli pięknym, optymistycznym światłem ciemny korytarz czy garderobę. Nowoczesny design lampy, zaprojektowany w zgodzie z najnowszymi trandami, to praktyczny i niebanalny dodatek, który będzie w stanie ożywić i odmienić wnętrze.	Jeśli poszukujesz dobrej jakościowo lampy ściennej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem. Dodatkowo kinkiet posiada dołączone źródło światła, co jest jego niewątpliwą zaletą.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-garderoby-1x-gu10-zarowka-led-gu10-3w', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do garderoby 1x GU10 + żarówka LED GU10 3W', '', '', '', ''),
(307, 1, 1, 'MOLI EL-1O to wykonany z najlepszej jakości stali kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chrom/mat, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w jeden punkt świetlny, do którego możemy zamontować żarówkę z trzonkiem GU10 o maksymalnej mocy 50W. MOLI przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux MOLI to rodzina opraw przywodząca na myśl styl retro. Satynowy chrom o opływowych kształtach stanie się ozdoba wnętrz domowych. Decydując się na zakup prezentowanej oprawy ścienno sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 7085 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-moli-1x-gu10-chrom-mat-kanlux', '', '', '', 'Oprawa Lampa Sufitowa MOLI 1x GU10 CHROM MAT Kanlux', '', '', '', ''),
(308, 1, 1, 'Kinkiet Fiona z wysokiej jakości materiałów w kolorze miętowym doskonale sprawdzi się do oświetlania ścian fasad budynku. Przystosowany do energooszczędnych źródeł światła z trzonkiem E14 (mały gwint). Żarówkę LED można dokupić na pozostałych naszych aukcjach. Lampa wykonana została z stali proszkowanej i stanowi piękny dodatek do Twojego wnętrza. Oprawka zasilana jest typowym napięciem 230V.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-fiona-oprawa-scienna-e14-do-sufitu-mieta-polux', '', '', '', 'KINKIET FIONA oprawa ścienna E14 do sufitu MIĘTA POLUX', '', '', '', ''),
(309, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY ściennej!Kinkiet czarny GAVI w nowoczesnym stylu o mocy 4,5W i strumieniu świetlnym 240lm, o ciepłej barwie światła, posiada kąt świecenia 95°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-ruchomy-reflektor-lampa-scienna-regulowana-45w-led-gavi-1-czarny-3000k-polux', '', '', '', 'Kinkiet ruchomy reflektor lampa ścienna regulowana 4,5W LED GAVI 1 czarny 3000K Polux', '', '', '', ''),
(310, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ! Lampa sufitowa w nowoczesnym stylu jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!    *MATERIAŁ WYKONANIA*GWINT GU10UWAGA! Brak źródła światła w komplecie.   *ŁATWOŚĆ MONTAŻU *REGULACJA KĄTA ŚWIECENIA       *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-gu10-led-ruchomy-czarny', '', '', '', 'Lampa ścienna kinkiet GU10 LED ruchomy czarny', '', '', '', ''),
(311, 1, 1, 'Wodoszczelna, Hermetyczna Lampa Ścienna serii BULKHEAD renomowanej i cenionej w branży oświetleniowej firmy Ledvance. Lampa koloru białego wykonana z wysokiej jakości tworzywa sztucznego cechuje się wysoką trwałością oraz odpornością na cieżkie warunki atmosferyczne. W oprawie wbudowane zostało zintegrowane źródło światła LED, które jest bardzo energooszczędne zapewnia mniejsze o nawet 90% zużycie energii względem innych tradycyjnych źródeł światła. Lampa o mocy 11W posiada doskonałe parametry świetlne - strumień świetlny na poziomie 800lm, emituje neutralne przyjemne dla użytkowników, nieoślepiające światło o temperaturze barwowej 4000K. Lampa o mlecznym - białym kloszu, wpasuje się w niemal każde wnętrze, swoje zastosowanie znajduje głównie jako oświetlenie ogólne w mniejszych wewnętrznych pomieszczeniach mieszkalnych o podwyższonej wilgotności oraz jako oświetlenie zewnętrzne.PLAFON IDEALNIE SPRAWDZI SIĘ JAKO OŚWIETLENIE:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 5-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-led-11w-4000k-ip54-hermetyczna-zewnetrzna-biala-bulkhead-ledvance', '', '', '', 'Lampa Ścienna LED 11W 4000K IP54 Hermetyczna Zewnętrzna Biała BULKHEAD LEDVANCE', '', '', '', ''),
(312, 1, 1, 'Kinkiety SQUALLA  to seria ściennych opraw LED marki SPECTRUM LED charakteryzujących się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonany z wysokogatunkowego odlewu stopu aluminium kinkiet przystosowany został do pracy z energooszczędnymi źródłami światła LED z gwintem G9. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Ta kompaktowych rozmiarów punktowa oprawa przeznaczona została do montażu natynkowego (naściennego). Prócz źródła oswietlenia ten ozdobny kinkiet zapewnia również eleganckie wrażenia estetyczne dla wystroju każdego wnętrza. Produkt występuje w różnych wersjach i kolorach, które można znaleźć na pozostałych naszych aukcjach.KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-scienny-led-squalla-g9-spectrum-bialo-zloty', '', '', '', 'Kinkiet Ścienny LED SQUALLA G9 SPECTRUM BIAŁO-ZŁOTY', '', '', '', ''),
(313, 1, 1, 'MANUFACTURE 9742 to unikatowa lampa o loftowym charakterze. Industrialna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze industrialnym oraz nowoczesnym. Pod nazwą tą kryje się bowiem efektowna lampa ścienna, przypominająca bombkę, w której kryję się źródło światła. Zaletą lamp drucianych jest to, że samoistnie tworzą, część aranżacji wnętrza przez swoje oryginalne formy jednocześnie dając dużo światła w pomieszczeniu. Dodatkową dekoracją metalowych części jest wykorzystanie dekoratywnych żarówek najlepiej w stylu vintage. Lampy druciane coraz częściej wieszane są w kuchni, pokojach dziennych czy młodzieżowych. Lampy druciaki są o tyle uniwersalne, że nie określają aranżacji pomieszczenia, choć najczęściej są użytkowane w pomieszczeniach industrialnych i skandynawskich. Z uwagi na swój intrygujący design, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość pojedynczego klosza lampy to 32 cm, a szerokość wynosi 33 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-e27-retro-loft-9742-manufacture-czarna-miedz-stal', '', '', '', 'Lampa ścienna NOWODVORSKI E27 Retro Loft 9742 MANUFACTURE Czarna Miedź Stal', '', '', '', ''),
(314, 1, 1, ' Oprawa ścienna RIZZO to gipsowa oprawa dekoracyjna LED firmy Kobi. Została wykonana z połączenia wysokiej jakości gipsu i metalu. Produkt odznacza się przede wszystkim wysoką odpornością na czynniki zewnętrzne takie jak ciepło i zimno. W przeciwieństwie do aluminiowych, wyprodukowana ze specjalnego rodzaju gipsu oprawa nie poddaje się korozji. Oferowany na tej aukcji kinkiet gipsowy z serii Art of Light jest łatwy w montażu, a także można go pomalować farbami ściennymi na dowolny kolor wedle uznania, dzięki czemu idealnie dopasuje się do Twoich pomieszczeń. Oprawa przystosowana jest do pracy z żarówkami LED z trzonkiem GU10 zużywającymi nawet do 90% mniej energii o maksymalnej mocy nieprzekraczającej 35W. Produkt znakomicie sprawdzi się jako oświetlenie dekoracyjne lub dodatkowe dla Twojego wnętrza. Stylowo oświetli Twój salon, korytarz, pokój lub dowolnie wybrane przez Ciebie miejsce. Dane szczegółowe Oferowana na tej aukcji podwójna oprawa przystosowana jest do źródeł światła o gwincie GU10. Jeśli szukasz innej oprawy to zapraszamy do odwiedzenia pozostałych naszych aukcji. Szeroki wybór asortymentu oraz konkurencyjne ceny.', '', 'oprawa-scienna-rizzo-2xgu10-gipsowa-kobi-dekoracyjna-led', '', '', '', 'Oprawa ścienna RIZZO 2xGU10 GIPSOWA KOBI DEKORACYJNA LED', '', '', '', ''),
(315, 1, 1, 'SZUKASZ NOWOCZESNEGO  I NASTROJOWEGO OŚWIETLENIA? Postaw na kinkiet z serii MODERN!Kinkiet ścienny LED marki Polux z kolekcji Modern w kolorze białym świetnie sprawdza się w pomieszczeniach typu korytarze, klatki schodowe salony i sypialnie. Pasuje do aranżacji utrzymanych w stylu modernistycznym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, pozwala idealnie wybraną przez siebie przestrzeń. Sprawdza się również w roli lampek nocnych w sypialni. Rozjaśni wnętrze ciepłym, miękkim światłem. Do klasycznego reflektora będzie pasować każda żarówka z trzonkiem E27 o maksymalnej mocy 20W LED, którą także można zamówić na naszej stronie Internetowej.ODMIEŃ SWOJE WNĘTRZE DZIĘKI KINKIETOM MODERN!  *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWNA OPRAWA    *WYMIAR LAMPY *REGULACJA KĄTA PADANIA ŚWIĘTA  *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-reflektor-do-led-e27-modern-w306-c-bialo-zloty-polux', '', '', '', 'Kinkiet Lampa Ścienna Reflektor do LED E27 MODERN W306-C Biało-Złoty - Polux', '', '', '', ''),
(316, 1, 1, 'SZUKASZ STYLOWEGO I NASTROJOWEGO OŚWIETLENIA DO SWOJEJ SYPIALNI? POSTAW NA KINKIETY Z SERII VEJLE!Kinkiet VEJLE o eliptycznym kształcie klosza ma niezwykle ozdobną, elegancką formę. Jego czarna, metalowa konstrukcja ozdobiona została kroplami szkła. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym. Będzie pasować również do aranżacji inspirowanych stylem retro i glamur.  Stworzony zosta  z dużą dbałością o szczegóły z wysokiej jakości stali i pięknie oszlifowanego szkła, które w dzień pięknie się mieni. Wieczorem natomiastpozwala uzyskać niezwykły efekt rozproszenia światła. Sprawdzi się nie tylko w sypialni, ale także w salonie, jako dodatkowe dekoracyjne oświetlenie. ODMIEŃ SWOJĄ SYPIALNIĘ DZIĘKI KINKIETOM Z SERII VEJLE!  *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWANA OPRAWA    *WYMIAR LAMPY *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Prezentowana lampa doskonale prezentuje się w połączeniu z innymi elementami oświetlenia z serii VEJLE. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu.  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-vejle-w351-polux-eliptyczna', '', '', '', 'Oprawa ścienna kinkiet Vejle W351 POLUX eliptyczna', '', '', '', ''),
(317, 1, 1, 'Duna to klasyczny kinkiet o jasnej, stonowanej barwie. Owalny kształt klosza doskonale podkreśli charakter każdego wnętrza. Lampa została wykonana z wysokiej jakości materiałów dzięki czemu świetnie prezentuje się, zachowując jednocześnie walory niezawodności. Owalna lampa współgra z żarówką o gwincie E27 oraz mocy max 6W (brak w zestawie).', '', 'kinkiet-k1-duna-biala-patyna-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet K1 Duna biała patyna 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(318, 1, 1, 'Lampa ścienna w kształcie prostokąta to minimalistyczny i piękny dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet cechuje piękno wynikające z prostoty. Lampa ścienna w połączeniu z żarówką LED wprowadzą w pomieszczeniu przyjemną atmosferę. Dzięki temu, że nic nie osłania żarówki będzie ona ozdobą wnętrza. Lampa ścienna o prostokątnym kształcie idealnie nadaje się do salonu jak również sypialni czy pokoju gościnnego jako oświetlenie dodatkowe. Wysoka jakość wykonania kinkietu jest gwaracją tego, że będzie on zachwycał swoim wyglądem przez długi czas. 	Lampa ścienna zaprojektowana z niezwykłą dbałością o szczegóły nada charakteru Twojemu wnętrzu i oświetli go pięknym blaskiemProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-salonu-prostokat-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do salonu prostokąt 1 x E27', '', '', '', ''),
(319, 1, 1, 'Kinkiet ścienny, model Cegiełka to oprawa marki Polux charakteryzująca się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonana w całości z gipsu, ręcznie szlifowana oprawa została przystosowana do pracy z energooszczędnymi źródłami światła LED z gwintem E14. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Efektowny kinkiet o niewielkich rozmiarach został dostoswany do montażu natynkowego (naściennego). Oprawa świetnie wkomponuje się w nowoczesne wnętrza, gdzie dominują proste aczkolwiek niebanalne formy. Ponadto, oprawę można malować na dowolny kolor.KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-gipsowa-ozdobna-kinkiet-scienny-cegielka-1xe14-biala-polux', '', '', '', 'Oprawa gipsowa, ozdobna, kinkiet ścienny CEGIEŁKA 1xE14 biała POLUX', '', '', '', ''),
(320, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-deluxe-a-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado DELUXE A biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(321, 1, 1, 'Kinkiet ścienny model NELA to unikatowa oprawa LED marki Polux charakteryzująca się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonana w całości z gipsu, ręcznie szlifowana oprawa o opływowym ksztłacie została przystosowana do pracy z energooszczędnymi źródłami światła LED z gwintem E14. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Efektowny kinkiet o niewielkich rozmiarach został dostoswany do montażu natynkowego (naściennego). Oprawa świetnie wkomponuje się w nowoczesne wnętrza, gdzie dominują proste aczkolwiek niebanalne formy. Ponadto, oprawę można malować na dowolny kolor. KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-gipsowa-kinkiet-scienny-polokragly-nela-1xe14-biala-polux', '', '', '', 'Oprawa gipsowa, kinkiet ścienny, półokrągły NELA 1xE14 biała POLUX', '', '', '', ''),
(322, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze CZARNYM. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w dwa tradycyjne gniazda E14 do których możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła. Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-2xe14-polux-czarny', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 2xE14 Polux CZARNY', '', '', '', ''),
(323, 1, 1, 'Kinkiet ALMA (producent Eko-Light) został wyprodukowany przez polską markę - MiLAGRO. Czarny kinkiet został wykonany z dbałością o każdy detal. Metalowy i druciany klosz o geometrycznym kształcie przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa ścienna współpracuje z żarówkami o trzonku E27. Lampa w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-industrialnym-lampa-scienna-czarna-druciana-milagro-alma-1x-e27', '', '', '', 'Kinkiet w stylu industrialnym lampa ścienna czarna druciana MiLAGRO Alma 1x E27', '', '', '', ''),
(324, 1, 1, 'Srebrna oprawa posiadająca dwa gniazda na żarówki LED o trzonku E14 wykonana jest z metalu wysokiej jakości. Kinkiet pięknie podkreśli wygląd wkręconych do niego żarówek, które same w sobie staną się ozdobą wnętrza. Lampa ścienna zrobiona w minimalistycznym stylu będzie się pięknie prezentować w każdym nowoczesnym wnętrzu. Została ona stworzona po to, aby oświetlić garderobę, choć równie dobrze sprawdzi się np. na korytarzu. 	Jeśli poszukujesz dobrej jakościowo lampy ściennej, w minimalistycznym stylu to lampa dostępna tutaj jest bardzo dobrym wyborem. Jej zaletą jest również to, że to od Ciebie zależy wygląd wkręconej żarówki jak również to jakie światło będzie ona emitować.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-srebrna-kinkiet-oprawa-do-garderoby-na-korytarz-2x-e14', '', '', '', 'Nowoczesna lampa ścienna srebrna kinkiet oprawa do garderoby na korytarz 2x E14', '', '', '', ''),
(325, 1, 1, 'Lampa ścienna kinkiet serii DAMA GREY, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Szary klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-lampa-scienna-milagro-dama-1x-e27-szara-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim lampa ścienna MiLAGRO DAMA 1x E27 szara Drewno + metal', '', '', '', ''),
(326, 1, 1, 'Kinkiet z kolekcji LUNA to niezwykle elegancki produkt, który zachwyca swoim wyglądem. Lampa ścienna pracuje z żarówką o gwincie E14 (brak w zestawie), wraz z którą pięknie oświetli każde wnętrze.  Lampa w stylu glamour łączy w sobie chromowany klosz oraz mieniące się kryształki, które doskonale się ze sobą komponują i będą doskonałą ozdobą każdego pomieszczenia. Do wykonania lampy użyto metalu oraz szkła. Lampa z kryształkami posiada regulację wysokości, co pozwala na dostosowanie jej do własnych potrzeb. Łącząc ze sobą lampy z kolekcji Luna, można stworzyć ciekawą i spójną aranżację. Oświetlenie z kolekcji LUNA objęte jest 24-miesięczną gwarancją.', '', 'kinkiet-lampa-scienna-luna-1x-e14-ip20-metal-i-szklo-milagro-krysztalki-styl-glamour', '', '', '', 'Kinkiet Lampa ścienna LUNA 1x E14 IP20 Metal i szkło Milagro Kryształki Styl glamour', '', '', '', ''),
(327, 1, 1, 'Oprawa LED KANAŁOWA Garażowa ścienno-sufitowa, serii SOMA METAL 60 w kolorze białym, o owalnym kształcie, renomowanej i cenionej w branży oświetleniowej firmy KOBI. Oprawa wykonana z wysokiej jakości materiałów, cechuje się wysoką trwałością i wykonaniem z dbałością o najmniejszy szczegół. Podstawa wykonana jest z tworzywa sztucznego, osłona wykonana z metalu, natomiast klosz jest ze szkła.Lampa kanałowa przystosowana jest do pracy z źródłami światła LED na dużym gwincie E27, w klasach energetycznych A++ - E, żarówki energooszczędne zapewniają mniejsze o nawet 90% zużycie energii względem innych tradycyjnych źródeł światła. Lampa o mocy max. 60W i stopniu ochronności IP44, zastosowane materiały pozwalają uzyskać ochronę na wnikanie pyłu i wilgoci, odporny na deszcz, dzięki temu klosz znajdzie swoje zastosowanie (wewnątrz i na zewnątrz budynku) w pomieszczeniach gospodarczych i domowych, np. w piwnicy, garażu, warsztacie, magazynie, klatce schodowej, a także w ogrodzie, czy też na tarasie. Tanie rozwiązanie na wydajne oświetlenie. Oprawa w kolorze białym z przezroczystym kloszem do montażu sufitowego lub ściennego.OPRAWA KANAŁOWA IDEALNIE SPRAWDZI SIĘ JAKO OŚWIETLENIE:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-led-e27-kanalowa-lampa-garazowa-owal-60w-siatka-metal-ip44-biala-kobi', '', '', '', 'Oprawa LED E27 KANAŁOWA Lampa Garażowa Owal 60W Siatka Metal IP44 Biała KOBI', '', '', '', ''),
(328, 1, 1, 'Kinkiet Lumi to doskonałe połączenie ceramiki i szkła. Jego niepowtarzalny kształt nada charakteru każdemu wnętrzu. Lampa została wykonana z materiałów wysokiej jakości, dzięki czemu wspaniale się prezentuje, zachowując przy tym walory niezawodności. Górna szybka nie jest dołączana do zestawu.  Szklana lampa współgra z żarówkami o trzonku E27 oraz  mocy max 60W (brak w zestawie).', '', 'kinkiet-lumi-20-bialy-1xe27-modern-ceramika-i-szklo-lampex', '', '', '', 'Kinkiet Lumi 20 biały 1xE27 Modern Ceramika i szkło Lampex', '', '', '', ''),
(329, 1, 1, 'Lampa ścienna kinkiet serii AURIS BLACK, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i szkła lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę doskonale sprawdzą się w każdym wnętrzu, a efekt przemysłowego wykończenia pomieszczeń jeszcze mocniej podkreśla wykonanie z metalu oraz kolorystyka lampy: czarna z białą kulą i złotym, połyskującym detalem. Ta kolorystyka lampy zachwyci nie tylko miłośników nowoczesnych wnętrz, gdyż z łatwością wpisze się w wiele przestrzeni. Dużą zaletą kinkietu jest to, że ich głowice są ruchome, co pozwala na dostosowanie kąta padania światła do własnych potrzeb, przez co konstrukcja klosza ujmująco rozprasza światło, tworząc charakterystyczny, niepowtarzalny efekt światłocienia.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E14. Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-ruchoma-czarna-milagro-auris-1x-e14', '', '', '', 'Kinkiet lampa ścienna ruchoma czarna MiLAGRO AURIS 1x E14', '', '', '', ''),
(330, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Fiona w kolorze białym. Ta oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Fiona która została wyposażona w tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-fiona-1xe14-polux-5901508311016', '', '', '', 'Oprawa ścienna KINKIET Spot Fiona 1xE14 Polux 5901508311016', '', '', '', ''),
(331, 1, 1, 'Kinkiet Lucas to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa  została wykonana z wysokiej jakości gipsu, dzięki czemu wspaniale się prezentuje, zachowując przy tym walory niezawodności. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-lucas-2xg9-gips-bialy-modern-lampex', '', '', '', 'Kinkiet Lucas 2xG9 Gips Biały Modern Lampex', '', '', '', ''),
(332, 1, 1, 'Srebrna oprawa posiadająca gniazdo na żarówkę LED o trzonku E14 wykonana jest z metalu wysokiej jakości. Kinkiet pięknie podkreśli wygląd wkręconej do niego żarówki, która sama w sobie stanie się ozdobą wnętrza. Lampa ścienna zrobiona w minimalistycznym stylu będzie się pięknie prezentować w każdym nowoczesnym wnętrzu. Została ona stworzona po to, aby oświetlić garderobę, choć równie dobrze sprawdzi się np. na korytarzu. 	Jeśli poszukujesz dobrej jakościowo lampy ściennej, w minimalistycznym stylu to lampa dostępna tutaj jest bardzo dobrym wyborem. Jej zaletą jest również to, że to od Ciebie zależy wygląd wkręconej żarówki jak również to jakie światło będzie ona emitować.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-srebrna-kinkiet-oprawa-do-garderoby-na-korytarz-1x-e14', '', '', '', 'Nowoczesna lampa ścienna srebrna kinkiet oprawa do garderoby na korytarz 1x E14', '', '', '', ''),
(333, 1, 1, 'Lampa ścienna serii KANE WHITE, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Biało-srebrny kinkiet został wykonany z dbałością o każdy detal. Ażurowe żyrandole zostały zaprojektowane w taki sposób, aby wyeksponować dekoracyjną żarówkę. Metalowy i druciany klosz o geometrycznym kształcie przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa ścienna współpracuje z żarówkami o trzonku E27 o mocy nieprzekraczającej 60W. Lampa w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-bialo-srebrna-milagro-kane-1x-e27', '', '', '', 'Kinkiet lampa ścienna biało-srebrna MiLAGRO KANE 1x E27', '', '', '', ''),
(334, 1, 1, 'Lampa wisząca STICKS 6267 to piękna lampa, która jest kwintesencją loftowego szyku. Stanowi wyjątkową propozycję, idealnie skrojoną na miarę potrzeb minimalistów i wielbicieli industrialnych klimatów we wnętrzach. Pod nazwą tą kryje się bowiem subtelna lampa ścienna, z dwoma źródłami światła. Z uwagi na swój intrygujący design i metalowe wykończenie, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa w kolorze złotym równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Lampa świetnie sprawdzi się jako dodatkowe doświetlenie bardziej zacienionych zakamarków: kącika multimedialnego czy biblioteczki. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wielkość lampy to 36,5 cm, a szerokość klosza wynosi 10 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-2xe27-vintage-retro-6267-sticks-zlota-stal', '', '', '', 'Lampa ścienna NOWODVORSKI 2xE27 Vintage Retro 6267 STICKS Złota Stal', '', '', '', ''),
(335, 1, 1, 'Dodaj stylu swoim wnętrzom dzięki lampie ERIS GOLDPoznaj jej największe zalety!Lampa sufitowa ERIS GOLD wykonana została z dużą dbałością o szczegóły, dzięki czemu wygląda niezwykle elegancko. Jej aluminiowa obudowa wykończona czarną matową powłoką, niezwykle stylowo prezentuje się w połączeniu ze złotym środkiem. Oprawa idealnie komponuje się we wnętrzach minimalistycznych, nowoczesnych i urządzonych w stylu industrialnym. Sprawdzi się w takich pomieszczeniach jak sypialnia, salon, jadalnia czy korytarz. Jedną z jej największych zalet jest możliwość regulacji kąta padania światła w zakresie 90° w pionie i 350° wokół własnej osi. Pozwala to dokładnie doświetlić wybraną przestrzeń przy wykorzystaniu żarówki o trzonku GU10 i maksymalnej mocy 35 W. GWINT GU10Lampa współpracuje z jedną żarówką o trzonku GU10, umożliwia nam to  błyskawiczny montaż lub wymianę źródła światła. Do oprawy z łatwością można dobrać energooszczędną żarówkę LED do max. 35W mocy. Dzięki temu możemy cieszyć się dobrze oświetloną przestrzenią, oszczędzając do 90% energii w porównaniu do tradycyjnych żródeł światła.  MATERIAŁ WYKONANIAPrezentowana lampa wykonana została z wysokiej jakości aluminium wykończonego czarną matową powłoką. Powstała z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  WYMIARY PRODUKTU Dzięki kompaktowym wymiarom lampa nadaje się do wykorzystania nawet w niewielkich pomieszczeniach, bez efektu przytłoczenia. długość całkowita: 445mmszerokość: 51mmwysokość podstawy: 25mmwysokość całkowita: 164mmWymiary klosza:długość: 100 mmszerokość: 60 mmEFEKTOWNA OPRAWACzarna matowa obudowa lampy w połączeniu ze złotymi wnętrzami kloszy, wygląda niezwykle stylowo. Wspaniale wygląda dzięki temu we wnętrzach urządzonych w stylu nowoczesnym,  minimalistycznym czy industrialnym. Może być dopełnieniem aranżacji, w której zastosowano inne dodatki w kolorze czarnym lub być przyciągającym uwagę akcentem.   STOPIEŃ SZCZELNOŚCI IP20Oprawa przeznaczona jest do stosowania wewnątrz pomieszczeń. Oznacza to, że obudowa chroni nas przed porażeniem prądem przy próbie dotknięcia, jednak w żaden sposób nie jest zabezpieczona przed działaniem wody.  REGULACJA KĄTA PADANIA ŚWIATŁAWybierając lampę sufitową Eris Gold mamy możliwość płynnej regulacji ustawienia jej kloszy w dwóch płaszczyznach, 90° w pionie i 350° wokoło wokół własnej  osi. Pozwala to doświetlić wybraną przestrzeń według własnych potrzeb.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Kupując u nas otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą. ', '', 'lampa-sufitowa-eris-spot-reflektor-oprawa-halogenowa-gu10-czarno-zlota', '', '', '', 'Lampa sufitowa ERIS SPOT Reflektor Oprawa Halogenowa GU10 Czarno-Złota', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(336, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom GALAXI IPoznaj ich największe zalety!Kinkiet GALAXI I wykonany został z wysokiej jakości szkła i metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem wnętrza w stylu glamur jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.POSTAW NA KINKIETY GALAXI I OCZARUJ SWOICH GOŚCI!   MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu pokrytego chromem. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje ze źródłem światła o trzonku E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu GALAXI o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.     ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki.  Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 16 cm. Całkowita szerokość lampy to 16 cm.  Wymiary klosza 16 cm x 10 cm.   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  sypialnia - kinkiety z serii GALAXI doskonale sprawdzają się w sypialni. Wyglądają niezwykle stylowo, są wydajnym źródłem nastrojowego światła. salon - kinkiety GALAXI sprawdzą się również w salonie jako dodatkowe, dekoracyjne źródło światła w salonie. restauracja - kinkiety GALAKSI to również doskonałe rozwiązanie do restauracji i kawiarni. Pomagają stworzyć kameralny nastrój. Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-k-8003-1g-z-serii-galaxy-i-1xe14-kaja', '', '', '', 'Lampa ścienna kinkiet K-8003-1G z serii GALAXY I 1xE14 Kaja', '', '', '', ''),
(337, 1, 1, 'Czy chcesz odmienić swoje wnętrze?Postaw ma kinkiet SIENA BLACK! Kinkiet SIENA BLACK o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metali. Abażury to mocna czarna tkanina. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni, czy jadalni.  Można go wykorzystać również w korytarzu lub jako oświetlenie schodów.POSTAW NA KINKIET SIENA BLACK I DODAJ STYLU SWOIM WNĘTRZOM!   MATERIAŁ WYKONANIA GWINT E27 EFEKTOWNA OPRAWAŁATWOŚĆ MONTAŻU WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ KINKIETY SIENA BLACK? Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-k-4028-siena-black-1xe27', '', '', '', 'Oprawa ścienna kinkiet K-4028 SIENA BLACK 1xE27', '', '', '', ''),
(338, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom SIMONE BLACK Poznaj ich największe zalety!Kinkiet SIMONE BLACK o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metali. Abażury to mocna czarna tkanina. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.WPROWADŹ NIEPOWTARZALNY KLIMAT DO SWOICH WNĘTRZ DZIĘKI KINKIETOM SIMONE BLACK!  MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości metalu i materiałowego abażuru. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko.  GWINT E27Lampa współpracuje z dwoma źródłami światła o trzonku  E27 o maksymalnej mocy 60W.  Do prezentowanego kinkietu z łatwością dobierzemy energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii.UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu Siena Black o okrągłym kształcie wykonana jest ze mocnego materiału w kolorze czarnym. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.     ŁATWOŚĆ MONTAŻUKinkiet SIMONE BLACK jest lekki. Jego montaż  jest bardzo łatwy. Zestaw zawiera niezbędne akcesoria.  WYMIAR LAMPYWysokość całkowita lampy wynosi 25 cm. Całkowita szerokość lampy to 25 cm.  Wymiary klosza 18 cm x 11 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań! sypialnia - kinkiety z serii SIMONE BLACK doskonale sprawdzają się w sypialni. Wyglądają niezwykle stylowo, są wydajnym źródłem nastrojowego światła. salon - kinkiety SIMONE BLACK sprawdzą się również w salonie jako dodatkowe, dekoracyjne źródło światła w salonie. restauracja - kinkiety SIMONE BLACK to również doskonałe rozwiązanie do restauracji i kawiarni. Pomagają stworzyć kameralny nastrój.Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-k-4324-z-serii-simone-black-1xe27-kaja', '', '', '', 'Oprawa ścienna kinkiet K-4324 z serii SIMONE BLACK 1xE27 Kaja', '', '', '', ''),
(339, 1, 1, 'Lampa NIX WHITE 512 to nowoczesna lampa ścienna w formie niedużej ramy o boku 20 x 20 cm. Model ten posiada jedno energooszczędne źródło światła w postaci całkowicie wymienialnego modułu LED. Jego moc wynosi 13 W, co odpowiada mocy 65 W w przypadku tradycyjnej żarówki. Punkt świetlny zapewnia ciepłą białą barwę o temperaturze 3000 K. Strumień świetlny lampy wynosi 910 lm. Oprawa lampy została wykonana w formie ramy z tworzywa sztucznego, w którą od wewnątrz wbudowano moduł LED. Kinkiet NIX WHITE 512 to doskonałe rozwiązanie do umieszczenia w różnych pomieszczeniach domu, a także w przestrzeniach komercyjnych. Biały kolor sprawia, że lampa naścienna ta wpasuje się w przestrzenie zaaranżowane niemal w każdej kolorystyce.', '', 'kinkiet-lampa-scienna-nix-ramka-biala-kwadrat-13w-led-ip20-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Kinkiet lampa ścienna NIX ramka biała kwadrat 13W LED IP20 Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(340, 1, 1, 'SZUKASZ STYLOWEGO I NASTROJOWEGO OŚWIETLENIA DO SWOJEJ SYPIALNI? POSTAW NA KINKIETY Z SERII VEJLE!Lampa VEJLE ma niezwykle ozdobną, elegancką formę. Jej czarna, metalowa konstrukcja ozdobiona została kroplami szkła. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym. Będzie pasować również do aranżacji inspirowanych stylem retro.   Stworzona została z dużą dbałością o szczegóły z wysokiej jakości stali i pięknie oszlifowanego szkła, które w dzień pięknie się mieni. Wieczorem natomiast lampa pozwala uzyskać niezwykły efekt rozproszenia światła. Sprawdzi się nie tylko w salonie, ale także w jadalni, jako oświetlenie stołu. ODMIEŃ SWOJĄ SYPIALNIĘ DZIĘKI KINKIETOM Z SERII VEJLE!  *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWNA OPRAWA    *WYMIAR LAMPY *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Prezentowana lampa doskonale prezentuje się w połączeniu z innymi elementami oświetlenia z serii VEJLE. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu.  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-vejle-w350-polux-okragla', '', '', '', 'Oprawa ścienna kinkiet Vejle W350 POLUX okrągła', '', '', '', ''),
(341, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 7 najważniejszych zalet LAMPY SUFITOWEJ!Lampa sufitowo-ścienna SKRĘT z jednym punktem świetlnym w loftowym stylu charakteryzuje elegancki minimalizm idący w parze ze swobodą i artyzmem, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.kmTa lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!    *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.    *KLOSZ  *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-nodum-skret-czarny-do-led-1x-e27-lumiled', '', '', '', 'Lampa sufitowo-ścienna NODUM SKRĘT czarny do LED 1x E27 LUMILED', '', '', '', ''),
(342, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-modern-b-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado MODERN B biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(343, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom SIENA BLACK Poznaj ich największe zalety!Podwójny kinkiet SIENA BLACK o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metali. Abażury to mocna czarna tkanina. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.WPROWADŹ NIEPOWTARZALNY KLIMAT DO SWOICH WNĘTRZ DZIĘKI KINKIETOM SIENA BLACK!  MATERIAŁ WYKONANIA GWINT E27 EFEKTOWNA OPRAWA   ŁATWOŚĆ MONTAŻU  WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-k-4028-siena-black-2xe27-kaja', '', '', '', 'Oprawa ścienna kinkiet K-4028 SIENA BLACK 2xE27 KAJA', '', '', '', ''),
(344, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom TROY GOLDPoznaj ich największe zalety!Kinkiet TROY GOLD o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metalu. Złoty, druciany klosz wygląda bardzo elegancko. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, ale także takich o bardziej klasycznym charakterze. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.WPROWADŹ NIEPOWTARZALNY KLIMAT DO SWOICH WNĘTRZ DZIĘKI KINKIETOM TROY GOLD!   MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości metalu. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko.  GWINT E27Lampa współpracuje z dwoma źródłami światła o trzonku  E27 o maksymalnej mocy 60W.  Do prezentowanego kinkietu z łatwością dobierzemy energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii.UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu TROY GOLD o okrągłym kształcie wykonana jest z wysokiej jakości metalu w kolorze czarnym. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.      ŁATWOŚĆ MONTAŻUSposób montażu polega na zamontowaniu lampy za pomocą akcesoriów montażowych dołączonych do lampy. Montaż powinien być dostosowany do efektu, który chcemy uzyskać  WYMIAR LAMPYSzerokość całkowita lampy wynosi 20 cm. Wymiary klosza 10 cm x 9 cm. Postawa kinkietu to 8 cm x 2 cm.   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań! Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-k-4780-z-serii-troy-gold-1xe27-kaja', '', '', '', 'Oprawa ścienna kinkiet K-4780 z serii TROY GOLD 1xE27 Kaja', '', '', '', ''),
(345, 1, 1, 'SZUKASZ NASTROJOWEGO I STYLOWEGO OŚWIETLENIA DO SYPIALNI?Kinkiety FLEX SHADE to doskonały wybór!Ten stylowy kinkiet marki NOWODVORSKI w kolorze białym sprawdzi się jako źródło światła w korytarzu, przedpokoju czy na klatce schodowej. Może być również nastrojowym oświetleniem dodatkowym w sypialni, jadalni czy salonie. Pasuje zarówno do nowoczesnych, jak i klasycznych aranżacji. Jego materiałowy abażur wykonany z dużą dbałością o szczegóły, wspaniale wygląda w jasnych wnętrzach, w których dominuje biel, szarości, czy beże. Interesująco prezentuje się również w połączeniu z naturalnym kamieniem czy drewnem. Dużą zaletą kinkietu FLEX SHADE jest możliwość współpracy z energooszczędnymi żarówkami LED o popularnym trzonku E27 i maksymalnej mocy 60W. Dzięki temu z łatwością można do niego dobrać źródło światła, które pozwoli nam się cieszyć dobrze oświetloną przestrzenią przy niskim zużyciu energii.  POZNAJ NAJWIĘKSZE ZALETY KINKIETÓW FLEX SHADE:   WYSOKA JAKOŚĆKinkiet FLEX SHADE wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości metalu i tkaniny. Dzięki temu nie tylko wygląda bardzo stylowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Kinkiet, przystosowany jest do pracy z żarówką LED o trzonku E27 o maksymalnej mocy 60W.  Z łatwością możemy więc dobrać do niego energooszczędne źródło  światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa kinkietu FLEX SHADE wygląda bardzo stylowo. Dzięki temu lamp jest subtelnym, ale interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.     WYMIARY LAMPYWymiary klosza kinkietu to średnica 20 cm x 24 cm wysokości. Dzięki niewielkim rozmiarom możemy zastosować kinkiety FLEX SHADE właściwe w dowolnym miejscu, bez obawy, że staną się przytłaczające.  WYDAJNE OŚWIETLENIEDzięki możliwości współpracy z żarówką o trzonku E27 o maksymalnej mocy aż 60W, kinkiety z tej serii mogą dobrze oświetlić schody, korytarz, czy inny ciąg komunikacyjny. Jeśli natomiast użyjemy w nich żarówek o mniejszej mocy i ciepłej barwie światła, staną się nastrojowym oświetleniem dodatkowym w sypialni lub salonie.  ŁATWY MONTAŻKinkiety są lekkie. Ich montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do ich przymocowania.     GDZIE MOŻESZ WYKORZYSTAĆ TE KINKIETY?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-nowodvorski-e27-biala-minimalistyczna-flex-shade-9746-materialstal', '', '', '', 'Lampa ścienna kinkiet NOWODVORSKI E27 Biała Minimalistyczna FLEX SHADE 9746 Materiał+Stal', '', '', '', ''),
(346, 1, 1, 'SZUKASZ STYLOWEGO I EFEKTYWNEGO OŚWIETLENIA?Postaw na kinkiet TWIG BLACK!  Dlaczego warto wybrać kinkiet TWIG BLACK? Kinkiet TWIG BLACK to jedna z wielu propozycji uznanej na rynku marki Nowodvorski. Jak wszystkie lampy tego producenta wyróżnia się jakością wykonania i prostym, ale interesującym designem. Został stworzony z myślą o nowoczesnych, minimalistycznych wnętrzach. Staje się w nich przyciągającym uwagę dodatkiem i efektywnym źródłem światła. Sprawdzi się jako dodatkowe dekoracyjne oświetlenie w salonie czy sypialni. Kinkiety z tej serii można wykorzystać także do oświetlenia korytarza czy klatki schodowej. W zależności od wybranego rodzaju żarówek lampa zyskuje inny charakter. Można ją używać w połączeniu z żarówkami mlecznymi lub typu filament.   POZNAJ NAJWIĘKSZE ZALETY KINKIETU TWIG BLACK:  WYSOKA JAKOŚĆKinkiet TWIG BLACK wykonany został z dużą dbałością o szczegóły z połączenia najwyższej jakości stali pokrytej bardzo wytrzymałą czarną powłoką. Dzięki temu nie tylko wygląda bardzo stylowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E27Plafon, przystosowany jest do pracy z dwoma energooszczędnymi żarówkami LED o trzonku E27 o maksymalnej mocy 60W. Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się doskonałym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa kinkietu TWIG BLACK wygląda niezwykle stylowo. Dzięki temu jest interesującym i ponadczasowym dodatkiem, który można wykorzystać w aranżacjach o różnym charakterze.      WYMIARY LAMPYOdległość od ściany, jaką zajmuje plafon TWIG BLACK to ok. 31cm .  WYDAJNE OŚWIETLENIEDzięki możliwości współpracy kinkietu z dwoma żarówkami o trzonku E27 o maksymalnej mocy 60W. Lampa może być wydajnym źródłem światła.   ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-2xe27-retro-loft-9141-twig-czarna-stal', '', '', '', 'Lampa ścienna NOWODVORSKI 2xE27 Retro Loft 9141 TWIG Czarna Stal', '', '', '', ''),
(347, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji CAPRI w kolorze białym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K dzięki wbudowanym do oprawy diodom led. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła. Chrakterystyczny, okrągły kształt opraw ledowych w białej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych typu led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-reflektor-oprawa-scienna-led-polux-capri-5w-bialy-3000k', '', '', '', 'Kinkiet Reflektor OPRAWA ŚCIENNA  LED Polux CAPRI 5W BIAŁY 3000K', '', '', '', ''),
(348, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY ŚCIENNEJ!Kinkiet FILIS marki LUMILED w loftowym stylu z jednym punktem świetlnym, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA *GWINT E27UWAGA! Brak źródła światła w komplecie.      *KLOSZ   *ŁATWOŚĆ MONTAŻU *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-filis-kinkiet-druciany-loft-do-led-1x-e27-lumiled', '', '', '', 'Lampa ścienna FILIS KINKIET druciany loft do LED 1x E27 LUMILED', '', '', '', ''),
(349, 1, 1, 'Vitrum to nowoczesna lampa ścienna o wspaniałym geometrycznym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia,a tafla ozdobnego szkła dodatkowo podkreśli wystrój wnętrza.  Kwadratowa lampa współgra z żarówkami o trzonku G9 oraz  mocy max 40W (brak w zestawie).', '', 'kinkiet-vitrum-a-czarny-kwadrat-loft-1xg9-metal-i-szklo-lampex', '', '', '', 'Kinkiet Vitrum A czarny kwadrat loft 1xG9 Metal i szkło Lampex', '', '', '', ''),
(350, 1, 1, 'Stylowy kinkiet MiLARGO Ray 343 można zamontować na dwa sposoby: poziomo lub pionowo. Ozdobi nie tylko ścianę, ale i sufit - wszystko zależy od potrzeb i gustu użytkownika. Lampka charakteryzuje się kompaktowymi wymiarami: długość 320 mm, szerokość 120 mm oraz niewielka głębokość która sprawia, że odstaje od ściany na jedynie 60 mm. Belka została wykonana z akrylu w połączeniu z metalem. Moc modułu LED wynosi 12 W, a strumień świetlny cechuje się jasnością 840 lm i neutralną barwą 4000 K. Kinkiet Ray dedykowany jest do salonów, pokoi gościnnych i korytarzy. Wyróżnia się ciekawą i nowoczesną stylistyką. Jego prosta forma będzie idealnym dopełnieniem współczesnych wnętrz, w których prym wiodą ostre linie i chłodna kolorystyka.', '', 'kinkiet-lampa-scienna-ray-12w-led-ip20-czarny-prostokat-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Kinkiet lampa ścienna RAY 12W LED IP20 czarny prostokąt Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(351, 1, 1, 'Lampa ścienna z abażurem o kwiatowym wzorze to wykonana w zgodzie z najnowszymi standardami lampa, przeznaczona na żarówkę LED o trzonku E27. Lampa ścienna została zaprojektowana z myślą o oświetleniu sypialni. Kinkiet z kloszem wykonanym z tkaniny w piękne kwiaty nada romantycznej aury każdemu wnętrzu. Urocza lampa na ścianę idealnie sprawdzi się w salonie lub sypialni jako oświetlenie dodatkowe. Złote elementy lampy nadadzą wnętrzu elegancji, a różowe kwiaty wprowadzą przytulną atmosferę. Ponadto lampka ta zamontowana w sypialni może służyć jako lampka nocna	Z tą lampą każde pomieszczenie nabierze szczególnego charakteru. Z pewnością sypialnia w której zamontuje się ten kinkiet będzie bardziej przytulna, a przyjemne światło wydobywające się z żarówki wprowadzi czarujący nastrój i ciekawy efekt świetlny. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-scienna-nocna-w-kwiaty-kinkiet-do-salonu-sypialni-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa ścienna nocna w kwiaty kinkiet do salonu sypialni abażur z tkaniny 1 x E27', '', '', '', ''),
(352, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom SIMONE WHITE Poznaj ich największe zalety!Kinkiet SIMONE WHITE o prostej minimalistycznej formie wygląda bardzo elegancko. Jego konstrukcja wykonana jest z wysokiej jakości metali. Abażur to mocna biała tkanina. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych. Może być ciekawym przełamaniem surowego wnętrza w stylu loftowym, jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.WPROWADŹ NIEPOWTARZALNY KLIMAT DO SWOICH WNĘTRZ DZIĘKI KINKIETOM SIMONE WHITE!   MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości metalu i materiałowego abażuru. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko.  GWINT E27Lampa współpracuje z dwoma źródłami światła o trzonku  E27 o maksymalnej mocy 60W.  Do prezentowanego kinkietu z łatwością dobierzemy energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii.UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu Simone White o okrągłym kształcie wykonana jest ze mocnego materiału w kolorze białym. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.     ŁATWOŚĆ MONTAŻUSposób montażu polega na zamontowaniu lampy za pomocą akcesoriów montażowych dołączonych do lampy. Montaż powinien być dostosowany do efektu, który chcemy uzyskać  WYMIAR LAMPYWysokość całkowita lampy wynosi 25 cm. Całkowita szerokość lampy to 25 cm.  Wymiary klosza 18 cm x 11 cm.   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań! sypialnia - kinkiety z serii SIMONE WHITE doskonale sprawdzają się w sypialni. Wyglądają niezwykle stylowo, są wydajnym źródłem nastrojowego światła. salon - kinkiety SIMONE WHITE sprawdzą się również w salonie jako dodatkowe, dekoracyjne źródło światła w salonie. restauracja - kinkiety SIMONE WHITE to również doskonałe rozwiązanie do restauracji i kawiarni. Pomagają stworzyć kameralny nastrój.Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-k-4334-z-serii-simone-white-1xe27-kaja', '', '', '', 'Oprawa ścienna kinkiet K-4334 z serii SIMONE WHITE 1xE27 KAJA', '', '', '', ''),
(353, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom GALAXI IPoznaj ich największe zalety! Podwójny kinkiet GALAXI I wykonany został z wysokiej jakości szkła i metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Może być ciekawym przełamaniem wnętrza w stylu glamur jednak będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.POSTAW NA KINKIETY GALAXI I OCZARUJ SWOICH GOŚCI!   MATERIAŁ WYKONANIAPrzedstawiony kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu pokrytego chromem. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje z dwoma źródłami światła o trzonku  E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu GALAXI o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.       ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki. Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 18 cm. Całkowita szerokość lampy to 50 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!   Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'podwojna-lampa-scienna-kinkiet-k-8003-2g-z-serii-galaxy-i-2xe14-kaja', '', '', '', 'Podwójna lampa ścienna kinkiet K-8003-2G z serii GALAXY I 2xE14 Kaja', '', '', '', ''),
(354, 1, 1, 'Lampka natynkowa TONIL LED w kolorze czarnym, to skromny w formie kinkiet ze zintegrowanym źródłem światła. Kanlux TONIL LED ma wbudowane źródło LED o mocy 2,7W, które emituje światło o przyjemnej barwie ciepłej - 3000K o strumieniu świetlnym 100lm. Produkt wykonany został z tworzywa sztucznego i stopu aluminium z dbałością o każdy detal. Lampka ścienna Kanlux TONIL LED idealnie sprawdzi się podczas czytania książki na łóżku, jako oświetlenie dodatkowe, nocne. Jego elastyczne, gumowe ramię umożliwia skierowanie oświetlenia w pożądanym kierunku, jednocześnie nadając różny kształt oprawie. Oprawa ruchoma w zakresie horyzontalnym i wertykalnym wynosi 360°. Oświetlenie TONIL spełni swoją rolę też w kąciku do czytania, a także jako lampka nocna. LAMPKA IDEALNIE SPRAWDZA SIĘ JAKO:-&gt; KOD PRODUKTU: 32520 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą. ', '', 'oprawa-lampa-scienna-natynkowa-led-czarna-tonil-27w-100lm-3000k-ciepla-kanlux', '', '', '', 'Oprawa lampa ścienna natynkowa LED czarna TONIL 2,7W 100lm 3000K ciepła Kanlux', '', '', '', ''),
(355, 1, 1, ' Kinkiet ścienny LED marki Polux z kolekcji Bresso cechuje sie nieprzeciętnym designiem w stylu loftowym który na zawsze zmieni wnętrza naszych domów lub mieszkań, dodając im charakteru i ciekawego wyglądu. Wykonana z najlepszej jakości metalu, malowana proszkowo oprawa ściena prezentuje sie znakomicie w klasycznych jak i nowoczesnych wystrojach wnętrz. Kinkiet został wyposażony w podwójne gniazdo z gwintem E14 przystosowanym do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 12W. Materiały zastosowane do produkcji  kinkietów z serii BRESSO zapewniaj najlepszą trwałość produktu przez co mogą być one użytkowane przez wiele lat. Decydując sie na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości który zadowoli każdego, nawet najbardziej wymagającego klienta. Mieszkaj modnie i stylowo. Zobacz też inne lampy i kinkiety.  SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-bresso-2xe14-polux', '', '', '', 'Oprawa ścienna KINKIET Bresso 2xE14 Polux', '', '', '', ''),
(356, 1, 1, 'Lampa ścienna w kształcie rombu to minimalistyczny i piękny dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet cechuje piękno wynikające z prostoty. Lampa ścienna w połączeniu z żarówką LED wprowadzą w pomieszczeniu przyjemną atmosferę. Dzięki temu, że nic nie osłania żarówki będzie ona ozdobą wnętrza. Lampa ścienna w kształcie rombu idealnie nadaje się do salonu jak również sypialni czy pokoju gościnnego jako oświetlenie dodatkowe. Wysoka jakość wykonania kinkietu jest gwaracją tego, że będzie on zachwycał swoim wyglądem przez długi czas. 	Lampa ścienna zaprojektowana z niezwykłą dbałością o szczegóły nada charakteru Twojemu wnętrzu i oświetli go pięknym blaskiemProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-salonu-romb-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do salonu romb 1 x E27', '', '', '', ''),
(357, 1, 1, 'Alicante to klasyczny kinkiet o ciekawym wyglądzie. Jego znakiem szczególnym jest szklany klosz, przyozdobiony kolistym wzorem. Całość została osadzona na solidnie wykonanej metalowej oprawie w kolorze wenge. Szczególnie polecana do klasycznych wnętrz.  Szklana lampa współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-olimp-bialy-1xe27-classic-metal-i-szklo-lampex', '', '', '', 'Kinkiet Olimp biały 1xE27 Classic Metal i szkło Lampex', '', '', '', ''),
(358, 1, 1, 'Kinkiet Irwin to nowoczesna lampa ścienna o ciekawym, lekko zaokrąglonym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza.  Lampa po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa została wykonana z wysokiej jakości gipsu, dzięki czemu wspaniale prezentuje się, zachowując przy tym walory niezawodności.  Gipsowa lampa współgra z żarówkami o trzonku G9 oraz  mocy max 40W (brak w zestawie)', '', 'kinkiet-irwin-bialy-1xg9-modern-gips-lampex', '', '', '', 'Kinkiet Irwin Biały 1xG9 Modern Gips Lampex', '', '', '', ''),
(359, 1, 1, 'Diego to nowoczesna lampa ścienna o wspaniałym obłym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia. Wyjątkowa poświata rzucana przez lampę idealnie podkreśli wyjątkowy obraz lub lustro. Do jego produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałym i odpornym na uszkodzenia.  Tuba współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-diego-czarny-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Diego czarny 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(360, 1, 1, 'Kinkiet Wera to idealna propozycja dla miłośników stylu nowoczesnego. Unikatowy metalowy klosz nadaje lampie prosty, minimalistyczny wygląd. Produkt został wykonany z materiałów najwyższej jakości,przez co wygląda wspaniale, zachowując przy tym walory niezawodności.', '', 'kinkiet-wera-bialy-1xg9-metal-lampex', '', '', '', 'Kinkiet Wera biały 1xG9 Metal Lampex', '', '', '', ''),
(361, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom RAVENPoznaj ich największe zalety! Kinkiet RAVEN wykonany został z wysokiej jakości szkła i metalu. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach o charakterze loftowym industrialnym i nowoczesnym, gdzie pojawiają się inne detale w kolorze czarnym. Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni.  Można go wykorzystać również w korytarzu czy jako oświetlenie schodów. POSTAW NA KINKIETY RAVEN I OCZARUJ SWOICH GOŚCI!   MATERIAŁ WYKONANIAPrezentowany kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko. Wygląda doskonale nawet po wielu latach użytkowania.  GWINT E27Lampa współpracuje ze źródłem światła o trzonku E27 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu RAVEN wykonana jest ze szkła i metalu pomalowanego na czarno. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje przyjemny efekt rozproszenia światła. Wspaniale wygląda w połączeniu z dekoracyjną żarówką.       ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki.  Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 37 cm. Całkowita szerokość lampy to 22 cm.  Średnica klosza 15 cm.  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-k-8004w-1-raven-1xe27-kaja', '', '', '', 'Lampa ścienna kinkiet K-8004W-1 RAVEN 1xE27 KAJA', '', '', '', ''),
(362, 1, 1, 'Kinkiet ścienny CRATE 9046 w minimalistycznym wydaniu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa została wykonana z niezwykłą dbałością o detale, dzięki czemu jest niezawodnym i efektownym produktem. Czarne elementy kinkietu doskonale komponują się ze sobą, tworząc zgrabną i elegancką całość. Dodatkowo wyróżnia się nowoczesnym designem oraz geometryczną formą. Jej wygląd przypomina klatkę, w której \"zamknięta\" została żarówka. Wysokość maksymalna lampy to 20 cm, a szerokość klosza wynosi 15 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-e27-klatka-loft-9046-crate-czarna-stal', '', '', '', 'Lampa ścienna NOWODVORSKI E27 Klatka Loft 9046 CRATE Czarna Stal', '', '', '', ''),
(363, 1, 1, 'Kinkiet serii BASE w kolorze białym, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i akrylu kinkiet. Źródło światła o mocy max. 8W+2W, które emituje światło o przyjemnej i neutralnej barwie (4000K) o strumieniu świetlnym 650lm, umieszczone zostało na długim, elastycznym ramieniu, dzięki czemu można swobodnie nim manewrować i dostosowywać do aktualnych potrzeb. Dodatkowym atutem lamp z kolekcji BASE jest umieszczony na jej podstawie port USB. Podstawa lampki jest owalna.Lampy z kolekcji BASE to propozycja, która znakomicie sprawdzi się w nowoczesnych wnętrzach, takich jak biura, gabinety i pokoje nastolatków. Ich minimalistyczna forma i wysoka funkcjonalność sprawiają, że z powodzeniem można zamontować je również w sypialni, jako alternatywę dla tradycyjnych lampek nocnych.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampka-nocna-scienna-led-usb-biala-8w-2w-milagro-base', '', '', '', 'Lampka nocna ścienna LED USB biała 8W +2W MiLAGRO BASE', '', '', '', ''),
(364, 1, 1, 'Wodoszczelna, Hermetyczna Lampa Ścienna serii BULKHEAD renomowanej i cenionej w branży oświetleniowej firmy Ledvance. Lampa koloru czarnego wykonana z wysokiej jakości tworzywa sztucznego cechuje się wysoką trwałością oraz odpornością na cieżkie warunki atmosferyczne. W oprawie wbudowane zostało zintegrowane źródło światła LED, które jest bardzo energooszczędne zapewnia mniejsze o nawet 90% zużycie energii względem innych tradycyjnych źródeł światła. Lampa o mocy 6W posiada doskonałe parametry świetlne - strumień świetlny na poziomie 450lm, emituje neutralne przyjemne dla użytkowników, nieoślepiające światło o temperaturze barwowej 4000K. Lampa o mlecznym - białym kloszu, wpasuje się w niemal każde wnętrze, swoje zastosowanie znajduje głównie jako oświetlenie ogólne w mniejszych wewnętrznych pomieszczeniach mieszkalnych o podwyższonej wilgotności oraz jako oświetlenie zewnętrzne.PLAFON IDEALNIE SPRAWDZI SIĘ JAKO OŚWIETLENIE:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 5-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-led-6w-4000k-ip54-hermetyczna-zewnetrzna-biala-bulkhead-ledvance', '', '', '', 'Lampa Ścienna LED 6W 4000K IP54 Hermetyczna Zewnętrzna Biała BULKHEAD LEDVANCE', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(365, 1, 1, 'Wodoszczelna, Hermetyczna Lampa Ścienna serii BULKHEAD renomowanej i cenionej w branży oświetleniowej firmy Ledvance. Lampa koloru czarnego wykonana z wysokiej jakości tworzywa sztucznego cechuje się wysoką trwałością oraz odpornością na cieżkie warunki atmosferyczne. W oprawie wbudowane zostało zintegrowane źródło światła LED, które jest bardzo energooszczędne zapewnia mniejsze o nawet 90% zużycie energii względem innych tradycyjnych źródeł światła. Lampa o mocy 11W posiada doskonałe parametry świetlne - strumień świetlny na poziomie 800lm, emituje neutralne przyjemne dla użytkowników, nieoślepiające światło o temperaturze barwowej 4000K. Lampa o mlecznym - białym kloszu, wpasuje się w niemal każde wnętrze, swoje zastosowanie znajduje głównie jako oświetlenie ogólne w mniejszych wewnętrznych pomieszczeniach mieszkalnych o podwyższonej wilgotności oraz jako oświetlenie zewnętrzne.PLAFON IDEALNIE SPRAWDZI SIĘ JAKO OŚWIETLENIE:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 5-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-led-11w-4000k-ip54-hermetyczna-zewnetrzna-czarna-bulkhead-ledvance', '', '', '', 'Lampa Ścienna LED 11W 4000K IP54 Hermetyczna Zewnętrzna Czarna BULKHEAD LEDVANCE', '', '', '', ''),
(366, 1, 1, 'Kinkiet ścienny model Cegła to unikatowa oprawa LED marki Polux charakteryzująca się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonana w całości z gipsu, ręcznie szlifowana oprawa została przystosowana została do pracy z energooszczędnymi źródłami światła LED z gwintem E14. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Efektowny kinkiet o niewielkich rozmiarach został dostoswany do montażu natynkowego (naściennego). Oprawa świetnie wkomponuje się w nowoczesne wnętrza, gdzie dominują proste aczkolwiek niebanalne formy. Ponadto, oprawę można malować na dowolny kolor. KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-gipsowaozodbna-kinkiet-scienny-cegla-2xe14-biala-polux', '', '', '', 'Oprawa gipsowa,ozodbna kinkiet ścienny CEGŁA 2xE14 biała POLUX', '', '', '', ''),
(367, 1, 1, 'Lampka natynkowa TONIL LED w kolorze białym, to skromny w formie kinkiet ze zintegrowanym źródłem światła. Kanlux TONIL LED ma wbudowane źródło LED o mocy 2,7W, które emituje światło o przyjemnej barwie ciepłej - 3000K o strumieniu świetlnym 100lm. Produkt wykonany został z tworzywa sztucznego i stopu aluminium z dbałością o każdy detal. Lampka ścienna Kanlux TONIL LED idealnie sprawdzi się podczas czytania książki na łóżku, jako oświetlenie dodatkowe, nocne. Jego elastyczne, gumowe ramię umożliwia skierowanie oświetlenia w pożądanym kierunku, jednocześnie nadając różny kształt oprawie. Oprawa ruchoma w zakresie horyzontalnym i wertykalnym wynosi 360°. Oświetlenie TONIL spełni swoją rolę też w kąciku do czytania, a także jako lampka nocna. LAMPKA IDEALNIE SPRAWDZA SIĘ JAKO:-&gt; KOD PRODUKTU: 32521 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą. ', '', 'oprawa-lampa-scienna-natynkowa-led-biala-tonil-27w-100lm-3000k-ciepla-kanlux', '', '', '', 'Oprawa lampa ścienna natynkowa LED biała TONIL 2,7W 100lm 3000K ciepła Kanlux', '', '', '', ''),
(368, 1, 1, 'Kinkiet Zoe to niezwykle nowoczesny produkt utrzymany w minimalistycznym stylu. Czarny kolor kinkietu w połączeniu ze srebrnym elementem sprawiają, że lampa wkomponuje się idealnie w niemal każde pomieszczenie. Lampa ścienna posiada solidnie wykonany metalowy klosz, który skutecznie ogranicza ryzyko stłuczenia. Lampa na ścianę została wykonana z materiałów najwyższej jakości, przez co wspaniale się prezentuje. Czarna lampa pracuje z żarówką E27 o mocy maksymalnej 40W, wraz z którą pięknie rozświetli pomieszczenie.', '', 'kinkiet-lampa-scienna-zoe-czarna-1x-e27-metal-lampex-styl-nowoczesny', '', '', '', 'Kinkiet Lampa ścienna Zoe Czarna 1x E27 Metal Lampex Styl nowoczesny', '', '', '', ''),
(369, 1, 1, 'Lampa ścienna w kształcie kwadratu to minimalistyczny i piękny dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet cechuje piękno wynikające z prostoty. Lampa ścienna w połączeniu z żarówką LED wprowadzą w pomieszczeniu przyjemną atmosferę. Dzięki temu, że nic nie osłania żarówki będzie ona ozdobą wnętrza. Lampa ścienna o kwadratowym kształcie idealnie nadaje się do salonu jak również sypialni czy pokoju gościnnego jako oświetlenie dodatkowe. Wysoka jakość wykonania kinkietu jest gwarancją tego, że będzie on zachwycał swoim wyglądem przez długi czas. 	Lampa ścienna zaprojektowana z niezwykłą dbałością o szczegóły nada charakteru Twojemu wnętrzu i oświetli go pięknym blaskiemProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-salonu-kwadrat-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do salonu kwadrat 1 x E27', '', '', '', ''),
(370, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom DEFISPoznaj ich największe zalety!Kinkiet DEFIS wykonany został z wysokiej jakości szkła i metalu. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Decydując się na te kinkiety, warto postawić na dekoracyjne żarówki typu filament. Wspaniale prezentuje się we wnętrzach nowoczesnych, gdzie pojawiają się detale w kolorze czarnym. Można z powodzeniem wykorzystać go również w pomieszczeniach urządzonych w stylu loft, czy boho, będzie pasować również do bardziej klasycznych aranżacji.   Sprawdzi się jako dodatkowe źródło światła nie tylko w salonie, ale także w sypialni czy jadalni. Można go wykorzystać również w korytarzu czy jako oświetlenie schodów.DODAJ SWOIM WNĘTRZOM CHARAKTERU DZIĘKI KINKIETOM SAMANTA  MATERIAŁ WYKONANIAPrezentowany kinkiet wyprodukowany jest z wysokiej jakości szkła i metalu. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko i wygląda doskonale, nawet po wielu latach użytkowania.  GWINT E14Lampa współpracuje ze źródłem światła o trzonku E14 o maksymalnej mocy 25W. Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAOprawa kinkietu DEFIS o kulistym kształcie wykonana jest z przydymionego szkła. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem daje piękny efekt rozproszenia światła.       ŁATWOŚĆ MONTAŻUKinkiet jest dosyć lekki. Jego montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędna od przymocowania lampy.   WYMIAR LAMPYWysokość całkowita lampy wynosi 13 cm. Całkowita szerokość lampy to 9 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-k-8111-z-serii-defis-1xe14-kaja', '', '', '', 'Lampa ścienna kinkiet K-8111 z serii DEFIS 1xE14 Kaja', '', '', '', ''),
(371, 1, 1, 'Lampa wisząca serii KANE BLACK, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Czarno-złoty kinkiet został wykonany z dbałością o każdy detal. Ażurowe żyrandole zostały zaprojektowane w taki sposób, aby wyeksponować dekoracyjną żarówkę. Metalowy i druciany klosz o geometrycznym kształcie przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa ścienna współpracuje z żarówkami o trzonku E27 o mocy nieprzekraczającej 60W. Lampa w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarna-milagro-kane-1x-e27', '', '', '', 'Kinkiet lampa ścienna czarna MiLAGRO KANE 1x E27', '', '', '', ''),
(372, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-plus-a-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO PLUS A biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(373, 1, 1, 'SZUKASZ STYLOWEGO I NASTROJOWEGO OŚWIETLENIA DO SWOJEJ SYPIALNI LUB SALONU? POSTAW NA KINKIETY Z SERII FABRIZIA! Białe kinkiety FABRIZIA idealnie sprawdzą się nie tylko w sypialni, ale również w salonie. To efektywne i niezwykle stylowe dodatkowe dekoracyjne źródło światła. Wyglądają bardzo dekoracyjnie i pozwalają stworzyć kameralną atmosferę w danym pomieszczeniu, która będzie sprzyjała chwilom spędzanym we dwoje lub wieczornemu relaksowi z książką czy telewizją. Sprawdzi się zarówno we wnętrzach nowoczesnych, klasycznych, jak i minimalistycznych. Może być także ciekawym przełamaniem wnętrza w stylu loftowym. Będzie pasować również do aranżacji inspirowanych stylem retro. Tworzy interesujące połączenie z cegłą, batonem, a także klasycznie wykończonymi ścianami.  ODMIEŃ SWOJĄ SYPIALNIĘ DZIĘKI KINKIETOM Z SERII VEJLE!    *WYSOKA JAKOŚĆ *WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E14 *EFEKTOWNA OPRAWA    *WYMIAR LAMPY *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Prezentowana lampa doskonale prezentuje się w połączeniu z innymi elementami oświetlenia z serii FABRIZIA. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu.  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-fabrizia-e14-biala-36cm-polux', '', '', '', 'Kinkiet Lampa Ścienna FABRIZIA E14 Biała 36cm - Polux', '', '', '', ''),
(374, 1, 1, 'Kinkiet, w kolorze biało-drewnianym, pochodzący z wyjątkowej kolekcji JOKER WHITE/WOOD jest niezwykle eleganckim produktem, który łączy w sobie minimalistyczny szyk i nowoczesność. Dzięki swojemu uniwersalnemu zastosowaniu lampa ta może służyć zarówno jako lampa ścienna jak i lampa sufitowa. Biała oprawa subtelnie łącząca się ze złotym i delikatnym zakończeniem prezentuje się niezwykle elegancko i jest piękną ozdobą każdego wnętrza. Producentem tej lampy jest polska marka MiLAGRO. Lampa ścienna została wykonana z dbałością o najmniejszy detal, dzięki czemu wprowadza we wnętrza odrobinę luksusu. Biała lampa współpracuje z żarówką o trzonku GU10, o mocy maksymalnej 8W. Wraz z tą elegancką lampą każde mieszkanie nabierze wyjątkowego, ekskluzywnego i nowoczesnego wyrazu, a widok kilku lamp z tej kolekcji, zamontowanych koło siebie, z pewnością zachwyci każdego.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Ponadto kolekcja JOKER objęta jest gwarancją producenta. Czas jej trwania wynosi 24 miesiące. W tym okresie wszelkie naprawy są świadczone nieodpłatnie.', '', 'kinkiet-joker-bialy-drewno-lampa-sufitowa-scienna-1xgu10-milagro-metal-styl-nowoczesny', '', '', '', 'Kinkiet JOKER BIAŁY DREWNO lampa sufitowa ścienna 1xGU10 MILAGRO Metal styl nowoczesny', '', '', '', ''),
(375, 1, 1, 'Nowoczesna lampa ścienna w kolorze czarnym została zaprojektowana z myślą o oświetleniu sypialni. Posiada ona gniazdo na żarówkę LED o trzonku E27. Żarówka wkręcona do lampy ściennej będzie się pięknie prezentować między czarnymi elementami lampy, a po zaświeceniu stworzy ona interesującą i przytulną atmosferę. Kinkiet stworzony w zgodzie z najnowszymi trendami projektowania wnętrz został dopracowany w najmniejszych szczegółach. Zachwyca w nim minimalistyczne piękno. Jest on idealny do sypialni, choć sprawdzi się również w salonie czy jadalni jako oświetlenie dodatkowe.	Ta lampa ścienna nada nowy, wyjątkowy charakter każdemu wnętrzu. Kinkiet wykonany z wysokiej jakości materiałów jest inwestycją na długi czas. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-sypialni-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do sypialni 1 x E27', '', '', '', ''),
(376, 1, 1, 'Kinkiet Kris to nowoczesna lampa ścienna o prostym a zarazem ciekawym geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza, Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.  Lampa współgra z żarówkami o trzonku G9 oraz  mocy max 40W (brak w zestawie).', '', 'kinkiet-kris-bialy-1xg9-modern-gips-lampex', '', '', '', 'Kinkiet Kris Biały 1xG9 Modern Gips Lampex', '', '', '', ''),
(377, 1, 1, 'Diego to nowoczesna lampa ścienna o wspaniałym obłym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia. Wyjątkowa poświata rzucana przez lampę idealnie podkreśli wyjątkowy obraz lub lustro. Do jego produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałym i odpornym na uszkodzenia.  Tuba współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-diego-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Diego biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(378, 1, 1, 'Lampa ścienna Kinkiet ASIL w kolorze białym, to charakterystyczny styl zachowany w kształcie, szerokim wyborze palety kolorów oraz dbałość o każdy szczegół wykonania. Lampa przystosowana została do pracy z energooszczędnymi źródłami świateł LED z gwintem G9 i mocy nieprzekraczającej 40W. Produkt wykonany został z wysokogatunkowego stopu aluminium. Kanlux ASIL to kinkiety, które dzięki swojemu kształtowi tworzą bardzo ciekawy efekt świetlny na ścianie. Światło rozchodzi się nie tylko do góry i na dół, ale również wydobywa się przez specjalnie zaprojektowaną szczelinę. Dzięki oprawie Kanlux ASIL stworzymy przytulny nastrój w domu, wnętrzu hotelowym lub uzupełnimy oświetlenie w restauracji czy kawiarni.Brak źródła światła w komplecie.-&gt; KOD PRODUKTU: 27022 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-scienna-natynkowa-biala-kinkiet-asil-g9-kanlux', '', '', '', 'Oprawa lampa ścienna natynkowa biała KINKIET ASIL G9 Kanlux', '', '', '', ''),
(379, 1, 1, 'Lampa ścienna Kinkiet ASIL w kolorze szarym, to charakterystyczny styl zachowany w kształcie, szerokim wyborze palety kolorów oraz dbałość o każdy szczegół wykonania. Lampa przystosowana została do pracy z energooszczędnymi źródłami świateł LED z gwintem G9 i mocy nieprzekraczającej 40W. Produkt wykonany został z wysokogatunkowego stopu aluminium. Kanlux ASIL to kinkiety, które dzięki swojemu kształtowi tworzą bardzo ciekawy efekt świetlny na ścianie. Światło rozchodzi się nie tylko do góry i na dół, ale również wydobywa się przez specjalnie zaprojektowaną szczelinę. Dzięki oprawie Kanlux ASIL stworzymy przytulny nastrój w domu, wnętrzu hotelowym lub uzupełnimy oświetlenie w restauracji czy kawiarni.Brak źródła światła w komplecie.-&gt; KOD PRODUKTU: 27021 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-scienna-natynkowa-szara-kinkiet-asil-g9-kanlux', '', '', '', 'Oprawa lampa ścienna natynkowa szara KINKIET ASIL G9 Kanlux', '', '', '', ''),
(380, 1, 1, 'Lampa ścienna o klasycznym wyglądzie to elegancki i luksusowy dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet charakteryzuje się pięknym wyglądem. Zaletą tej klasycznej lampy jest ekskluzywny materiałowy abażur o ciekawym wzorze. Dzięki niemu źródło światła przymocowane do kinkietu będzie emitować piękne, rozproszone światło. Lampa idealnie nadaje się do salonu, sypialni czy pokoju gościnnego jako światło dodatkowe. 	Lampa ścienna została wykonana z materiałów wysokiej jakości i z niezwykłą dbałością o szczegóły. Jest to dobry zakup, który będzie cieszył oczy swoim pięknym wyglądem przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-scienna-zlota-bezowa-kinkiet-do-salonu-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa ścienna złota beżowa kinkiet do salonu abażur z tkaniny 1 x E27', '', '', '', ''),
(381, 1, 1, 'Lampa ścienna z abażurem o pięknym wzorze to wykonana w zgodzie z najnowszymi standardami lampa, przeznaczona na żarówkę LED o trzonku E27. Lampa ścienna została zaprojektowana z myślą o oświetleniu sypialni. Kinkiet z kloszem wykonanym z eleganckiej tkaniny nada romantycznej aury każdemu wnętrzu. Urocza lampa na ścianę idealnie sprawdzi się w salonie lub sypialni jako oświetlenie dodatkowe. Srebrne elementy lampy nadadzą wnętrzu elegancji, a klosze zrobione z dbałością o detale wprowadzą przytulną atmosferę. Ponadto lampka ta zamontowana w sypialni może służyć jako lampka nocna	Z tą lampą każde pomieszczenie nabierze szczególnego charakteru. Z pewnością sypialnia w której zamontuje się ten kinkiet będzie bardziej przytulna, a przyjemne światło wydobywające się z żarówki wprowadzi czarujący nastrój i ciekawy efekt świetlny. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-scienna-nocna-srebrna-kinkiet-do-salonu-sypialni-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa ścienna nocna srebrna kinkiet do salonu sypialni abażur z tkaniny 1 x E27', '', '', '', ''),
(382, 1, 1, 'Harold to nowoczesny kinkiet utrzymany w minimalistycznym stylu. Podłużny kształt kinkietu wraz z symetrycznie umieszczonymi wcięciami nadaje lampie prosty, a zarazem przyciągający uwagę wygląd. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.  Gipsowa lampa współgra z żarówkami o trzonku E14 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-harold-bialy-1xe14-modern-gips-lampex', '', '', '', 'Kinkiet Harold Biały 1xE14 Modern Gips Lampex', '', '', '', ''),
(383, 1, 1, 'Kinkiet ścienny obrazowy z pełni wymienialnym jednym punktem światła LED serii BEAM, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i akrylu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Dużą zaletą kinkietu jest możliwość regulacji położenia elementu świetlnego, a także kąta nachylenia względem oświetlanej płaszczyzny, przez co konstrukcja \"klosza\" ujmująco rozprasza światło, tworząc charakterystyczny, niepowtarzalny efekt światłocienia.Lampa, posiada ledowe źródło światła, które świeci barwą przyjazną dla oka ludzkiego 3000K o strumieniu świetlnym równym 420lm, jest przy tym energooszczędne 6W co odpowiada 36W w żarówkach żarowych. Szerokość kinkietu to 31 cm, z kolei puszki montażowej 25 cm. Odległość od ściany wynosi maksymalnie do 18 cm.Kinkiet jest doskonałą propozycją nie tylko do nowoczesnych i stylowych salonów. Swoje miejsce znajdzie też w sypialni, przedpokoju, a nawet kuchni. Za jego pomocą oświetlimy obrazy oraz ramki. Lampa może z powodzeniem zostać wykorzystana jako oświetlenie, np. lustra. Wykorzystanie tej lampy zrobi imponujące wrażenie, którego każdy pozazdrości. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-beam-led-lampa-scienna-obrazowa-6w-420lm-3000k-ciepla-milagro', '', '', '', 'Kinkiet BEAM LED lampa ścienna obrazowa 6W 420lm 3000K ciepła MiLAGRO', '', '', '', ''),
(384, 1, 1, 'Vitrum to nowoczesna lampa ścienna o wspaniałym geometrycznym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia, a tafla ozdobnego szkła dodatkowo podkreśli wystrój wnętrza. Geometryczna lampa współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-vitrum-b-czarny-loft-1xg9-metal-i-szklo-lampex', '', '', '', 'Kinkiet Vitrum B czarny loft 1xG9 Metal i szkło Lampex', '', '', '', ''),
(385, 1, 1, 'Kinkiet Peter to nowoczesna lampa ścienna o nieskomplikowanym a zarazem ciekawym geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa została wykonana z wysokiej jakości gipsu, dzięki czemu wspaniale się prezentuje, zachowując przy tym walory niezawodności. Lampa jest kompatybilna z żarówkami G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-peter-2xg9-gips-bialy-modern-lampex', '', '', '', 'Kinkiet Peter 2xG9 Gips Biały Modern  Lampex', '', '', '', ''),
(386, 1, 1, 'Lampa ścienna kinkiet serii DAMA BLACK, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Czarny klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-lampa-scienna-milagro-dama-1x-e27-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim lampa ścienna MiLAGRO DAMA 1x E27 Drewno + metal', '', '', '', ''),
(387, 1, 1, 'SZUKASZ NOWOCZESNEGO I EFEKTYWNEGO OŚWIETLENIA?Kinkiet TUBE BLACK to doskonałe rozwiązanie!Kinkiety TUBE BLACK sprawdzą się jako efektowne źródło światła w korytarzu, przedpokoju czy na klatce schodowej. Mogą być również nastrojowym oświetleniem dodatkowym w sypialni, jadalni czy salonie. Światło wydobywające się z obu stron oprawy jest nie tylko przyjemne, ale także wygląda niezwykle dekoracyjnie. Kinkiety TUBE BLACK pasują do wnętrz nowoczesnych, gdzie pojawiają się inne dodatki w kolorze czarnym, a także przestrzeni utrzymanych w stylu industrialnym. Oprawa lampy została wykonana z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo. Interesująco prezentuje się w połączeniu z naturalnym kamieniem, betonem, surową cegłą, czy drewnem. Dużą zaletą prezentowanej lampy jest możliwość współpracy z energooszczędnymi żarówkami LED o trzonku GU10 i maksymalnej mocy 75W. Dzięki temu z łatwością można do niej dobrać źródło światła, które pozwoli nam się cieszyć dobrze oświetloną przestrzenią przy niskim zużyciu energii.  POZNAJ NAJWIĘKSZE ZALETY KINKIETU TUBE BLACK:  WYSOKA JAKOŚĆKinkiet TUBE BLACK został wykonany z wysokiej jakość stali. Jego czarna powłoka została położona z dużą dbałością o szczegóły. Dzięki temu nie tylko wygląda bardzo elegancko, wręcz luksusowo, ale także zachowuje pełną estetykę przez wiele lat.   WSPÓŁPRACA Z ENERGOOSZCZĘDNYMI ŻARÓWKAMI LEDKinkiet przystosowany jest do pracy z dwoma energooszczędnymi żarówkami LED o trzonku GU10 i bańce  ES111 o maksymalnej mocy 75W.  Z łatwością możemy więc dobrać do niego energooszczędne źródła światła i cieszyć się wydajnym oświetleniem przy niskich kosztach użytkowania. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWAMinimalistyczna oprawa kinkietu TUBE BLACK wygląda niezwykle nowocześnie. Światło wydobywające się z obu jej stron dodatkowo daje bardzo dekoracyjny efekt. Dzięki temu lampa jest nie tylko wydajnym źródłem światła, ale także interesującym i ponadczasowym dodatkiem.      WYMIARY LAMPYTuba ma wymiary 13 cm średnicy i 20 cm wysokości. Jest niewielka, dzięki czemu możemy zastosować ją niemal w dowolnym miejscu, bez efektu przytłoczenia.   WYDAJNE OŚWIETLENIEDzięki możliwości współpracy prezentowanego kinkietu z dwoma żarówkami o maksymalnej mocy 75W lampa jest w stanie skutecznie oświetlić klatkę schodową lub korytarz. Jeśli natomiast zastosujemy w oprawie żarówki emitujące ciepłe światło, może być nastrojowym dekoracyjnym oświetleniem w salonie.   ŁATWY MONTAŻLampa jest dosyć lekka. Jej montaż jest bardzo łatwy. W zestawie są akcesoria niezbędne do jej przymocowania.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-nowodvorski-6xgu10es111-czarna-tube-9320-stalszklo', '', '', '', 'Lampa ścienna kinkiet NOWODVORSKI 6xGU10|ES111 Czarna TUBE 9320 Stal+Szkło', '', '', '', ''),
(388, 1, 1, 'Srebrna oprawa posiadająca trzy gniazda na żarówki LED o trzonku E14 wykonana jest z metalu wysokiej jakości. Kinkiet pięknie podkreśli wygląd wkręconych do niego żarówek, które same w sobie staną się ozdobą wnętrza. Lampa ścienna zrobiona w minimalistycznym stylu będzie się pięknie prezentować w każdym nowoczesnym wnętrzu. Została ona stworzona po to, aby oświetlić garderobę, choć równie dobrze sprawdzi się np. na korytarzu. 	Jeśli poszukujesz dobrej jakościowo lampy ściennej, w minimalistycznym stylu to lampa dostępna tutaj jest bardzo dobrym wyborem. Jej zaletą jest również to, że to od Ciebie zależy wygląd wkręconej żarówki jak również to jakie światło będzie ona emitować.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-srebrna-kinkiet-oprawa-do-garderoby-na-korytarz-3x-e14', '', '', '', 'Nowoczesna lampa ścienna srebrna kinkiet oprawa do garderoby na korytarz 3x E14', '', '', '', ''),
(389, 1, 1, 'Kinkiet Bruno to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca zjawiskową poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.  Gipsowa lampa współgra z żarówkami o trzonku G9 oraz  mocy max 40W (brak w zestawie).', '', 'kinkiet-bruno-bialy-2xg9-modern-gips-lampex', '', '', '', 'Kinkiet Bruno Biały 2xG9 Modern Gips Lampex', '', '', '', ''),
(390, 1, 1, 'Odmień swoje wnętrze dzięki kinkietom WATSOPoznaj ich największe zalety!  Podwójny kinkiet WATSO wykonany został z wysokiej jakości metalu pokrytego chromem. Dzięki zastosowaniu materiałów najwyższej jakości zachowuje doskonały wygląd przez wiele lat. Wspaniale prezentuje się we wnętrzach nowoczesnych. Może być ciekawym przełamaniem aranżacji w stylu loftowym. Sprawdzi się jako dodatkowe źródło światła w salonie, w sypialni czy jadalni.  Można go wykorzystać również w korytarzu, garderobie czy jako oświetlenie schodów.LAMPA SUFITOWA WATSO TO EFEKTOWNE I WYDAJNE ŹRÓDŁO ŚWIATŁA  MATERIAŁ WYKONANIAPrezentowana lampa wykonana jest z wysokiej jakości metalu malowanego na biało. Powstał z dużą dbałością o szczegóły, dzięki czemu wygląda bardzo elegancko, wręcz luksusowo.  GWINT E14Lampa współpracuje z dwoma źródłami światła o trzonku  E14 o maksymalnej mocy 40W.  Do prezentowanego kinkietu z łatwością dobierzemy zatem energooszczędną żarówkę LED, która po zamontowaniu pozwoli cieszyć się pięknie oświetlonym pomieszczeniem przy niskim zużyciu energii. UWAGA! Brak źródła światła w komplecie. EFEKTOWNA OPRAWALampa WATSO nadaje się do wykorzystania jako podwójny konkiet lub lampa sufitowa. Dzięki temu jest interesującym dodatkiem do aranżacji danego wnętrza w dzień, a wieczorem jest efektywnym źródłem światła.      ŁATWOŚĆ MONTAŻULampa jest dosyć lekka. Jej montaż jest zatem bardzo łatwy. Zestaw zawiera akcesoria niezbędne od przymocowania lampy.  WYMIAR LAMPYWysokość całkowita lampy wynosi 23 cm. Całkowita szerokość lampy to natomiast 32 cm.    GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?Kilka przykładów zastosowań!  Prezentowana lampa doskonale wygląda się w połączeniu z innymi elementami oświetlenia w podobnym stylu. Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowa-podwojny-kinkiet-k-8005-2-watso-white-2xe14-kaja', '', '', '', 'Lampa sufitowa podwójny kinkiet K-8005-2 WATSO WHITE 2xE14 KAJA', '', '', '', ''),
(391, 1, 1, 'Lampa NIX BLACK 516 to nowoczesna lampa ścienna w formie niedużej ramy o boku 20 x 20 cm. Model ten posiada jedno energooszczędne źródło światła w postaci całkowicie wymienialnego modułu LED. Jego moc wynosi 13 W, co odpowiada mocy 65 W w przypadku tradycyjnej żarówki. Punkt świetlny zapewnia ciepłą białą barwę o temperaturze 3000 K. Strumień świetlny lampy wynosi 910 lm. Oprawa lampy została wykonana w formie ramy z tworzywa sztucznego, w którą od wewnątrz wbudowano moduł LED. Kinkiet NIX  BLACK 516 to doskonałe rozwiązanie do umieszczenia w różnych pomieszczeniach domu, a także w przestrzeniach komercyjnych. Czarny kolor sprawia, że lampa ta wpasuje się w przestrzenie zaaranżowane niemal w każdej kolorystyce.', '', 'kinkiet-nix-czarny-kwadrat-ramka-13w-led-ip20-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Kinkiet NIX czarny kwadrat ramka 13W LED IP20 Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(392, 1, 1, 'Czarna lampa ścienna, w kształcie prostokąta, posiada możliwość zamontowania dwóch żarówek LED o trzonku GU10. Została ona zaprojektowana z myślą o oświetleniu korytarza, choć świetnie sprawdzi się również w garderobie czy w przedpokoju. Elegancka oprawa w klasycznym czarnym kolorze będzie dopełnieniem oświetlenia we współczesnym mieszkaniu. Kinkiet wraz z żarówkami LED GU10 pięknie oświetli korytarz na którym zostanie zamontowany. Ponadto dzięki swojej prostocie lampa ta będzie pasować niemal do każdego pomieszczenia. Ogromną zaletą tej lampy jest to, że można zamontować żarówkę LED z dwóch stron, co daje ciekawy efekt świetlny, a światło pada i od góry, i od dołu.	Lampa ścienna umieszczona w korytarzu odmieni jego oblicze i sprawi, że będzie się on wydawał bardziej nowoczesny. Ten Kinkiet to produkt wysokiej jakości, który z pewnością będzie piękną ozdobą wnętrza przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-oprawa-czarna-prostokat-kinkiet-na-korytarz-2x-gu10', '', '', '', 'Nowoczesna lampa ścienna oprawa czarna prostokąt kinkiet  na korytarz 2x GU10', '', '', '', ''),
(393, 1, 1, 'Kinkiet z kolekcji Starlight to produkt niezwykle elegancki i wzbudzający zachwyt. Lampa na ścianę została wyprodukowana przez polską markę - MiLAGRO, z wysokiej jakości materiałów: szkła i metalu. Lampa w stylu glamour wykonana została z dbałością o każdy detal. Współpracuje ona z żarówką o trzonku E14 wraz z którą tworzy ona niesamowity efekt świetlny, który zachwyca i przywodzi na myśl galaktykę. Zwisające łańcuszki kryształków pięknie mienią się w świetle i są idealnym dopełnieniem całości. Lampa ścienna przyciąga wzrok dzięki czemu nie sposób przejść obok niej obojętnie. Lampa z kryształkami posiada regulację wysokości, dzięki czemu można dostosować ją do własnych potrzeb.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów.SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-glamour-z-krysztalkami-milagro-starlight-3x-e14-galaktyka-crystal', '', '', '', 'Kinkiet w stylu glamour z kryształkami MiLAGRO STARLIGHT 3x E14 galaktyka crystal', '', '', '', ''),
(394, 1, 1, 'Kinkiet Justin to nowoczesna lampa ścienna o niespotykanym i zjawiskowym kształcie. Jednolity, stonowany kolor oprawy sprawi że będzie świetnie wyglądała w pomieszczeniach takich jak korytarz, salon czy sypialnia. Szczególnie polecana dla ludzi ceniących sobie nowoczesny design. Lampa jest kompatybilna z żarówką LED o mocy 15W (brak w zestawie).', '', 'kinkiet-justin-xled-gips-bialy-lampex', '', '', '', 'Kinkiet Justin xLED Gips Biały Lampex', '', '', '', ''),
(395, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji CAPRI w kolorze czarnym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka, ciepłą barwą światła białego o mocy 3000K dzięki wbudowanym do oprawy diodom led. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła. Chrakterystyczny, okrągły kształt opraw ledowych w czarnej kolorystyce doda wnętrzu przyjaznego, a zarazem modnego charakteru.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych typu led. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-reflektor-oprawa-scienna-led-polux-capri-5w-czarny-3000k', '', '', '', 'Kinkiet Reflektor OPRAWA ŚCIENNA LED Polux CAPRI 5W CZARNY 3000K', '', '', '', ''),
(396, 1, 1, 'Kinkiet z kolekcji Duna to stylowe połączenie minimalistycznej budowy i wyszukanego wzornictwa. Szklany klosz, o ciekawym kształcie, pokryty jest fantazyjnym i artystycznym wzorem, który doskonale podkreśli charakter każdego wnętrza. Lampa ścienna została wykonana z wysokiej jakości materiałów, dzięki czemu świetnie się prezentuje, działając niezawodnie przez długi czas. Klasyczna lampa wraz z żarówką E27 (brak w zestawie) pięknie oświetli wnętrze.', '', 'kinkiet-lampa-scienna-k1-duna-ambra-bezowa-patyna-1x-e27-metal-i-szklo-lampex', '', '', '', 'Kinkiet Lampa ścienna K1 Duna ambra Beżowa Patyna 1x E27 Metal i szkło Lampex', '', '', '', ''),
(397, 1, 1, 'Duna to klasyczny kinkiet o jasnej, stonowanej barwie. Owalny kształt klosza doskonale podkreśli charakter każdego wnętrza. Lampa została wykonana z wysokiej jakości materiałów dzięki czemu świetnie prezentuje się,zachowując jednocześnie walory niezawodności. Owalna lampa współgra z żarówką o gwincie E27 oraz mocy max 60W (brak żarówki w zestawie).', '', 'kinkiet-k1-duna-biala-chrom-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet K1 Duna biała chrom 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(398, 1, 1, 'Madryt to klasyczny plafon o jasnych stonowanych barwach. Szklany klosz przyozdobiony pięknym roślinnym wzorem doskonale podkreśli charakter każdego wnętrza. Lampa została wykonana z materiałów najwyższej jakości, dzięki czemu wygląda wspaniale. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-k1-madryt-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet K1 Madryt 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(399, 1, 1, 'Lampa ścienna wykonana w skandynawskim stylu przeznaczona jest na żarówkę LED z gwintem E27. Idealnie sprawdzi się ona w sypialni, salonie czy jadalni, jako oświetlenie dodatkowe. Kinkiet świetnie dopasuje się do współczesnych wnętrz. Biała minimalistyczna lampa jest wykonana w zgodzie z najnowszymi trendami projektowania wnętrz. Piękno prostoty tutaj zachwyca i będzie idealnie współgrało ze współczesnym wnętrzem. Lampę ścienną można zamontować również nad łóżkiem gdzie może służyć jako lampka nocna. 	Ta lampa jest produktem, który został zaprojektowany z nowatorskim podejściem. Jest to oryginalny i innowacyjny dodatek do wystroju nowoczesnego wnętrza, który doda mu szyku i odmieni jego oblicze.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-nocna-biala-minimalistyczna-kinkiet-do-sypialni-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna nocna biała minimalistyczna kinkiet do sypialni 1 x E27', '', '', '', ''),
(400, 1, 1, 'Lampa ścienna wykonana w skandynawskim stylu przeznaczona jest na żarówkę LED z gwintem E27. Idealnie sprawdzi się ona w sypialni, salonie czy jadalni, jako oświetlenie dodatkowe. Kinkiet świetnie dopasuje się do współczesnych wnętrz. Czarna minimalistyczna lampa jest wykonana w zgodzie z najnowszymi trendami projektowania wnętrz. Piękno prostoty tutaj zachwyca i będzie idealnie współgrało ze współczesnym wnętrzem. Lampę ścienną można zamontować również nad łóżkiem gdzie może służyć jako lampka nocna. 	Ta lampa jest produktem, który został zaprojektowany z nowatorskim podejściem. Jest to oryginalny i innowacyjny dodatek do wystroju nowoczesnego wnętrza, który doda mu szyku i odmieni jego oblicze.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-nocna-czarna-minimalistyczna-kinkiet-do-sypialni-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna nocna czarna minimalistyczna kinkiet do sypialni 1 x E27', '', '', '', ''),
(401, 1, 1, 'KINKIET ŚCIENNY LED marki Polux z kolekcji Niko w kolorze białym. Oprawa świetnie sprawdzi się w różnych pomieszczeniach typu:  korytarze, klatki schodowe oraz gabinety/biura  urządzonych w stylu nowoczesnym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń.  Ciesz się przyjemną dla oka lampą ścienną Niko która została wyposażona w podwójne tradycyjne gniazdo E14 do którego możemy zastosować popularne, energooszczędne żarówki LED o maksymalnej mocy 8W. Nowoczesne i praktyczne oświetlenie w formie oprawy led, może służyć w zależności od potrzeb, jako dodatkowe źródło światła.  Odmień swoje wnętrze i korzystaj z wszystkich możliwości jakie daje Ci oświetlenie led najnowszej genereacji.  Mieszkaj modnie i stylowo. Zobacz inne dostępne u nas modele  kinkietów i listw oświetleniowych.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-spot-niko-2xe14-polux-5901508310989', '', '', '', 'Oprawa ścienna KINKIET Spot Niko 2xE14 Polux 5901508310989', '', '', '', ''),
(402, 1, 1, 'Kinkiet Violato klasyczny produkt w stylu vintage. Jego znakiem szczególnym jest szklany klosz, przyozdobiony ciekawym wzorem. Dzięki prostej palecie barw, bez problemu wkomponujesz go w dowolne pomieszczenie. Lampa ta została wykonana z materiałów najwyższej jakości, przez co świetnie się prezentuje,zachowując przy tym walory niezawodności. Szczególnie polecana do klasycznych wnętrz.  Lampa ścienna współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-lampa-scienna-viola-a-czarny-1xe27-metal-i-szklo-styl-klasyczny-lampex', '', '', '', 'Kinkiet lampa ścienna Viola A czarny 1xE27 Metal i szkło styl klasyczny Lampex', '', '', '', ''),
(403, 1, 1, 'Lampa ścienna w kształcie trójkąta to minimalistyczny i piękny dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet cechuje piękno wynikające z prostoty. Lampa ścienna w połączeniu z żarówką LED wprowadzą w pomieszczeniu przyjemną atmosferę. Dzięki temu, że nic nie osłania żarówki będzie ona ozdobą wnętrza. Lampa ścienna w kształcie trójkąta idealnie nadaje się do salonu jak również sypialni czy pokoju gościnnego jako oświetlenie dodatkowe. Wysoka jakość wykonania kinkietu jest gwarancją tego, że będzie on zachwycał swoim wyglądem przez długi czas. 	Lampa ścienna zaprojektowana z niezwykłą dbałością o szczegóły nada charakteru Twojemu wnętrzu i oświetli go pięknym blaskiemProdukt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-salonu-trojkat-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do salonu trójkąt 1 x E27', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(404, 1, 1, 'SZUKASZ STYLOWEGO I NASTROJOWEGO OŚWIETLENIA DO SWOJEJ SYPIALNI LUB SALONU? POSTAW NA KINKIETY Z SERII GLORIA! Białe kinkiety GLORIA idealnie sprawdzą się nie tylko w sypialni, ale również w salonie. To efektywne i niezwykle stylowe dodatkowe dekoracyjne źródło światła. Wyglądają bardzo dekoracyjnie i pozwalają stworzyć kameralną atmosferę w danym pomieszczeniu, która będzie sprzyjała chwilom spędzanym we dwoje lub wieczornemu relaksowi z książką czy telewizją. Sprawdzi się zarówno we wnętrzach nowoczesnych, klasycznych,  jak i minimalistycznych. Może być także ciekawym przełamaniem wnętrza w stylu loftowym. Będzie pasować również do aranżacji inspirowanych stylem retro. Tworzy interesujące połączenie z cegłą, batonem, a także klasycznie wykończonymi ścianami.  ODMIEŃ SWOJĄ SYPIALNIĘ LUB SALON DZIĘKI KINKIETOM Z SERII GLORIA!  *WYSOKA JAKOŚĆ*WSPÓŁPRACA Z ŻARÓWKAMI NA GWINT E14*EFEKTOWNA OPRAWA*WYMIAR LAMPY  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?   Prezentowana lampa doskonale prezentuje się w połączeniu z innymi elementami oświetlenia z serii GLORIA Z ich wykorzystaniem łatwo stworzysz stylową aranżację oświetlenia w całym domu.  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-gloria-1xe14-biala-26cm-polux', '', '', '', 'Kinkiet Lampa Ścienna GLORIA 1xE14 Biała 26cm - Polux', '', '', '', ''),
(405, 1, 1, 'Quado to nowoczesna lampa ścienna o ciekawym geometrycznym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia, a poświata rzucana przez lampę doskonale podkreśli wyjątkowy obraz, czy lustro.  Kwadratowa lampa współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-quado-bialy-kwadrat-1xg9-metal-lampex', '', '', '', 'Kinkiet Quado biały kwadrat 1xG9 Metal Lampex', '', '', '', ''),
(406, 1, 1, 'Quado to nowoczesna lampa ścienna o ciekawym geometrycznym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia, a poświata rzucana przez lampę doskonale podkreśli wyjątkowy obraz, czy lustro.  Kwadratowa lampa współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-quado-popiel-kwadrat-1xg9-metal-lampex', '', '', '', 'Kinkiet Quado popiel kwadrat 1xG9 Metal Lampex', '', '', '', ''),
(407, 1, 1, 'SILMA LED to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX, która cechuje się nowoczesnym designem w okrągłym płaskim kształcie z możliwością regulacji. Oprawa ścienno-sufitowa została wyposażona w zintegrowane źródło światła o mocy 6W w barwie 3000K - biały ciepły emitujących strumień świetlny na poziomie 320lm. SILMA przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kinkiet LED, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Decydując się na zakup prezentowanej oprawy ścienno-sufitowej otrzymujemy produkt najlepszej jakości i trwałości, który zadowoli każdego, nawet najbardziej wymagającego klienta. Kanlux SILMA to seria opraw o nietypowym, futurystycznym kształcie. Ciekawy design opraw to przede wszystkim płaskie klosze tych opraw ze zintegrowanymi źródłami światła LED. Polecamy do nowoczesnych, modernistycznych wnętrz.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 24440Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-silma-6w-3000k-ciepla-chrom-kanlux', '', '', '', 'Oprawa Lampa Sufitowa SILMA 6W 3000K Ciepła Chrom Kanlux', '', '', '', ''),
(408, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-modern-b-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna  Quado MODERN B popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(409, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity czarny kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Czarna lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-dlugi-czarny-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik długi Czarny Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(410, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity czarny kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Czarna lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-krotki-czarny-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik krótki Czarny Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(411, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik, w kolorze popielatym i w wersji długiej, to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity szary kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Szara lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-dlugi-popiel-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik długi Popiel Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(412, 1, 1, 'Kinkiet JACK 581 marki MiLAGRO to najnowsza propozycja stworzona do wnętrz o różnych stylach. Prosta forma, połączona z niebanalnie zamontowaną żarówką czynią kinkiet wyjątkowo uniwersalnym. Z powodzeniem sprawdzi się on w pomieszczeniach w klasycznym czy nowoczesnym stylu, jak również w rustykalnych klimatach. Jej piękny brązowy odcień drewna, będzie stanowił zwieńczenie i ozdobę samą w sobie dla wielu ścian. Kinkiet posiada popularny rodzaj gwintu E27, co pozwala na bezproblemowe dobranie żarówki o pożądanej przez siebie jasności oraz barwie. Produkt został wykonany z dwóch niezwykle trwałych materiałów: metalu oraz drewna. Należy zwrócić uwagę na niską wagę kinkietu, gdyż całość z żarówką waży jedyne 0,5 kg. Kinkiet prawidłowo działa przy napięciu równym 230 V oraz przy częstotliwości wynoszącej 50 Hz.Oświetlenie z serii JACK to dosyć wrażliwe produkty na działanie czynników zewnętrznych, dlatego należy przemyśleć miejsce montażu, kierując się symbolem stopnia ochrony - IP20.Produkt został wyprodukowany w Polsce. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-jack-1xe27-orzech-klasyczna-zarowka-drewniana-oprawa-mlp4359-milagro-metal-drewno', '', '', '', 'Kinkiet JACK 1xE27 Orzech Klasyczna Żarówka Drewniana Oprawa MLP4359 Milagro Metal + Drewno', '', '', '', ''),
(413, 1, 1, 'Kinkiet ścienny z jednym punktem światła LED serii BOTTLE, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i akrylu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Lampa, której design nie pozostawia nikogo obojętnym, swoim wyglądem nawiązuje do butelki wypełnionej wodą gazowaną.Lampa, posiada ledowe źródło światła, które świeci barwą przyjazną dla oka ludzkiego 4000K o strumieniu świetlnym równym 350lm, jest przy tym energooszczędne 5W. To idealna propozycja zarówno do wnętrz współczesnych, jak i bardziej klasycznych. Kinkiet wyjątkowo dobrze będzie wyglądał w kuchni oraz w salonie. Z powodzeniem może być wykorzystany również w barach, pubach i restauracjach. Ze względu na swój oryginalny design, ożywi i nada charakteru każdemu pomieszczeniu. Wykorzystanie tej lampy zrobi imponujące wrażenie, którego każdy pozazdrości. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-bottle-led-lampa-scienna-nowoczesna-5w-350lm-4000k-neutralna-milagro', '', '', '', 'Kinkiet BOTTLE LED lampa ścienna nowoczesna 5W 350lm 4000K neutralna MiLAGRO', '', '', '', ''),
(414, 1, 1, 'Diego to nowoczesna lampa ścienna o wspaniałym obłym kształcie. Kinkiet idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon, czy jadalnia. Wyjątkowa poświata rzucana przez lampę idealnie podkreśli wyjątkowy obraz lub lustro. Do jego produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałym i odpornym na uszkodzenia.  Tuba współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-diego-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Diego popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(415, 1, 1, 'Kinkiet Victor to nowoczesna lampa ścienna o niecodziennym półkolistym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca na ścianę zjawiskową poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.  Gipsowa lampa współgra z żarówkami o trzonku G9 oraz  mocy max 40W (brak w zestawie).', '', 'kinkiet-victor-bialy-1xg9-modern-gips-lampex', '', '', '', 'Kinkiet Victor Biały 1xG9 Modern Gips Lampex', '', '', '', ''),
(416, 1, 1, 'Rossi to nowoczesny kinkiet ceramiczny o przykuwającym uwagę wyglądzie. Jego nieskomplikowany kształt sprawi, że idealnie wkomponuje się w pomieszczenia takie jak salon, pokój dzienny, czy korytarz. Lampa rzuca zjawiskową poświatę na ścianę, dzięki czemu uwydatni walory obrazu czy lustra. Oprawa została wykonana wyłącznie z materiałów wysokiej jakości, dzięki czemu wygląda wspaniale, jednocześnie zachowując walory niezawodności.  Ceramiczna lampa współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie). Górna szybka nie jest dołączana do zestawu', '', 'kinkiet-lampa-scienna-rossi-40-popiel-prostokat-1xe27-ceramika-i-szklo-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Rossi 40 popiel prostokąt 1xE27 Ceramika i szkło styl nowoczesny Lampex', '', '', '', ''),
(417, 1, 1, 'Kinkiet Denis to nowoczesna lampa ścienna o ciekawym półkolistym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca na ścianę poświatę, która uwydatni ulubiony obraz, lub lustro. Lampa jest kompatybilna z żarówką E27 o mocy 60W (brak w zestawie).', '', 'kinkiet-denis-1xe27-bialy-polkula-modern-gips-lampex', '', '', '', 'Kinkiet Denis 1xE27 Biały Półkula Modern Gips Lampex', '', '', '', ''),
(418, 1, 1, 'Lampa ścienna kinkiet serii DAMA WHITE, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Biały klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-lampa-scienna-milagro-dama-1x-e27-biala-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim lampa ścienna MiLAGRO DAMA 1x E27 biała Drewno + metal', '', '', '', ''),
(419, 1, 1, 'Prostokątna obudowa w formie kostki posiada LEDowe źródło światła o mocy równej 7 W, co odpowiada mocy 41W w przypadku tradycyjnej żarówki. Lampa jest więc energooszczędna. LED zapewnia światło o neutralnej barwie, której temperatura wynosi 4000 K. Strumień świetlny w przypadku tego modelu ma wartość 490 lm. Akrylowy kinkiet ma 11 cm wysokości i 16 cm szerokości. Kinkiet dobrze sprawdzi się w pomieszczeniu zaaranżowanym na jadalnię. Geometryczny kształt i jasna, jednolita kolorystyka pozwolą dopasować lampę CUBO 448 do nowoczesnych wnętrz, urządzonych w jasnych kolorach.', '', 'kinkiet-lampa-scienna-cubo-7w-bialy-led-ip20-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Kinkiet lampa ścienna CUBO 7W biały LED IP20 Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(420, 1, 1, 'Lampa ścienna kinkiet serii VICTORIA, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i tkaniny z dbałością o każdy detal lampa. Dominuje w niej klasyka zapakowana w nieco bardziej awangardową formę. W tej kolekcji na pierwszy plan wysuwają się tradycyjne, tkaninowe klosze o lekko trapezowym kształcie umieszczone na charakterystycznie wygiętych, metalowych ramionach. Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, z gwintem E27 o mocy nieprzekraczającej 60W.Stylistyka kolekcji VICTORIA świetnie wkomponuje się we wnętrza o nieco bardziej klasycznym sznycie. W zależności od wariantu kolorystycznego, na jaki się zdecydujemy, możemy połączyć ją z różnymi odcieniami drewna, z szarością, bielą czy czernią.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-milagro-victoria-1x-e27', '', '', '', 'Kinkiet lampa ścienna MiLAGRO VICTORIA 1x E27', '', '', '', ''),
(421, 1, 1, 'Lampa ścienna kinkiet w kolorze czarnym serii VICTORIA, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i tkaniny z dbałością o każdy detal lampa. Dominuje w niej klasyka zapakowana w nieco bardziej awangardową formę. W tej kolekcji na pierwszy plan wysuwają się tradycyjne, tkaninowe klosze o lekko trapezowym kształcie umieszczone na charakterystycznie wygiętych, metalowych ramionach. Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, z gwintem E27 o mocy nieprzekraczającej 60W.Stylistyka kolekcji VICTORIA świetnie wkomponuje się we wnętrza o nieco bardziej klasycznym sznycie. W zależności od wariantu kolorystycznego, na jaki się zdecydujemy, możemy połączyć ją z różnymi odcieniami drewna, z szarością, bielą czy czernią.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarna-milagro-victoria-black-1x-e27', '', '', '', 'Kinkiet lampa ścienna czarna MiLAGRO VICTORIA BLACK 1x E27', '', '', '', ''),
(422, 1, 1, 'Kinkiet model MLP3709 z serii RALPH marki MILAGRO została wykonana z połączenia metalu oraz drewna. Lampa ścienna została wyposażona w jedno gniazdo z tradycyjnym gwintem typu E27, dzięki czemu jest on dostosowany do różnego rodzaju energooszczędnych żarówek LED (brak źródła światła w zestawie). Oprawa ścienna RALPH 3709 zachwyca swoją prostotą, czarny kolor z dodatkiem drewna to kompozycja, która idealnie wkomponuje się w wystrój wnętrz w stylu minimalistycznym, nowoczesnym lub loftowym. Prezentowana lampa z serii RALPH ożywi wasze wnętrza, a zarazem doda im charakteru oraz ciekawszego wyglądu.Lampa Świetnie Sprawdzi się: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'kinkiet-industrialny-lampa-scienna-ralph-1x-e27-czarny-metal-drewno-milagro', '', '', '', 'Kinkiet Industrialny Lampa ścienna Ralph 1x E27 Czarny Metal + drewno Milagro', '', '', '', ''),
(423, 1, 1, 'Lampa ścienna kinkiet serii DAMA WHITE, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Biały klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-bialy-regulowany-milagro-dama-1x-e27-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim biały regulowany MiLAGRO DAMA 1x E27 Drewno + metal', '', '', '', ''),
(424, 1, 1, 'Kinkiet, w kolorze białym, z niezwykle eleganckiej kolekcji Wenecja to produkt wykonany z dbałością detale. Lampa na ścianę została przystosowana do pracy z żarówkami o trzonku E27 i mocy maksymalnej wynoszącej 60W. Lampa ścienna za sprawą ozdobnych, akrylowych kryształków zwisających spod abażuru będzie wspaniałą ozdobą każdego wnętrza. Elegancka lampa świetnie sprawdzi się w salonie, kuchni czy jadalni, gdzie wprowadzi niepowtarzalny klimat. Lampa w stylu glamour świetnie wkomponuje się w jasne przestrzenie jak również stworzy ciekawy kontrast przy ciemnych wnętrzach.', '', 'kinkiet-wenecja-bialy-1x-e27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Kinkiet Wenecja Biały 1x E27 Metal abażur tkanina kryształki Lampex styl glamour', '', '', '', ''),
(425, 1, 1, 'Kinkiet, w kolorze czarnym, z niezwykle eleganckiej kolekcji Wenecja to produkt wykonany z dbałością detale. Lampa na ścianę została przystosowana do pracy z żarówkami o trzonku E27 i mocy maksymalnej wynoszącej 60W. Lampa ścienna za sprawą ozdobnych, akrylowych kryształków zwisających spod abażuru będzie wspaniałą ozdobą każdego wnętrza. Elegancka lampa świetnie sprawdzi się w salonie, kuchni czy jadalni, gdzie wprowadzi niepowtarzalny klimat. Abażur można łatwo wyczyścić z kurzu i zabrudzeń przy użyciu lekko zwilżonej ściereczki.', '', 'kinkiet-wenecja-czarny-1x-e27-metal-abazur-tkanina-krysztalki-lampex-styl-glamour', '', '', '', 'Kinkiet Wenecja Czarny 1x E27 Metal abażur tkanina kryształki Lampex styl glamour', '', '', '', ''),
(426, 1, 1, 'Lampa ścienna kinkiet serii AURIS WHITE, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i szkła lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę doskonale sprawdzą się w każdym wnętrzu, a efekt przemysłowego wykończenia pomieszczeń jeszcze mocniej podkreśla wykonanie z metalu oraz kolorystyka lampy: biała z białą kulą i srebrnym, połyskującym detalem. Ta kolorystyka lampy zachwyci nie tylko miłośników nowoczesnych wnętrz, gdyż z łatwością wpisze się w wiele przestrzeni. Dużą zaletą kinkietu jest to, że ich głowice są ruchome, co pozwala na dostosowanie kąta padania światła do własnych potrzeb, przez co konstrukcja klosza ujmująco rozprasza światło, tworząc charakterystyczny, niepowtarzalny efekt światłocienia.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E14. Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-ruchoma-bialo-srebrna-milagro-auris-1x-e14', '', '', '', 'Kinkiet lampa ścienna ruchoma biało-srebrna MiLAGRO AURIS 1x E14', '', '', '', ''),
(427, 1, 1, 'Lampa ścienna z dwoma czarnymi oprawkami, w których można zamontować dwie żarówki LED o trzonku GU10 to produkt wysokiej jakości ze źródłem światła LED w komplecie. Kinkiet został stworzony po to, aby pięknie oświetlić garderobę, choć równie dobrze sprawdzi się zamontowany np. na korytarzu. Dołączone do kompletu żarówki LED o mocy 3W i białej ciepłej barwie światła wprowadzą przyjemną atmosferę i oświetlą pięknym, optymistycznym światłem ciemny korytarz czy garderobę. Nowoczesny design lampy, zaprojektowany w zgodzie z najnowszymi trandami, to praktyczny i niebanalny dodatek, który będzie w stanie ożywić i odmienić wnętrze.	Jeśli poszukujesz dobrej jakościowo lampy ściennej, która przy okazji ładnie się prezentuje to lampa przedstawiona tutaj będzie dobrym wyborem. Dodatkowo kinkiet posiada dołączone źródła światła, co jest jego ogromną zaletą.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-garderoby-2x-gu10-2x-zarowka-led-gu10-3w', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do garderoby 2x GU10 + 2x żarówka LED GU10 3W', '', '', '', ''),
(428, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-b-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO B biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(429, 1, 1, 'Kinkiet należący do kolekcji Moonlight został wyprodukowany przez polską markę MiLAGRO. Lampa ścienna wykonana jest z wysokiej jakości materiałów: metalu, szkła i kryształków - które doskonale się ze sobą komponują i tworzą piękną całość. Lampa w stylu glamour będzie pasować zarówno do nowoczesnych jak i klasycznych wnętrz. Ciekawie wykonany klosz i wiszące kryształki sprawiają, że po zamontowaniu żarówki o trzonku E14 kinkiet pięknie oświetli wnętrze jednocześnie tworząc niesamowity efekt świetlny. Lampa z kryształkami przyciąga wzrok i sprawia, że nie sposób przejść obok niej obojętnie.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów. Produkt objęty jest 24-miesięczną gwarancją. Po upływie ww. okresu użytkownik ma możliwość skorzystania ze specjalistycznego firmowego serwisu.', '', 'kinkiet-lampa-scienna-moonlight-1x-e14-milagro-glamour-chrom-metal-szklo', '', '', '', 'Kinkiet lampa ścienna MOONLIGHT 1x E14 MILAGRO glamour chrom metal szkło', '', '', '', ''),
(430, 1, 1, 'Kinkiet serii ROMA WHITE, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i szkła. Lampa ścienna współpracuje z żarówkami o trzonku E27 o mocy nieprzekraczającej 60W. Biały kinkiet został wykonany z dbałością o każdy detal. Cechą jest piękny, subtelny klosz z dymionego szkła, a także stylowe złote wstawki na elementach konstrukcyjnych.Lampy z kolekcji ROMA doskonale sprawdzą się w nowoczesnych wnętrzach o modnym, minimalistycznym klimacie. Wariant biały wprowadzi do pomieszczenia lekkość, świeżość i subtelny powiew luksusu, modele w barwie czarnego matu to z kolei kwintesencja elegancji i klasy.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-biala-milagro-roma-white-1x-e27', '', '', '', 'Kinkiet lampa ścienna biała MiLAGRO ROMA WHITE 1x E27', '', '', '', ''),
(431, 1, 1, 'Lampa ścienna STALACTITE BRASS 9055 marki Nowodvorski to najnowsza propozycja stworzona dla nowoczesnych wystrojów wnętrz. Industrialna, a nawet futurystyczna forma oświetlenia będzie idealnym uzupełnieniem wnętrz o charakterze loftowym oraz nowoczesnym. Jej nietypowy wygląd przyciąga wzrok, dzięki dwóm punktom świetlnym skierowanym strumieniem światła ku górze. Niecodzienna mosiężna barwa, w połączeniu z delikatnie odbijającym światło wykończeniem, sprosta oczekiwaniom najbardziej wymagających klientów. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Model ten zawieszono na okrągłej podsufitce. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Lampa ścienna w nowoczesnym stylu jest w stanie delikatnie oświetlić pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Swoje miejsce znajdzie w salonie czy biblioteczce i będzie cieszącą oczy ozdobą, doskonale nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja. Wysokość lampy to 25,5 cm, a szerokość wynosi 34 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 10W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to G9, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-2xg9-retro-loft-9055-stalactite-brass-mosiadz-stal', '', '', '', 'Lampa ścienna NOWODVORSKI 2xG9 Retro Loft 9055 STALACTITE BRASS Mosiądź Stal', '', '', '', ''),
(432, 1, 1, 'Kinkiet ścienny z zainstalowanym wymiennym jednym punktem światła LED. Lampa świeci przyjazną dla oka barwą 3000 K, jest przy tym energooszczędna - 6 W odpowiada 36 W w tradycyjnych żarówkach. Całość wykonano z metalu oraz akrylu. W zestawie oprócz lampy znajdują się niezbędne elementy do jej montażu. Wartość zasilania mieści się w zakresie od 220 V do 240 V. Kinkiet z serii Orion jest doskonałą propozycją nie tylko do nowoczesnych i stylowych salonów. Idealnie oświetli też korytarz i przedpokój. Jego prosty design charakteryzuje się minimalistyczną, a zarazem prostą formą.', '', 'kinkiet-orion-okrag-czarny-10w-led-ip20-styl-nowoczesny-minimalistyczny-metal-i-akryl-milagro', '', '', '', 'Kinkiet ORION okrąg czarny 10W LED IP20 styl nowoczesny minimalistyczny Metal i akryl Milagro', '', '', '', ''),
(433, 1, 1, 'Kinkiet ścienny z zainstalowanym wymiennym jednym punktem światła LED. Lampa świeci przyjazną dla oka barwą 3000 K, jest przy tym energooszczędna - 6 W odpowiada 36 W w tradycyjnych żarówkach. Całość wykonano z metalu oraz akrylu. W zestawie oprócz lampy znajdują się niezbędne elementy do jej montażu. Wartość zasilania mieści się w zakresie od 220 V do 240 V. Kinkiet z serii Orion jest doskonałą propozycją nie tylko do nowoczesnych i stylowych salonów. Idealnie oświetli też korytarz i przedpokój. Jego prosty design charakteryzuje się minimalistyczną, a zarazem prostą formą.', '', 'kinkiet-orion-okrag-bialy-10w-led-ip20-styl-nowoczesny-minimalistyczny-metal-i-akryl-milagro', '', '', '', 'Kinkiet ORION okrąg biały 10W LED IP20 styl nowoczesny minimalistyczny Metal i akryl Milagro', '', '', '', ''),
(434, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY ŚCIENNEJ!Lampa ścienna JULIA marki POLUX w kolorze chromu w eleganckim stylu z dwoma punktami świetlnymi, zawieszona w widocznym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, modnych bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.Produkt ten, z pewnością przypadnie do gustu wszystkim wielbicielom klasycznych rozwiązań. POSTAW NA TĘ LAMPĘ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*2x GWINT G9UWAGA! Brak źródła światła w komplecie.*KLOSZ*ŁATWOŚĆ MONTAŻU   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-oprawa-julia-szklana-chrom-krysztalki-2x-g9-polux-5901508317438', '', '', '', 'Lampa Ścienna Kinkiet oprawa JULIA szklana chrom kryształki 2x G9 Polux 5901508317438', '', '', '', ''),
(435, 1, 1, 'Biała lampa ścienna, w kształcie prostokąta, posiada możliwość zamontowania dwóch żarówek LED o trzonku GU10. Została ona zaprojektowana z myślą o oświetleniu korytarza, choć świetnie sprawdzi się również w garderobie czy w przedpokoju. Elegancka oprawa w klasycznym białym kolorze będzie dopełnieniem oświetlenia we współczesnym mieszkaniu. Kinkiet wraz z żarówkami LED GU10 pięknie oświetli korytarz na którym zostanie zamontowany. Ponadto dzięki swojej prostocie lampa ta będzie pasować niemal do każdego pomieszczenia. Ogromną zaletą tej lampy jest to, że można zamontować żarówkę LED z dwóch stron, co daje ciekawy efekt świetlny, a światło pada i od góry, i od dołu.	Lampa ścienna umieszczona w korytarzu odmieni jego oblicze i sprawi, że będzie się on wydawał bardziej nowoczesny. Ten Kinkiet to produkt wysokiej jakości, który z pewnością będzie piękną ozdobą wnętrza przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-oprawa-biala-prostokat-kinkiet-na-korytarz-2x-gu10', '', '', '', 'Nowoczesna lampa ścienna oprawa biała prostokąt kinkiet  na korytarz 2x GU10', '', '', '', ''),
(436, 1, 1, 'Kinkiet Oregon to wspaniała propozycja dla miłośników stylu nowoczesnego. Biały, szklany klosz został dodatkowo przyozdobiony delikatnym kwiatowym wzorem, dzięki czemu lampa nabrała wyjątkowo stylowego oraz niecodziennego wyglądu. Oprawa została wykonana z materiałów wysokiej jakości, dzięki czemu będzie wspaniałą ozdobą pokoju przez długie lata. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W(brak w zestawie).', '', 'kinkiet-oregon-k1-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet Oregon K1 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(437, 1, 1, 'Kinkiet Roma to doskonała propozycja dla miłośników stylu klasycznego. Lampa ścienna posiada szklany klosz, który ozdobiony jest ciekawym i eleganckim wzorem. Klosz w połączeniu z solidną oprawą wykonaną z metalu nadaje lampie przykuwający uwagę wygląd. Lampa na ścianę została wykonana z materiałów wysokiej jakości, dzięki czemu będzie działać niezawodnie przez długi czas, jednocześnie pięknie się prezentując. Klasyczny kinkiet pracuje z żarówką o trzonku E27 (brak w zestawie), wraz z którą pięknie oświetli wnętrze.', '', 'kinkiet-lampa-scienna-k1-roma-bez-patyna-1x-e27-metal-i-szklo-lampex-styl-klasyczny', '', '', '', 'Kinkiet Lampa ścienna K1 Roma Beż Patyna 1x E27 Metal i szkło Lampex Styl klasyczny', '', '', '', ''),
(438, 1, 1, 'Kinkiet Helix to stylowa lampa z pięknym, ekspresyjnym wzorem. Lampa ścienna o półokrągłym kształcie doskonale podkreśli charakter zarówno nowoczesnych jak i klasycznych wnętrz. Lampa na ścianę w kremowym kolorze posiada czarny, nieregularny wzór, który budzi pozytywne odczucia. Elegancka lampa została wykonana z wysokiej jakości materiałów, dzięki czemu będzie działać niezawodnie przez długi czas. Kinkiet pracuje z żarówką E27 (brak w zestawie), wraz z którą pięknie oświetli pomieszczenie.', '', 'kinkiet-lampa-scienna-helix-ecru-k1-1x-e27-metal-i-szklo-lampex', '', '', '', 'Kinkiet Lampa ścienna Helix Ecru K1 1x E27 Metal i szkło Lampex', '', '', '', ''),
(439, 1, 1, 'Kinkiet Haga to stylowa i oryginalna lampa z roślinnym motywem. Lampa ścienna w beżowym kolorze posiada brązowy, roślinny wzór, który pięknie się prezentuje. Lampa retro o półokrągłym kształcie doskonale podkreśli charakter zarówno klasycznych jak i nowoczesnych wnętrz. Elegancka lampa została wykonana z wysokiej jakości materiałów, dzięki czemu będzie działać niezawodnie przez długi czas. Plafon pracuje z żarówką E27 (brak w zestawie), wraz z którą pięknie oświetli pomieszczenie.', '', 'kinkiet-lampa-scienna-k1-haga-1x-e27-metal-i-szklo-lampex-retro-roslinny-wzor', '', '', '', 'Kinkiet Lampa ścienna K1 Haga 1x E27 Metal i szkło Lampex retro roślinny wzór', '', '', '', ''),
(440, 1, 1, 'Kinkiet ścienny model KOMETA to unikatowa oprawa LED marki Polux charakteryzująca się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonana w całości z gipsu, ręcznie szlifowana oprawa o ciekawym ksztłacie została przystosowana do pracy z energooszczędnymi źródłami światła LED z gwintem E14. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Efektowny kinkiet o niewielkich rozmiarach został dostoswany do montażu natynkowego (naściennego). Oprawa świetnie wkomponuje się w nowoczesne wnętrza, gdzie dominują proste aczkolwiek niebanalne formy. Ponadto, oprawę można malować na dowolny kolor. KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-gipsowa-kinkiet-scienny-ozdobny-kometa-1xe14-biala-polux', '', '', '', 'Oprawa gipsowa, kinkiet ścienny, ozdobny KOMETA 1xE14 biała POLUX', '', '', '', ''),
(441, 1, 1, 'Kinkiet ścienny model FALA to unikatowa oprawa LED marki Polux charakteryzująca się nowoczesnym wyglądem, który subtelnie podkreśli światłem Twoje wnętrze. Wykonana w całości z gipsu, ręcznie szlifowana oprawa o opływowym ksztłacie została przystosowana do pracy z energooszczędnymi źródłami światła LED z gwintem E14. Wymiana źródła światła jest stosunkowo łatwa, dzięki czemu możesz dopasować moc i barwę źródła światła według własnych potrzeb. Efektowny kinkiet o niewielkich rozmiarach został dostoswany do montażu natynkowego (naściennego). Oprawa świetnie wkomponuje się w nowoczesne wnętrza, gdzie dominują proste aczkolwiek niebanalne formy. Ponadto, oprawę można malować na dowolny kolor. KINKIET IDEALNIE SPRAWDZI SIĘ JAKO ELEMENT OŚWIETLENIA:SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-gipsowa-kinkiet-scienny-ozdobny-fala-1xe14-biala-polux', '', '', '', 'Lampa Oprawa gipsowa, kinkiet ścienny, ozdobny FALA 1xE14 biała POLUX', '', '', '', ''),
(442, 1, 1, 'Doli to wspaniały kinkiet stylizowany na świecznik. Całość została utrzymana w stylu vintage. Biały metalowy korpus, w połączeniu ze złotymi akcentami tworzy wspaniały duet, a jego unikalny kształt wprowadzi do wnętrza niepowtarzalny. Lampa została wykonana z materiałów najwyższej jakości, dzięki czemu prezentuje się wspaniale. Lampa ścienna współgra z żarówkami o trzonku E14 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-doli-bialy-swiecznik-1xe14-metal-styl-klasyczny-retro-lampex', '', '', '', 'Kinkiet Doli biały świecznik 1xE14 Metal styl klasyczny retro Lampex', '', '', '', ''),
(443, 1, 1, 'Oprawa ścienna KASSI to wyprodukowana w Polsce z wysokiej jakości aluminium w połączeniu ze szkłem lampa sufitowa oprawa punktowa charakteryzująca się bardzo prostym i modnym wzornictwem. Lampa w kolorze białym stanowi idealny dodatek dekoracyjny do pomieszczeń takich jak salon czy sypialnia. Doskonale nadaje się również jako utrzymane w eleganckim stylu oświetlenie dekoracyjne stosowane w restauracjach czy hotelach. Produkt przystosowany został do pracy z energooszczędnymi źródłami świateł LED z trzonkiem G9 o mocy nieprzekraczającej 40W. Wymiana żarówek w lampie jest łatwa, dzięki czemu możesz bez problemu dobrać pożądaną moc oraz barwę światła.SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-scienna-kassi-g9-o-w-ip20-kanlux-aluminium', '', '', '', 'Lampa oprawa ścienna KASSI G9 O-W IP20 KANLUX ALUMINIUM', '', '', '', ''),
(444, 1, 1, 'Kinkiet ścienny w minimalistycznym wydaniu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa została wykonana z dbałością o detale, dzięki czemu jest niezawodnym i efektownym produktem. Lampa ścienna przeznaczona jest do pracy z żarówką o trzonku E14, dzięki czemu z łatwością można dobrać do niej żarówkę wedle gustu i swoich upodobań. Elegancki kinkiet wykonany z materiałów wysokiej jakości jest idealny do oświetlenia korytarzy, salonów, sypialni i wszystkich pomieszczeń, którym chcemy nadać niepowtarzalny charakter.Specyfikacja Techniczna:', '', 'kinkiet-lampa-scienna-oprawa-e14-czarna-loft-retro-k-3993-kaja', '', '', '', 'Kinkiet Lampa Ścienna Oprawa E14 Czarna LOFT RETRO K-3993 Kaja', '', '', '', ''),
(445, 1, 1, 'Lampa ścienna kinkiet serii DYLAN, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni ze złotem oraz miedzianego odcienia żarówki sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.DYLAN idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-industrialnym-lampa-scienna-czarna-milagro-dylan-1x-e27', '', '', '', 'Kinkiet w stylu industrialnym lampa ścienna czarna MiLAGRO DYLAN 1x E27', '', '', '', ''),
(446, 1, 1, 'Kinkiet ALMA został wyprodukowany przez polską markę - MiLAGRO. Biały kinkiet został wykonany z dbałością o każdy detal. Metalowy i druciany klosz o geometrycznym kształcie przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa ścienna współpracuje z żarówkami o trzonku E27. Lampa w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów.SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-industrialnym-lampa-scienna-biala-druciana-milagro-alma-1x-e27', '', '', '', 'Kinkiet w stylu industrialnym lampa ścienna biała druciana MiLAGRO Alma 1x E27', '', '', '', ''),
(447, 1, 1, 'Riwana to fantastyczny kinkiet, który swoim designem zachwyci miłośników nowoczesności. Bogato zdobiony klosz z pewnością spełni oczekiwania najbardziej wymagających kinkietów. Lampa idealnie dopełni główne oświetlenie w pomieszczeniu. Świecąc samodzielnie rzuci wspaniała poświatę na ścianę. Idealnie sprawdzi się w nowoczesnych aranżacjach.  Szklana lampa współgra z żarówkami o trzonku E14 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-riwana-1xe14-chrom-metal-i-szklo-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Riwana 1xE14 Chrom Metal i szkło styl nowoczesny Lampex', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(448, 1, 1, 'Lampa ścienna kinkiet serii LINES, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Kolor obudowy to naturalne drewno, co zapewnia nam, że ta seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej. LINES idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-industrialnym-lampa-scienna-metal-drewno-milagro-lines-1x-e27', '', '', '', 'Kinkiet w stylu industrialnym lampa ścienna metal + drewno MiLAGRO LINES 1x E27', '', '', '', ''),
(449, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik, w kolorze białym i w wersji krótkiej, to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity biały kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Biała lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-krotki-bialy-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik krótki Biały Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(450, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik, w kolorze białym i w wersji długiej, to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity biały kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Biała lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-dlugi-bialy-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik długi Biały Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(451, 1, 1, 'Kinkiet z nowoczesnej kolekcji Rubik, w kolorze popielatym i w wersji krótkiej, to stylowy produkt o interesującym, geometrycznym kształcie. Minimalistyczny styl oraz jednolity szary kolor sprawiają, że ten kinkiet idealnie wkomponuje się w niemal każde wnętrze. Lampa ścienna posiada solidnie wykonany i metalowy korpus, który zapewnia wytrzymałość i gwarantuje odporność na stłuczenia. Szara lampa swoim wyglądem nawiązuje do kubistycznych kształtów, dzięki czemu idealnie będzie pasować do wnętrz w stylu minimalistycznym bądź nowoczesnym. Nowoczesny kinkiet pracuje z żarówką o trzonku G9 o mocy maksymalnej 40W wraz z którą odmieni oblicze wnętrza.', '', 'kinkiet-rubik-krotki-popiel-lampa-scienna-1x-g9-metal-lampex-kostka-kwadrat-styl-nowoczesny', '', '', '', 'Kinkiet Rubik krótki Popiel Lampa ścienna 1x G9 Metal Lampex Kostka Kwadrat Styl nowoczesny', '', '', '', ''),
(452, 1, 1, 'KinkietAron to wspaniały designerski kinkiet. owoczesna lampa ścienna  o prostym a zarazem ciekawym geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Lampa została wykonana z materiałów najwyższej jakości, dzięki czemu wspaniale się prezentuje, zachowując walory niezawodności. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-aron-1xg9-bialy-gips-modern-lampex', '', '', '', 'Kinkiet Aron 1xG9 Biały Gips Modern Lampex', '', '', '', ''),
(453, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-plus-a-czarny-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO PLUS A czarny 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(454, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-plus-a-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO PLUS A popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(455, 1, 1, 'Lampa ścienna kinkiet serii EDISON, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni z mosiądzem, sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.EDISON idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarna-mosiadz-milagro-edison-1x-e27', '', '', '', 'Kinkiet lampa ścienna czarna mosiądz MiLAGRO EDISON 1x E27', '', '', '', ''),
(456, 1, 1, 'Kinkiet Mark to nowoczesna lampa ścienna o prostym a zarazem ciekawym geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza, Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa jest kompatybilna z żarówką G6 o mocy 40W (brak w zestawie)i.', '', 'kinkiet-mark-1xg9-gips-bialy-modern-lampex', '', '', '', 'Kinkiet Mark 1xG9 Gips Biały Modern Lampex', '', '', '', ''),
(457, 1, 1, 'Kinkiet LED o eleganckim i podłużnym kształcie został zaprojektowany z myślą o nowoczesnych i minimalistycznych wnętrzach. Lampa ścienna za sprawą swoich niewielkich wymiarów doskonale wkomponuje się w niemal każde wnętrze. Lampa na ścianę posiada zainstalowany na stałe moduł LED o mocy 5 W i strumieniu świetlnym wynoszącym 350 lm. Lampa LED emituje neutralną i przyjemną dla oka barwę 4000 K, która wiernie odzwierciedla kolory oświetlanych przedmiotów i wprowadza przyjemny nastrój. Nieskomplikowany design lampy sprawia, że można ją wkomponować w niemal każdą aranżację, a w połączeniu z innymi lampami z tej serii kinkiet będzie się cudownie prezentować. Kinkiet objęty jest 2-letnią gwarancją, w ramach której świadczone są nieodpłatne usługi gwarancyjne. Po upływie ww. okresu istnieje możliwość skorzystania ze specjalistycznego firmowego serwisu.\"', '', 'kinkiet-led-lampa-scienna-ice-5w-4000k-ip20-metal-i-akryl-milagro', '', '', '', 'Kinkiet LED Lampa ścienna ICE 5W 4000K IP20 Metal i akryl Milagro', '', '', '', ''),
(458, 1, 1, 'Lampa ścienna model ML4383 z serii TRIANGOLO marki MILAGRO wykonana została z połączenia dwóch bardzo wytrzymały i odporny tworzyw, metalu oraz PVC. Kinkiet został wyposażony w jedno gniazdo z tradycyjnym gwintem typu E27, dzięki czemu jest on dostosowany do różnego rodzaju energooszczędnych źródeł światła LED (brak źródła światła w zestawie). Szerokość oferowanej lampy ściennej wynosi 26cm, a jej wysokość to 32cm. Maksymalna moc pracy kinkietu ściennego wynosi 40W, a wartość napięcia znamionowego to 230V. Klosz wykonany z czarnego drutu, gdzie dominują, wycięcia w kształcie trójkątów w połączeniu z białym abażurem idealnie wkomponuje się w wystrój wnętrz w stylu minimalistycznym lub loftowym. Prezentowany kinkiet ścienny z serii TRIANGOLO ożywi wasze wnętrza, a zarazem doda im charakteru oraz ciekawszego wyglądu.Lampa Stołowa Świetnie Sprawdzi się: Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany towar, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje najwyższą jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że umieszczone na opakowania informacje będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-triangolo-1x-e27-czarno-biala-metal-tkanina-milagro', '', '', '', 'Kinkiet Lampa ścienna TRIANGOLO 1x E27 Czarno-biała Metal + tkanina Milagro', '', '', '', ''),
(459, 1, 1, 'Lampa ścienna o klasycznym wyglądzie to elegancki i luksusowy dodatek do każdego wnętrza. Jest ona przystosowana do pracy z żarówką o trzonku E27. Kinkiet charakteryzuje się pięknym wyglądem. Zaletą tej klasycznej lampy jest ekskluzywny materiałowy abażur o ciekawym wzorze. Dzięki niemu źródło światła przymocowane do kinkietu będzie emitować piękne, rozproszone światło. Lampa idealnie nadaje się do salonu, sypialni czy pokoju gościnnego jako światło dodatkowe. 	Lampa ścienna została wykonana z materiałów wysokiej jakości i z niezwykłą dbałością o szczegóły. Jest to dobry zakup, który będzie cieszył oczy swoim pięknym wyglądem przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'klasyczna-lampa-scienna-srebrna-biala-kinkiet-do-salonu-abazur-z-tkaniny-1-x-e27', '', '', '', 'Klasyczna lampa ścienna srebrna biała kinkiet do salonu abażur z tkaniny 1 x E27', '', '', '', ''),
(460, 1, 1, 'Lampa ścienna to lampa wykonana w stylu skandynawskim, przystosowana do pracy z żarówką o trzonku E27. Kinkiet zaprojektowany został z dbałością o detale, dzięki czemu jego ciekawy wygląd zachwyca i jest ozdobą każdego wnętrza. Biały uniwersalny kolor lampy ściennej sprawia, że bardzo łatwo dopasować ją do wystroju mieszkania. Kinkiet idealnie nadaje się do salonu czy sypialni, gdzie wprowadzi niepowtarzalną atmosferę. Lampa została zaprojektowana zgodnie z najnowszymi trendami. Dzięki temu, że lampa nie posiada klosza pięknie widać w niej żarówkę, która również może być ozdobą mieszkania.	Lampa ścienna to nowoczesna lampa wykonana z wysokiej jakości materiałów, która z pewnością wpasuje się w nowoczesne wnętrza.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-biala-kinkiet-do-salonu-w-stylu-skandynawskim-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna biała kinkiet do salonu w stylu skandynawskim 1 x E27', '', '', '', ''),
(461, 1, 1, 'Lampa ścienna to lampa wykonana w stylu skandynawskim, przystosowana do pracy z żarówką o trzonku E27. Kinkiet zaprojektowany został z dbałością o detale, dzięki czemu jego ciekawy wygląd zachwyca i jest ozdobą każdego wnętrza. Czarny uniwersalny kolor lampy ściennej sprawia, że bardzo łatwo dopasować ją do wystroju mieszkania. Kinkiet idealnie nadaje się do salonu czy sypialni, gdzie wprowadzi niepowtarzalną atmosferę. Lampa została zaprojektowana zgodnie z najnowszymi trendami. Dzięki temu, że lampa nie posiada klosza pięknie widać w niej żarówkę, która również może być ozdobą mieszkania.	Lampa ścienna to nowoczesna lampa wykonana z wysokiej jakości materiałów, która z pewnością wpasuje się w nowoczesne wnętrza.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-do-salonu-w-stylu-skandynawskim-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet do salonu w stylu skandynawskim 1 x E27', '', '', '', ''),
(462, 1, 1, 'Kinkiet Jerry to nowoczesna lampa ścienna o prostym a zarazem ciekawym geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza, Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa ścienna została wykonana z wysokiej jakości gipsu. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie)', '', 'kinkiet-jerry-1xg9-gips-bialy-modern-lampex', '', '', '', 'Kinkiet Jerry 1xG9 Gips Biały Modern Lampex', '', '', '', ''),
(463, 1, 1, 'Kinkiet Tim to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.Szczególnie polecany do nowoczesnych, designerskich wnętrz. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-tim-1xg9-gips-bialy-modern-lampex', '', '', '', 'Kinkiet Tim 1xG9 Gips Biały Modern Lampex', '', '', '', ''),
(464, 1, 1, 'Kolekcja Felix Concrete to trzy ciekawie zaprojektowane lampy wśród których znajdziemy kinkiet, oprawę pojedynczą oraz dwupłomienną. Produkty zostały wykonane z metalu w kolorze piaskowanej szarości o modnym industrialnym designie. Łączenie ze sobą różnych lamp z kolekcji Felix Concrete, pozwoli na stworzenie spójnej i kompletnej aranżacji. Lampy doskonale podkreślą wyjątkowy styl wnętrz o charakterze przemysłowym i skandynawskim. Producent udziela na lampy 2-letniej gwarancji, w ramach której świadczy nieodpłatnie usługi gwarancyjne.', '', 'kinkiet-lampa-scienna-felix-concrete-szary-1xe27-ip20-metal-styl-loft-industrialny-milagro', '', '', '', 'Kinkiet lampa ścienna FELIX CONCRETE szary 1xE27 IP20 Metal styl loft industrialny Milagro', '', '', '', ''),
(465, 1, 1, 'Warna to nowoczesna lampa ścienna utrzymana w minimalistycznym stylu. Wysokiej jakości metalowy korpus przyciąga spojrzenia, a poświata rzucana przez lampę wprowadzi do wnętrza ciepły, przyjemny klimat. Lampa będzie stanowiła idealne uzupełnienie wnętrza na długie lata.  Lampa współgra z żarówkami o trzonku GU10 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-warna-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Warna popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(466, 1, 1, 'Kinkiet z kolekcji VIDAR, w kolorze białym, utrzymany jest w nowoczesnej stylistyce nawiązującej do stylu industrialnego i skandynawskiego. Lampa loft dzięki swojemu uniwersalnemu przeznaczeniu może służyć zarówno jako kinkiet jak i lampa sufitowa. Lampa ścienna  jest przystosowana do pracy z jednym źródłem światła - żarówką GU10 wraz z którą wprowadza do pomieszczenia przyjemną atmosferę. Lampa loft została wyprodukowana przez polską markę MiLAGRO, która odpowiada za wysoką jakość produktu. Niezwykła dbałość o każdy detal sprawia, że lampa ta jest wyjątkowa, a drewniane wstawki dodają jej uroku. Biała, nieco kubistyczna oprawa idealnie komponuje się z drewnianym elementem.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów.SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-loft-lampa-scienna-sufitowa-biala-milagro-vidar-1x-gu10', '', '', '', 'Kinkiet w stylu skandynawskim loft lampa ścienna sufitowa biała MiLAGRO VIDAR 1x GU10', '', '', '', ''),
(467, 1, 1, 'Kinkiet Wera to idealna propozycja dla miłośników stylu nowoczesnego. Unikatowy metalowy klosz nadaje lampie prosty, minimalistyczny wygląd. Produkt został wykonany z materiałów najwyższej jakości, przez co wygląda wspaniale, zachowując przy tym walory niezawodności.  Sufitowa lampa współgra z żarówkami o trzonku GU10 oraz  mocy max 40W (brak w zestawie).', '', 'kinkiet-wera-popiel-1xg9-metal-lampex', '', '', '', 'Kinkiet Wera popiel 1xG9 Metal Lampex', '', '', '', ''),
(468, 1, 1, 'Mario to kinkiet, który został wykonany z najwyższej jakości metalu, co pozwoli cieszyć się trwałością oraz niezawodnością przez wiele lat. Lampa w stylu industrialnym posiada czarny klosz, a światło wydobywające się z jego wnętrza wspaniale wypełnia pomieszczenie.  Tego typu lampa idealnie dopełni główne oświetlenie we wnętrzu oraz stanie się niebanalną dekoracją. Polecana jest w szczególności do nowoczesnych aranżacji.  Lampa loft współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-mario-czarny-1xe27-industrial-loft-metal-lampex', '', '', '', 'Kinkiet Mario Czarny 1xE27 Industrial Loft Metal Lampex', '', '', '', ''),
(469, 1, 1, 'Werona to nowoczesna lampa ścienna utrzymana w minimalistycznym stylu. Wysokiej jakości metalowy korpus przyciąga spojrzenia, a poświata rzucana przez lampę wprowadzi do wnętrza ciepły, przyjemny klimat. Lampa będzie stanowiła idealne uzupełnienie wnętrza na długie lata.  Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-werona-biala-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet Werona biała 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(470, 1, 1, 'Lampa sufitowa kinkiet ścienny z dwoma punktami świetlnymi serii DYLAN, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni ze złotem oraz miedzianego odcienia żarówki sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.DYLAN idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-scienny-lampa-sufitowa-w-stylu-industrialnym-czarna-milagro-dylan-2x-e27', '', '', '', 'Kinkiet ścienny lampa sufitowa w stylu industrialnym czarna MiLAGRO DYLAN 2x E27', '', '', '', ''),
(471, 1, 1, 'Lampa ścienna kinkiet serii DAMA BLACK, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Czarny klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-lampa-scienna-milagro-dama-1x-e27-czarna-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim lampa ścienna MiLAGRO DAMA 1x E27 czarna Drewno + metal', '', '', '', ''),
(472, 1, 1, 'GLASO to wykonany z najlepszej jakości stali i szkła kinkiet, oprawa ścienno-sufitowa marki KANLUX w kolorze chromu, która cechuje się nowoczesnym designem z możliwością regulacji. Oprawa ścienno sufitowa została wyposażona w trzy punkty świetlne, do których możemy zamontować żarówki z trzonkiem G9 o maksymalnej mocy 3x 40W. GLASO przystosowana jest do montażu na podłożu stałym, pionowym lub poziomym. Kinkiet, oprawa ścienno-sufitowa idealne sprawdzi się jako dodatkowe oświetlenie ozdobne, dekoracyjne w naszym domu czy mieszkaniu. Oprawa ruchoma w zakresie horyzontalnym wynosi 320°, natomiast w zakresie wertykalnym 90°. Kanlux GLASO, to rodzina opraw punktowych (sufitowo-ściennych). Dzięki regulacji możemy swobodnie ustawić kąt padania światła. Kształt opraw i ciekawe wzornictwo szklanych kloszy podkreślają charakter wnętrz retro, a chromowane dodatki dodają subtelnego szlifu wnętrzom nowoczesnym.OPRAWA IDEALNA DO OŚWIETLENIA:-&gt; KOD PRODUKTU: 19644 Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-lampa-sufitowa-glaso-3xg9-chrom-kanlux', '', '', '', 'Oprawa lampa sufitowa GLASO 3xG9 chrom Kanlux', '', '', '', ''),
(473, 1, 1, 'Lampa ścienna kinkiet serii PARMA, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i szkła lampa. Wyróżnia ją eklektyczny charakter - jej design łączy w sobie bowiem znamiona stylu loftowego i nienachalnej nowoczesności.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E14) o mocy nieprzekraczającej 40W. Kolor obudowy to czarny mosiądz. Lampa doskonale wkomponuje się we wnętrza utrzymane w industrialnym stylu, w których dominuje cegła, czerń czy też barwy natury. Z kolei biała kula, która rozprasza światło to ukłon w stronę osób ceniących sobie modernistyczne akcenty.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarny-mosiadz-milagro-parma-1x-e14', '', '', '', 'Kinkiet lampa ścienna czarny mosiądz MiLAGRO PARMA 1x E14', '', '', '', ''),
(474, 1, 1, 'Lampa ścienna kinkiet serii DAMA GREY, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i drewna z dbałością o każdy detal lampa. Lampa w stylu skandynawskim przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Szary klosz z drewnianym dodatkiem doskonale się ze sobą komponują i są idealną ozdobą każdego pomieszczenia.Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampa prezentuję się świeżo, przyciąga wzrok i stanowi stylowy dodatek dla efektownych wnętrz.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-skandynawskim-lampa-szara-regulowana-milagro-dama-1x-e27-drewno-metal', '', '', '', 'Kinkiet w stylu skandynawskim lampa szara regulowana MiLAGRO DAMA 1x E27 Drewno + metal', '', '', '', ''),
(475, 1, 1, 'Kinkiet Edgar to nowoczesna lampa ścienna o ciekawym, lekko zaokrąglonym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa  została wykonana z wysokiej jakości gipsu. Współpracuje z żarówką GU10 o mocy 40W (brak w zestawie).', '', 'kinkiet-edgar-2xgu10-gips-bialy-lampex', '', '', '', 'Kinkiet Edgar 2xGU10 Gips Biały Lampex', '', '', '', ''),
(476, 1, 1, 'Kinkiet Tobi to nowoczesna lampa ścienna o ciekawym, lekko zaokrąglonym kształcie. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro.Lampa jest kompatybilna z żarówką GU10 o mocy 40W (brak w zestawie).', '', 'kinkiet-tobi-2xgu10-bialy-modern-gips-lampex', '', '', '', 'Kinkiet Tobi 2xGU10 Biały Modern Gips Lampex', '', '', '', ''),
(477, 1, 1, ' Oprawa ścienna RICCO to gipsowa oprawa dekoracyjna LED firmy Kobi. Została wykonana z połączenia wysokiej jakości gipsu i metalu. Produkt odznacza się przede wszystkim wysoką odpornością na czynniki zewnętrzne takie jak ciepło i zimno. W przeciwieństwie do aluminiowych, wyprodukowana ze specjalnego rodzaju gipsu oprawa nie poddaje się korozji. Oferowany na tej aukcji kinkiet gipsowy z serii Art of Light jest łatwy w montażu, a także można go pomalować farbami ściennymi na dowolny kolor wedle uznania, dzięki czemu idealnie dopasuje się do Twoich pomieszczeń. Oprawa przystosowana jest do pracy z żarówkami LED z trzonkiem GU10 zużywającymi nawet do 90% mniej energii o maksymalnej mocy nieprzekraczającej 35W. Produkt znakomicie sprawdzi się jako oświetlenie dekoracyjne lub dodatkowe dla Twojego wnętrza. Stylowo oświetli Twój salon, korytarz, pokój lub dowolnie wybrane przez Ciebie miejsce. Dane szczegółowe Oferowana na tej aukcji podwójna oprawa przystosowana jest do źródeł światła o gwincie GU10. Jeśli szukasz innej oprawy to zapraszamy do odwiedzenia pozostałych naszych aukcji. Szeroki wybór asortymentu oraz konkurencyjne ceny.', '', 'oprawa-scienna-ricco-2xgu10-gipsowa-kobi-dekoracyjna-led', '', '', '', 'Oprawa ścienna RICCO 2xGU10 GIPSOWA KOBI DEKORACYJNA LED', '', '', '', ''),
(478, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-b-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO B popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(479, 1, 1, ' Oprawa ścienna GRANDE to gipsowa oprawa dekoracyjna LED firmy Kobi. Została wykonana z połączenia wysokiej jakości gipsu i metalu. Produkt odznacza się przede wszystkim wysoką odpornością na czynniki zewnętrzne takie jak ciepło i zimno. W przeciwieństwie do aluminiowych, wyprodukowana ze specjalnego rodzaju gipsu oprawa nie poddaje się korozji. Oferowany na tej aukcji gipsowy kinkiet z serii Art of Light jest niezwykle uniwersalny, gdyż może zostać pomalowany farbami ściennymi na dowolny kolor wedle uznania, dzięki czemu idealnie dopasuje się do Twoich pomieszczeń. Oprawa przystosowana jest do pracy ze żarówkami LED z trzonkiem R7s zużywającymi nawet do 90% mniej energii o maksymalnej mocy nieprzekraczającej 100W. Produkt znakomicie sprawdzi się jako oświetlenie dekoracyjne lub dodatkowe dla Twojego wnętrza. Stylowo oświetli Twój salon, korytarz, pokój lub dowolnie wybrane przez Ciebie miejsce. Dane szczegółowe Oferowana na tej aukcji oprawa przystosowana jest do pojedynczego źródła światła R7s. Jeśli szukasz innej oprawy to zapraszamy do odwiedzenia pozostałych naszych aukcji. Szeroki wybór asortymentu oraz konkurencyjne ceny.', '', 'oprawa-scienna-grande-r7s-gipsowa-kobi-dekoracyjna-led', '', '', '', 'Oprawa ścienna GRANDE R7s GIPSOWA KOBI DEKORACYJNA LED', '', '', '', ''),
(480, 1, 1, 'Lampa ścienna STICKS 9077 to piękna, która jest kwintesencją loftowego szyku. Stanowi wyjątkową propozycję, idealnie skrojoną na miarę potrzeb minimalistów i wielbicieli industrialnych klimatów we wnętrzach. Pod nazwą tą kryje się bowiem subtelna lampa ścienna, z dwoma źródłami światła. Z uwagi na swój intrygujący design i metalowe wykończenie, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa w kolorze złotym równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Lampa świetnie sprawdzi się jako dodatkowe doświetlenie bardziej zacienionych zakamarków: kącika multimedialnego czy biblioteczki. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wielkość lampy to 36,5 cm, a głębokość klosza wynosi 10 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-2xe27-vintage-retro-9077-sticks-zlota-stal', '', '', '', 'Lampa ścienna NOWODVORSKI 2xE27 Vintage Retro 9077 STICKS Złota Stal', '', '', '', ''),
(481, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-plus-b-bialy-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO PLUS B biały 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(482, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-pro-plus-b-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado PRO PLUS B popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(483, 1, 1, 'Kinkiet Alan to nowoczesna lampa ścienna o niespotykanym i zjawiskowym kształcie. Jednolity, stonowany kolor oprawy sprawi że będzie świetnie wyglądała w pomieszczeniach takich jak korytarz, salon czy sypialnia. Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-alan-2xg9-gips-biala-modern-lampex', '', '', '', 'Kinkiet Alan 2xG9 Gips Biała Modern Lampex', '', '', '', ''),
(484, 1, 1, 'Lampa ścienna kinkiet serii CORONA WHITE, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę doskonale sprawdzą się w każdym wnętrzu, unikatowy kształt klosza, przypominający planetę otuloną pierścieniami nadaje lampie dekoracyjnego charakteru.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampy z kolekcji CORONA mogą być montowane samodzielnie, stanowiąc designerski akcent, ale świetnie będą wyglądały również w komplecie. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-nowoczesna-biala-corona-1x-e27-milagro', '', '', '', 'Kinkiet lampa ścienna nowoczesna biała CORONA 1x E27 MiLAGRO', '', '', '', ''),
(485, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-deluxe-b-bialy-1xg9-metals-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado DELUXE B biały 1xG9 Metals styl nowoczesny Lampex', '', '', '', ''),
(486, 1, 1, 'Quado to nowoczesna lampa ścienna o przykuwającym uwagę geometrycznym kształcie. Lampa idealnie wkomponuje się w pomieszczenia takie jak przedpokój, salon czy jadalnia, nadając im przy tym niepowtarzalny klimat. Geometryczna lampa pięknie prezentuje się na ścianie i przyciąga wzrok. Do jej produkcji wykorzystano wyłącznie materiały najwyższej jakości, dzięki czemu prezentuje się wspaniale, jednocześnie będąc niezwykle wytrzymałą i odporną na uszkodzenia. Kinkiet współgra z żarówkami o trzonku G9 oraz mocy max 40W (brak w zestawie).', '', 'kinkiet-lampa-scienna-quado-deluxe-b-popiel-1xg9-metal-styl-nowoczesny-lampex', '', '', '', 'Kinkiet lampa ścienna Quado DELUXE B popiel 1xG9 Metal styl nowoczesny Lampex', '', '', '', ''),
(487, 1, 1, 'Felix to kolekcja trzech lamp wśród których znajdują się kinkiet, oprawa pojedyncza oraz dwupłomienna. Produkty zostały wykonane z metalu i wykończone w ciekawej i atrakcyjnej kolorystyce - czarnym, matowym z wnętrzem klosza w kolorze starego złota. Lampy doskonale podkreślą wnętrza pomieszczeń zaprojektowanych w stylu industrialnym i skandynawskim. Tego typu lampa loft idealnie dopełni główne oświetlenie we wnętrzu oraz stanie się niebanalną dekoracją. Lampy objęte są 2-letnią gwarancją.', '', 'kinkiet-lampa-scienna-felix-czarny-zloto-1xe27-ip20-metal-loft-industrial-milagro', '', '', '', 'Kinkiet lampa ścienna FELIX czarny złoto 1xE27 IP20 Metal loft industrial Milagro', '', '', '', ''),
(488, 1, 1, 'Kinkiet Albert to nowoczesna lampa ścienna o kształcie trapezu. Jednolity, stonowany kolor oprawy pozwoli wkomponować ją w wystrój każdego wnętrza.Kinkiet po zapaleniu rzuca poświatę, która doskonale podkreśli ciekawy obraz, lub lustro. Lampa jest kompatybilna z żarówką G9 o mocy 40W (brak w zestawie).', '', 'kinkiet-albert-2xg9-bialy-gips-lampex', '', '', '', 'Kinkiet Albert 2xG9 Biały Gips Lampex', '', '', '', ''),
(489, 1, 1, 'Kinkiet serii ROMA BLACK, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i szkła. Lampa ścienna współpracuje z żarówkami o trzonku E27 o mocy nieprzekraczającej 60W. Czarny kinkiet został wykonany z dbałością o każdy detal. Cechą jest piękny, subtelny klosz z dymionego szkła, a także stylowe złote wstawki na elementach konstrukcyjnych.Lampy z kolekcji ROMA doskonale sprawdzą się w nowoczesnych wnętrzach o modnym, minimalistycznym klimacie. Wariant biały wprowadzi do pomieszczenia lekkość, świeżość i subtelny powiew luksusu, modele w barwie czarnego matu to z kolei kwintesencja elegancji i klasy.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarna-milagro-roma-black-1x-e27', '', '', '', 'Kinkiet lampa ścienna czarna MiLAGRO ROMA BLACK 1x E27', '', '', '', ''),
(490, 1, 1, 'AXIS 9294 to piękna lampa wisząca, która jest kwintesencją loftowego szyku. Stanowi wyjątkową propozycję, idealnie skrojoną na miarę potrzeb minimalistów i wielbicieli industrialnych klimatów we wnętrzach. Pod nazwą tą kryje się bowiem subtelna lampa ścienna, z jednym źródłem światła, zwieńczonym miedzianą oprawą na żarówkę, która jest odsłonięta, doskonale oświetlając całe pomieszczenie i tworząc znakomitą grę cieni, dzięki temu przyciąga wzrok i nadaje wnętrzom niepowtarzalny charakter. Produkt został zaprojektowany w taki sposób, aby wyeksponować dekoracyjną żarówkę. Będzie w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. Z uwagi na swój intrygujący design i metalowe wykończenie, znakomicie wpisze się w loftowe przestrzenie, gdzie będzie perfekcyjnie harmonizowała z betonem, drewnem i surową cegłą. Lampa z miedzianym akcentem równie dobrze może jednak współgrać ze ścianami w pastelowych barwach, a także w modnym odcieniu głębokiej zieleni, grafitu i granatu. Tego rodzaju oświetlenie sprawdzi się także we wnętrzach stylizowanych na retro. Wysokość lampy to 86 cm, a szerokość klosza wynosi 70 cm.Maksymalna moc przewidziana na jeden punkt świetlny to 60W. Stopień ochrony IP20 sprawi, że może zostać zamontowana wewnątrz różnych pomieszczeń. Oprawa nie zawiera źródeł światła. Polecane żarówki dla lampy to E27, które dostępne są w naszym sklepie. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-nowodvorski-e27-vintage-retro-9294-axis-czarna-miedz-stal', '', '', '', 'Lampa ścienna NOWODVORSKI E27 Vintage Retro 9294 AXIS Czarna Miedź Stal', '', '', '', ''),
(491, 1, 1, 'Lampa Mercurio 330 firmy MiLAGRO to kinkiet o bardzo nowoczesnym i intrygującym wyglądzie. Oprócz efektownego wyglądu jego zaletą jest wysoka jakość zastosowanych materiałów: metalu i akrylu. Kinkiet ma 25 cm wysokości, 28 cm szerokości, a maksymalna odległość od ściany to 15 cm. Źródłem światła jest tutaj wymienny moduł LED o mocy 12 W. Zastosowanie technologii LED pozwala zmniejszyć koszty zużycia energii, nie wpływając na jakość źródła światła. Przyjemna dla oka barwa 4000 K ma strumień świetlny 840 lm i wprowadza miły klimat do pomieszczeń oraz dba o odpowiedni nastrój. Ten nowoczesny kinkiet łączy w sobie minimalizm formy z geometrycznymi kształtami i ciekawą kompozycją. Może być z powodzeniem zastosowany w salonie, pokojach gościnnych, ale również w łazienkach i korytarzach.', '', 'kinkiet-mercurio-chrom-okrag-12w-led-ip20-metal-styl-nowoczesny-milagro', '', '', '', 'Kinkiet MERCURIO chrom okrąg 12W LED IP20 Metal styl nowoczesny Milagro', '', '', '', ''),
(492, 1, 1, 'Kinkiet ścienny LED marki Polux z kolekcji HORTEN cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Oprawa wykonana z najlepszej jakości aluminium, prezentuje sie znakomicie. Kinkiet został wyposażony w gniazdo E27, przystosowane do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 10W. Decydując sie na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta.Mieszkaj modnie i stylowo. Zobacz też pozostałe kinkiety z serii HORTEN.Specyfikacja techniczna:', '', 'kinkiet-zewnetrzny-horten-1x-e27-polux-czarny-314147', '', '', '', 'Kinkiet zewnętrzny HORTEN 1x E27 Polux Czarny 314147', '', '', '', ''),
(493, 1, 1, 'Kinkiet z kolekcji COLIN został wyprodukowany przez polską markę - MiLAGRO. Czarny kinkiet cechuje się oryginalnym designem i niezwykłą dbałością o każdy detal. Metalowy i druciany klosz o geometrycznym kształcie przyciąga wzrok i nadaje pomieszczeniom niepowtarzalny charakter. Lampa ścienna współpracuje z żarówkami o trzonku E27. Lampa w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych, industrialnych bądź minimalistycznych wnętrz i sprawi, że odmienią one swoje oblicze. Lampę na ścianę można zamontować pojedynczo, ale świetnie będzie wyglądać również w komplecieMiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy wspierasz polskie marki, przedsiębiorców i projektantów.', '', 'kinkiet-lampa-scienna-colin-czarny-1xe27-milagro-styl-loft-industrial-metal', '', '', '', 'Kinkiet lampa ścienna COLIN Czarny 1xE27 MILAGRO styl loft industrial metal', '', '', '', ''),
(494, 1, 1, ' Kinkiet ścienny LED marki Polux z kolekcji Modern w kolorze czarnym ze złotym wnętrzem.  Reflektor ścienny świetnie sprawdzi się w różnych pomieszczeniach typu korytarze, klatki schodowe oraz gabinety/biura, które zostały urządzone w stylu modernistycznym. Dzięki możliwości ustawienia padania promieni światła pod dowolnym kątem, idealnie oświetlisz wybraną przez siebie przestrzeń. Oprawa ścienna dopłeni stylową aranżację oraz rozjaśni wnętrze ciepłym, miękkim światłem, wydobuwającym się z czarno-złotej oprawy. Do klasycznego reflektora będzie pasować każda żarówka z tzrzonkiem E27 o maksymalnej mocy 20W led, którą także można zamówić na naszej stronie ineternetowej. Mieszkaj modnie i stylowo. Zobacz też pozostałe lampy i kinkiety z kolecji modern.  SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-reflektor-do-led-modern-w306-c-czarno-zloty-polux', '', '', '', 'Kinkiet Lampa Ścienna Reflektor do LED MODERN W306-C Czarno-Złoty - Polux', '', '', '', ''),
(495, 1, 1, 'Kinkiet ścienny w minimalistycznym wydaniu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Druciana lampa została wykonana z niezwykłą dbałością o detale, dzięki czemu jest niezawodnym i efektownym produktem. Druciane elementy kinkietu doskonale komponują się ze sobą tworząc zgrabną i elegancką całość. Lampa ścienna przeznaczona jest do pracy z żarówką o trzonku E27, dzięki czemu z łatwością można dobrać do niej żarówkę wedle gustu i swoich upodobań. Elegancki druciany kinkiet wykonany z materiałów wysokiej jakości jest idealny do oświetlenia korytarzy, salonów, sypialni i wszystkich pomieszczeń, którym chcemy nadać niepowtarzalny charakter.Specyfikacja techniczna:', '', 'kinkiet-scienny-lampa-scienna-loft-industrial-e27-czarny-druciany-ryga-polux', '', '', '', 'Kinkiet ścienny lampa ścienna loft industrial E27 czarny druciany RYGA Polux', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(496, 1, 1, 'Lampa ścienna wykonana w skandynawskim stylu przeznaczona jest na żarówkę LED z gwintem E27. Idealnie sprawdzi się ona w sypialni, salonie czy jadalni, jako oświetlenie dodatkowe. Kinkiet świetnie dopasuje się do współczesnych wnętrz. Szara minimalistyczna lampa jest wykonana w zgodzie z najnowszymi trendami projektowania wnętrz. Piękno prostoty tutaj zachwyca i będzie idealnie współgrało ze współczesnym wnętrzem. Lampę ścienną można zamontować również nad łóżkiem gdzie może służyć jako lampka nocna. 	Ta lampa jest produktem, który został zaprojektowany z nowatorskim podejściem. Jest to oryginalny i innowacyjny dodatek do wystroju nowoczesnego wnętrza, który doda mu szyku i odmieni jego oblicze.	Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-nocna-szara-minimalistyczna-kinkiet-do-sypialni-1-x-e27', '', '', '', 'Nowoczesna lampa ścienna nocna szara minimalistyczna kinkiet do sypialni 1 x E27', '', '', '', ''),
(497, 1, 1, 'Kinkiet z kolekcji Bluszcz został stworzony z myślą o miłośnikach stylu retro i vintage. Lampa ścienna posiada biały klosz, który stylizowany jest na kielich kwiatu. Klosz został osadzony na solidnej i metalowej oprawie, która przywodzi na myśl gałązkę i została przyozdobiona listkami, co razem świetnie się komponuje. Produkt został wykonany z materiałów wysokiej jakości, dzięki czemu prezentuje się wspaniale i będzie działać niezawodnie przez długi czas.Lampa retro została przystosowana do pracy z żarówką o trzonku E27 o mocy maksymalnej wynoszącej 60W, wraz z którą pięknie oświetli pomieszczenie.', '', 'kinkiet-bluszcz-kl-1x-e27-metal-i-szklo-lampex-styl-retro-vintage', '', '', '', 'Kinkiet Bluszcz KL 1x E27 Metal i szkło Lampex Styl retro vintage', '', '', '', ''),
(498, 1, 1, 'Lampa ścienna z abażurem w kolorowe samloty została stworzona z myślą o dzieciach. Kinkiet wykonany jest z bezpiecznych materiałów wysokiej jakości. Solidność wykonania lampy jest gwarancją tego, że będzie służyła ona Waszym pociechom niezawodnie przez długi czas. Lampa ścienna z kolorowymi samolotami przypadnie do gustu każdemu małemu chłopcowi. Kinkiet ten będzie idealny dla każdego małego chłopca lubiącego samoloty, a dzięki tej lampie chłopiec będzie się mógł poczuć jak pilot. Lampa nocna z abażurem w kolorowe samoloty na niebieskim tle z pewnością wywoła uśmiech na twarzy każdego dziecka, a ponadto zagwarantuje mu łatwe zasypianie i spokojny sen.Kupując tą wiszącą lampę nie musisz obawiać się o montaż, gdyż jest on bardzo prosty. Bez problemu zainstalujesz kinkiet w dziecięcym pokoju, a promienny uśmiech dziecka i jego radość z nowej lampy będą bezcenne. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-dziecieca-nocna-kinkiet-dla-dzieci-niebieska-w-samoloty-dla-chlopca-1-x-e14', '', '', '', 'Lampa ścienna dziecięca nocna kinkiet dla dzieci niebieska w samoloty dla chłopca 1 x E14', '', '', '', ''),
(499, 1, 1, 'Kinkiet ścienny o ciekawym kształcie, przywodzącym na myśl plaster miodu, to piękny i niebanalny dodatek, który będzie pasował do niemal każdego wystroju wnętrza. Błyszczący złoty element kinkietu doskonale komponuje się z całością tworząc zgrabną i elegancką całość. Lampa ścienna przeznaczona jest do pracy z żarówkami o trzonku E14, dzięki czemu z łatwością można dobrać do niej żarówkę wedle gustu i swoich upodobań. Elegancki kinkiet wykonany z materiałów wysokiej jakości jest idealny do oświetlenia korytarzy, salonów, sypialni i wszystkich pomieszczeń, którym chcemy nadać niepowtarzalny charakter.', '', 'kinkiet-scienny-lampa-scienna-retro-loft-e14-czarny-zloty-honey-polux', '', '', '', 'Kinkiet ścienny lampa ścienna retro loft E14 czarny + złoty Honey Polux', '', '', '', ''),
(500, 1, 1, 'Elegancka lampa ścienna została przystosowana do pracy z żarówką o trzonku E14. Czarna lampa jest idealna do oświetlenia korytarza, choć świetnie sprawdzi się również w przedpokoju czy w garderobie. Kinkiet został wykonany z niezwykłą dbałością o detale. Razem z zamontowaną żarówką LED E14 lampa ta będzie pięknie oświetlać korytarz i odmieni jego wygląd. Jeśli potrzebujesz lampy ściennej do korytarza czy garderoby ten kinkiet będzie dobrym wyborem. Lampa ścienna to produkt wykonany z wysokiej jakości materiałów, który będzie cieszył oczy pięknym wyglądem przez długi czas.Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'nowoczesna-lampa-scienna-czarna-kinkiet-na-korytarz-do-przedpokoju-1x-e14', '', '', '', 'Nowoczesna lampa ścienna czarna kinkiet na korytarz do przedpokoju 1x E14', '', '', '', ''),
(501, 1, 1, '', '', 'kinkiet-scienny-szklany-retro-vintage-loft-e27-volteno-milo-c', '', '', '', 'Kinkiet ścienny szklany retro vintage loft E27 Volteno Milo C', '', '', '', ''),
(502, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 13 najważniejszych zalet LAMPY ściennej!Kinkiet w nowoczesnym stylu o mocy 4,2W i strumieniu świetlnym 425lm, o ciepłej barwie światła, posiada szeroki kąt świecenia 120°. Jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.Niezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!  *MATERIAŁ WYKONANIA*ŁATWOŚĆ MONTAŻU*WYMIAR LAMPYGDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań! Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-ruchomy-reflektor-lampa-scienna-regulowana-45w-led-gavi-1-pomaranczowy-3000k-polux', '', '', '', 'Kinkiet ruchomy reflektor lampa ścienna regulowana 4,5W LED GAVI 1 pomarańczowy 3000K Polux', '', '', '', ''),
