(505, 1, 1, 'SZUKASZ ZACHWYCAJĄCEGO OŚWIETLENIA DO SWOJEGO SALONU LUB SYPIALNI? Postaw na kinkiety z serii DELIA!Kinkiety DELIA mają ekskluzywny charakter. Stworzone zostały z wysokiej jakości chromowanego metalu oraz grubego szkła, daltego prezentują się niezwykle elegancko. W dzień pięknie się mienią, a wieczorem pozwalają uzyskać niezwykły efekt rozproszenia światła. Wspaniale wyglądają zarówno we wnętrzach nowoczesnych, jak i klasycznych. Są idealnym dopełnieniem głównego oświetlenia. Idealnie nadają się bowiem do wykorzystania jako dekoracyjne, akcentowe oświetlenie.Dodadzą klasy i reprezentacyjnego charakteru każdemu salonowi, sypialni, jadalni czy sali restauracyjnej. ODMIEŃ SWOJE WNĘTRZE DZIĘKI KINKIETOM Z SERII DELIA!  *WYSOKA JAKOŚĆ *GWINT E27 *EFEKTOWANA OPRAWA    *WYMIAR LAMPY  *MONTAŻ  GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ?    Wspaniele prezentują sie w połączeniu z lampami z tej samej serii. Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie!Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-delia-1xe27-elegancki-styl-satyna-p316479-polux-metal-szklo', '', '', '', 'Kinkiet DELIA 1xE27 Elegancki Styl Satyna P316479 Polux Metal + Szkło', '', '', '', ''),
(506, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWO-ŚCIENNEJ!Kinkiet w loftowym stylu z jednym punktem świetlnym, zawieszona w centralnym miejscu będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, bądź minimalistycznych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.kmNiezwykle wygląda na tle jasnych ścian, lub w pomieszczeniu gdzie dominuje biel, ponieważ uwypukla to jej niezwykłą konstrukcję.POSTAW NA TĘ LAMPĘ SUFITOWO-ŚCIENNĄ I OCZARUJ SWOICH GOŚCI!   *MATERIAŁ WYKONANIA*GWINT E27UWAGA! Brak źródła światła w komplecie.      *KLOSZ   *ŁATWOŚĆ MONTAŻU *REGULOWANA LAMPA     *WYMIAR LAMPY   GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-sufitowo-scienna-filis-geometryczna-ruchoma-druciana-loft-do-led-1xe27-lumiled', '', '', '', 'Lampa sufitowo-ścienna FILIS geometryczna ruchoma druciana loft do LED 1xE27 LUMILED', '', '', '', ''),
(507, 1, 1, 'Kinkiet z kolekcji Bluszcz został stworzony z myślą o miłośnikach stylu retro i vintage. Lampa ścienna posiada biały klosz, który stylizowany jest na kielich kwiatu. Klosz został osadzony na krętej i metalowej oprawie przyozdobionej listkiem, co razem świetnie się komponuje. Produkt został wykonany z materiałów wysokiej jakości, dzięki czemu prezentuje się wspaniale i będzie działać niezawodnie przez długi czas.Lampa retro została przystosowana do pracy z żarówką o trzonku E27 o mocy maksymalnej wynoszącej 60W, wraz z którą pięknie oświetli pomieszczenie.', '', 'kinkiet-bluszcz-1x-e27-metal-i-szklo-lampex-styl-retro-vintage', '', '', '', 'Kinkiet Bluszcz 1x E27 Metal i szkło Lampex styl retro vintage', '', '', '', ''),
(508, 1, 1, 'Kinkiet LED z kolekcji NERO to połączenie minimalizmu i elegancji. W obudowie lampy ściennej zamontowano energooszczędne źródło światła w postaci wymiennego modułu LED. Lampa LED emituje światło o mocy 7 W, dzięki czemu lampa ta pięknie oświetli pomieszczenie, w którym zostanie zamontowana. Lampa ścienna LED świeci przyjemnym dla oka i naturalnym światłem o temperaturze barwowej 4000 K i strumieniu świetlnym 490 lm. Lampa na ścianę to idealne rozwiązanie do pomieszczeń takich, jak salon, jadalnia czy sypialnia. Lampa ścienna LED świetnie będzie się prezentowała w nowoczesnych wnętrzach, w których dominuje geometria. Lampy NERO zostały objęte 2-letnią gwarancją producenta.', '', 'kinkiet-led-lampa-scienna-nero-7w-4000k-ip20-metal-i-akryl-milagro-styl-nowoczesny', '', '', '', 'Kinkiet LED Lampa ścienna NERO 7W 4000K IP20 Metal i akryl Milagro Styl nowoczesny', '', '', '', ''),
(509, 1, 1, 'Kinkiet ścienny w kolorze antycznego mosiądzu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa ścienna dzięki wysokiej ochronie na pył i wodę wynoszącej IP65 świetnie sprawdzi się również jako lampa zewnętrzna. Kinkiet elewacyjny doskonale sprawdzi się w altance, na tarasie czy przy garażu i pięknie oświetli te miejsca. Kinkiet zewnętrzny został wykonany z dbałością o każdy detal, dzięki czemu można mieć pewność, że będzie on służył niezawodnie przez długi czas i rozjaśniał naszą posesję.Specyfikacja techniczna:', '', 'kinkiet-scienny-zewnetrzny-elewacyjny-lampa-scienna-industrial-e27-mosiadz-loft-halland-polux', '', '', '', 'Kinkiet ścienny zewnętrzny elewacyjny lampa ścienna industrial E27 mosiądz LOFT HALLAND Polux', '', '', '', ''),
(510, 1, 1, 'KINKIET FIONA to oprawa oświetleniowa najnowszej generacji! Ten niesamowity produkt renomowanej marki POLUX to nieodzowny dodatek każdego wnętrza w stylu nowoczesnym oraz loft / industrial. Pozornie minimalistyczna forma odmieni Twoje wnętrze i wprawi w zachwyt wszystkich oglądających. Prostota tej lampy nadaje jej charakteru - minimalizm nigdy nie przestanie być modny. Łącząc ją z nieco bardziej ekstrawaganckimi meblami czy dodatkami utworzysz niepowtarzalną całość, która sprawi, że z ogromną chęcią i przyjemnością będziesz tam wracać. Oprawa LED w kolorze czarnym została przystosowana do popularnych żarówek z trzonkiem E14 - mały gwint, a jej moc maksymalna wynosi 8W. Zasilana typowym napięciem 230V. Wykonana została ze stali proszkowanej. Jest niezwykle funkcjonalna dzięki możliwości regulacji kąta świecenia. Bądź Panem swojego domu i sam zdecyduj co ma być najlepiej oświetlone. Doskonale sprawdzi się do gabinetu, korytarza, a także sypialni czy salonu urządzonego w sytylu loft / industrial. Czasem zmiana jednego dodatku w swoim domu potrafi zmienić Twoje myślenie i sposób życia. Tchnij do swojego mieszkania trochę świeżości jaką daje OPRAWA ŚCIENNA FIONA od marki Polux.  Żarówki LED dostępne na innych naszych aukcjach. Sprawdź naszą szeroką gamę produktów i odmień swoje wnętrze!SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-fiona-spot-oprawa-scienna-e14-sufitowa-czarna-polux', '', '', '', 'KINKIET FIONA spot oprawa ścienna E14 sufitowa CZARNA POLUX', '', '', '', ''),
