(513, 1, 1, 'Monic to wspaniała klasyczna lampa, z jednym punktem świetlnym i w czarnym kolorze, stylizowana na świecznik. Czarna lampa w stylu klasycznym będzie wspaniałą ozdobą wnętrza. Kinkiet za sprawą swojej klasycznej konstrukcji przyciąga spojrzenia. Lampa ścienna została wykonana z materiałów wysokiej jakości, dzięki czemu będzie działać niezawodnie przez długi czas. Lampa na ścianę posiada wejście na żarówkę o trzonku E14, wraz z którą pięknie oświetli pomieszczenie.', '', 'kinkiet-lampa-scienna-monic-czarna-swiecznik-1x-e14-metal-lampex-styl-klasyczny', '', '', '', 'Kinkiet Lampa ścienna Monic czarna Świecznik 1x E14 Metal Lampex Styl klasyczny', '', '', '', ''),
(514, 1, 1, 'Kinkiet ścienny HIRA 314567 marki POLUX jest bardzo interesujący wizualnie dzięki swojej metalowej konstrukcji przypominającej diament. Jego surowy projekt połączony metalem sprawia, że mamy wiele możliwości dopasowania lampy do otoczenia - zaprezentuje się ona w kuchni, przedpokoju jak również w salonie. Doskonała do wnętrz w stylu industrialnym. Świetne sprawdzi się połączenie go z cegłą oraz intensywnymi kolorami. Intryguje on ciekawym pomysłem i formą. Oszczędny stelaż z zawieszonym źródłem światła stanowi okazję do wykorzystania ozdobnej żarówki, które podkreślą charakter wnętrza oraz dopełnią jego niepowtarzalnego charakteru.Lampa HIRA przystosowana do źródła światła z trzonkiem E27, dostosowanym do żarówek o klasach energetycznych A++, A+ i A o maksymalnej mocy 20W. ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-natynkowa-hira-1xe27-kinkiet-geometryczna-oprawa-trojwymiarowa-p314567-polux-metal', '', '', '', 'Lampa natynkowa HIRA 1xE27 Kinkiet Geometryczna Oprawa Trójwymiarowa P314567 Polux Metal', '', '', '', ''),
(515, 1, 1, 'Czy chcesz urozmaicić i zachwycać swoim wnętrzem? Poznaj 6 najważniejszych zalet LAMPY SUFITOWEJ! Lampa sufitowa/ścienna z dwoma punktami świetlnymi w nowoczesnym stylu jest w stanie oświetlić nawet najciemniejsze pomieszczenie i wprowadzić w nie przytulny, przyjemny i jasny klimat. TUBA będzie cieszącą oczy ozdobą, nadaje się także do przestrzeni komercyjnych, takich jak bar czy klimatyczna restauracja, jak również będzie doskonałym dodatkiem do nowoczesnych, glamour bądź tradycyjnych wnętrz, doda im uroku i sprawi, że odmienią one swoje oblicze.km.Ta lampa to produkt idealny dla każdego, kto pragnie udekorować swoje mieszkanie niepowtarzalnym i nieszablonowym dodatkiem, który będzie podkreślał oryginalny i awangardowy wystrój wnętrza.km.POSTAW NA TĘ LAMPĘ SUFITOWĄ I OCZARUJ SWOICH GOŚCI!    *MATERIAŁ WYKONANIA*2x GWINT GU10UWAGA! Brak źródła światła w komplecie.  *ŁATWOŚĆ MONTAŻU *REGULACJA KĄTA ŚWIECENIA     GDZIE MOŻESZ WYKORZYSTAĆ LAMPĘ? Kilka przykładów zastosowań!  Wygląd Twojego mieszkania będzie UNIKATOWY, dzięki TEJ lampie! Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-scienna-kinkiet-2x-gu10-led-ruchomy-czarny', '', '', '', 'Lampa ścienna kinkiet 2x GU10 LED ruchomy czarny', '', '', '', ''),
(516, 1, 1, '', '', 'lampa-scienna-szklana-kinkiet-na-sciane-retro-vintage-loft-e27-volteno-emily-glass', '', '', '', 'Lampa ścienna szklana kinkiet na ścianę retro vintage loft E27 Volteno Emily Glass', '', '', '', ''),
(517, 1, 1, 'Oprawa natynkowa, sufitowa marki KOBI model RARO w kolorze bieli to idealne dopełnienie nowoczesnych aranżacji oraz praktyczne źródło światła. Oprawa RARO pozwoli Ci doświetlić dowolną przestrzeń lub wybrane przedmioty i obiekty. Ponadto, oprawa doskonale będzie się prezentować pojedynczo lub w zestawie, tworząc niesamowite efekty, które podkreślą wyjątkowy wystrój i charakter Twoich pomieszczeń.Biała oprawa wykonana z wysokogatunkowego odlewu gipsu i metalu wraz z  wbudowanymi na stałe lampami LED klasy A++ emituje najwyższej jakości światło o przyjemnej dla oka ciepłej, białej barwie 3000K oraz mocy 4,2W i strumieniu świetlnym 253lm. Standardowy kąt rozsyłu światła wynoszący 38°  zapewnia optymalne oświetlenie wybranej przestrzeni.  Ponadto, dzięki temu, że oprawa została wykonana w technologii LED cieszy się bardzo długą żywotnością, aż do 30 000 godzin. OPRAWA IDEALNIE SPRAWDZI SIĘ W:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampa-oprawa-sufitowa-natynkowa-led-raro-42w-253lm-3000k-biala-kobi', '', '', '', 'Lampa OPRAWA SUFITOWA  natynkowa LED RARO 4,2W 253lm 3000K biała KOBI', '', '', '', ''),
(518, 1, 1, 'Kinkiet serii BASE w kolorze czarnym, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu i akrylu kinkiet. Źródło światła o mocy max. 8W+2W, które emituje światło o przyjemnej i neutralnej barwie (4000K) o strumieniu świetlnym 650lm, umieszczone zostało na długim, elastycznym ramieniu, dzięki czemu można swobodnie nim manewrować i dostosowywać do aktualnych potrzeb. Dodatkowym atutem lamp z kolekcji BASE jest umieszczony na jej podstawie port USB. Podstawa lampki jest owalna.Lampy z kolekcji BASE to propozycja, która znakomicie sprawdzi się w nowoczesnych wnętrzach, takich jak biura, gabinety i pokoje nastolatków. Ich minimalistyczna forma i wysoka funkcjonalność sprawiają, że z powodzeniem można zamontować je również w sypialni, jako alternatywę dla tradycyjnych lampek nocnych.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'lampka-nocna-scienna-led-usb-czarna-8w-2w-milagro-base', '', '', '', 'Lampka nocna ścienna LED USB czarna 8W +2W MiLAGRO BASE', '', '', '', ''),
(519, 1, 1, 'Lampa Kolorado to doskonałe połączenie bieli i półprzejrzystego szkła. Klosz został wykonany z dbałością o każdy detal, dzięki czemu wygląda wspaniale. Lampa zapewnia dużą ilość światła, a jej dodatkowym atutem jest łatwy w czyszczeniu klosz.Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-kolorado-k1-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet Kolorado K1 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(520, 1, 1, 'Aplis to doskonała propozycja dla miłośników stylu klasycznego. Szklany klosz ozdobiony ciekawym kolistym wzorem przyciąga spojrzenia. Lampa została wykonana z materiałów najwyższej jakości, dzięki czemu wygląda wspaniale,jednocześnie zachowując walory niezawodności. Szczególnie polecana do stylowych wnętrz. Szklana lampa współpracuje z żarówkami o gwincie E27 oraz mocy max 60W.', '', 'kinkiet-k1-aplis-1xe27-classic-retro-metal-i-szklo-lampex', '', '', '', 'Kinkiet K1 Aplis 1xE27 Classic Retro Metal i szkło Lampex', '', '', '', ''),
(521, 1, 1, 'Kinkiet Asti to wspaniała propozycja dla miłośników stylu klasycznego. Półokrągły klosz przyozdobiony roślinnym wzorem przyciąga spojrzenia postronnych obserwatorów. Lampa ścienna została wyprodukowana z materiałów najwyższej jakości, dzięki czemu będzie działać przez długi czas, jednocześnie pięknie się prezentując. Klasyczna lampa wraz z żarówką E27 pięknie oświetli pomieszczenie.', '', 'kinkiet-lampa-scienna-k1-asti-1x-e27-metal-i-szklo-lampex', '', '', '', 'Kinkiet Lampa ścienna K1 Asti 1x E27 Metal i szkło Lampex', '', '', '', ''),
(522, 1, 1, 'KINKIET ścienny marki Polux, z kolekcji IL MIO RALFPH  w kolorze patyny, z jednym, wymiennym źródłem światła E14 (brak w zestawie) idealnie wpasuję się we wnętrza urządzone w stylu klasycznym, gdzie króluje przepych oraz wyrafinowana elegancja.  Połączenie ponadczasowej kolorystyki  w odcieniu patyny z niebanalną, finezyjną formą wraz z bogatymi detalami w postaci zdobień i kryształków tworzą wyjątkową całość. Klasyczną lampę ścienną najlepiej zamontować w przedpokoju, na korytarzu lub na klatce schodowej, gdzie będzie wyszukaną ozdobą oraz praktycznym źródłem światła. Do lampy będzie pasować każda żarówka z trzonkiem E14,  o maksymalnej mocy 10W LED, którą także można zamówić na naszej stronie internetowej. Warto również pomyśleć o żarówkach ozdobnych przypominających płomień świeczki, które najlepiej oddadzą charakter lampy.      Mieszkaj modnie i stylowo. Zobacz także inne lampy i kinkiety z kolekcji IL MIO RALPH. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-reflektor-oprawa-scienna-il-mio-ralph-1xe14-patyna-polux', '', '', '', 'Kinkiet Reflektor OPRAWA ŚCIENNA IL MIO RALPH 1xE14 PATYNA Polux', '', '', '', ''),
(523, 1, 1, 'Słupek ogrodowy stojący LED marki Polux z kolekcji HORTEN cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Oprawa wykonana z najlepszej jakości aluminium, prezentuje sie znakomicie. Słupek został wyposażony w gniazdo E27, przystosowane do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 10W. Decydując sie na zakup słupka firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta.Mieszkaj modnie i stylowo. Zobacz też pozostałe produkty z serii HORTEN.Specyfikacja techniczna:', '', 'slupek-ogrodowy-horten-1x-e27-44-cm-polux-czarny-314154', '', '', '', 'Słupek ogrodowy HORTEN 1x E27 44 cm Polux Czarny 314154', '', '', '', ''),
(524, 1, 1, ' Kinkiet ścienny LED marki Polux z kolekcji SOHO cechuje sie nieprzeciętnym designiem który na zawsze zmieni wnętrza naszych domów lub mieszkań, dodając im charakteru i ciekawego wyglądu. Wykonana z najlepszej jakości metalu, malowana proszkowo oprawa ściena prezentuje sie znakomicie w klasycznych jak i nowoczesnych wystrojach wnętrz. Kinkiet został wyposażony w gniazdo z gwintem E14 przystosowanym do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 12W. Materiały zastosowane do produkcji kinkietów z serii SOHO zapewniaj najlepszą trwałość produktu przez co mogą być one użytkowane przez wiele lat. Decydując sie na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości który zadowoli każdego, nawet najbardziej wymagającego klienta.  Mieszkaj modnie i stylowo. Zobacz też inne lampy i kinkiety.  SPECYFIKACJA TECHNICZNA: Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-soho-1xe14-polux', '', '', '', 'Oprawa ścienna KINKIET Soho 1xE14 Polux', '', '', '', ''),
(525, 1, 1, 'Słupek ogrodowy stojący LED marki Polux z kolekcji HORTEN cechuje sie nieprzeciętnym wyglądem który zmieni nasze wnętrze, dodając mu charakteru i ciekawego wyglądu. Oprawa wykonana z najlepszej jakości aluminium, prezentuje sie znakomicie. Słupek został wyposażony w gniazdo E27, przystosowane do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 10W. Decydując sie na zakup słupka firmy Polux otrzymujemy produkt o najlepszej jakości i trwałości który zadowoli każdego, nawet najbardziej wymagającego klienta.Mieszkaj modnie i stylowo. Zobacz też pozostałe produkty z serii HORTEN.Specyfikacja techniczna:', '', 'slupek-ogrodowy-horten-1x-e27-60-cm-polux-czarny-314161', '', '', '', 'Słupek ogrodowy HORTEN 1x E27 60 cm Polux Czarny 314161', '', '', '', ''),
(526, 1, 1, 'Kinkiet Viola to klasyczny produkt w stylu vintage. Jego znakiem szczególnym jest szklany klosz, przyozdobiony ciekawym wzorem. Dzięki prostej palecie barw, bez problemu wkomponujesz go w dowolne pomieszczenie. Lampa ta została wykonana z materiałów najwyższej jakości, przez co świetnie się prezentuje,zachowując przy tym walory niezawodności. Szczególnie polecana do klasycznych wnętrz.   Szklana lampa współgra z żarówkami o trzonku E27 oraz mocy max 60W (brak w zestawie).', '', 'kinkiet-lampa-scienna-viola-b-czarny-1xe27-metal-i-szklo-styl-klasyczny-retro-lampex', '', '', '', 'Kinkiet lampa ścienna Viola B czarny 1xE27 Metal i szkło styl klasyczny retro Lampex', '', '', '', ''),
(527, 1, 1, 'Kinkiet ścienny LED marki Polux z kolekcji SOHO cechuje się nieprzeciętnym designiem który na zawsze zmieni wnętrza naszych domów lub mieszkań, dodając im charakteru i ciekawego wyglądu. Wykonana z najlepszej jakości metalu, malowana proszkowo oprawa ściena prezentuje się znakomicie w klasycznych jak i nowoczesnych wystrojach wnętrz. Kinkiet został wyposażony w podwójne gniazdo z gwintem E14 przystosowanym do pracy z oszczędnymi żarówkami LED o maksymalnej mocy 12W. Materiały zastosowane do produkcji kinkietów z serii SOHO zapewniaj najlepszą trwałość produktu, przez co mogą być one użytkowane przez wiele lat. Decydując się na zakup kinkietu firmy Polux otrzymujemy produkt o najlepszej jakości który zadowoli każdego, nawet najbardziej wymagającego klienta. Mieszkaj modnie i stylowo. Zobacz też inne lampy i kinkiety. Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'oprawa-scienna-kinkiet-soho-2xe14-polux', '', '', '', 'Oprawa ścienna KINKIET Soho 2xE14 Polux', '', '', '', ''),
(528, 1, 1, 'KINKIET ścienny marki Polux, z kolekcji IL MIO RALPH  w kolorze patyny, z 2-oma wymiennymi źródłem światła 2xE14 (brak w zestawie) idealnie wpasuję się we wnętrza urządzone w stylu klasycznym, gdzie króluje przepych oraz wyrafinowana elegancja.  Połączenie ponadczasowej kolorystyki  w odcieniu patyny z niebanalną, finezyjną formą wraz z bogatymi detalami w postaci zdobień i kryształków tworzą wyjątkową całość. Klasyczną lampę ścienną najlepiej zamontować w salonie, przedpokoju, na korytarzu lub na klatce schodowej, gdzie będzie wyszukaną ozdobą oraz praktycznym źródłem światła. Do lampy będą pasować 2 żarówki z trzonkami E14,  o maksymalnej mocy 2x 10W LED, które także można zamówić na naszej stronie internetowej. Warto również pomyśleć o żarówkach ozdobnych przypominających płomień świeczki, które najlepiej oddadzą charakter lampy.      Mieszkaj modnie i stylowo. Zobacz także inne lampy i kinkiety z kolekcji IL MIO RALPH. SPECYFIKACJA TECHNICZNA:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-reflektor-oprawa-scienna-il-mio-ralph-2xe14-patyna-polux', '', '', '', 'Kinkiet Reflektor OPRAWA ŚCIENNA IL MIO RALPH 2xE14 PATYNA Polux', '', '', '', ''),
(529, 1, 1, '', '', 'kinkiet-scienny-szklany-retro-vintage-loft-e27-volteno-milo-a', '', '', '', 'Kinkiet ścienny szklany retro vintage loft E27 Volteno Milo A', '', '', '', ''),
(530, 1, 1, 'Model CARBON 185 to nowoczesna lampa naścienna w formie czarnej pochodni w kształcie walca zakończonej punktem świetlnym w przezroczystym kloszu. Walcowa obudowa z metalu i akrylu ma szerokość równą 16,5 cm oraz wysokość wynoszącą 32 cm. W obudowie zamontowano jedno źródło światła. Energooszczędny LED ma moc równą 5 W.  Temperatura barwowa wynosi w tym przypadku 4000 K, a strumień świetlny ma wartość 350 lm. Kinkiet CARBON 185 to doskonałe rozwiązanie do nowoczesnego salonu. Czarna obudowa i modny kształt sprawia, że lampa doskonale wpasuje się w ciemne przestrzenie lub wnętrza w wyrazistych kolorach.', '', 'kinkiet-lampa-scienna-carbon-czarna-5w-led-ip20-metal-i-akryl-styl-nowoczesny-minimalistyczny-milagro', '', '', '', 'Kinkiet lampa ścienna CARBON czarna 5W LED IP20 Metal i akryl styl nowoczesny minimalistyczny Milagro', '', '', '', ''),
(531, 1, 1, 'Lampa ścienna kinkiet serii EDISON, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Tym, co wyróżnia ten model lampy, jest oryginalny kształt, stylizowany na retro żarówkę. Połączenie czerni z chromem sprawia, że seria będzie świetnie wyglądać, zarówno we wnętrzach utrzymanych w jasnej, jak i tej ciemniejszej tonacji kolorystycznej.EDISON idealnie sprawdzi się w nowoczesnych, stylizowanych na postindustrialne i surowych wnętrzach.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarna-chrom-milagro-edison-1x-e27', '', '', '', 'Kinkiet lampa ścienna czarna chrom MiLAGRO EDISON 1x E27', '', '', '', ''),
(532, 1, 1, 'Kinkiet ścienny w kolorze chromu, to piękny i niebanalny dodatek, który idealnie wpasuje się w industrialne, loftowe bądź minimalistyczne wnętrza. Lampa ścienna dzięki wysokiej ochronie na pył i wodę wynoszącej IP65 świetnie sprawdzi się również jako lampa zewnętrzna. Kinkiet elewacyjny doskonale sprawdzi się w altance, na tarasie czy przy garażu i pięknie oświetli te miejsca. Kinkiet zewnętrzny został wykonany z dbałością o każdy detal, dzięki czemu można mieć pewność, że będzie on służył niezawodnie przez długi czas i rozjaśniał naszą posesję.Specyfikacja techniczna:', '', 'kinkiet-scienny-zewnetrzny-elewacyjny-lampa-scienna-industrial-e27-chrom-loft-varmland-polux', '', '', '', 'Kinkiet ścienny zewnętrzny elewacyjny lampa ścienna industrial E27 chrom LOFT VARMLAND Polux', '', '', '', ''),
(533, 1, 1, 'Lampa ścienna kinkiet serii ARES BLACK, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu lampa. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę utrzymaną w charakterze industrialnym, doskonale sprawdzą się we wnętrzach loftowych, a efekt przemysłowego wykończenia pomieszczeń jeszcze mocniej podkreśla wykonanie z metalu oraz kolorystyka lamp: czarna matowa z dodatkiem starego złota. Ta kolorystyka lampy zachwyci nie tylko miłośników nowoczesnych wnętrz, gdyż z łatwością wpisze się w wiele przestrzeni. Konstrukcja klosza ujmująco rozprasza światło, tworząc charakterystyczny, niepowtarzalny efekt światłocienia.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, ze standardowym gwintem (E27) o mocy nieprzekraczającej 60W. Wykorzystanie tej lampy w industrialnym stylu będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-w-stylu-industrialnym-lampa-scienna-czarna-milagro-ares-1x-e27', '', '', '', 'Kinkiet w stylu industrialnym lampa ścienna czarna MiLAGRO ARES 1x E27', '', '', '', ''),
(534, 1, 1, 'Lampa ścienna kinkiet serii DALLAS GOLD, której producentem jest EkoLight marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu z dbałością o każdy detal lampa. Lampa w stylu nowoczesnym przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem GU10. W zestawie jest źródło światła o mocy 3W, które emituje światło o przyjemnej i ciepłej barwie (3000K) o strumieniu świetlnym 300lm.Lampy z kolekcji DALLAS to propozycja dla osób, które szukają do swojego domu rozwiązań nie tylko praktycznych, ale również stylowych. Prosta, geometryczna forma kloszy i elegancka kolorystyka, łącząca czerń i szlachetne złoto, sprawiają, że lampy – poza swoją podstawową funkcją oświetleniową – będą pełniły również rolę designerskiego dodatku. Szczególnie gdy zestawi się je z nowoczesnymi meblami z drewna i malowanego proszkowo metalu.MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Źródło światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-czarno-zlota-milagro-dallas-1xgu10-3w-led', '', '', '', 'Kinkiet lampa ścienna czarno-złota MiLAGRO DALLAS + 1xGU10 3W LED', '', '', '', ''),
(535, 1, 1, 'Lampa ścienna kinkiet serii CORONA BLACK, której producentem jest Eko-Light marki MiLAGRO, to wyprodukowana z wysokiej jakości metalu. Jest to połączenie klasyki i oryginalności, wyróżnia ją prostota i funkcjonalność. Ze względu na swoją nowoczesną stylistykę doskonale sprawdzą się w każdym wnętrzu, unikatowy kształt klosza, przypominający planetę otuloną pierścieniami nadaje lampie dekoracyjnego charakteru.Lampa, przystosowana została do pracy z energooszczędnym źródłem świateł LED, gwintem E27. Wykorzystanie tej lampy będzie doskonałym dodatkiem do nowoczesnych bądź minimalistycznych wnętrz, które robi imponujące wrażenie, którego każdy pozazdrości. Lampy z kolekcji CORONA mogą być montowane samodzielnie, stanowiąc designerski akcent, ale świetnie będą wyglądały również w komplecie. MiLAGRO to marka, która produkuje swoje lampy m.in. na własnej linii produkcyjnej, w Polsce, przy użyciu specjalistycznych maszyn. Kupując lampy tej firmy, wspierasz polskie marki, przedsiębiorców i projektantów.Brak źródła światła w komplecie.ZASTOSOWANIE:Produkt wykonany został z wysokiej jakości materiałów, zapewniających jego długotrwałą żywotność i satysfakcję z zakupu. Kupując u nas, otrzymujesz nowy, oryginalnie zapakowany produkt, objęty 2-letnią gwarancją producenta. Tylko zakup markowych produktów gwarantuje wysoką jakość, energooszczędność, bezpieczeństwo użytkowania oraz pewność, że informacje umieszczone na opakowaniach będą zgodne z prawdą.', '', 'kinkiet-lampa-scienna-nowoczesna-czarna-corona-1x-e27-milagro', '', '', '', 'Kinkiet lampa ścienna nowoczesna czarna CORONA 1x E27 MiLAGRO', '', '', '', ''),
(536, 1, 1, 'Ring 410 to niewielki kinkiet wyposażony w wymienny moduł LED o mocy 8 W, który zapewnia niskie zużycie energii. Ponadto, barwę oświetlenia dobrano z uwzględnieniem tego, iż lampa ma gwarantować komfort jej użytkowania, stąd barwa najbardziej neutralna 4000 K. Produkt wykonano z metalu oraz akrylu i dostępny jest w kolorze białym. Wartość zasilania mieści się na poziomie od 220 V do 240 V. Kinkiet wyróżnia się prostą, nowoczesną formą. Stanowi też stylowy dodatek do współczesnych wnętrz. Lampa ścienna może być też doskonałym uzupełnieniem aranżacji, w której wykorzystano pozostałe oświetlenie z kolekcji Ring.', '', 'kinkiet-lampa-scienna-ring-8w-okrag-bialy-led-ip20-metal-i-akryl-styl-nowoczesny-milagro', '', '', '', 'Kinkiet lampa ścienna RING 8W okrąg biały LED IP20 Metal i akryl styl nowoczesny Milagro', '', '', '', '');
